INSERT INTO `vocabulary` (`id`, `word`, `meaning`, `similar_word`, `opposite_word`, `part_of_speech`, `forms`, `status`, `sequence`, `created_user_id`, `updated_user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'about', 'In a circle around; all round; on every side of; on the outside of.,Over or upon different parts of; through or over in various directions; here and there in; to and fro in; throughout.,See about to.,On the point or verge of.,Concerning; with regard to; on account of; on the subject of; to affect.,Concerned with; engaged in; intent on.,Have you much hay about? = Have you much in the process of making?,Within or in the immediate neighborhood of; in contiguity or proximity to; near, as to place.,On one\'s person; nearby the person.,In or near, as in mental faculties or (literally) in the possession of; under the control of; at one\'s command; in one\'s makeup.', 'apropos,as for,about', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'about', 'On all sides; around.,Here and there; around; in one place and another; up and down.,From one place or position to another in succession; indicating repeated movement or activity.,Indicating unproductive or unstructured activity.,Nearly; approximately; with close correspondence in quality, manner, degree, quantity, or time; almost.,Near; in the vicinity.,To a reversed order; half round; facing in the opposite direction; from a contrary point of view.,To the opposite tack: see go about.,In succession; one after another; in the course of events.,In circuit; circularly; by a circuitous way; around the outside; in circumference.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'about', 'Moving around; astir.,In existence; being in evidence; apparent.,Near; in the vicinity or neighbourhood.', 'around,active,mobile,astir,around', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 'search', 'An attempt to find something.,The act of searching in general.', '', '', 'noun', '[{\"text\":\"searches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 'search', 'To look in (a place) for something.,To look thoroughly.,To look for, seek.,To probe or examine (a wound).,To examine; to try; to put to the test.', 'comb,look for', '', 'verb', '[{\"text\":\"searches\",\"type\":\"present singular third-person\"},{\"text\":\"searching\",\"type\":\"participle present\"},{\"text\":\"searched\",\"type\":\"participle past\"},{\"text\":\"searched\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"search\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'other', 'See other (determiner) below.,Second.,Alien.,Different.,Left, as opposed to right.', 'additional,another,alternate,foreign,disparate,dissimilar,distinctive,distinguishable,diverse,different', 'same', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'other', 'An other, another (person, etc), more often rendered as another.,The other one; the second of two.', '', '', 'noun', '[{\"text\":\"others\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'other', 'Not the one or ones previously referred to.', '', '', 'det', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'other', 'Otherwise.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'other', 'To regard, label, or treat as an \"other\", as not part of the same group; to view as different and alien.,To treat as different or separate; segregate; ostracise.', '', '', 'verb', '[{\"text\":\"others\",\"type\":\"present singular third-person\"},{\"text\":\"othering\",\"type\":\"participle present\"},{\"text\":\"othered\",\"type\":\"participle past\"},{\"text\":\"othered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'which', 'What, of those mentioned or implied.,The/Any ... that; whichever.,Designates the one(s) previously mentioned.', '', '', 'det', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'which', 'What one or ones (of those mentioned or implied).,The/Any ones that; whichever.,Introduces a relative clause giving further information about something previously mentioned.,Used of people (now generally who, whom or that).', '', '', 'pron', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 'their', 'Belonging to, from, of, or relating to, them (plural).,Belonging to someone (one person, singular).', '', '', 'det', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 'their', 'Misspelling of there.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15, 'their', 'Misspelling of they’re.', '', '', 'abbrev', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(16, 'there', 'In a place or location (stated, implied or otherwise indicated) at some distance from the speaker (compare here).,In that matter, relation, etc.; at that point, stage, etc., regarded as a distinct place.,To or into that place; thither.,Where, there where, in which place.,In this world, used to say that someone or something exists; see pronoun section below.', 'over there,away there,thither,yonder,over there,away there,thither,yonder,dar,der,dere,thur,thar,dey', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(17, 'there', 'Used to offer encouragement or sympathy.,Used to express victory or completion.', '', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'there', 'That place.,That status; that position.', '', '', 'noun', '[{\"text\":\"theres\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(19, 'there', 'Used as an expletive subject of be in its sense of “exist”, with the semantic, usually indefinite subject being postponed or (occasionally) implied.,Used with other intransitive verbs of existence, in the same sense, or with other intransitive verbs, adding a sense of existence.,Used with other verbs, when raised.,That.,Appended to words of greeting etc.', '', '', 'pron', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(20, 'there', 'Misspelling of they’re.', '', '', 'abbrev', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(21, 'there', 'Misspelling of their.', '', '', 'det', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(22, 'contact', 'The act of touching physically; being in close association.,The establishment of communication (with).,The situation of being within sight of something; visual contact.,A nodule designed to connect a device with something else.,Someone who can be contacted, or with whom one is in communication.,A contact lens.,A device designed for repetitive connections.,Contact juggling.,The plane between two adjacent bodies of dissimilar rock.', '', '', 'noun', '[{\"text\":\"contacts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(23, 'contact', 'To touch; to come into physical contact with.,To establish communication with something or someone.', '', '', 'verb', '[{\"text\":\"contacts\",\"type\":\"present singular third-person\"},{\"text\":\"contacting\",\"type\":\"participle present\"},{\"text\":\"contacted\",\"type\":\"participle past\"},{\"text\":\"contacted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(24, 'online', 'Of a generator or power plant: connected to the grid.,Of a computer: actively connected to the Internet or to some other communications service.,Available over, or delivered from, the Internet.,Connected to the Internet.,Available on a computer system, even if not networked.,Of a system: active, particularly building facilities (such as power) or a factory or power plant.,Immersed in Internet culture. (Usually modified by an intensifier such as extremely or terminally)', '', '', 'adj', '[{\"text\":\"more online\",\"type\":\"comparative\"},{\"text\":\"most online\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(25, 'online', 'While online; while in a running or active state, or connected to the Internet.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'online', 'To bring (a system, etc.) online; to promote to an active or running state.', '', '', 'verb', '[{\"text\":\"onlines\",\"type\":\"present singular third-person\"},{\"text\":\"onlining\",\"type\":\"participle present\"},{\"text\":\"onlined\",\"type\":\"participle past\"},{\"text\":\"onlined\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'first', 'Preceding all others of a series or kind; the ordinal of one; earliest.,Most eminent or exalted; most excellent; chief; highest.,Of or belonging to a first family.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(28, 'first', 'Before anything else; firstly.,For the first time.,Now.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(29, 'first', 'The person or thing in the first position.,The first gear of an engine.,Something that has never happened before; a new occurrence.,first base,A first-class honours degree.,A first-edition copy of some publication.,A fraction whose (integer) denominator ends in the digit 1.', '', '', 'noun', '[{\"text\":\"firsts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(30, 'first', 'Time; time granted; respite.', '', '', 'noun', '[{\"text\":\"firsts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(31, 'would', 'Used to form the \"anterior future\", or \"future in the past\", indicating a futurity relative to a past time.,Used to; was or were habitually accustomed to; indicating an action in the past that happened repeatedly or commonly.,Was or were determined to; indicating someone\'s insistence upon doing something.,Could naturally have been expected to (given the tendencies of someone\'s character etc.).,Wanted to.,Used with ellipsis of the infinitive verb, or postponement to a relative clause, in various senses.,Wished, desired (something).,Used as the auxiliary of the simple conditional modality, indicating a state or action that is conditional on another.,Without explicit condition, or with loose or vague implied condition, indicating a hypothetical or imagined state or action.,Suggesting conditionality or potentiality in order to express a sense of politeness, tentativeness, indirectness, hesitancy, uncertainty, etc.,Used to express what the speaker would do in another person\'s situation, as a means of giving a suggestion or recommendation.,Used to express the speaker\'s belief or assumption.,Used interrogatively to express a polite request; are (you) willing to …?,Might wish (+ verb in past subjunctive); often used in the first person (with or without that) in the sense of \"if only\".,Might desire; wish (something).', 'used to', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 'would', 'Something that would happen, or would be the case, under different circumstances; a potentiality.', '', '', 'noun', '[{\"text\":\"woulds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 'services', 'That which is produced, then traded, bought or sold, then finally consumed and consists of an action or work.,plural of service', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 'services', 'third-person singular simple present indicative form of service', '', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(35, 'click', 'A brief, sharp, not particularly loud, relatively high-pitched sound produced by the impact of something small and hard against something hard, such as by the operation of a switch, a lock, or a latch.,The act of making a clicking sound by pressing a finger against the thumb and then releasing to strike the palm; a snap.,An ingressive sound made by coarticulating a velar or uvular closure with another closure.,Sound made by a dolphin.,The act of operating a switch, etc., so that it clicks.,The act of pressing a button on a computer mouse or similar input device, both as a physical act and a reaction in the software.,A single instance of content on the Internet being accessed.,A pawl or similar catch.,A knock or blow.,A limb contortion at the joint, part of vogue dancing.', 'click consonant', '', 'noun', '[{\"text\":\"clicks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(36, 'click', 'To cause to make a click; to operate (a switch, etc) so that it makes a click.,To emit a click.,To snap the fingers.,To press and release (a button on a computer mouse).,To select a software item using, usually, but not always, the pressing of a mouse button.,To visit (a web site).,To navigate by clicking a mouse button.,To make sense suddenly.,To get along well.,To tick.,To take (a photograph) with a camera.,To achieve success in one\'s career or a breakthrough, often the first time.,Of a film, to be successful at the box office.', '', '', 'verb', '[{\"text\":\"clicks\",\"type\":\"present singular third-person\"},{\"text\":\"clicking\",\"type\":\"participle present\"},{\"text\":\"clicked\",\"type\":\"participle past\"},{\"text\":\"clicked\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(37, 'click', 'The sound of a click.', '', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
