(39, 'click', 'A detent, pawl, or ratchet, such as that which catches the cogs of a ratchet wheel to prevent backward motion.,The latch of a door.', '', '', 'noun', '[{\"text\":\"clicks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
