(114, 'public', 'Able to be seen or known by everyone; open to general view, happening without concealment.,Pertaining to the people as a whole (as opposed to a private group); concerning the whole country, community etc.,Officially representing the community; carried out or funded by the state on behalf of the community.,Open to all members of a community; especially, provided by national or local authorities and supported by money from taxes.,Traded publicly via a stock market.,Accessible to the program in general, not only to the class or any subclasses.', '', '', 'adj', '[{\"text\":\"more public\",\"type\":\"comparative\"},{\"text\":\"most public\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(115, 'public', 'The people in general, regardless of membership of any particular group.,A particular group or demographic to be targeted.,A public house; an inn.', '', '', 'noun', '[{\"text\":\"publics\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(116, 'review', 'A second or subsequent reading of a text or artifact in an attempt to gain new insights.,An account intended as a critical evaluation of a text or a piece of work.,A judicial reassessment of a case or an event.,A stage show made up of topical sketches etc.,A survey of the available items or material.,A periodical which makes a survey of the arts or some other field.,A military inspection or display for the benefit of superiors or VIPs.,A forensic inspection to assess compliance with regulations or some code.', 'revue', '', 'noun', '[{\"text\":\"reviews\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(117, 'review', 'To survey; to look broadly over.,To write a critical evaluation of a new art work etc.; to write a review.,To look back over in order to correct or edit; to revise.,To look over again (something previously written or learned), especially in preparation for an examination.,To view or see again; to look back on.,To retrace; to go over again.', 'revise', '', 'verb', '[{\"text\":\"reviews\",\"type\":\"present singular third-person\"},{\"text\":\"reviewing\",\"type\":\"participle present\"},{\"text\":\"reviewed\",\"type\":\"participle past\"},{\"text\":\"reviewed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
