(120, 'privacy', 'The state of being secluded from the presence, sight, or knowledge of others.,Freedom from unwanted or undue disturbance of one\'s private life.,Freedom from damaging publicity, public scrutiny, surveillance, and disclosure of personal information, usually by a government or a private organization.,A place of seclusion.,A relationship between parties seen as being a result of their mutual interest or participation in a given transaction, contract etc.,Secrecy.,A private matter.', 'privity,secret', '', 'noun', '[{\"text\":\"privacies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
