(124, 'order', 'To set in some sort of order.,To arrange, set in proper order.,To issue a command to.,To request some product or service; to secure by placing an order.,To admit to holy orders; to ordain; to receive into the ranks of the ministry.', 'sort,rank,command', '', 'verb', '[{\"text\":\"orders\",\"type\":\"present singular third-person\"},{\"text\":\"ordering\",\"type\":\"participle present\"},{\"text\":\"ordered\",\"type\":\"participle past\"},{\"text\":\"ordered\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"order\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(125, 'group', 'A number of things or persons being in some relation to one another.,A set with an associative binary operation, under which there exists an identity element, and such that each element has an inverse.,An effective divisor on a curve.,A (usually small) group of people who perform music together.,A small number (up to about fifty) of galaxies that are near each other.,A column in the periodic table of chemical elements.,A functional group.,A subset of a culture or of a society.,An air force formation.,A collection of formations or rock strata.,A number of users with the same rights with respect to accession, modification, and execution of files, computers and peripherals.,An element of an espresso machine from which hot water pours into the portafilter.,A number of eighth, sixteenth, etc., notes joined at the stems; sometimes rather indefinitely applied to any ornament made up of a few short notes.,A set of teams playing each other in the same division, while not during the same period playing any teams that belong to other sets in the division.,A commercial organization.', 'collection,set,band,ensemble', '', 'noun', '[{\"text\":\"groups\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(126, 'group', 'To put together to form a group.,To come together to form a group.', 'amass,assemble', '', 'verb', '[{\"text\":\"groups\",\"type\":\"present singular third-person\"},{\"text\":\"grouping\",\"type\":\"participle present\"},{\"text\":\"grouped\",\"type\":\"participle past\"},{\"text\":\"grouped\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(127, 'under', 'In or at a lower level than; in the area covered or surmounted by.,Below the surface of.,From one side of to the other, passing beneath.,Less than.,Subordinate to; subject to the control of; in accordance with; in compliance with.,Within the category, classification or heading of.,In the face of; in response to (some attacking force).,Using or adopting (a name, identity, etc.).', '', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
