(133, 'program', 'A set of structured activities.,A leaflet listing information about a play, game or other activity.,A set of principle goals which are supported by a political party or individual candidate,A performance of a show or other broadcast on radio or television.,A software application, or a collection of software applications, designed to perform a specific task.,A particular mindset or method of doing things.', 'playbill,show,application', '', 'noun', '[{\"text\":\"programs\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(134, 'program', 'To enter a program or other instructions into (a computer or other electronic device) to instruct it to do a particular task.,To develop (software) by writing program code.,To put together the schedule of an event.,To schedule the programming; to determine what will be broadcast.,To cause to automatically behave in a particular way.', '', '', 'verb', '[{\"text\":\"programs\",\"type\":\"present singular third-person\"},{\"text\":\"programming\",\"type\":\"participle present\"},{\"text\":\"programing\",\"type\":\"participle present\"},{\"text\":\"programmed\",\"type\":\"participle past\"},{\"text\":\"programmed\",\"type\":\"past\"},{\"text\":\"programed\",\"type\":\"participle past\"},{\"text\":\"programed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(135, 'research', 'Diligent inquiry or examination to seek or revise facts, principles, theories, applications, etc.; laborious or continued search after truth.,The research station that houses Wang and his team is outside Lijiang, a city of about 1.2 million people. File:The research station that houses Wang and his team is outside Lijiang.ogg,A particular instance or piece of research.', '', '', 'noun', '[{\"text\":\"researches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(136, 'research', 'To search or examine with continued care; to seek diligently.,To make an extensive investigation into.,To search again.', '', '', 'verb', '[{\"text\":\"researches\",\"type\":\"present singular third-person\"},{\"text\":\"researching\",\"type\":\"participle present\"},{\"text\":\"researched\",\"type\":\"participle past\"},{\"text\":\"researched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(137, 'general', 'Including or involving every part or member of a given or implied entity, whole etc.; as opposed to specific or particular.,Applied to a person (as a postmodifier or a normal preceding adjective) to indicate supreme rank, in civil or military titles, and later in other terms; pre-eminent.,Prevalent or widespread among a given class or area; common, usual.,Not limited in use or application; applicable to the whole or every member of a class or category.,Giving or consisting of only the most important aspects of something, ignoring minor details; indefinite.,Not limited to a specific class; miscellaneous, concerned with all branches of a given subject or area.', 'broad,typical', '', 'adj', '[{\"text\":\"more general\",\"type\":\"comparative\"},{\"text\":\"most general\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(138, 'general', 'A general fact or proposition; a generality.,The holder of a senior military title, originally designating the commander of an army and now a specific rank falling under field marshal (in the British army) and below general of the army or general of the air force in the US army and air forces.,A great strategist or tactician.,The head of certain religious orders, especially Dominicans or Jesuits.,A commander of naval forces; an admiral.,A general servant; a maid with no specific duties.,A general anesthetic.,General anesthesia.,The general insurance industry.,A xiangqi piece, that is moved one point orthogonally and confined within the palace.', '', '', 'noun', '[{\"text\":\"generals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
