(145, 'great', 'Relatively large in scale, size, extent, number (i.e. having many parts or members) or duration (i.e. relatively long); very big.,Title referring to an important leader.,Of larger size or more importance than others of its kind.,Very good; excellent; wonderful; fantastic.,Intensifying a word or expression, used in mild oaths.,Involving more generations than the qualified word implies — as many extra generations as repetitions of the word great (from 1510s).,Pregnant; large with young; full of.,Intimate; familiar.,Extreme or more than usual.,Of significant importance or consequence; important.,Arising from or possessing idealism; admirable; superior; commanding; heroic; illustrious; eminent.,Impressive or striking.,Much in use; favoured.,Endowed with extraordinary powers; of exceptional talents or achievements; uncommonly gifted; able to accomplish vast results; remarkable; strong; powerful; mighty; noble.,Doing or exemplifying (a characteristic or pursuit) on a large scale; active or enthusiastic.,Skilful or adroit.', '', '', 'adj', '[{\"text\":\"greater\",\"type\":\"comparative\"},{\"text\":\"greatest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
