(151, 'hotel', 'A large town house or mansion; a grand private residence, especially in France.,An establishment that provides accommodation and other services for paying guests; normally larger than a guesthouse, and often one of a chain.,A restaurant; any dining establishment.,Alternative letter-case form of Hotel from the NATO/ICAO Phonetic Alphabet.,The larger red property in the game of Monopoly, in contradistinction to houses.,The guest accommodation and dining section of a cruise ship.,A pub', '', '', 'noun', '[{\"text\":\"hotels\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
