(154, 'travel', 'To be on a journey, often for pleasure or business and with luggage; to go from one place to another.,To pass from one place to another; to move or transmit,To move illegally by walking or running without dribbling the ball.,To travel throughout (a place).,To force to journey.,To labour; to travail.', '', '', 'verb', '[{\"text\":\"travels\",\"type\":\"present singular third-person\"},{\"text\":\"travelling\",\"type\":\"participle present\"},{\"text\":\"traveling\",\"type\":\"US participle present\"},{\"text\":\"travelled\",\"type\":\"participle past\"},{\"text\":\"travelled\",\"type\":\"past\"},{\"text\":\"traveled\",\"type\":\"US participle past\"},{\"text\":\"traveled\",\"type\":\"US past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"travel\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(155, 'travel', 'The act of traveling; passage from place to place.,A series of journeys.,An account of one\'s travels.,The activity or traffic along a route or through a given point.,The working motion of a piece of machinery; the length of a mechanical stroke.,Labour; parturition; travail.,Distance that a keyboard\'s key moves vertically when depressed.', 'journey,passage,tour,trip,voyage,stroke,movement,progression', '', 'noun', '[{\"text\":\"travels\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(156, 'store', 'A place where items may be accumulated or routinely kept.,A supply held in storage.,A place where items may be purchased; a shop.,Memory.,A great quantity or number; abundance.,A head of store cattle (feeder cattle to be sold to others for finishing); a store cattle beast.', 'stock,supply,memory', '', 'noun', '[{\"text\":\"stores\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(157, 'store', 'To keep (something) while not in use, generally in a place meant for that purpose.,Contain.,Have the capacity and capability to contain.,To write (something) into memory or registers.', '', '', 'verb', '[{\"text\":\"stores\",\"type\":\"present singular third-person\"},{\"text\":\"storing\",\"type\":\"participle present\"},{\"text\":\"stored\",\"type\":\"participle past\"},{\"text\":\"stored\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
