(160, 'report', 'To relate details of (an event or incident); to recount, describe (something).,To repeat (something one has heard), to retell; to pass on, convey (a message, information etc.).,To take oneself (to someone or something) for guidance or support; to appeal.,To notify someone of (particular intelligence, suspicions, illegality, misconduct etc.); to make notification to relevant authorities; to submit a formal report of.,To make a formal statement, especially of complaint, about (someone).,To show up or appear at an appointed time; to present oneself.,To write news reports (for); to cover as a journalist or reporter.,To be accountable to or subordinate to (someone) in a hierarchy; to receive orders from (someone); to give official updates to (someone who is above oneself in a hierarchy).,To return or present as the result of an examination or consideration of any matter officially referred.,To take minutes of (a speech, the doings of a public body, etc.); to write down from the lips of a speaker.,To refer.,To return or repeat, as sound; to echo.', '', '', 'verb', '[{\"text\":\"reports\",\"type\":\"present singular third-person\"},{\"text\":\"reporting\",\"type\":\"participle present\"},{\"text\":\"reported\",\"type\":\"participle past\"},{\"text\":\"reported\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"report\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(161, 'report', 'A piece of information describing, or an account of certain events given or presented to someone, with the most common adpositions being by (referring to creator of the report) and on (referring to the subject).,Reputation.,The sharp, loud sound from a gun or explosion.,An employee whose position in a corporate hierarchy is below that of a particular manager.', 'subordinate', '', 'noun', '[{\"text\":\"reports\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
