(164, 'member', 'One who officially belongs to a group.,A part of a whole.,Part of an animal capable of performing a distinct office; an organ; a limb.,The penis.,One of the propositions making up a syllogism.,An element of a set.,the judge or adjudicator in a consumer court.,A part of a discourse or of a period, sentence, or verse; a clause.,Either of the two parts of an algebraic equation, connected by the equality sign.,A file stored within an archive file.,A function or piece of data associated with each separate instance of a class.,friend', 'limb,lith,pintle,tarse,premise,premiss,element', '', 'noun', '[{\"text\":\"members\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
