(169, 'before', 'Earlier than (in time).,In front of in space.,In the presence of.,Under consideration, judgment, authority of (someone).,In store for, in the future of (someone).,In front of, according to a formal system of ordering items.,At a higher or greater position than, in a ranking.', 'by,no later than,previous to,prior to,ere,ahead of,in front of,ahead of', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
