(174, 'right', 'Straight, not bent.,Of an angle, having a size of 90 degrees, or one quarter of a complete rotation; the angle between two perpendicular lines.,Of a geometric figure, incorporating a right angle between edges, faces, axes, etc.,Complying with justice, correctness, or reason; correct, just, true.,Appropriate, perfectly suitable; fit for purpose.,Healthy, sane, competent.,Real; veritable (used emphatically).,All right; not requiring assistance.,Most favourable or convenient; fortunate.,Designating the side of the body which is positioned to the east if one is facing north, the side on which the heart is not located in most humans. This arrow points to the reader\'s right: →,Designating the bank of a river (etc.) on one\'s right when facing downstream (i.e. facing forward while floating with the current); that is, the south bank of a river that flows eastward. If this arrow: ⥴ shows the direction of the current, the tilde is on the right side of the river.,Designed to be placed or worn outward.,Pertaining to the political right; conservative.', 'correct,just,dexter,dextral,right-hand', '', 'adj', '[{\"text\":\"righter\",\"type\":\"comparative\"},{\"text\":\"more right\",\"type\":\"comparative\"},{\"text\":\"rightest\",\"type\":\"superlative\"},{\"text\":\"rightmost\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(175, 'right', 'On the right side.,Towards the right side.,Exactly, precisely.,Immediately, directly.,Very, extremely, quite.,According to fact or truth; actually; truly; really.,In a correct manner.,To a great extent or degree.', 'rightward,rightwise,rightward,rightways,exactly,right smack,slap-bang,ever so,in point of fact,correctly,properly', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(176, 'right', 'Yes, that is correct; I agree.,I have listened to what you just said and I acknowledge your assertion or opinion, regardless of whether I agree with it (opinion) or can verify it (assertion).,Signpost word to change the subject in a discussion or discourse.,Used to check listener engagement and (especially) agreement at the end of an utterance or each segment thereof.,Used to add seriousness or decisiveness before a statement.', 'all right,alright,right on,damn right,damn straight,all right,alright,OK,okay,hmm,mmm,all right,alright,well,all right,alright,y\'know,do you know what I\'m saying,you know what I\'m saying,eh', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(177, 'right', 'That which complies with justice, law or reason.,A legal, just or moral entitlement.,The right side or direction.,The right hand or fist.,The authority to perform, publish, film, or televise a particular work, event, etc.; a copyright.,The ensemble of right-wing political parties; political conservatives as a group.,The outward or most finished surface, as of a coin, piece of cloth, a carpet, etc.,A wave breaking from right to left (viewed from the shore).', 'starboard,3 o\'clock,right side', 'left', 'noun', '[{\"text\":\"rights\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
