(191, 'office', 'The authorized form of ceremonial worship of a church.,Any special liturgy, as the Office for the Dead or of the Virgin.,A daily service without the eucharist.,The daily service of the breviary, the liturgy for each canonical hour, including psalms, collects, and lessons.,Various prayers used with modification as a morning or evening service.,Last rites.,Mass, (particularly) the introit sung at its beginning.,A ceremonial duty or service,A position of responsibility.,Official position, particularly high employment within government; tenure in such a position.,A duty, particularly owing to one\'s position or station; a charge, trust, or role; (obsolete, rare) moral duty.,Function: anything typically done by or expected of something.,A service, a kindness.,Inside information.,A room, set of rooms, or building used for administration and bookkeeping.,A room, set of rooms, or building used for selling services or tickets to the public.,A room, set of rooms, or building used for consultation and diagnosis, but not surgery or other major procedures.,A room, set of rooms, or building used for non-manual work,The staff of such places.,A ministry or other department of government.,Short for Holy Office: the court of final appeal in cases of heresy.,A particular place of business of a larger white-collar business.,The administrative departments housed in such places,The parts of a house or estate devoted to manual work and storage, as the kitchen, scullery, laundry, stables, etc., particularly (euphemistic, dated) a house or estate\'s facilities for urination and defecation: outhouses or lavatories.,Clipping of inquest of office: an inquest undertaken on occasions when the Crown claimed the right of possession to land or property.,A piece of land used for hunting; the area of land overseen by a gamekeeper.,A hangout: a place where one is normally found.,A plane\'s cockpit, particularly an observer\'s cockpit.,A collection of business software typically includ