(220, 'subject', 'In a clause: the word or word group (usually a noun phrase) about whom the statement is made. In active clauses with verbs denoting an action, the subject and the actor are usually the same.,An actor; one who takes action.,The main topic of a paper, work of art, discussion, field of study, etc.,A particular area of study.,A citizen in a monarchy.,A person ruled over by another, especially a monarch or state authority.,The main theme or melody, especially in a fugue.,A human, animal or an inanimate object that is being examined, treated, analysed, etc.,A being that has subjective experiences, subjective consciousness, or a relationship with another entity.,That of which something is stated.,The variable in terms of which an expression is defined.', 'matter,topic', '', 'noun', '[{\"text\":\"subjects\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
