(229, 'black', 'Absorbing all light and reflecting none; dark and hueless.,Without light.,Belonging to or descended from any of various (African, Aboriginal, etc) ethnic groups which typically have dark pigmentation of the skin. (See usage notes below.),Belonging to or descended from any of various sub-Saharan African ethnic groups which typically have dark pigmentation of the skin.,Designated for use by those ethnic groups (as described above).,Of the spades or clubs suits. Compare red (“of the hearts or diamonds suit”),Bad; evil; ill-omened.,Expressing menace, or discontent; threatening; sullen.,Illegitimate, illegal or disgraced.,Foul; dirty, soiled.,Overcrowded.,Without any cream, milk, or creamer.,Of or relating to the playing pieces of a board game deemed to belong to the \"black\" set (in chess the set used by the player who moves second) (often regardless of the pieces\' actual colour).,Anarchist; of or pertaining to anarchism.,Said of a symbol or character that is solid, filled with color. Compare white (“said of a character or symbol outline, not filled with color”).,Related to the Christian Democratic Union of Germany.,Clandestine; relating to a political, military, or espionage operation or site, the existence or details of which is withheld from the general public.,Occult; relating to something (such as mystical or magical knowledge) which is unknown to or kept secret from the general public.,Protestant, often with the implication of being militantly pro-British or anti-Catholic. (Compare blackmouth (\"Presbyterian\").),Having one or more features (hair, fur, armour, clothes, bark, etc) that is dark (or black); in taxonomy, especially: dark in comparison to another species with the same base name.', 'dark,dark,gloomy,pitch-black', '', 'adj', '[{\"text\":\"blacker\",\"type\":\"comparative\"},{\"text\":\"more black\",\"type\":\"comparative\"},{\"text\":\"blackest\",\"type\":\"superlative\"},{\"text\":\"most black\",\"type\":\"superlative\"}]', NULL, NULL,