(310, 'north', 'One of the four principal compass points, specifically 0° (being directed towards the North Pole); conventionally upwards on a map.,The up or positive direction.,The positive or north pole of a magnet, which seeks the magnetic pole near Earth\'s geographic North Pole (which, for its magnetic properties, is a south pole).,Alternative letter-case form of North (“a northern region; the inhabitants thereof”).,In a church: the direction to the left-hand side of a person facing the altar.', '', '', 'noun', '[{\"text\":\"norths\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(311, 'north', 'Of or pertaining to the north; northern.,Toward the north; northward.,Of wind, from the north.,Pertaining to the part of a corridor used by northbound traffic.,Designating, or situated in, the liturgical north (in a church, the direction to the left-hand side of a person facing the altar).,More or greater than.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(312, 'north', 'Toward the north; northward; northerly.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(313, 'north', 'To turn or move toward the north.', '', '', 'verb', '[{\"text\":\"norths\",\"type\":\"present singular third-person\"},{\"text\":\"northing\",\"type\":\"participle present\"},{\"text\":\"northed\",\"type\":\"participle past\"},{\"text\":\"northed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(314, 'download', 'A file transfer to a given computer or device from a remote one through a network connection.,A file that has been or is intended to be transferred in this way.', '', '', 'noun', '[{\"text\":\"downloads\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(315, 'download', 'To transfer data to a given computer from a remote one via a network.,Synonym of upload: to send data from a given computer to a remote one.,Synonym of copy: to transfer data to or from removable media.,Synonym of install: to load software forced.,To load a gun (especially a muzzle-loader) with less propellant than its designed load.', 'upload,copy,install', '', 'verb', '[{\"text\":\"downloads\",\"type\":\"present singular third-person\"},{\"text\":\"downloading\",\"type\":\"participle present\"},{\"text\":\"downloaded\",\"type\":\"participle past\"},{\"text\":\"downloaded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(316, 'control', 'To exercise influence over; to suggest or dictate the behavior of.,(construed with for) To design (an experiment) so that the effects of one or more variables are reduced or eliminated.,to verify the accuracy of (something or someone, especially a financial account) by comparison with another account,to call to account, to take to task, to challenge,to hold in check, to curb, to restrain', 'besteer,bewield,manage,puppeteer,rule', '', 'verb', '[{\"text\":\"controls\",\"type\":\"present singular third-person\"},{\"text\":\"controlling\",\"type\":\"participle present\"},{\"text\":\"controlled\",\"type\":\"participle past\"},{\"text\":\"controlled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(317, 'control', 'Influence or authority over something.,The method and means of governing the performance of any apparatus, machine or system, such as a lever, handle or button.,Restraint or ability to contain one\'s movements or emotions, or self-control.,A security mechanism, policy, or procedure that can counter system attack, reduce risks, and resolve vulnerabilities; a safeguard or countermeasure.,A means of monitoring for, and triggering intervention in, activities that are not going according to plan.,A control group or control experiment.,A duplicate book, register, or account, kept to correct or check another account or register.,An interface element that a computer user interacts with, such as a window or a text box.,Any of the physical factors determining the climate of a place, such as latitude, distribution of land and water, altitude, exposure, prevailing winds, permanent high- or low-barometric-pressure areas, ocean currents, mountain barriers, soil, and vegetation.,A construction in which the understood subject of a given predicate is determined by an expression in context. See control.,A spirit that takes possession of a psychic or medium and allows other spirits to communicate with the living.,A checkpoint along an audax route.', 'widget,Ctrl', '', 'noun', '[{\"text\":\"controls\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(318, 'three', 'A numerical value after two and before four. Represented in Arabic digits as 3; this many dots (•••).,Describing a set or group with three elements.', 'leash,tether', '', 'num', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(319, 'three', 'The digit/figure 3.,Anything measuring three units, as length.,A person who is three years old.,The playing card featuring three pips.,Three o\'clock, either a.m. or p.m.,Abbreviation of three-pointer.', '', '', 'noun', '[{\"text\":\"threes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(320, 'total', 'An amount obtained by the addition of smaller amounts.,Sum.', 'sum', '', 'noun', '[{\"text\":\"totals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(321, 'total', 'Entire; relating to the whole of something.,Complete; absolute.,(of a function) Defined on all possible inputs.', 'entire,abject,absolute,arrant,categoric,categorical,complete,consummate,downright,full-bore,mere,outright,out-and-out,perfect,proper,pure [⇒ thesaurus],regular,root and branch,sheer [⇒ thesaurus],straight-out,thorough,thoroughgoing,unadulterated,unalloyed,uncompromising,unconditional,unfettered,unmitigated,unqualified,unreserved,unrestricted,utter [⇒ thesaurus],wholesale', '', 'adj', '[{\"text\":\"more total\",\"type\":\"comparative\"},{\"text\":\"most total\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(322, 'total', 'To add up; to calculate the sum of.,To equal a total of; to amount to.,To demolish; to wreck completely. (from total loss),To amount to; to add up to.', 'sum,demolish,trash,wreck', '', 'verb', '[{\"text\":\"totals\",\"type\":\"present singular third-person\"},{\"text\":\"totalling\",\"type\":\"UK participle present\"},{\"text\":\"totaling\",\"type\":\"US participle present\"},{\"text\":\"totalled\",\"type\":\"UK participle past\"},{\"text\":\"totalled\",\"type\":\"UK past\"},{\"text\":\"totaled\",\"type\":\"US participle past\"},{\"text\":\"totaled\",\"type\":\"US past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(323, 'place', 'An open space, particularly a city square, market square, or courtyard.,A street, sometimes but not always surrounding a public place, square, or plaza of the same name.,An inhabited area: a village, town, or city.,Any area of the earth: a region.,The area one occupies, particularly somewhere to sit.,The area where one lives: one\'s home, formerly (chiefly) country estates and farms.,An area of the body, especially the skin.,An area to urinate and defecate: an outhouse or lavatory.,An area to fight: a battlefield or the contested ground in a battle.,A location or position in space.,A particular location in a book or document, particularly the current location of a reader.,A passage or extract from a book or document.,A topic.,A state of mind.,A chess position; a square of the chessboard.,A role or purpose; a station.,The position of a contestant in a competition.,The position of first, second, or third at the finish, especially the second position.,The position as a member of a sports team.,A fortified position: a fortress, citadel, or walled town.,Numerically, the column counting a certain quantity.,Ordinal relation; position in the order of proceeding.,Reception; effect; implying the making room for.', 'courtyard,piazza,plaza,square,seat,bathroom,frame of mind,mindset,mood', '', 'noun', '[{\"text\":\"places\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(324, 'place', 'To put (an object or person) in a specific location.,To earn a given spot in a competition.,To finish second, especially of horses or dogs.,To rank at (a certain position, often followed by an ordinal) as in a horse race.,To remember where and when (an object or person) has been previously encountered.,To sing (a note) with the correct pitch.,To arrange for or to make (a bet).,To establish a call (connection by telephone or similar).,To recruit or match an appropriate person for a job, or a home for an animal for adoption, etc.,To place-kick (a goal).', 'deposit,lay,lay down,put down,achieve,make,reach', '', 'verb', '[{\"text\":\"places\",\"type\":\"present singular third-person\"},{\"text\":\"placing\",\"type\":\"participle present\"},{\"text\":\"placed\",\"type\":\"participle past\"},{\"text\":\"placed\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"place\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(325, 'without', 'Outside, externally. This is still used in the names of some civil parishes in England, e.g. St Cuthbert Without.,Lacking something.,In prostitution: without a condom being worn.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(326, 'without', 'Outside of, beyond.,Not having, containing, characteristic of, etc.,Not doing or not having done something.', '', 'within,with', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(327, 'without', 'Unless, except (introducing a clause).', '', '', 'conj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(328, 'current', 'The generally unidirectional movement of a gas or fluid.,The part of a fluid that moves continuously in a certain direction, especially (oceanography) short for ocean current.,the amount of electric charge flowing in each unit of time.,a tendency or a course of events', 'flow,stream,electric current,flow,stream,tendency', '', 'noun', '[{\"text\":\"currents\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(329, 'current', 'Existing or occurring at the moment.,Generally accepted, used, practiced, or prevalent at the moment.,Electric; of or relating to electricity.,Running or moving rapidly.', 'present,present,fashionable,prevailing,prevalent,rife,up-to-date,fashionable,speeding', 'future,past,out-of-date,unfashionable,unfashionable', 'adj', '[{\"text\":\"currenter\",\"type\":\"comparative\"},{\"text\":\"more current\",\"type\":\"comparative\"},{\"text\":\"currentest\",\"type\":\"superlative\"},{\"text\":\"most current\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(330, 'history', 'The aggregate of past events.,The branch of knowledge that studies the past; the assessment of notable events.,The portion of the past that is known and recorded by this field of study, as opposed to all earlier and unknown times that preceded it (prehistory).,A set of events involving an entity.,A record or narrative description of past events.,A list of past and continuing medical conditions of an individual or family.,A record of previous user events, especially of visited web pages in a browser.,Something that no longer exists or is no longer relevant.,Shared experience or interaction.', 'background,past,account,chronicle,story,tale,medical history,log', '', 'noun', '[{\"text\":\"histories\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(331, 'history', 'To narrate or record.', '', '', 'verb', '[{\"text\":\"histories\",\"type\":\"present singular third-person\"},{\"text\":\"historying\",\"type\":\"participle present\"},{\"text\":\"historied\",\"type\":\"participle past\"},{\"text\":\"historied\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(332, 'shopping', 'present participle of shop', '', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(333, 'shopping', 'The process of buying goods or services, or searching for those suitable to buy.,Recently bought goods.,An area\'s combination of stores and other infrastructure and products available for people who want to shop.,Placement in a workshop for overhaul.', '', '', 'noun', '[{\"text\":\"shoppings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(334, 'account', 'A registry of pecuniary transactions; a written or printed statement of business dealings or debts and credits, and also of other things subjected to a reckoning or review.,A bank account.,A statement in general of reasons, causes, grounds, etc., explanatory of some event; a reason of an action to be done.,A reason, grounds, consideration, motive; a person\'s sake.,A record of events; a relation or narrative.,An estimate or estimation; valuation; judgment.,Importance; worth; value; esteem; judgement.,Authorization as a specific registered user in accessing a system.,A reckoning; computation; calculation; enumeration; a record of some reckoning.,Profit; advantage.', 'accounting,explanation,narrative,narration,relation,recital,report,description,explanation,membership,registration', '', 'noun', '[{\"text\":\"accounts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(335, 'account', 'To present an account of; to answer for, to justify.,To give an account of financial transactions, money received etc.,To estimate, consider (something to be as described).,To consider that.,To give a satisfactory evaluation for financial transactions, money received etc.,To give a satisfactory evaluation for (one\'s actions, behaviour etc.); to answer for.,To give a satisfactory reason for; to explain.,To establish the location for someone.,To cause the death, capture, or destruction of someone or something (+ for).,To calculate, work out (especially with periods of time).,To count (up), enumerate.,To recount, relate (a narrative etc.).', 'deem', '', 'verb', '[{\"text\":\"accounts\",\"type\":\"present singular third-person\"},{\"text\":\"accounting\",\"type\":\"participle present\"},{\"text\":\"accounted\",\"type\":\"participle past\"},{\"text\":\"accounted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(336, 'personal', 'Pertaining to human beings as distinct from things.,Of or pertaining to a particular person; relating to, or affecting, an individual, or each of many individuals; peculiar or proper to private concerns; not public or general,personal values personal desire personal reasons,Dealing with subjects about which one wishes (or people usually wish) to maintain privacy or discretion; not for public view; sensitive, intimate.,Intended for sexual use.,Pertaining to the external or bodily appearance; corporeal.,Done in person; without the intervention of another.,Relating to an individual, their character, conduct, motives, or private affairs, in an invidious and offensive manner,Denoting a person.,Denoting ownership.', '', '', 'adj', '[{\"text\":\"more personal\",\"type\":\"comparative\"},{\"text\":\"most personal\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(337, 'personal', 'An advertisement by which an individual attempts to meet others with similar interests.,A movable; a chattel.', '', '', 'noun', '[{\"text\":\"personals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(338, 'during', 'For all of a given time interval.,At any time or period within a given time interval.', '', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(339, 'during', 'present participle of dure', '', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(340, 'since', 'From a specified time in the past.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(341, 'since', 'Continuously during that period of time.,At certain points during that period of time.', '', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(342, 'since', 'From the time that.,Because.,When or that.', 'sithen,sithence,sith', '', 'conj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(343, 'water', 'The liquid form of this substance: liquid H₂O.,A serving of liquid water.,A substance (of molecular formula H₂O) found at room temperature and pressure as a clear liquid; it is present naturally as rain, and found in rivers, lakes and seas; its solid form is ice and its gaseous form is steam.,The aforementioned liquid, considered one of the Classical elements or basic elements of alchemy.,Water in a body; an area of open water.,A body of water, almost always a river.,Mineral water.,Spa water.,A solution in water of a gaseous or readily volatile substance.,Urine.,Amniotic fluid or the amniotic sac containing it. (Used only in the plural in the UK but often also in the singular in North America.),Fluids in the body, especially when causing swelling.,A state of affairs; conditions; usually with an adjective indicating an adverse condition.,A person\'s intuition.,Excess valuation of securities.,The limpidity and lustre of a precious stone, especially a diamond.,A wavy, lustrous pattern or decoration such as is imparted to linen, silk, metals, etc.', 'bag of waters,bones', '', 'noun', '[{\"text\":\"waters\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(344, 'water', 'To pour water into the soil surrounding (plants).,To wet or supply with water; to moisten; to overflow with water; to irrigate.,To provide (animals) with water for drinking.,To get or take in water.,To urinate onto.,To dilute.,To overvalue (securities), especially through deceptive accounting.,To fill with or secrete water.,To wet and calender, as cloth, so as to impart to it a lustrous appearance in wavy lines; to diversify with wavelike lines.', 'water down', '', 'verb', '[{\"text\":\"waters\",\"type\":\"present singular third-person\"},{\"text\":\"watering\",\"type\":\"participle present\"},{\"text\":\"watered\",\"type\":\"participle past\"},{\"text\":\"watered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
