(347, 'small', 'Not large or big; insignificant; few in number.,Young, as a child.,Minuscule or lowercase, referring to written or printed letters.,Humiliated or insignificant.,Evincing little worth or ability; not large-minded; paltry; mean.,Not prolonged in duration; not extended in time; short.,Synonym of little (“of an industry or institution(s) therein: operating on a small scale, unlike larger counterparts”),Slender, gracefully slim.,That is small (the manufactured size).', 'little,microscopic,minuscule,minute,tiny,tiny,little,wee,young,lowercase,minuscule,little', 'big,generous,large,large,adult,grown-up,old,big,capital,majuscule,uppercase', 'adj', '[{\"text\":\"smaller\",\"type\":\"comparative\"},{\"text\":\"smallest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(348, 'small', 'In a small fashion,In or into small pieces.,To a small extent.,In a low tone; softly.', '', '', 'adv', '[{\"text\":\"smaller\",\"type\":\"comparative\"},{\"text\":\"smallest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(349, 'small', 'One of several common sizes to which an item may be manufactured.,An item labelled or denoted as being that size.,One who fits an item of that size.,Any part of something that is smaller or slimmer than the rest, now usually with anatomical reference to the back.', 'S', '', 'noun', '[{\"text\":\"smalls\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
