(355, 'rating', 'A position on a scale.,An evaluation of status, especially of financial status.,A number, letter, or other mark that refers to the ability of something.,A quantitative measure of the audience of a television program.,A seaman in a warship.,An enlisted seaman not a commissioned officer or warrant officer.', '', '', 'noun', '[{\"text\":\"ratings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(356, 'location', 'A particular point or place in physical space.,An act of locating.,An apartheid-era urban area populated by non-white people; township.,A leasing on rent.,A contract for the use of a thing, or service of a person, for hire.,The marking out of the boundaries, or identifying the place or site of, a piece of land, according to the description given in an entry, plan, map, etc,An administrative region in Kenya, below counties and subcounties, and further divided into sublocations.', '', '', 'noun', '[{\"text\":\"locations\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(357, 'board', 'A relatively long, wide and thin piece of any material, usually wood or similar, often for use in construction or furniture-making.,A device (e.g., switchboard) containing electrical switches and other controls and designed to control lights, sound, telephone connections, etc.,A flat surface with markings for playing a board game.,Short for blackboard, whiteboard, chessboard, surfboard, circuit board, message board (on the Internet), etc.,A committee that manages the business of an organization, e.g., a board of directors.,Regular meals or the amount paid for them in a place of lodging.,The side of a ship.,The distance a sailing vessel runs between tacks when working to windward.,The wall that surrounds an ice hockey rink.,A long, narrow table, like that used in a medieval dining hall.,Paper made thick and stiff like a board, for book covers, etc.; pasteboard.,A level or stage having a particular layout.,A container for holding pre-dealt cards that is used to allow multiple sets of players to play the same cards.,Short for message board.,Short for bulletin board.', '', '', 'noun', '[{\"text\":\"boards\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(358, 'board', 'To step or climb onto or otherwise enter a ship, aircraft, train or other conveyance.,Antonyms: alight, disembark,To provide someone with meals and lodging, usually in exchange for money.,To receive meals and lodging in exchange for money.,To capture an enemy ship by going alongside and grappling her, then invading her with a boarding party,To obtain meals, or meals and lodgings, statedly for compensation,To approach (someone); to make advances to, accost.,To cover with boards or boarding.,To hit (someone) with a wooden board.,To write something on a board, especially a blackboard or whiteboard.', '', '', 'verb', '[{\"text\":\"boards\",\"type\":\"present singular third-person\"},{\"text\":\"boarding\",\"type\":\"participle present\"},{\"text\":\"boarded\",\"type\":\"participle past\"},{\"text\":\"boarded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(359, 'board', 'A rebound.', '', '', 'noun', '[{\"text\":\"boards\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
