(361, 'while', 'During the same time that.,Although.,Until.,As long as.,Used to denote an individual experiencing racial profiling when performing a seemingly benign activity.', 'whilst,as,when,whilom,as much as,till,provided that,providing,so long as', '', 'conj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(362, 'while', 'Until.', '', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(363, 'while', 'To pass (time) idly.,To occupy or entertain (someone) in order to let time pass.,To elapse, to pass.,Alternative spelling or misspelling of wile.', 'idle,laze,lounge,loiter', '', 'verb', '[{\"text\":\"whiles\",\"type\":\"present singular third-person\"},{\"text\":\"whiling\",\"type\":\"participle present\"},{\"text\":\"whiled\",\"type\":\"participle past\"},{\"text\":\"whiled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(364, 'think', 'To ponder, to go over in one\'s head.,To communicate to oneself in one\'s mind, to try to find a solution to a problem.,To conceive of something or someone (usually followed by of; infrequently, by on).,To be of opinion (that); to consider, judge, regard, or look upon (something) as.,To guess; to reckon.,To plan; to be considering; to be of a mind (to do something).,To presume; to venture.', 'ponder,have opinion,deem,guess See Thesaurus:suppose', '', 'verb', '[{\"text\":\"thinks\",\"type\":\"present singular third-person\"},{\"text\":\"thinking\",\"type\":\"participle present\"},{\"text\":\"thought\",\"type\":\"participle past\"},{\"text\":\"thought\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"think\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(365, 'think', 'An act of thinking; consideration (of something).', '', '', 'noun', '[{\"text\":\"thinks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
