(367, 'return', 'To come or go back (to a place or person).,To go back in thought, narration, or argument.,To recur; to come again.,To turn back, retreat.,To turn (something) round.,To place or put back something where it had been.,To give something back to its original holder or owner.,To take back something to a vendor for a complete or partial refund.,To give in requital or recompense; to requite.,To bat the ball back over the net in response to a serve.,To play a card as a result of another player\'s lead.,To throw a ball back to the wicket-keeper (or a fielder at that position) from somewhere in the field.,To say in reply; to respond.,To relinquish control to the calling procedure.,To pass (data) back to the calling procedure.,To retort; to throw back.,To report, or bring back and make known.,To elect according to the official report of the election officers.', 'give back,reinstate,render,restore,revest,surrender [⇒ thesaurus]', '', 'verb', '[{\"text\":\"returns\",\"type\":\"present singular third-person\"},{\"text\":\"returning\",\"type\":\"participle present\"},{\"text\":\"returned\",\"type\":\"participle past\"},{\"text\":\"returned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
