(424, 'white', 'Bright and colourless; reflecting equal quantities of all frequencies of visible light.,Of or relating to Caucasians, people of European descent with light-coloured skin.,Designated for use by Caucasians.,Relatively light or pale in colour.,Pale or pallid, as from fear, illness, etc.,Lacking coloration (tan) from ultraviolet light; not tanned.,Affected by leucism.,Containing cream, milk, or creamer.,The standard denomination of the playing pieces of a board game deemed to belong to the white set, no matter what the actual colour.,Pertaining to an ecclesiastical order whose adherents dress in white habits; Cistercian.,Honourable, fair; decent.,Grey, as from old age; having silvery hair; hoary.,Characterized by freedom from that which disturbs, and the like; fortunate; happy; favourable.,Regarded with especial favour; favourite; darling.,Pertaining to constitutional or anti-revolutionary political parties or movements.,Made from immature leaves and shoots.,Not containing characters; see white space.,Said of a symbol or character outline, not solid, not filled with color. Compare black (“said of a character or symbol filled with color”).,Characterised by the presence of snow.,Alwhite, pertaining to white armor.', 'fair,pale', 'black,nonwhite,unwhite,tanned,black', 'adj', '[{\"text\":\"whiter\",\"type\":\"comparative\"},{\"text\":\"more white\",\"type\":\"comparative\"},{\"text\":\"whitest\",\"type\":\"superlative\"},{\"text\":\"most white\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(425, 'white', 'The color/colour of snow or milk; the colour of light containing equal amounts of all visible wavelengths.,A person of European descent with light-coloured skin.,Any butterfly of the subfamily Pierinae in the family Pieridae.,White wine.,White coffee,The albumen of bird eggs (egg white).,The sclera, white of the eye.,The cue ball in cue games.,Cocaine,The snow- or ice-covered \"green\" in snow golf.,A white pigment.,A white bean,The central part of the butt, which was formerly painted white; the centre of a mark at which a missile is shot.,The enclosed part of a letter of the alphabet, especially when handwritten.,A feather, from the wing of the cock ostrich, that is of the palest possible shade.', 'white person,prime', '', 'noun', '[{\"text\":\"whites\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(426, 'white', 'To make white; to whiten; to bleach.', '', '', 'verb', '[{\"text\":\"whites\",\"type\":\"present singular third-person\"},{\"text\":\"whiting\",\"type\":\"participle present\"},{\"text\":\"whited\",\"type\":\"participle past\"},{\"text\":\"whited\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(427, 'white', 'Alternative letter-case form of white (“of or relating to Caucasians”)', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(428, 'white', 'Alternative letter-case form of white (“Caucasian”),An anticommunist who fought against the Reds during the Russian Civil War; the term is mostly associated with monarchist forces.', '', '', 'noun', '[{\"text\":\"Whites\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(429, 'little', 'Small in size.,Insignificant, trivial.,Used to belittle a person.,Very young.,Younger.,Used with the name of a place, especially of a country or its capital, to denote a neighborhood whose residents or storekeepers are from that place.,To imply that the inhabitants of the place have an insular attitude and are hostile to those they perceive as foreign.,Having few members.,Operating on a small scale.,Short in duration; brief.,Small in extent of views or sympathies; narrow; shallow; contracted; mean; illiberal; ungenerous.', '', '', 'adj', '[{\"text\":\"less\",\"type\":\"comparative\"},{\"text\":\"lesser\",\"type\":\"comparative\"},{\"text\":\"littler\",\"type\":\"comparative\"},{\"text\":\"least\",\"type\":\"superlative\"},{\"text\":\"littlest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(430, 'little', 'Not much.,Not at all.', '', '', 'adv', '[{\"text\":\"less\",\"type\":\"comparative\"},{\"text\":\"lesser\",\"type\":\"comparative\"},{\"text\":\"least\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(431, 'little', 'Not much, only a little: only a small amount (of).', '', '', 'det', '[{\"text\":\"less\",\"type\":\"comparative\"},{\"text\":\"least\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(432, 'little', 'Not much; not a large amount.', '', '', 'pron', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(433, 'little', 'A small amount.,A child; particularly an infant.,A newly initiated member of a sorority, who is mentored by a big.,The participant in ageplay who acts out the younger role.,One who has mentally age regressed to a childlike state.', '', 'big', 'noun', '[{\"text\":\"littles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(434, 'visit', 'To habitually go to (someone in distress, sickness etc.) to comfort them. (Now generally merged into later senses, below.),To go and meet (a person) as an act of friendliness or sociability.,Of God: to appear to (someone) to comfort, bless, or chastise or punish them. (Now generally merged into later senses, below.),To punish, to inflict harm upon (someone or something).,Of a sickness, misfortune etc.: to afflict (someone).,To inflict punishment, vengeance for (an offense) on or upon someone.,To go to (a shrine, temple etc.) for worship. (Now generally merged into later senses, below.),To go to (a place) for pleasure, on an errand, etc.', 'call on', '', 'verb', '[{\"text\":\"visits\",\"type\":\"present singular third-person\"},{\"text\":\"visiting\",\"type\":\"participle present\"},{\"text\":\"visited\",\"type\":\"participle past\"},{\"text\":\"visited\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"visit\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(435, 'visit', 'A single act of visiting.,A meeting with a doctor at their surgery or the doctor\'s at one\'s home.', '', '', 'noun', '[{\"text\":\"visits\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(436, 'tools', 'plural of tool', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(437, 'tools', 'third-person singular simple present indicative form of tool', '', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(438, 'reply', 'To give a written or spoken response, especially to a question, request, accusation or criticism; to answer.,To act or gesture in response.,To repeat something back; to echo.', '', '', 'verb', '[{\"text\":\"replies\",\"type\":\"present singular third-person\"},{\"text\":\"replying\",\"type\":\"participle present\"},{\"text\":\"replied\",\"type\":\"participle past\"},{\"text\":\"replied\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(439, 'reply', 'A written or spoken response; part of a conversation.,Something given in reply.,A counterattack.,The answer of a figure.,A document written by a party specifically replying to a responsive declaration and in some cases an answer.', 'answer,comeback,response,retort,return [⇒ thesaurus],account,rejoinder,rebuttal,riposte,reaction', '', 'noun', '[{\"text\":\"replies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(440, 'value', 'The quality (positive or negative) that renders something desirable or valuable.,The degree of importance given to something.,That which is valued or highly esteemed, such as one\'s morals, morality, or belief system.,The amount (of money or goods or services) that is considered to be a fair equivalent for something else.,The relative duration of a musical note.,The relative darkness or lightness of a color in (a specific area of) a painting etc.,Any definite numerical quantity or other mathematical object, determined by being measured, computed, or otherwise defined.,Precise meaning; import.,The valuable ingredients to be obtained by treating a mass or compound; specifically, the precious metals contained in rock, gravel, etc.,Esteem; regard.,Valour; also spelled valew.', 'worth,value,worth', '', 'noun', '[{\"text\":\"values\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(441, 'value', 'To estimate the value of; judge the worth of something.,To fix or determine the value of; assign a value to, as of jewelry or art work.,To regard highly; think much of; place importance upon.,To hold dear.', '', '', 'verb', '[{\"text\":\"values\",\"type\":\"present singular third-person\"},{\"text\":\"valuing\",\"type\":\"participle present\"},{\"text\":\"valued\",\"type\":\"participle past\"},{\"text\":\"valued\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(442, 'source', 'The person, place, or thing from which something (information, goods, etc.) comes or is acquired.,Spring; fountainhead; wellhead; any collection of water on or under the surface of the ground in which a stream originates.,A reporter\'s informant.,Source code.,The name of one terminal of a field effect transistor (FET).', '', '', 'noun', '[{\"text\":\"sources\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(443, 'source', 'To obtain or procure: used especially of a business resource.,To find information about (a quotation)\'s source (from which it comes): to find a citation for.', '', '', 'verb', '[{\"text\":\"sources\",\"type\":\"present singular third-person\"},{\"text\":\"sourcing\",\"type\":\"participle present\"},{\"text\":\"sourced\",\"type\":\"participle past\"},{\"text\":\"sourced\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(444, 'article', 'A piece of nonfictional writing such as a story, report, opinion piece, or entry in a newspaper, magazine, journal, dictionary, encyclopedia, etc.,An object, a member of a group or class.,A part of speech that indicates, specifies and limits a noun (a, an, or the in English). In some languages the article may appear as an ending (e.g. definite article in Swedish) or there may be none (e.g. Russian, Pashto).,A section of a legal document, bylaws, etc. or, in the plural, the entire document seen as a collection of these.,A genuine article.,A part or segment of something joined to other parts, or, in combination, forming a structured set.,A person; an individual.,A wench.,Subject matter; concern.,A distinct part.,A precise point in time; a moment.', '', '', 'noun', '[{\"text\":\"articles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(445, 'article', 'To bind by articles of apprenticeship.,To accuse or charge by an exhibition of articles or accusations.,To formulate in articles; to set forth in distinct particulars.', '', '', 'verb', '[{\"text\":\"articles\",\"type\":\"present singular third-person\"},{\"text\":\"participle articling\",\"type\":\"present\"},{\"text\":\"articled\",\"type\":\"participle past\"},{\"text\":\"articled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(446, 'learn', 'To acquire, or attempt to acquire knowledge or an ability to do something.,To attend a course or other educational activity.,To gain knowledge from a bad experience so as to improve.,To study.,To come to know; to become informed of; to find out.', '', '', 'verb', '[{\"text\":\"learns\",\"type\":\"present singular third-person\"},{\"text\":\"learning\",\"type\":\"participle present\"},{\"text\":\"learned\",\"type\":\"participle past\"},{\"text\":\"learned\",\"type\":\"past\"},{\"text\":\"learnt\",\"type\":\"participle past\"},{\"text\":\"learnt\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"learn\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(447, 'learn', 'The act of learning something', '', '', 'noun', '[{\"text\":\"learns\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(448, 'learn', 'To teach.', '', '', 'verb', '[{\"text\":\"learns\",\"type\":\"present singular third-person\"},{\"text\":\"learning\",\"type\":\"participle present\"},{\"text\":\"learned\",\"type\":\"participle past\"},{\"text\":\"learned\",\"type\":\"past\"},{\"text\":\"learnt\",\"type\":\"participle past\"},{\"text\":\"learnt\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(449, 'movies', 'plural of movie', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(450, 'movies', 'The cinema', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(451, 'college', 'A corporate group; a group of colleagues.,A group sharing common purposes or goals.,An electoral college.,A specialized division of a university.,An institution of higher education teaching undergraduates.,A university.,A postsecondary institution that offers vocational training and/or associate\'s degrees.,A non-specialized, semi-autonomous division of a university, with its own faculty, departments, library, etc.,An institution of further education at an intermediate level; sixth form.,An institution for adult education at a basic or intermediate level (teaching those of any age).,A high school or secondary school.,A private (non-government) primary or high school.,A residential hall associated with a university, possibly having its own tutors.,A government high school, short for junior college.,A bilingual school.', 'department', '', 'noun', '[{\"text\":\"colleges\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `vocabulary` (`id`, `word`, `meaning`, `similar_word`, `opposite_word`, `part_of_speech`, `forms`, `status`, `sequence`, `created_user_id`, `updated_user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(452, 'author', 'The originator or creator of a work, especially of a literary composition.,Someone who writes books for a living.,Principal.,One\'s authority for something: an informant.', 'bookwright,creator,artist,subcreator,fabulator,writer', '', 'noun', '[{\"text\":\"authors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(453, 'author', 'To create a work as its author.', '', '', 'verb', '[{\"text\":\"authors\",\"type\":\"present singular third-person\"},{\"text\":\"authoring\",\"type\":\"participle present\"},{\"text\":\"authored\",\"type\":\"participle past\"},{\"text\":\"authored\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(454, 'press', 'An instance of applying pressure; an instance of pressing.,A device used to apply pressure to an item.,A printing machine.,The print-based media (both the people and the newspapers).,A publisher.,An enclosed storage space (e.g. closet, cupboard).,An exercise in which weight is forced away from the body by extension of the arms or legs.,An additional bet in a golf match that duplicates an existing (usually losing) wager in value, but begins even at the time of the bet.,Pure, unfermented grape juice.,A commission to force men into public service, particularly into the navy.,A crowd.,In personology, any environmental factor that arouses a need in the individual.', 'printing press,closet,cupboard,pantry,press-gang', '', 'noun', '[{\"text\":\"presses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(455, 'press', 'To exert weight or force against, to act upon with force or weight; to exert pressure upon.,To activate a button or key by exerting a downward or forward force on it, and then releasing it.,To compress, squeeze.,To clasp, hold in an embrace.,To reduce to a particular shape or form by pressure, especially flatten or smooth.,To flatten a selected area of fabric using an iron with an up-and-down, not sliding, motion, so as to avoid disturbing adjacent areas.,To drive or thrust by pressure, to force in a certain direction.,To weigh upon, oppress, trouble.,To force to a certain end or result; to urge strongly.,To try to force (something upon someone).,To hasten, urge onward.,To urge, beseech, entreat.,To lay stress upon.,To throng, crowd.,To print.,To force into service, particularly into naval service.', 'strike,hit,depress,thring,thrutch,compress,hug,thring,thrutch,impel,urge,inculcate,emphasize,thring,thrutch,assemble,press-gang', '', 'verb', '[{\"text\":\"presses\",\"type\":\"present singular third-person\"},{\"text\":\"pressing\",\"type\":\"participle present\"},{\"text\":\"pressed\",\"type\":\"participle past\"},{\"text\":\"pressed\",\"type\":\"past\"},{\"text\":\"prest\",\"type\":\"participle past\"},{\"text\":\"prest\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(456, 'course', 'A normal or customary sequence.,A programme, a chosen manner of proceeding.,Any ordered process or sequence of steps.,A learning programme, whether a single class or (UK) a major area of study.,A treatment plan.,A stage of a meal.,The succession of one to another in office or duty; order; turn.,A sequence of events.,The itinerary of a race.,A racecourse.,The path taken by a flow of water; a watercourse.,The trajectory of a ball, frisbee etc.,A golf course.,The direction of movement of a vessel at any given moment.,The intended passage of voyage, such as a boat, ship, airplane, spaceship, etc.,The drive usually frequented by Europeans at an Indian station.,A path that something or someone moves along.,The lowest square sail in a fully rigged mast, often named according to the mast.,Menses.,A row of bricks or blocks.,A row of material that forms the roofing, waterproofing or flashing system.,In weft knitting, a single row of loops connecting the loops of the preceding and following rows.,One or more strings on some musical instruments (such as the guitar, lute or vihuela): if multiple, then closely spaced, tuned in unison or octaves and intended to played together.', '', '', 'noun', '[{\"text\":\"courses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(457, 'course', 'To run or flow (especially of liquids and more particularly blood).,To run through or over.,To pursue by tracking or estimating the course taken by one\'s prey; to follow or chase after.,To cause to chase after or pursue game.', '', '', 'verb', '[{\"text\":\"courses\",\"type\":\"present singular third-person\"},{\"text\":\"coursing\",\"type\":\"participle present\"},{\"text\":\"coursed\",\"type\":\"participle past\"},{\"text\":\"coursed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(458, 'course', 'Ellipsis of of course.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(459, 'canada', 'A country bordering a larger country that shares many similarities with it, but is overshadowed by the more prominent larger.', '', '', 'noun', '[{\"text\":\"Canadas\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(460, 'canada', 'A traditional Portuguese unit of liquid volume equal to 1.7–2.1 liters depending on the area of Portugal, used particularly for wine.', '', '', 'noun', '[{\"text\":\"canadas\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(461, 'canada', 'Alternative form of cañada, a ravine, a gulley.', '', '', 'noun', '[{\"text\":\"canadas\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(462, 'compare', 'To assess the similarities and differences between two or more things [\"to compare X with Y\"]. Having made the comparison of X with Y, one might have found it similar to Y or different from Y.,To declare two things to be similar in some respect [\"to compare X to Y\"].,To form the three degrees of comparison of (an adjective).,To be similar (often used in the negative).,To get; to obtain.', '', '', 'verb', '[{\"text\":\"compares\",\"type\":\"present singular third-person\"},{\"text\":\"comparing\",\"type\":\"participle present\"},{\"text\":\"compared\",\"type\":\"participle past\"},{\"text\":\"compared\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"compare\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(463, 'compare', 'Comparison.,An instruction or command that compares two values or states.,Illustration by comparison; simile.', '', '', 'noun', '[{\"text\":\"compares\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(464, 'include', 'To bring into a group, class, set, or total as a (new) part or member.,To consider as part of something; to comprehend.,To enclose, confine.,To conclude; to terminate.,To use a directive that allows the use of source code from another file.', '', '', 'verb', '[{\"text\":\"includes\",\"type\":\"present singular third-person\"},{\"text\":\"including\",\"type\":\"participle present\"},{\"text\":\"included\",\"type\":\"participle past\"},{\"text\":\"included\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(465, 'include', 'A piece of source code or other content that is dynamically retrieved for inclusion in another item.', '', '', 'noun', '[{\"text\":\"includes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(466, 'provide', 'To make a living; earn money for necessities.,To act to prepare for something.,To establish as a previous condition; to stipulate.,To give what is needed or desired, especially basic needs.,To furnish (with), cause to be present.,To make possible or attainable.,To foresee, to consider in advance.,To appoint to an ecclesiastical benefice before it is vacant. See provisor.', '', '', 'verb', '[{\"text\":\"provides\",\"type\":\"present singular third-person\"},{\"text\":\"providing\",\"type\":\"participle present\"},{\"text\":\"provided\",\"type\":\"participle past\"},{\"text\":\"provided\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"provide\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(467, 'around', 'Forming a circle or closed curve containing (something).,Centred upon; surrounding.,Following the perimeter of a specified area and returning to the starting point.,Following a path which curves near an object, with the object on the inside of the curve.,Near; in the vicinity of.,At or to various places within.', 'environ,environ', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(468, 'around', 'Present in the vicinity.,Alive; existing.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(469, 'around', 'So as to form a circle or trace a circular path, or approximation thereof.,So as to surround or be near.,Nearly; approximately; about.,From place to place.,From one state or condition to an opposite or very different one; with a metaphorical change in direction; bringing about awareness or agreement.,So as to partially or completely rotate; so as to face in the opposite direction.,Used with verbs to indicate repeated or continuous action, or in numerous locations or with numerous people.,Used with certain verbs to suggest unproductive activity.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(470, 'print', 'Of, relating to, or writing for printed publications.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(471, 'print', 'To produce one or more copies of a text or image on a surface, especially by machine; often used with out or off: print out, print off.,To produce a microchip (an integrated circuit) in a process resembling the printing of an image.,To write very clearly, especially, to write without connecting the letters as in cursive.,To publish in a book, newspaper, etc.,To stamp or impress (something) with coloured figures or patterns.,To fix or impress, as a stamp, mark, character, idea, etc., into or upon something.,To stamp something in or upon; to make an impression or mark upon by pressure, or as by pressure.,To display a string on the terminal.,To produce an observable value.,To fingerprint (a person).', '', '', 'verb', '[{\"text\":\"prints\",\"type\":\"present singular third-person\"},{\"text\":\"printing\",\"type\":\"participle present\"},{\"text\":\"printed\",\"type\":\"participle past\"},{\"text\":\"printed\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"print\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(472, 'print', 'Books and other material created by printing presses, considered collectively or as a medium.,Clear handwriting, especially, writing without connected letters as in cursive.,The letters forming the text of a document.,A newspaper.,A visible impression on a surface.,A fingerprint.,A footprint.,A picture that was created in multiple copies by printing.,A photograph that has been printed onto paper from the negative.,A copy of a film that can be projected.,Cloth that has had a pattern of dye printed onto it.,A plaster cast in bas relief.', '', '', 'noun', '[{\"text\":\"prints\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(473, 'process', 'A series of events which produce a result (the product).,A set of procedures used to produce a product, most commonly in the food and chemical industries.,A path of succession of states through which a system passes.,Successive physiological responses to keep or restore health.,Documents issued by a court in the course of a lawsuit or action at law, such as a summons, mandate, or writ.,An outgrowth of tissue or cell.,A structure that arises above a surface.,An executable task or program.,The centre mark that players aim at in the game of squails.', '', '', 'noun', '[{\"text\":\"processes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(474, 'process', 'To perform a particular process on a thing.,To retrieve, store, classify, manipulate, transmit etc. (data, signals, etc.), especially using computer techniques.,To think about a piece of information, or a concept, in order to assimilate it, and perhaps accept it in a modified state.,To develop photographic film.,To take legal proceedings against.', '', '', 'verb', '[{\"text\":\"processes\",\"type\":\"present singular third-person\"},{\"text\":\"processing\",\"type\":\"participle present\"},{\"text\":\"processed\",\"type\":\"participle past\"},{\"text\":\"processed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(475, 'process', 'To walk in a procession', '', '', 'verb', '[{\"text\":\"processes\",\"type\":\"present singular third-person\"},{\"text\":\"processing\",\"type\":\"participle present\"},{\"text\":\"processed\",\"type\":\"participle past\"},{\"text\":\"processed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(476, 'customer', 'A patron, a client; one who purchases or receives a product or service from a business or merchant, or intends to do so.,A person, especially one engaging in some sort of interaction with others.,A native official who exacted customs duties.', '', '', 'noun', '[{\"text\":\"customers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(477, 'stock', 'A store of goods ready for sale; inventory.,A supply of anything ready for use.,Railroad rolling stock.,A stack of undealt cards made available to the players.,Farm or ranch animals; livestock.,The population of a given type of animal (especially fish) available to be captured from the wild for economic use.,The price or value of the stock of a company on the stock market.,A share in a company.,The measure of how highly a person or institution is valued.,Any of several types of security that are similar to a stock, or marketed like one.,Broth made from meat (originally bones) or vegetables, used as a basis for stew or soup.,The type of paper used in printing.,Ellipsis of film stock.,Plain soap before it is coloured and perfumed.,Stock theater, summer stock theater.,The plant upon which the scion is grafted.,Lineage, family, ancestry.,Lineage, family, ancestry.,The trunk and woody main stems of a tree. The base from which something grows or branches.,Any of the several species of cruciferous flowers in the genus Matthiola.,The part of a rifle or shotgun that rests against the shooter\'s shoulder.,The handle of a whip, fishing rod, etc.,The headstock of a lathe, drill, etc.,The tailstock of a lathe.,A ski pole.,A bar going through an anchor, perpendicular to the flukes.,The axle attached to the rudder, which transfers the movement of the helm to the rudder.,A pipe (vertical cylinder of ore),A necktie or cravat, particularly a wide necktie popular in the eighteenth century, often seen today as a part of formal wear for horse riding competitions.,A piece of black cloth worn under a clerical collar.,A bed for infants; a crib, cot, or cradle,A piece of wood magically made to be just like a real baby and substituted for it by magical beings.,A cover for the legs; a stocking.,A block of wood; something fixed and solid; a pillar; a firm support; a post.,A person who is as dull and lifeless as a stock or post; one who has little sense.,The longest part of a split tally stick formerly struck in the exchequer, which was delivered to the person who had lent the king money on account, as the evidence of indebtedness.,The frame or timbers on which a ship rests during construction.,Red and grey bricks, used for the exterior of walls and the front of buildings.,In tectology, an aggregate or colony of individuals, such as trees, chains of salpae, etc.,The beater of a fulling mill.', 'rolling stock,livestock,reputation,card stock,rootstock,understock,rudder stock,stock-tie', '', 'noun', '[{\"text\":\"stocks\",\"type\":\"plural\"},{\"text\":\"stocken\",\"type\":\"obsolete plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
