(485, 'point', 'An individual element in a larger whole; a particular detail, thought, or quality.,A particular moment in an event or occurrence; a juncture.,Condition, state.,A topic of discussion or debate; a proposition.,A focus of conversation or consideration; the main idea.,A purpose or objective, which makes something meaningful.,The smallest quantity of something; a jot, a whit.,A tiny amount of time; a moment.,A specific location or place, seen as a spatial position.,A zero-dimensional mathematical object representing a location in one or more dimensions; something considered to have position but no magnitude or direction.,A full stop or other terminal punctuation mark.,A dot or mark used to designate certain tones or time. In ancient music, it distinguished or characterized certain tones or styles (points of perfection, of augmentation, etc.). In modern music, it is placed on the right of a note to raise its value, or prolong its time, by one half.,A note; a tune.,A distinguishing quality or characteristic.,The chief or excellent features.,Something tiny, as a pinprick; a very small mark.,A tenth; formerly also a twelfth.,Short for percentage point.,Each of the marks or strokes written above letters, especially in Semitic languages, to indicate vowels, stress etc.,A unit of scoring in a game or competition.,A decimal point (now especially when reading decimal fractions aloud).,A unit used to express differences in prices of stocks and shares.,a unit of measure equal to 1/12 of a pica, or approximately 1/72 of an inch (exactly 1/72 of an inch in the digital era).,An electric power socket.,A unit of bearing equal to one thirty-second of a circle, i.e. 11.25°.,A unit of measure for rain, equal to 0.254 mm or 0.01 of an inch.,Either of the two metal surfaces in a distributor which close or open to allow or prevent the flow of current through the ignition coil. There is usually a moving point, pushed by the distributor cam, and a fixed point, and they are built