(525, 'market', 'A gathering of people for the purchase and sale of merchandise at a set time, often periodic.,City square or other fairly spacious site where traders set up stalls and buyers browse the merchandise.,A grocery store,A group of potential customers for one\'s product.,A geographical area where a certain commercial demand exists.,A formally organized, sometimes monopolistic, system of trading in specified goods or effects.,The sum total traded in a process of individuals trading for certain commodities.,The price for which a thing is sold in a market; hence, value; worth.', '', '', 'noun', '[{\"text\":\"markets\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(526, 'market', 'To make (products or services) available for sale and promote them.,To sell.,To deal in a market; to buy or sell; to make bargains for provisions or goods.,To shop in a market; to attend a market.', '', '', 'verb', '[{\"text\":\"markets\",\"type\":\"present singular third-person\"},{\"text\":\"marketing\",\"type\":\"participle present\"},{\"text\":\"marketed\",\"type\":\"participle past\"},{\"text\":\"marketed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(527, 'november', 'Alternative letter-case form of November from the NATO/ICAO Phonetic Alphabet.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(528, 'really', 'In a way or manner that is real, not unreal.,Actually; in fact; in reality.,Very (modifying an adjective); very much (modifying a verb).', 'real-ly,actually,so', '', 'adv', '[{\"text\":\"more really\",\"type\":\"comparative\"},{\"text\":\"most really\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(529, 'really', 'Indicating surprise at, or requesting confirmation of, some new information; to express skepticism.,Indicating that what was just said was obvious and unnecessary; contrived incredulity,Indicating affirmation, agreement.,Indicating displeasure at another person\'s behaviour or statement.', 'you don\'t say,no kidding,oh really,no really', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(530, 'really', 'Alternative form of re-ally', '', '', 'verb', '[{\"text\":\"reallies\",\"type\":\"present singular third-person\"},{\"text\":\"reallying\",\"type\":\"participle present\"},{\"text\":\"reallied\",\"type\":\"participle past\"},{\"text\":\"reallied\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(531, 'model', 'A person who serves as a subject for artwork or fashion, usually in the medium of photography but also for painting or drawing.,A person, usually an attractive male or female that is hired to show items or goods to the public, such as items that are given away as prizes on a TV game show.,A representation of a physical object, usually in miniature.,A simplified representation used to explain the workings of a real world system or event.,A style, type, or design.,The structural design of a complex system.,A successful example to be copied, with or without modifications.,An interpretation function which assigns a truth value to each atomic proposition.,An interpretation which makes a set of sentences true, in which case that interpretation is called a model of that set.,An animal that is used to study a human disease or pathology.,Any copy, or resemblance, more or less exact.,In software applications using the model-view-controller design pattern, the part or parts of the application that manage the data.', 'archetype,epitome,example [⇒ thesaurus],exemplar [⇒ thesaurus],icon,paradigm,paragon,pattern,quintessence,template', '', 'noun', '[{\"text\":\"models\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(532, 'model', 'Worthy of being a model; exemplary.', 'ideal', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(533, 'model', 'to display for others to see, especially in regard to wearing clothing while performing the role of a fashion model,to use as an object in the creation of a forecast or model,to make a miniature model of,to create from a substance such as clay,to make a model or models,to be a model of any kind', '', '', 'verb', '[{\"text\":\"models\",\"type\":\"present singular third-person\"},{\"text\":\"modelling\",\"type\":\"UK participle present\"},{\"text\":\"modeling\",\"type\":\"US participle present\"},{\"text\":\"modelled\",\"type\":\"UK participle past\"},{\"text\":\"modelled\",\"type\":\"UK past\"},{\"text\":\"modeled\",\"type\":\"US participle past\"},{\"text\":\"modeled\",\"type\":\"US past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(534, 'start', 'The beginning of an activity.,A sudden involuntary movement.,The beginning point of a race, a board game, etc.,An appearance in a sports game, horserace, etc., from the beginning of the event.,A young plant germinated in a pot to be transplanted later.,An initial advantage over somebody else; a head start.,A happening or proceeding.', '', '', 'noun', '[{\"text\":\"starts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(535, 'start', 'To set in motion.,To begin.,To ready the operation of a vehicle or machine.,To put or raise (a question, an objection); to put forward (a subject for discussion).,To bring onto being or into view; to originate; to invent.,To begin an activity.,To have its origin (at), begin.,To jerk suddenly in surprise.,To awaken suddenly.,To disturb and cause to move suddenly; to startle; to alarm; to rouse; to cause to flee or fly.,To flinch or draw back.,To move suddenly from its place or position; to displace or loosen; to dislocate.,To break away, to come loose.,To put into play.,To pour out; to empty; to tap and begin drawing from.,To start one\'s periods (menstruation).', '', '', 'verb', '[{\"text\":\"starts\",\"type\":\"present singular third-person\"},{\"text\":\"starting\",\"type\":\"participle present\"},{\"text\":\"started\",\"type\":\"participle past\"},{\"text\":\"started\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(536, 'start', 'An instance of starting.', '', '', 'noun', '[{\"text\":\"starts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(537, 'start', 'A projection or protrusion; that which pokes out.,A handle, especially that of a plough.,The curved or inclined front and bottom of a water wheel bucket.,The arm, or level, of a gin, drawn around by a horse.', '', '', 'noun', '[{\"text\":\"starts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(538, 'start', 'A typical button for video games, originally used to start a game, now also often to pause or choose an option.', 'start,START', '', 'noun', '[{\"text\":\"Starts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
