(540, 'human', 'Of or belonging to the species Homo sapiens or its closest relatives.,Having the nature or attributes of a human being.', '', '', 'adj', '[{\"text\":\"more human\",\"type\":\"comparative\"},{\"text\":\"most human\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(541, 'human', 'The tallest, most abundant and most intelligent of primates; Homo sapiens.,Any hominid of the genus Homo.', 'human being,man,person', '', 'noun', '[{\"text\":\"humans\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(542, 'human', 'To behave as or become, or to cause to behave as or become, a human.', '', '', 'verb', '[{\"text\":\"humans\",\"type\":\"present singular third-person\"},{\"text\":\"humaning\",\"type\":\"participle present\"},{\"text\":\"humaned\",\"type\":\"participle past\"},{\"text\":\"humaned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(543, 'march', 'A formal, rhythmic way of walking, used especially by soldiers, bands and in ceremonies.,A political rally or parade,Any song in the genre of music written for marching (see Wikipedia\'s article on this type of music),Steady forward movement or progression.,The feat of taking all the tricks of a hand.', 'protest,parade,rally,process,advancement,progression', '', 'noun', '[{\"text\":\"marches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(544, 'march', 'To walk with long, regular strides, as a soldier does.,To cause someone to walk somewhere.,To go to war; to make military advances.,To make steady progress.', '', '', 'verb', '[{\"text\":\"marches\",\"type\":\"present singular third-person\"},{\"text\":\"marching\",\"type\":\"participle present\"},{\"text\":\"marched\",\"type\":\"participle past\"},{\"text\":\"marched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(545, 'march', 'A border region, especially one originally set up to defend a boundary.,A region at a frontier governed by a marquess.,Any of various territories with similar meanings or etymologies in their native languages.', 'frontier,marchland,county palatinate,county palatine', '', 'noun', '[{\"text\":\"marches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(546, 'march', 'To have common borders or frontiers', '', '', 'verb', '[{\"text\":\"marches\",\"type\":\"present singular third-person\"},{\"text\":\"marching\",\"type\":\"participle present\"},{\"text\":\"marched\",\"type\":\"participle past\"},{\"text\":\"marched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(547, 'march', 'Smallage.', '', '', 'noun', '[{\"text\":\"marches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(548, 'library', 'An institution which holds books and/or other forms of media for use by the public or qualified people often lending them out, as well as providing various other services for its users.,Any institution that lends out its goods for use by the public or a community.,A collection of books or other forms of stored information.,An equivalent collection of analogous information in a non-printed form, e.g. record library.,A room dedicated to storing books.,A collection of software routines that provide functionality to be incorporated into or used by a computer program.,A collection of DNA material from a single organism or relative to a single disease.,The deck or draw pile.', 'bookhouse', '', 'noun', '[{\"text\":\"libraries\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(549, 'action', 'The effort of performing or doing something.,Something done, often so as to accomplish a purpose.,A way of motion or functioning.,Fast-paced activity.,The way in which a mechanical device acts when used; especially a firearm.,The way in which cartridges are loaded, locked, and extracted from the mechanism.,The mechanism, that is the set of moving mechanical parts, of a keyboard instrument, like a piano, which transfers the motion of the key to the sound-making device.,The distance separating the strings and the fretboard on a guitar or other string instrument.,Sexual intercourse.,Combat.,A charge or other process in a law court (also called lawsuit and actio).,A mapping from a pairing of mathematical objects to one of them, respecting their individual structures. The pairing is typically a Cartesian product or a tensor product. The object that is not part of the output is said to act on the other object. In any given context, action is used as an abbreviation for a more fully named notion, like group action or left group action.,The product of energy and time, especially the product of the Lagrangian and time.,The event or connected series of events, either real or imaginary, forming the subject of a play, poem, or other composition; the unfolding of the drama of events.,The attitude or position of the several parts of the body as expressive of the sentiment or passion depicted.,spin put on the bowling ball.,A share in the capital stock of a joint-stock company, or in the public funds.,A religious performance or solemn function, i.e. action sermon, a sacramental sermon in the Scots Presbyterian Church.,a process existing in or produced by nature (rather than by the intent of human beings).', 'deed,act,acting,cocky,deed,doing', '', 'noun', '[{\"text\":\"actions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(550, 'action', 'Demanding or signifying the start of something, usually a performance.', '', 'cut', 'intj', '[{\"text\":\"action!\",\"type\":\"canonical\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
