(559, 'going', 'A departure.,The suitability of ground for riding, walking etc.,Progress.,Conditions for advancing in any way.,Course of life; behaviour; doings; ways.,The whereabouts (of something).,The horizontal distance between the front of one step in a flight of stairs and the front of the next.', '', '', 'noun', '[{\"text\":\"goings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
