(561, 'provided', 'Only if (the stipulation that follows is true).', 'on condition that,only if,provided that,providing,as long as', 'unless', 'conj', '[{\"text\":\"provided that\",\"type\":\"also\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
