(563, 'friend', 'A person, typically someone other than a family member, spouse or lover, whose company one enjoys and towards whom one feels affection.,An associate who provides assistance.,A person with whom one is vaguely or indirectly acquainted.,A person who backs or supports something.,An object or idea that can be used for good.,Used as a form of address when warning someone.,A function or class granted special access to the private and protected members of another class.,A spring-loaded camming device.,A lover; a boyfriend or girlfriend.,A relative, a relation by blood or marriage.,Used to refer collectively to a group of associated individuals, especially those comprising a cast, company, or crew', 'acquaintance,contact,admirer,booster,champion,protagonist,supporter,buster,mate,pal,buddy,sonny,lover,company,et al.', '', 'noun', '[{\"text\":\"friends\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(564, 'friend', 'To act as a friend to, to befriend; to be friendly to, to help.,To add (a person) to a list of friends on a social networking site; to officially designate (someone) as a friend.', 'befriend', '', 'verb', '[{\"text\":\"friends\",\"type\":\"present singular third-person\"},{\"text\":\"friending\",\"type\":\"participle present\"},{\"text\":\"friended\",\"type\":\"participle past\"},{\"text\":\"friended\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(565, 'friend', 'A Quaker; a member of the Society of Friends. (See also Friends.),Brand name of a spring-loaded camming device, now used to refer to any such device, often uncapitalized, as friend.', '', '', 'noun', '[{\"text\":\"Friends\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
