(568, 'medical', 'Of or pertaining to the practice of medicine.,Intended to have a therapeutic effect; medicinal.,Requiring medical treatment.,Pertaining to the state of one\'s health.,Pertaining to or requiring treatment by other than surgical means.,Pertaining to medication specifically (that is, pharmacotherapy), rather than to other aspects of medicine and surgery.', 'curative,therapeutic', '', 'adj', '[{\"text\":\"more medical\",\"type\":\"comparative\"},{\"text\":\"most medical\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
