(574, 'second', 'Number-two; following after the first one with nothing between them. The ordinal number corresponding to the cardinal number two.,Next to the first in value, power, excellence, dignity, or rank; secondary; subordinate; inferior.,Being of the same kind as one that has preceded; another.', '2nd,2ⁿᵈ,2d,2ᵈ,IInd,II,II.', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(575, 'second', 'After the first; at the second rank.,After the first occurrence but before the third.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(576, 'second', 'Something that is number two in a series.,Something that is next in rank, quality, precedence, position, status, or authority.,The place that is next below or after first in a race or contest.,A manufactured item that, though still usable, fails to meet quality control standards.,An additional helping of food.,A chance or attempt to achieve what should have been done the first time, usually indicating success this time around. (See second-guess.),The interval between two adjacent notes in a diatonic scale (either or both of them may be raised or lowered from the basic scale via any type of accidental).,The second gear of an engine.,Second base.,The agent of a party to an honour dispute whose role was to try to resolve the dispute or to make the necessary arrangements for a duel.,A Cub Scout appointed to assist the sixer.,A second-class honours degree.', 'seconder', '', 'noun', '[{\"text\":\"seconds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(577, 'second', 'To agree as a second person to (a proposal), usually to reach a necessary quorum of two. (See under [[#Etymology 3]] for translations.),To follow in the next place; to succeed.,To climb after a lead climber.', '', '', 'verb', '[{\"text\":\"seconds\",\"type\":\"present singular third-person\"},{\"text\":\"seconding\",\"type\":\"participle present\"},{\"text\":\"seconded\",\"type\":\"participle past\"},{\"text\":\"seconded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(578, 'second', 'One-sixtieth of a minute; the SI unit of time, defined as the duration of 9,192,631,770 periods of radiation corresponding to the transition between two hyperfine levels of caesium-133 in a ground state at a temperature of absolute zero and at rest.,A unit of angle equal to one-sixtieth of a minute of arc or one part in 3600 of a degree.,A short, indeterminate amount of time.', 's,sec,s,sec,second of arc,arcsecond,arcsec,\",sec', '', 'noun', '[{\"text\":\"seconds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(579, 'second', 'To transfer temporarily to alternative employment.,To assist or support; to back.,To agree as a second person to (a proposal), usually to reach a necessary quorum of two. (This may come from the English adjective above.),To accompany by singing as the second performer.', '', '', 'verb', '[{\"text\":\"seconds\",\"type\":\"present singular third-person\"},{\"text\":\"seconding\",\"type\":\"participle present\"},{\"text\":\"seconded\",\"type\":\"participle past\"},{\"text\":\"seconded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(580, 'second', 'One who supports another in a contest or combat, such as a dueller\'s assistant.,One who supports or seconds a motion, or the act itself, as required in certain meetings to pass judgement etc.,Aid; assistance; help.', '', '', 'noun', '[{\"text\":\"seconds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(581, 'server', 'A program that provides services to other programs or devices, either in the same computer or over a computer network.,A computer dedicated to running such programs.,A waitress or waiter.,The player who serves the ball.,A priest\'s attendant at the celebration of the Eucharist.,A tray for dishes.,A spoon for serving food.', 'altar server,acolyte,salver', 'client', 'noun', '[{\"text\":\"servers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(582, 'again', 'Another time; once more.,Over and above a factor of one.,Tell me again, say again; used in asking a question to which one may have already received an answer that one cannot remember.,I ask again, I say again; used in repeating a question or statement.,Here too, here also, in this case as well; used in applying a previously made point to a new instance; sometimes preceded by \"here\".,Used metalinguistically, with the repetition being in the discussion, or in the linguistic or pragmatic context of the discussion, rather than in the subject of discussion.,Back in the reverse direction, or to an original starting point.,Back (to a former place or state).,In return, as a reciprocal action; back.,In any other place.,On the other hand.,Moreover; besides; further.', 'once more,re-,ana-', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(583, 'again', 'Against.', '', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(584, 'feedback', 'Critical assessment of a process or activity or of their results.,The part of an output signal that is looped back into the input to control or modify a system.,The high-pitched howling noise heard when there is a loop between a microphone and a speaker.', 'estimation,assessment,critique,evaluation,audio feedback,Larsen effect,howlback,howlround', '', 'noun', '[{\"text\":\"feedbacks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(585, 'feedback', 'To generate the high-frequency sound by allowing a speaker to cause vibration of the sound generator of a musical instrument connected by an amplifier to the speaker.,To provide informational feedback to.,To convey by means of specialized communications channel.', '', '', 'verb', '[{\"text\":\"feedbacks\",\"type\":\"present singular third-person\"},{\"text\":\"feedbacking\",\"type\":\"participle present\"},{\"text\":\"feedbacked\",\"type\":\"participle past\"},{\"text\":\"feedbacked\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(586, 'staff', 'A long, straight, thick wooden rod or stick, especially one used to assist in walking.,A series of horizontal lines on which musical notes are written; a stave.,The employees of a business.,A mixture of plaster and fibre used as a temporary exterior wall covering.ᵂ,A pole, stick, or wand borne as an ensign of authority; a badge of office.,A pole upon which a flag is supported and displayed.,The rung of a ladder.,A series of verses so disposed that, when it is concluded, the same order begins again; a stanza; a stave.,An arbor, as of a wheel or a pinion of a watch.,The grooved director for the gorget, or knife, used in cutting for stone in the bladder.,An establishment of officers in various departments attached to an army, to a section of an army, or to the commander of an army. The general\'s staff consists of those officers about his person who are employed in carrying his commands into execution.,A form of token once used, in combination with a ticket, for safe train movements between two points on a single line.', 'personnel,stick', '', 'noun', '[{\"text\":\"staffs\",\"type\":\"plural\"},{\"text\":\"staves\",\"type\":\"plural\"},{\"text\":\"staff\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
