(675, 'create', 'To bring into existence out of nothing, without the prior existence of the materials or elements used.,To make or produce from other (e.g. raw, unrefined or scattered) materials or combinable elements or ideas; to design or invest with a new form, shape, function, etc.,To bring into existence; (sometimes in particular:),To cause, to bring (a non-object) about by an action, behavior, or event, to occasion.,To confer or invest with a rank or title of nobility, to appoint, ordain or constitute.,To be or do something creative, imaginative, originative.,In theatre, to be the first performer of a role; to originate a character.,To make a fuss, complain; to shout.', 'generate,generate,invent,generate', 'annihilate,extinguish,annihilate,extinguish,imitate,annihilate,extinguish', 'verb', '[{\"text\":\"creates\",\"type\":\"present singular third-person\"},{\"text\":\"creating\",\"type\":\"participle present\"},{\"text\":\"created\",\"type\":\"participle past\"},{\"text\":\"created\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"create\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(676, 'create', 'Created, resulting from creation.', '', '', 'adj', '[{\"text\":\"more create\",\"type\":\"comparative\"},{\"text\":\"most create\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(677, 'august', 'Awe-inspiring, majestic, noble, venerable.,Of noble birth.', '', '', 'adj', '[{\"text\":\"auguster\",\"type\":\"comparative\"},{\"text\":\"more august\",\"type\":\"comparative\"},{\"text\":\"augustest\",\"type\":\"superlative\"},{\"text\":\"most august\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(678, 'august', 'To make ripe; ripen.,To bring to realization.', '', '', 'verb', '[{\"text\":\"augusts\",\"type\":\"present singular third-person\"},{\"text\":\"augusting\",\"type\":\"participle present\"},{\"text\":\"augusted\",\"type\":\"participle past\"},{\"text\":\"augusted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
