(680, 'young', 'In the early part of growth or life; born not long ago.,At an early stage of existence or development; having recently come into existence.,advanced in age; (far towards or) at a specified stage of existence or age.,Junior (of two related people with the same name).,Early.,Youthful; having the look or qualities of a young person.,Of or belonging to the early part of life.,Having little experience; inexperienced; unpracticed; ignorant; weak.', 'youthful,youthful,juvenile,juvenile,underdeveloped,undeveloped,immature', '', 'adj', '[{\"text\":\"younger\",\"type\":\"comparative\"},{\"text\":\"youngest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(681, 'young', 'Offspring, especially the immature offspring of animals.', '', '', 'noun', '[{\"text\":\"young\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(682, 'young', 'To become or seem to become younger.,To cause to appear younger.,To exhibit younging.', '', '', 'verb', '[{\"text\":\"youngs\",\"type\":\"present singular third-person\"},{\"text\":\"younging\",\"type\":\"participle present\"},{\"text\":\"younged\",\"type\":\"participle past\"},{\"text\":\"younged\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(683, 'field', 'A land area free of woodland, cities, and towns; an area of open country.,The open country near or belonging to a town or city.,A wide, open space that is used to grow crops or to hold farm animals, usually enclosed by a fence, hedge or other barrier.,A region containing a particular mineral.,An airfield, airport or air base; especially, one with unpaved runways.,A place where a battle is fought; a battlefield.,An area reserved for playing a game or race with one’s physical force.,An area reserved for playing a game or race with one’s physical force.,An area reserved for playing a game or race with one’s physical force.,A place where competitive matches are carried out with figures, or playing area in a board game or a computer game.,A competitive situation, circumstances in which one faces conflicting moves of rivals.,All of the competitors in any outdoor contest or trial, or all except the favourites in the betting.,A physical phenomenon (such as force, potential or fluid velocity) that pervades a region; a mathematical model of such a phenomenon that associates each point and time with a scalar, vector or tensor quantity.,Any of certain structures serving cognition.,Any of certain structures serving cognition.,Any of certain structures serving cognition.,Any of certain structures serving cognition.,Any of certain structures serving cognition.,A physical or virtual location for the input of information in the form of symbols.,A physical or virtual location for the input of information in the form of symbols.,A physical or virtual location for the input of information in the form of symbols.,A physical or virtual location for the input of information in the form of symbols.,A physical or virtual location for the input of information in the form of symbols.,A physical or virtual location for the input of information in the form of symbols.,Part (usually one half) of a frame in an interlaced signal,Archaic form of fielder.', 'area,domain,sphere,realm', '', 'noun', '[{\"text\":\"fields\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(684, 'field', 'To intercept or catch (a ball) and play it.,To be the team catching and throwing the ball, as opposed to hitting it.,To place (a team, its players, etc.) in a game.,The away team fielded two new players and the second-choice goalkeeper.,To answer; to address.,To defeat.,To execute research (in the field).,To deploy in the field.', 'address,answer,deal with,respond to', '', 'verb', '[{\"text\":\"fields\",\"type\":\"present singular third-person\"},{\"text\":\"fielding\",\"type\":\"participle present\"},{\"text\":\"fielded\",\"type\":\"participle past\"},{\"text\":\"fielded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(685, 'story', 'An account of real or fictional events.,A lie, fiction.,A soap opera.,History.,A sequence of events, or a situation, such as might be related in an account.,A chronological collection of pictures or short videos published by a user on an application or website that is typically only available for a short period.,Ellipsis of user story.', 'tome,lie,serial,narrative', '', 'noun', '[{\"text\":\"stories\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(686, 'story', 'To tell as a story; to relate or narrate about.', '', '', 'verb', '[{\"text\":\"stories\",\"type\":\"present singular third-person\"},{\"text\":\"storying\",\"type\":\"participle present\"},{\"text\":\"storied\",\"type\":\"participle past\"},{\"text\":\"storied\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(687, 'story', 'Alternative spelling of storey.', '', '', 'noun', '[{\"text\":\"stories\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(688, 'paper', 'A sheet material used for writing on or printing on (or as a non-waterproof container), usually made by draining cellulose fibres from a suspension in water.,A newspaper or anything used as such (such as a newsletter or listing magazine).,Wallpaper.,Wrapping paper.,An open hand (a handshape resembling a sheet of paper), that beats rock and loses to scissors. It loses to lizard and beats Spock in rock-paper-scissors-lizard-Spock.,A written document, generally shorter than a book (white paper, term paper), in particular one written for the Government.,A written document that reports scientific or academic research and is usually subjected to peer review before publication in a scientific journal (as a journal article or the manuscript for one) or in the proceedings of a scientific or academic meeting (such as a conference, workshop, or symposium).,A scholastic essay.,A set of examination questions to be answered at one session.,Money.,Any financial assets other than specie.,A university course.,A paper packet containing a quantity of items.,A medicinal preparation spread upon paper, intended for external application.,A substance resembling paper secreted by certain invertebrates as protection for their nests and eggs.,Free passes of admission to a theatre, etc.,The people admitted by free passes.', 'bookfell', '', 'noun', '[{\"text\":\"papers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(689, 'paper', 'Made of paper.,Insubstantial (from the weakness of common paper),Planned (from plans being drawn up on paper),Having a title that is merely official, or given by courtesy or convention.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(690, 'paper', 'To apply paper to.,To document; to memorialize.,To fill (a theatre or other paid event) with complimentary seats.,To submit official papers to (a law court, etc.).,To give public notice (typically by displaying posters) that a person is wanted by the police or other authority.,To sandpaper.,To enfold in paper.,To paste the endpapers and flyleaves at the beginning and end of a book before fitting it into its covers.', 'paper the house', '', 'verb', '[{\"text\":\"papers\",\"type\":\"present singular third-person\"},{\"text\":\"papering\",\"type\":\"participle present\"},{\"text\":\"papered\",\"type\":\"participle past\"},{\"text\":\"papered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(691, 'single', 'Not accompanied by anything else; one in number.,Not divided in parts.,Designed for the use of only one.,Performed by one person, or one on each side.,Not married, and (in modern times) not dating or without a significant other.,Having only one rank or row of petals.,Simple and honest; sincere, without deceit.,Uncompounded; pure; unmixed.,Simple; foolish; weak; silly.', 'lone,sole,unbroken,undivided,uniform,unmarried,unpartnered,available', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(692, 'single', 'A 45 RPM vinyl record with one song on side A and one on side B.,A popular song released and sold (on any format) nominally on its own though usually having at least one extra track.,One who is not married or does not have a romantic partner.,A score of one run.,A hit in baseball where the batter advances to first base.,A tile that has a different value (i.e. number of pips) at each end.,A bill valued at $1.,A one-way ticket.,A score of one point, awarded when a kicked ball is dead within the non-kicking team\'s end zone or has exited that end zone.,A game with one player on each side, as in tennis.,One of the reeled filaments of silk, twisted without doubling to give them firmness.,A handful of gleaned grain.,A floating-point number having half the precision of a double-precision value.,A shot of only one character.,A single cigarette.,Synonym of single-driver.', 'rouge,single-driver', 'album,married', 'noun', '[{\"text\":\"singles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(693, 'single', 'To identify or select one member of a group from the others; generally used with out, either to single out or to single (something) out.,To get a hit that advances the batter exactly one base.,To thin out.,To take the irregular gait called singlefoot.,To sequester; to withdraw; to retire.,To take alone, or one by one; to single out.,To reduce (a railway) to single track.', '', '', 'verb', '[{\"text\":\"singles\",\"type\":\"present singular third-person\"},{\"text\":\"singling\",\"type\":\"participle present\"},{\"text\":\"singled\",\"type\":\"participle past\"},{\"text\":\"singled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(694, 'password', 'A word relayed to a person to gain admittance to a place or to gain access to information.,A string of characters used to log in to a computer or network, to access a level in a video game, and so on; archetypally a word but nowadays often an alphanumeric string or a phrase.', 'watchword,underword,passcode', '', 'noun', '[{\"text\":\"passwords\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
