(704, 'question', 'A sentence, phrase or word which asks for information, reply or response; an interrogative.,A subject or topic for consideration or investigation.,A doubt or challenge about the truth, accuracy, or validity of a matter.,A proposal to a meeting as a topic for deliberation.,Interrogation by torture.,Talk; conversation; speech.', 'issue,doubt,proposal', '', 'noun', '[{\"text\":\"questions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(705, 'question', 'To ask questions of; to interrogate; to ask for information.,To raise doubts about; have doubts about.,To ask a question or questions; inquire or seek to know; examine.,To argue; to converse; to dispute.', '', '', 'verb', '[{\"text\":\"questions\",\"type\":\"present singular third-person\"},{\"text\":\"questioning\",\"type\":\"participle present\"},{\"text\":\"questioned\",\"type\":\"participle past\"},{\"text\":\"questioned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(706, 'night', 'The period between sunset and sunrise, when a location faces far away from the sun, thus when the sky is dark.,The period of darkness beginning at the end of evening astronomical twilight when the sun is 18 degrees below the horizon, and ending at the beginning of morning astronomical twilight.,A period of time often defined in the legal system as beginning 30 minutes after sunset, and ending 30 minutes before sunrise.,An evening or night spent at a particular activity.,A night (and part of the days before and after it) spent in a place away from home, e.g. a hotel.,Nightfall.,Darkness (due to it being nighttime).,A dark blue colour, midnight blue.,A night\'s worth of competitions, generally one game.', 'evening,dark,blackness,darkness,gloom,obscurity,shadow', '', 'noun', '[{\"text\":\"nights\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(707, 'night', 'Ellipsis of good night.', '', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
