(709, 'example', 'Something that is representative of all such things in a group.,Something that serves to illustrate or explain a rule.,Something that serves as a pattern of behaviour to be imitated (a good example) or not to be imitated (a bad example).,A person punished as a warning to others.,A parallel or closely similar case, especially when serving as a precedent or model.,An instance (as a problem to be solved) serving to illustrate the rule or precept or to act as an exercise in the application of the rule.', '', '', 'noun', '[{\"text\":\"examples\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(710, 'example', 'To be illustrated or exemplified (by).', '', '', 'verb', '[{\"text\":\"examples\",\"type\":\"present singular third-person\"},{\"text\":\"exampling\",\"type\":\"participle present\"},{\"text\":\"exampled\",\"type\":\"participle past\"},{\"text\":\"exampled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
