(712, 'poker', 'A metal rod, generally of wrought iron, for adjusting the burning logs or coals in a fire; a firestick.,A tool like a soldering iron for making poker drawings.,One who pokes.,A kind of duck, the pochard.,A knife.', 'firestick,stoker,fire pike,jook,jooker,ching,ying,bassy,rambo,pokey,chete,shank,nank,splash,splasher,cheffer,wetter', '', 'noun', '[{\"text\":\"pokers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(713, 'poker', 'To poke with a utensil such as a poker or needle.', '', '', 'verb', '[{\"text\":\"pokers\",\"type\":\"present singular third-person\"},{\"text\":\"pokering\",\"type\":\"participle present\"},{\"text\":\"pokered\",\"type\":\"participle past\"},{\"text\":\"pokered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(714, 'poker', 'Any of various card games in which, following each of one or more rounds of dealing or revealing cards, the players in sequence make tactical bets or drop out, the bets forming a pool to be taken either by the sole remaining player or, after all rounds and bets have been completed, by those remaining players who hold a superior hand according to a standard ranking of hand values for the game.,All the four cards of the same rank.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(715, 'poker', 'To play poker.', '', '', 'verb', '[{\"text\":\"pokers\",\"type\":\"present singular third-person\"},{\"text\":\"pokering\",\"type\":\"participle present\"},{\"text\":\"pokered\",\"type\":\"participle past\"},{\"text\":\"pokered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(716, 'poker', 'Any imagined frightful object, especially one supposed to haunt the darkness; a bugbear.', '', '', 'noun', '[{\"text\":\"pokers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(717, 'status', 'A person’s condition, position or standing relative to that of others.,Prestige or high standing.,A situation or state of affairs.,The legal condition of a person or thing.,The state (of a Canadian First Nations person) of being registered under the Indian Act.,A function of some instant messaging applications, whereby a user may post a message that appears automatically to other users, if they attempt to make contact.,Short for status epilepticus or status asthmaticus.', '', '', 'noun', '[{\"text\":\"statuses\",\"type\":\"plural\"},{\"text\":\"status\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(718, 'browse', 'To scan, to casually look through in order to find items of interest, especially without knowledge of what to look for beforehand.,To move about while sampling, such as with food or products on display.,To navigate through hyperlinked documents on a computer, usually with a browser.,To move about while eating parts of plants, especially plants other than pasture, such as shrubs or trees.,To feed on, as pasture; to pasture on; to graze.', '', '', 'verb', '[{\"text\":\"browses\",\"type\":\"present singular third-person\"},{\"text\":\"browsing\",\"type\":\"participle present\"},{\"text\":\"browsed\",\"type\":\"participle past\"},{\"text\":\"browsed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(719, 'browse', 'Young shoots and twigs.,Fodder for cattle and other animals.,That which one browses through; something to read.', '', '', 'noun', '[{\"text\":\"browses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(720, 'building', 'The act or process by which something is built; construction.,A closed structure with walls and a roof.', 'construction,edifice,building,edifice', '', 'noun', '[{\"text\":\"buildings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(721, 'building', 'present participle of build', '', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(722, 'seller', 'Someone who sells; a vendor; a clerk.,Something which sells.', '', '', 'noun', '[{\"text\":\"sellers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(723, 'seller', 'Obsolete spelling of cellar', '', '', 'noun', '[{\"text\":\"sellers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(724, 'range', 'A line or series of mountains, buildings, etc.,A fireplace; a fire or other cooking apparatus; now specifically, a large cooking stove with many hotplates.,Selection, array.,An area for practicing shooting at targets.,An area for military training or equipment testing.,The distance from a person or sensor to an object, target, emanation, or event.,The maximum distance or reach of capability (of a weapon, radio, detector, etc.).,The distance a vehicle (e.g., a car, bicycle, lorry, or aircraft) can travel without refueling.,An area of open, often unfenced, grazing land.,The extent or space taken in by anything excursive; compass or extent of excursion; reach; scope.,The set of values (points) which a function can obtain.,The length of the smallest interval which contains all the data in a sample; the difference between the largest and smallest observations in the sample.,The defensive area that a player can cover.,The scale of all the tones a voice or an instrument can produce.,The geographical area or zone where a species is normally naturally found.,A sequential list of values specified by an iterator.,An aggregate of individuals in one rank or degree; an order; a class.,The step of a ladder; a rung.,A bolting sieve to sift meal.,A wandering or roving; a going to and fro; an excursion; a ramble; an expedition.,In the public land system, a row or line of townships lying between two succession meridian lines six miles apart.,The variety of roles that an actor can play in a satisfactory way.', 'base,training area,training ground,distance,radius,compass', 'domain', 'noun', '[{\"text\":\"ranges\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(725, 'range', 'To travel over (an area, etc); to roam, wander.,To rove over or through.,To exercise the power of something over something else; to cause to submit to, over.,To bring (something) into a specified position or relationship (especially, of opposition) with something else.,Of a variable, to be able to take any of the values in a specified range.,To classify.,To form a line or a row.,To be placed in order; to be ranked; to admit of arrangement or classification; to rank.,To set in a row, or in rows; to place in a regular line or lines, or in ranks; to dispose in the proper order.,To place among others in a line, row, or order, as in the ranks of an army; usually, reflexively and figuratively, to espouse a cause, to join a party, etc.,To be native to, or live in, a certain district or region.,To determine the range to a target.,To sail or pass in a direction parallel to or near.,Of a player, to travel a significant distance for a defensive play.', '', '', 'verb', '[{\"text\":\"ranges\",\"type\":\"present singular third-person\"},{\"text\":\"ranging\",\"type\":\"participle present\"},{\"text\":\"ranged\",\"type\":\"participle past\"},{\"text\":\"ranged\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(726, 'issue', 'A movement of soldiers towards an enemy, a sortie.,The outflow of a bodily fluid, particularly (now rare) in abnormal amounts.,The bodily fluid drained through a natural or artificial issue.,Offspring: one\'s natural child or children.,Progeny: all one\'s lineal descendants.,A race of people considered as the descendants of some common ancestor.,The produce or income derived from farmland or rental properties.,Income derived from fines levied by a court or law-enforcement officer; the fines themselves.,The entrails of a slaughtered animal.,Any action or deed performed by a person.,Luck considered as the favor or disfavor of nature, the gods, or God.,A single edition of a newspaper or other periodical publication.,The entire set of some item printed and disseminated during a certain period, particularly (publishing) a single printing of a particular edition of a work when contrasted with other print runs.,The entire set of something; all of something.,Any financial instrument issued by a company.,The loan of a book etc. from a library to a patron; all such loans by a given library during a given period.,The means or opportunity by which something flows or comes out,A sewer.,An exit from a room or building.,A confluence: the mouth of a river; the outlet of a lake or other body of water.,A small incision, tear, or artificial ulcer, used to drain fluid and usually held open with a pea or other small object.,The production or distribution of something for general use.,The distribution of something (particularly rations or standardized provisions) to someone or some group.,The action or an instance of a company selling bonds, stock, or other securities.,The action or an instance of sending something out,A point of law or fact in dispute or question in a legal action presented for resolution by the court.,Anything in dispute, an area of disagreement whose resolution is being debated or decided.,A dispute between two alternatives, a dilemma.,A psychological or emotional difficulty, (now informal, figurative and usually euphemistic) any problem or concern considered as a vague and intractable difficulty.,Any question or situation to be resolved,The end of any action or process.,The end of any period of time.,The result of a discussion or negotiation, an agreement.,The result of an investigation or consideration, a conclusion.,The action or an instance of feeling some emotion.,The action or an instance of leaving any state or condition.', 'sortie,sally,charge,descendant,fruit of one\'s loins,offspring', '', 'noun', '[{\"text\":\"issues\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(727, 'issue', 'To flow out, to proceed from, to come out or from.,To rush out, to sally forth.,To extend into, to open onto.,To turn out in a certain way, to result in.,To end up as, to turn out being, to become as a result.,To come to a point in fact or law on which the parties join issue.,To send out; to put into circulation.,To deliver for use.,To deliver by authority.', 'begive', '', 'verb', '[{\"text\":\"issues\",\"type\":\"present singular third-person\"},{\"text\":\"issuing\",\"type\":\"participle present\"},{\"text\":\"issued\",\"type\":\"participle past\"},{\"text\":\"issued\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
