(730, 'court', 'A street with no outlet, a cul-de-sac.,A housing estate under the House Ownership Scheme.,An apartment building, or a small development of several apartment buildings.,An enclosed space; a courtyard; an uncovered area shut in by the walls of a building, or by different buildings; also, a space opening from a street and nearly surrounded by houses; a blind alley.,The residence of a sovereign, prince, nobleman, or other dignitary; a palace.,The collective body of persons composing the retinue of a sovereign or person high in authority; all the surroundings of a sovereign in his regal state.,Any formal assembling of the retinue of a sovereign.,Attention directed to a person in power; behaviour designed to gain favor; politeness of manner; civility towards someone,The hall, chamber, or place, where justice is administered.,The persons officially assembled under authority of law, at the appropriate time and place, for the administration of justice; an official assembly, legally met together for the transaction of judicial business; a judge or judges sitting for the hearing or trial of cases.,The judge or judges or other judicial officer presiding in a particular matter, particularly as distinguished from the counsel or jury, or both.,The session of a judicial assembly.,Any jurisdiction, civil, military, or ecclesiastical.,A place arranged for playing the games of tennis, basketball, handball, badminton, volleyball, squash and some other games,one of the two divisions of a tennis, badminton or volleyball court, in which the player or players of each team play', '', '', 'noun', '[{\"text\":\"courts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(731, 'court', 'To seek to achieve or win.,To risk (a consequence, usually negative).,To try to win a commitment to marry from.,To engage in behavior leading to mating.,To attempt to attract.,To invite by attractions; to allure; to attract.,To attempt to gain alliance with.,To engage in activities intended to win someone\'s affections.,To engage in courtship behavior.', 'charm,entrance,allure,romance,solicit,woo', '', 'verb', '[{\"text\":\"courts\",\"type\":\"present singular third-person\"},{\"text\":\"courting\",\"type\":\"participle present\"},{\"text\":\"courted\",\"type\":\"participle past\"},{\"text\":\"courted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(732, 'event', 'An occurrence; something that happens.,A prearranged social activity (function, etc.),One of several contests that combine to make up a competition.,An end result; an outcome (now chiefly in phrases).,In the event, he turned out to have what I needed anyway.,A point in spacetime having three spatial coordinates and one temporal coordinate.,A possible action that the user can perform that is monitored by an application or the operating system (event listener). When an event occurs an event handler is called which performs a specific task.,A set of some of the possible outcomes; a subset of the sample space.,An affair in hand; business; enterprise.,An episode of severe health conditions.', '', '', 'noun', '[{\"text\":\"events\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
