(740, 'offer', 'To propose or express one\'s willingness (to do something).,To present in words; to proffer; to make a proposal of; to suggest.,To place at someone’s disposal; to present (something) to be either accepted or turned down.,To present (something) to God or gods as a gesture of worship, or for a sacrifice.,To place (something) in a position where it can be added to an existing mechanical assembly.,To bid, as a price, reward, or wages.,To happen, to present itself.,To make an attempt; typically used with at.,To put in opposition to; to manifest in an offensive way; to threaten.', '', '', 'verb', '[{\"text\":\"offers\",\"type\":\"present singular third-person\"},{\"text\":\"offering\",\"type\":\"participle present\"},{\"text\":\"offered\",\"type\":\"participle past\"},{\"text\":\"offered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
