(744, 'picture', 'A representation of anything (as a person, a landscape, a building) upon canvas, paper, or other surface, by drawing, painting, printing, photography, etc.,An image; a representation as in the imagination.,A painting.,A photograph.,A motion picture.,(\"the pictures\") Cinema (as a form of entertainment).,A paragon, a perfect example or specimen (of a category).,An attractive sight.,The art of painting; representation by painting.,A figure; a model.,Situation.,A sample of an illegal drug.,A format string in the COBOL programming language.', 'image', '', 'noun', '[{\"text\":\"pictures\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
