(746, 'popular', 'Common among the general public; generally accepted.,Concerning the people; public.,Pertaining to or deriving from the people or general public.,Of low birth, not noble; vulgar, plebian.,Aimed at ordinary people, as opposed to specialists etc.; intended for general consumption.,Cultivating the favour of the common people.,Liked by many people; generally pleasing, widely admired.,Adapted to the means of the common people; cheap.', '', '', 'adj', '[{\"text\":\"more popular\",\"type\":\"comparative\"},{\"text\":\"most popular\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(747, 'popular', 'A person who is popular, especially at a school.,An inexpensive newspaper with wide circulation.,A member of the Populares', '', '', 'noun', '[{\"text\":\"populars\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
