(749, 'radio', 'The technology that allows for the transmission of sound or other signals by modulation of electromagnetic waves.,A device that can capture (receive) the signal sent over radio waves and render the modulated signal as sound.,On-board entertainment system in a car, usually including a radio receiver as well as the capability to play audio from recorded media.,A device that can transmit radio signals.,The continuous broadcasting of sound via the Internet in the style of traditional radio.', 'tuner,wireless,receiver', '', 'noun', '[{\"text\":\"radios\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(750, 'radio', 'To use two-way radio to transmit (a message) (to another radio or other radio operator).,To order or assist (to a location), using telecommunications.', '', '', 'verb', '[{\"text\":\"radios\",\"type\":\"present singular third-person\"},{\"text\":\"radioing\",\"type\":\"participle present\"},{\"text\":\"radioed\",\"type\":\"participle past\"},{\"text\":\"radioed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(751, 'color', 'The spectral composition of visible light.,A particular set of visible spectral compositions, perceived or named as a class.,Hue as opposed to achromatic colors (black, white and grays).,These hues as used in color television or films, color photographs, etc (as opposed to the shades of grey used in black-and-white television).,Any of the standard dark tinctures used in a coat of arms, including azure, gules, sable, and vert.,A paint.,Human skin tone, especially as an indicator of race or ethnicity.,Skin color, noted as normal, jaundiced, cyanotic, flush, mottled, pale, or ashen as part of the skin signs assessment.,A flushed appearance of blood in the face; redness of complexion.,Richness of expression; detail or flavour that is likely to generate interest or enjoyment.,A standard or banner.,The flag of a nation or team.,Gang insignia.,An award for sporting achievement, particularly within a school or university.,The morning ceremony of raising the flag.,A property of quarks, with three values called red, green, and blue, which they can exchange by passing gluons; color charge.,A third-order measure of derivative price sensitivity, expressed as the rate of change of gamma with respect to time, or equivalently the rate of change of charm with respect to changes in the underlying asset price.,The relative lightness or darkness of a mass of written or printed text on a page. (See type color on Wikipedia.Wikipedia),Any of the colored balls excluding the reds.,A front or facade; an ostensible truth actually false; pretext.,An appearance of right or authority; color of law.', 'blee,blee,colour,hue,shade,tincture,tint,hue,blee,hue,shade,blee,color television,complexion,ethnicity,race,banner,standard,colour,DgammaDtime,gamma decay', '', 'noun', '[{\"text\":\"colors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(752, 'color', 'Conveying color, as opposed to shades of gray.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(753, 'color', 'To give something color.,To cause (a pipe, especially a meerschaum) to take on a brown or black color, by smoking.,To apply colors to the areas within the boundaries of a line drawing using colored markers or crayons.,To become red through increased blood flow.,To affect without completely changing.,To attribute a quality to; to portray (as).,To assign colors to the vertices of a graph (or the regions of a map) so that no two vertices connected by an edge (regions sharing a border) have the same color.', 'dye,paint,stain,shade,tinge,tint,dye,paint,stain,shade,tinge,tint,color in,blush,affect,influence,call', '', 'verb', '[{\"text\":\"colors\",\"type\":\"present singular third-person\"},{\"text\":\"coloring\",\"type\":\"participle present\"},{\"text\":\"colored\",\"type\":\"participle past\"},{\"text\":\"colored\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(754, 'major', 'Greater in dignity, rank, importance, significance, or interest.,Greater in number, quantity, or extent.,Notable or conspicuous in effect or scope.,Prominent or significant in size, amount, or degree.,Involving great risk, serious, life-threatening.,Of full legal age, having attained majority.,Of or relating to a subject of academic study chosen as a field of specialization.,Having intervals of a semitone between the third and fourth, and seventh and eighth degrees.,Equivalent to that between the tonic and another note of a major scale, and greater by a semitone than the corresponding minor interval.,Having a major third above the root.,(of a key) Based on a major scale, tending to produce a bright or joyful effect.,Bell changes rung on eight bells.,Indicating the elder of two brothers, appended to a surname in public schools.,Occurring as the predicate in the conclusion of a categorical syllogism.,Containing the major term in a categorical syllogism.', 'main,considerable', '', 'adj', '[{\"text\":\"more major\",\"type\":\"comparative\"},{\"text\":\"most major\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(755, 'major', 'A rank of officer in the army and the US air force, between captain and lieutenant colonel.,An officer in charge of a section of band instruments, used with a modifier.,A person of legal age.,Ellipsis of major key..,Ellipsis of major interval..,Ellipsis of major scale..,A system of change-ringing using eight bells.,A large, commercially successful company, especially a record label that is bigger than an indie.,The principal subject or course of a student working toward a degree at a college or university.,A student at a college or university specializing on a given area of study.,Ellipsis of major term..,Ellipsis of major premise..,Ellipsis of major suit..,A touchdown, or major score.,A goal.,An elder brother (especially at a public school).,A large leaf-cutter ant that acts as a soldier, defending the nest.,Alternative form of mayor and mair.', 'course,course', 'minor', 'noun', '[{\"text\":\"majors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
