(762, 'become', 'begin to be; turn into.,To come about; happen; come into being; arise.,To be proper for; to beseem.,Of an adornment, piece of clothing etc.: to look attractive on (someone).,To arrive, come (to a place).', 'get,turn,go,befit,suit', '', 'verb', '[{\"text\":\"becomes\",\"type\":\"present singular third-person\"},{\"text\":\"becoming\",\"type\":\"participle present\"},{\"text\":\"became\",\"type\":\"past\"},{\"text\":\"become\",\"type\":\"participle past\"},{\"text\":\"becomen\",\"type\":\"dialectal participle past rare\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(763, 'write', 'To form letters, words or symbols on a surface in order to communicate.,To be the author of (a book, article, poem, etc.).,To send written information to.,To show (information, etc) in written form.,To convey a fact to someone via writing.,To be an author.,To record data mechanically or electronically.,To fill in, to complete using words.,To impress durably; to imprint; to engrave.,To make known by writing; to record; to prove by one\'s own written testimony; often used reflexively.,To sell (an option or other derivative).', 'inscribe,scrawl,scribble,to post,display,indicate,mark,show,save,sit,pen [⇒ thesaurus]', '', 'verb', '[{\"text\":\"writes\",\"type\":\"present singular third-person\"},{\"text\":\"writing\",\"type\":\"participle present\"},{\"text\":\"wrote\",\"type\":\"past\"},{\"text\":\"writ\",\"type\":\"archaic past\"},{\"text\":\"written\",\"type\":\"participle past\"},{\"text\":\"writ\",\"type\":\"archaic participle past\"},{\"text\":\"ywriten\",\"type\":\"obsolete participle past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"write\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
