(769, 'society', 'A long-standing group of people sharing cultural aspects such as language, dress, norms of behavior and artistic forms.,A group of people who meet from time to time to engage in a common interest; an association or organization.,The sum total of all voluntary interrelations between individuals.,The people of one’s country or community taken as a whole.,High society.,A number of people joined by mutual consent to deliberate, determine and act toward a common goal.', '', '', 'noun', '[{\"text\":\"societies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
