(777, 'format', 'To create or edit the layout of a document.,Change a document so it will fit onto a different type of page.,To prepare a mass storage medium for initial use, erasing any existing data in the process.', 'reformat,initialise', '', 'verb', '[{\"text\":\"formats\",\"type\":\"present singular third-person\"},{\"text\":\"formatting\",\"type\":\"participle present\"},{\"text\":\"formatted\",\"type\":\"participle past\"},{\"text\":\"formatted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(778, 'close', 'To obstruct (an opening).,To move so that an opening is closed.,To make (e.g. a gap) smaller.,To move to a position preventing fluid from flowing.,To move to a position allowing electricity to flow.,To grapple; to engage in close combat.,To put an end to; to conclude; to complete; to finish; to consummate.,To come to an end.,To make a sale.,To make the final outs, usually three, of a game.,To terminate an application, window, file or database connection, etc.,To cancel or reverse (a trading position).,To come or gather around; to enclose; to encompass; to confine.,To have a vector sum of 0; that is, to form a closed polygon.,To do the tasks (putting things away, locking doors, etc.) required to prepare a store or other establishment to shut down for the night.,To turn off; to switch off.', 'close off,close up,cover,shut,shut off,narrow,end,finish,terminate,wind up,close down', '', 'verb', '[{\"text\":\"closes\",\"type\":\"present singular third-person\"},{\"text\":\"closing\",\"type\":\"participle present\"},{\"text\":\"closed\",\"type\":\"participle past\"},{\"text\":\"closed\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"close\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(779, 'close', 'An end or conclusion.,The manner of shutting; the union of parts; junction.,The point at the end of a sales pitch when the consumer is asked to buy.,A grapple in wrestling.,The conclusion of a strain of music; cadence.,A double bar marking the end.,The time when checkin staff will no longer accept passengers for a flight.', 'closer', '', 'noun', '[{\"text\":\"closes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(780, 'close', 'Closed, shut.,Narrow; confined.,At a little distance; near.,Intimate; well-loved.,Of a corporation or other business entity, closely held.,Oppressive; without motion or ventilation; causing a feeling of lassitude.,Hot, humid, with no wind.,Articulated with the tongue body relatively close to the hard palate.,Strictly confined; carefully guarded.,Out of the way of observation; secluded; secret; hidden.,Nearly equal; almost evenly balanced.,Short.,Dense; solid; compact.,Concise; to the point.,Difficult to obtain.,Parsimonious; stingy.,Adhering strictly to a standard or original; exact.,Accurate; careful; precise; also, attentive; undeviating; strict.,Marked, evident.', 'close by,muggy,high,compact', '', 'adj', '[{\"text\":\"closer\",\"type\":\"comparative\"},{\"text\":\"closest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(781, 'close', 'An enclosed field.,A street that ends in a dead end.,A very narrow alley between two buildings, often overhung by one of the buildings above the ground floor.,The common staircase in a tenement.,A cathedral close.,The interest which one may have in a piece of ground, even though it is not enclosed', 'cul-de-sac,alley', '', 'noun', '[{\"text\":\"closes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
