(787, 'edition', 'A written work edited and published, as by a certain editor or in a certain manner, or at a certain time.,The whole number of copies of a work printed and published at one time.,An instance of [1] or [2],A particular instance of an event.', '', '', 'noun', '[{\"text\":\"editions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(788, 'analysis', 'Decomposition into components in order to study (a complex thing, concept, theory etc.).,The result of such a process.,The mathematical study of functions, sequences, series, limits, derivatives and integrals.,Proof by deduction from known truths.,The process of breaking down a substance into its constituent parts, or the result of this process.,The analytical study of melodies, harmonies, sequences, repetitions, variations, quotations, juxtapositions, and surprises.,Psychoanalysis.', 'mathematical analysis', '', 'noun', '[{\"text\":\"analyses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(789, 'space', 'Free time; leisure, opportunity.,A specific (specified) period of time.,An undefined period of time (without qualifier, especially a short period); a while.,Distance between things.,Physical extent across two or three dimensions (sometimes for or to do something).,Physical extent in all directions, seen as an attribute of the universe (now usually considered as a part of space-time), or a mathematical model of this.,The near-vacuum in which planets, stars and other celestial objects are situated; the universe beyond the earth\'s atmosphere.,The physical and psychological area one needs within which to live or operate; personal freedom.,A (chiefly empty) area or volume with set limits or boundaries.,A position on the staff or stave bounded by lines.,A gap in text between words, lines etc., or a digital character used to create such a gap.,A piece of metal type used to separate words, cast lower than other type so as not to take ink, especially one that is narrower than one en (compare quad).,A gap; an empty place.,A set of points, each of which is uniquely specified by a number (the dimensionality) of coordinates.,A generalized construct or set whose members have some property in common; typically there will be a geometric metaphor allowing these members to be viewed as \"points\". Often used with a restricting modifier describing the members (e.g. vector space), or indicating the inventor of the construct (e.g. Hilbert space).,A field, area, or sphere of activity or endeavour.,Anything analogous to a physical space in which one can interact, such as an online chat room.', 'leisure time,spare time,duration,span,period,spell,while,uncertain period,break,gap,interspace,area,volume,outer space,blank,gap,whitespace,quad,quadrat', '', 'noun', '[{\"text\":\"spaces\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
