(893, 'green', 'Having green as its color.,Sickly, unwell.,Unripe, said of certain fruits that change color when they ripen.,Inexperienced.,Full of life and vigour; fresh and vigorous; new; recent.,Naive or unaware of obvious facts.,Overcome with envy.,Environmentally friendly.,Describing a pitch which, even if there is no visible grass, still contains a significant amount of moisture.,Of bacon or similar smallgoods: unprocessed, raw, unsmoked; not smoked or spiced.,Not fully roasted; half raw.,Of film: freshly processed by the laboratory and not yet fully physically hardened.,Of freshly cut wood or lumber that has not been dried: containing moisture and therefore relatively more flexible or springy.,High or too high in acidity.,Having a sexual connotation.,Having a color charge of green.,Being or relating to the green currencies of the European Union.', 'verdant,vert,inexperienced,new,gullible,eco-friendly,raw,unprocessed,unsmoked,tart', '', 'adj', '[{\"text\":\"greener\",\"type\":\"comparative\"},{\"text\":\"greenest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(894, 'green', 'The colour of growing foliage, as well as other plant cells containing chlorophyll; the colour between yellow and blue in the visible spectrum; one of the primary additive colour for transmitted light; the colour obtained by subtracting red and blue from white light using cyan and yellow filters.,A member of a green party; an environmentalist.,A putting green, the part of a golf course near the hole.,The surface upon which bowls is played.,One of the colour balls used in snooker, with a value of 3 points.,a public patch of land in the middle of a settlement.,A grassy plain; a piece of ground covered with verdant herbage.,Fresh leaves or branches of trees or other plants; wreaths.,Any substance or pigment of a green colour.,A green light used as a signal.,Marijuana.,Money.,One of the three color charges for quarks.,Short for green room.', 'environmentalist,greenie,tree hugger,treehugger,bowling green,marijuana', '', 'noun', '[{\"text\":\"greens\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
