(898, 'future', 'The time ahead; those moments yet to be experienced.,Something that will happen in moments yet to come.,Goodness in what is yet to come. Something to look forward to.,The likely prospects for or fate of someone or something in time to come.,Verb tense used to talk about events that will happen in the future; future tense.,Alternative form of futures,An object that retrieves the value of a promise.,A minor-league prospect.', 'to-come', '', 'noun', '[{\"text\":\"futures\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
