(900, 'track', 'A mark left by something that has passed along.,A mark or impression left by the foot, either of man or animal.,The entire lower surface of the foot; said of birds, etc.,A road or other similar beaten path.,Physical course; way.,A path or course laid out for a race, for exercise, etc.,The direction and progress of someone or something; path.,The way or rails along which a train moves.,A tract or area, such as of land.,The street, as a prostitute\'s place of work.,Awareness of something, especially when arising from close monitoring.,The distance between two opposite wheels on a same axletree.,Short for caterpillar track.,The pitch.,Sound stored on a record.,The physical track on a record.,A song or other relatively short piece of music, on a record, separated from others by a short silence.,A circular (never-ending) data storage unit on a side of magnetic or optical disk, divided into sectors.,The racing events of track and field; track and field in general.,A themed set of talks within a conference.,Clipping of trackshoe.', 'trace,trail,wake,footprint,impression,path,road,way,course,path,trajectory,way,course,racetrack,rails,railway,train tracks,tracks,area,parcel,region,tract,track width,ground,pitch,recording,groove,athletics,track and field', '', 'noun', '[{\"text\":\"tracks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
