(902, 'safety', 'The condition or feeling of being safe; security; certainty.,A mechanism on a weapon or dangerous equipment designed to prevent accidental firing.,An instance of a player being sacked or tackled in the end zone, or stepping out of the end zone and off the field, resulting in two points to the opposite team.,Any of the defensive players who are in position furthest from the line of scrimmage and whose responsibility is to defend against passes as well as to be the tacklers of last resort.,A safety squeeze.,Preservation from escape; close custody.,A safety bicycle.', '', '', 'noun', '[{\"text\":\"safeties\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
