(904, 'light', 'Visible electromagnetic radiation. The human eye can typically detect radiation (light) in the wavelength range of about 400 to 750 nanometers. Nearby shorter and longer wavelength ranges, although not visible, are commonly called ultraviolet and infrared light.,A source of illumination.,Spiritual or mental illumination; enlightenment, useful information.,Facts; pieces of information; ideas, concepts.,A notable person within a specific field or discipline.,The manner in which the light strikes a picture; that part of a picture which represents those objects upon which the light is supposed to fall; the more illuminated part of a landscape or other scene; opposed to shade.,A point of view, or aspect from which a concept, person or thing is regarded.,A flame or something used to create fire.,A cigarette lighter.,A firework made by filling a case with a substance which burns brilliantly with a white or coloured flame.,A window in architecture, carriage design, or motor car design: either the opening itself or the window pane of glass that fills it, if any.,The series of squares reserved for the answer to a crossword clue.,A cross-light in a double acrostic or triple acrostic.,Open view; a visible state or condition; public observation; publicity.,The power of perception by vision.,The brightness of the eye or eyes.,A traffic light, or, by extension, an intersection controlled by one or more that will face a traveler who is receiving instructions.', 'visible light', '', 'noun', '[{\"text\":\"lights\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(905, 'light', 'To start (a fire).,To set fire to; to set burning.,To illuminate; to provide light for when it is dark.,To become ignited; to take fire.,To attend or conduct with a light; to show the way to by means of a light.,To make (a bonus) available to be collected by hitting a target, and thus light up the feature light corresponding to that bonus to indicate its availability.', 'set,ignite,kindle,conflagrate,illuminate,light up,catch fire,ignite,conflagrate', 'extinguish,put out,quench,extinguish,put out,quench', 'verb', '[{\"text\":\"lights\",\"type\":\"present singular third-person\"},{\"text\":\"lighting\",\"type\":\"participle present\"},{\"text\":\"lit\",\"type\":\"participle past\"},{\"text\":\"lit\",\"type\":\"past\"},{\"text\":\"lighted\",\"type\":\"participle past\"},{\"text\":\"lighted\",\"type\":\"past\"},{\"text\":\"light\",\"type\":\"obsolete participle past\"},{\"text\":\"light\",\"type\":\"obsolete past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(906, 'light', 'Having light; bright; clear; not dark or obscure.,Pale or whitish in color; highly luminous and more or less deficient in chroma.,Served with extra milk or cream.', 'bright,lightful,pale,white', '', 'adj', '[{\"text\":\"lighter\",\"type\":\"comparative\"},{\"text\":\"lightest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(907, 'light', 'Having little or relatively little actual weight; not cumbrous or unwieldy.,Having little weight as compared with bulk; of little density or specific gravity.,Of short or insufficient weight; weighing less than the legal, standard, or proper amount; clipped or diminished.,Free from burden or impediment; unencumbered.,Lightly built; typically designed for speed or small loads.,Not heavily armed; armed with light weapons.,Riding high because of no cargo; by extension, pertaining to a ship which is light.,Without any piece of equipment attached or attached only to a caboose.,With low viscosity.,Not heavy or soggy; spongy; well raised.,Low in fat, calories, alcohol, salt, etc.,Slight, not forceful or intense; small in amount or intensity.,Gentle; having little force or momentum.,Easy to endure or perform.,Unimportant, trivial, having little value or significance.,Unchaste, wanton.,Not encumbered; unembarrassed; clear of impediments; hence, active; nimble; swift.,Easily influenced by trifling considerations; unsteady; unsettled; volatile.,Indulging in, or inclined to, levity; lacking dignity or solemnity; frivolous; airy.,Not quite sound or normal; somewhat impaired or deranged; dizzy; giddy.,Easily interrupted by stimulation.', 'lightweight,lite,lo-cal,low-alcohol,delicate,gentle,soft,inconsequential,trivial,unimportant', '', 'adj', '[{\"text\":\"lighter\",\"type\":\"comparative\"},{\"text\":\"lightest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
