(923, 'natural', 'Existing in the nature of a person or thing; innate, not acquired or learned.,Normally associated with a particular person or thing; inherently related to the nature of a thing or creature.,As expected; reasonable, normal; naturally arising from the given circumstances.,Formed by nature; not manufactured or created by artificial processes.,Pertaining to death brought about by disease or old age, rather than by violence, accident etc.,Having an innate ability to fill a given role or profession, or display a specified character.,Designating a standard trigonometric function of an angle, as opposed to the logarithmic function.,Neither sharp nor flat. Denoted ♮.,Containing no artificial or man-made additives; especially (of food) containing no colourings, flavourings or preservatives.,Pertaining to a decoration that preserves or enhances the appearance of the original material; not stained or artificially coloured.,Pertaining to a fabric still in its undyed state, or to the colour of undyed fabric.,Pertaining to a dice roll before bonuses or penalties have been applied to the result.,Not having used anabolic steroids or other performance-enhancing drugs.,Bidding in an intuitive way that reflects one\'s actual hand.,Closed under submodules, direct sums, and injective hulls.,Having a given status (especially of authority) by virtue of birth.,Related genetically but not legally to one\'s father; born out of wedlock, illegitimate.,Related by birth; genetically related.', 'consanguine,inevitable,raw,illegitimate,condomless', 'enhanced,artificial', 'adj', '[{\"text\":\"more natural\",\"type\":\"comparative\"},{\"text\":\"most natural\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
