(926, 'child', 'A person who has not yet reached adulthood, whether natural (puberty), cultural (initiation), or legal (majority).,A kid aged 1 to 11 years, whereas neonates are aged 0 to 1 month, infants are aged 1 month to 12 months, and adolescents are aged 12 years to 18 years.,One\'s direct descendant by birth, regardless of age; one\'s offspring; a son or daughter.,The thirteenth Lenormand card.,A person considered a product of a place or culture, a member of a tribe or culture, regardless of age.,Anything derived from or caused by something.,A data item, process, or object which has a subservient or derivative role relative to another.,Alternative form of childe (“youth of noble birth”),A subordinate node of a tree.,A female child, a girl.', 'kid,kid,descendant,product,son,daughter', '', 'noun', '[{\"text\":\"children\",\"type\":\"plural\"},{\"text\":\"childer\",\"type\":\"archaic dialectal plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
