(961, 'drive', 'Planned, usually long-lasting, effort to achieve something; ability coupled with ambition, determination, and motivation.,Violent or rapid motion; a rushing onward or away; especially, a forced or hurried dispatch of business.,An act of driving (prompting) game animals forward, to be captured or hunted.,An act of driving (prompting) livestock animals forward, to transport a herd.,A sustained advance in the face of the enemy to take a strategic objective.,A mechanism used to power or give motion to a vehicle or other machine or machine part.,A trip made in a vehicle (now generally in a motor vehicle).,A driveway.,A type of public roadway.,A place suitable or agreeable for driving; a road prepared for driving.,Desire or interest.,An apparatus for reading and writing data to or from a mass storage device such as a disk.,A mass storage device in which the mechanism for reading and writing data is integrated with the mechanism for storing data.,A stroke made with a driver.,A ball struck in a flat trajectory.,A type of shot played by swinging the bat in a vertical arc, through the line of the ball, and hitting it along the ground, normally between cover and midwicket.,A straight level shot or pass.,An offensive possession, generally one consisting of several plays and/ or first downs, often leading to a scoring opportunity.,A charity event such as a fundraiser, bake sale, or toy drive.,A campaign aimed at selling more of a certain product, e.g. by offering a discount.,An impression or matrix formed by a punch drift.,A collection of objects that are driven; a mass of logs to be floated down a river.', 'ambition,grit,push,verve,motivation,get-up-and-go,self-motivation,drove,attack,push,gear,engine,ride,spin,trip,approach,driveway,avenue,boulevard,road,street,Dr.,desire,impetus,impulse,urge,disk drive', 'inertia,lack of motivation,laziness,phlegm,sloth', 'noun', '[{\"text\":\"drives\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(962, 'drive', 'To provide an impetus for motion or other physical change, to move an object by means of the provision of force thereto.,To provide an impetus for a non-physical change, especially a change in one\'s state of mind.,To displace either physically or non-physically, through the application of force.,To cause intrinsic motivation through the application or demonstration of force: to impel or urge onward thusly, to compel to move on, to coerce, intimidate or threaten.,(especially of animals) To impel or urge onward by force; to push forward; to compel to move on.,To direct a vehicle powered by a horse, ox or similar animal.,To cause animals to flee out of.,To move (something) by hitting it with great force.,To cause (a mechanism) to operate.,To operate (a wheeled motorized vehicle).,To operate (an aircraft).,To motivate; to provide an incentive for.,To compel (to do something).,To cause to become.,To hit the ball with a drive.,To travel by operating a wheeled motorized vehicle.,To convey (a person, etc.) in a wheeled motorized vehicle.,To move forcefully.,To be moved or propelled forcefully (especially of a ship).,To urge, press, or bring to a point or state.,To carry or to keep in motion; to conduct; to prosecute.,To clear, by forcing away what is contained.,To dig horizontally; to cut a horizontal gallery or tunnel.,To put together a drive (n.): to string together offensive plays and advance the ball down the field.,To distrain for rent.,To separate the lighter (feathers or down) from the heavier, by exposing them to a current of air.,To be the dominant party in a sex act.', 'force,push,move,operate,impel,incentivise,incentivize,motivate,push,urge,compel,force,oblige,push,require,make,send,render,motorvate,take', '', 'verb', '[{\"text\":\"drives\",\"type\":\"present singular third-person\"},{\"text\":\"driving\",\"type\":\"participle present\"},{\"text\":\"drove\",\"type\":\"past\"},{\"text\":\"drave\",\"type\":\"archaic past\"},{\"text\":\"driv\",\"typ