(1011, 'simple', 'A herbal preparation made from one plant, as opposed to something made from more than one plant.,A physician.,A simple or atomic proposition.,Something not mixed or compounded.,A drawloom.,Part of the apparatus for raising the heddles of a drawloom.,A feast which is not a double or a semidouble.', '', '', 'noun', '[{\"text\":\"simples\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
