(1013, 'quick', 'Moving with speed, rapidity or swiftness, or capable of doing so; rapid; fast.,Occurring in a short time; happening or done rapidly.,Lively, fast-thinking, witty, intelligent.,Mentally agile, alert, perceptive.,Of temper: easily aroused to anger; quick-tempered.,Alive, living.,Pregnant, especially at the stage where the foetus\'s movements can be felt; figuratively, alive with some emotion or feeling.,Of water: flowing.,Burning, flammable, fiery.,Fresh; bracing; sharp; keen.,productive; not \"dead\" or barren', 'fast,brief,bright,hotheaded,rattish,short-tempered,snippish,snippy,extant,expecting,fluent', '', 'adj', '[{\"text\":\"quicker\",\"type\":\"comparative\"},{\"text\":\"quickest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
