(1017, 'license', 'A legal document giving official permission to do something; a permit.,The legal terms under which a person is allowed to use a product, especially software.,Freedom to deviate deliberately from normally applicable rules or practices (especially in behaviour or speech).,Excessive freedom; lack of due restraint.,Short for driver\'s license.', '', '', 'noun', '[{\"text\":\"licenses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
