(1022, 'friday', 'The sixth day of the week in many religious traditions, and the fifth day of the week in systems using the ISO 8601 norm; the Muslim Sabbath; it follows Thursday and precedes Saturday.,The last workday in a work schedule that is not Monday through Friday.', 'Fri,Fri.', '', 'noun', '[{\"text\":\"Fridays\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
