(1024, 'annual', 'Happening once every year.,an annual general meeting; an annual publication,Of, for, or relating to a whole year, often as a recurring cycle; determined or reckoned by the year; accumulating in the course of a year; performed, executed, or completed over the course of a year. See also circannual.,Having a life cycle that is completed in only one growing season; e.g. beans, corn, marigold. See Annual plant in Wikipedia. Compare biennial, perennial.,Living or lasting just one season or year, as certain insects or insect colonies.', 'yearly', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1025, 'annual', 'An annual publication; a book, periodical, journal, report, comic book, yearbook, etc., which is published serially once a year, which may or may not be in addition to regular weekly or monthly publication.,An annual plant; a plant with a life span of just one growing season; a plant which naturally germinates, flowers and dies in one year. Compare biennial, perennial.,A medical checkup taking place once a year.,A pantomime taking place once a year.', '', '', 'noun', '[{\"text\":\"annuals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
