(1039, 'region', 'Any considerable and connected part of a space or surface; specifically, a tract of land or sea of considerable but indefinite extent; a country; a district; in a broad sense, a place without special reference to location or extent but viewed as an entity for geographical, social or cultural reasons.,Such a division of the city of Rome and of the territory about Rome, of which the number varied at different times; a district, quarter, or ward.,An administrative subdivision of the European Union.,A subnational region of Chile; equivalent to province.,Ellipsis of regional municipality; a county-level municipality.,Ellipsis of administrative region.,Ellipsis of administrative region.,The inhabitants of a region or district of a country.,A place in or a part of the body in any way indicated.,Place; rank; station; dignity.,The space from the earth\'s surface out to the orbit of the moon: properly called the elemental region.', '', '', 'noun', '[{\"text\":\"regions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
