(1047, 'cover', 'To place something over or upon, as to conceal or protect.,To be over or upon, as to conceal or protect.,To be upon all of, so as to completely conceal.,To set upon all of, so as to completely conceal.,To put on one\'s hat.,To invest (oneself with something); to bring upon (oneself).,To discuss thoroughly; to provide coverage of.,To deal with or include someone or something.,To be enough money for.,To act as a replacement.,To have as an assignment or responsibility.,To make a cover version of (a song that was originally recorded by another artist).,To protect using an aimed firearm and the threat of firing; or to protect using continuous, heaving fire at or in the direction of the enemy so as to force the enemy to remain in cover; or to threaten using an aimed firearm.,To provide insurance coverage for.,To copulate with (said of certain male animals such as dogs and horses).,To protect or control (a piece or square).,To extend over a given period of time or range, to occupy, to stretch over a given area.,To traverse or put behind a certain distance.,To defend (mark) a particular player or area.', 'impregnate', '', 'verb', '[{\"text\":\"covers\",\"type\":\"present singular third-person\"},{\"text\":\"covering\",\"type\":\"participle present\"},{\"text\":\"covered\",\"type\":\"participle past\"},{\"text\":\"covered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
