(1051, 'final', 'A final examination; a test or examination given at the end of a term or class; the test that concludes a class.,A final examination taken at the end of the final year of an undergraduate course, which contributes towards a student\'s degree classification.,The last round, game or match in a contest, after which the winner is determined.,The final part of a syllable, the combination of medial and rime in phonetics and phonology.,The tonic or keynote of a Gregorian mode, and hence the final note of any conventional melody played in that mode.', '', '', 'noun', '[{\"text\":\"finals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
