(1080, 'present', 'To bring (someone) into the presence of (a person); to introduce formally.,To nominate (a member of the clergy) for an ecclesiastical benefice; to offer to the bishop or ordinary as a candidate for institution.,To offer (a problem, complaint) to a court or other authority for consideration.,To charge (a person) with a crime or accusation; to bring before court.,To come forward, appear in a particular place or before a particular person, especially formally.,To put (something) forward in order for it to be seen; to show, exhibit.,To make clear to one\'s mind or intelligence; to put forward for consideration.,To put on, stage (a play etc.).,To point (a firearm) at something, to hold (a weapon) in a position ready to fire.,To offer oneself for mental consideration; to occur to the mind.,To come to the attention of medical staff, especially with a specific symptom.,To appear (in a specific way) for delivery (of a fetus); to appear first at the mouth of the uterus during childbirth.,To appear or represent oneself (as having a certain gender).,To act as presenter on (a radio, television programme etc.).,To give a gift or presentation to (someone).,To give (a gift or presentation) to someone; to bestow.,To deliver (something abstract) as though as a gift; to offer.,To hand over (a bill etc.) to be paid.,To display one\'s female genitalia in a way that signals to others that one is ready for copulation. Also referred to as lordosis behaviour.,In omegaverse fiction, to have one\'s secondary sex (alpha, omega, or beta) become apparent, typically at puberty.', '', '', 'verb', '[{\"text\":\"presents\",\"type\":\"present singular third-person\"},{\"text\":\"presenting\",\"type\":\"participle present\"},{\"text\":\"presented\",\"type\":\"participle past\"},{\"text\":\"presented\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1081, 'front', 'The foremost side of something or the end that faces the direction it normally moves.,The side of a building with the main entrance.,A field of activity.,A person or institution acting as the public face of some other, covert group.,The interface or transition zone between two airmasses of different density, often resulting in precipitation. Since the temperature distribution is the most important regulator of atmospheric density, a front almost invariably separates airmasses of different temperature.,An area where armies are engaged in conflict, especially the line of contact.,The lateral space occupied by an element measured from the extremity of one flank to the extremity of the other flank.,The direction of the enemy.,When a combat situation does not exist or is not assumed, the direction toward which the command is faced.,A major military subdivision of the Soviet Army.,Cheek; boldness; impudence.,An act, show, façade, persona: an intentional and false impression of oneself.,That which covers the foremost part of the head: a front piece of false hair worn by women.,The most conspicuous part.,The beginning.,A seafront or coastal promenade.,The forehead or brow, the part of the face above the eyes; sometimes, also, the whole face.,The bellhop whose turn it is to answer a client\'s call, which is often the word \"front\" used as an exclamation.,A grill (jewellery worn on front teeth).', '', '', 'noun', '[{\"text\":\"fronts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1082, 'front', 'Located at or near the front.,Pronounced with the highest part of the body of the tongue toward the front of the mouth, near the hard palate (most often describing a vowel).,Closest or nearest, of a set of futures contracts which expire at particular times, or of the times they expire; (typically, the front month or front year is the next calender month or year after the current one).', 'first,lead,fore,prompt', 'back', 'adj', '[{\"text\":\"further front\",\"type\":\"comparative\"},{\"text\":\"furthest front\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
