(1191, 'heart', 'A muscular organ that pumps blood through the body, traditionally thought to be the seat of emotion.,One\'s feelings and emotions, especially considered as part of one\'s character.,The seat of the affections or sensibilities, collectively or separately, as love, hate, joy, grief, courage, etc.; rarely, the seat of the understanding or will; usually in a good sense; personality.,Emotional strength that allows one to continue in difficult situations; courage; spirit; a will to compete.,Vigorous and efficient activity; power of fertile production; condition of the soil, whether good or bad.,A term of affectionate or kindly and familiar address.,Memory.,A wight or being.,A conventional shape or symbol used to represent the heart, love, or emotion: ♥ or sometimes <3.,A playing card of the suit hearts featuring one or more heart-shaped symbols.,The twenty-fourth Lenormand card.,The centre, essence, or core.', 'bravery,nerve,spirit,courage,honey,sugar,sweetheart,crux,gist,gist', '', 'noun', '[{\"text\":\"hearts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
