(1210, 'purchase', 'The acquisition of title to, or property in, anything for a price; buying for money or its equivalent.,That which is obtained, got or acquired, in any manner, honestly or dishonestly; property; possession; acquisition.,That which is obtained for a price in money or its equivalent.,The act or process of seeking and obtaining something (e.g. property, etc.),A price paid for a house or estate, etc. equal to the amount of the rent or income during the stated number of years.,Any mechanical hold or advantage, applied to the raising or removing of heavy bodies, as by a lever, a tackle or capstan.,The apparatus, tackle or device by which such mechanical advantage is gained and in nautical terminology the ratio of such a device, like a pulley, or block and tackle.,The amount of hold one has from an individual foothold or ledge.,Acquisition of lands or tenements by means other than descent or inheritance, namely, by one\'s own act or agreement.', 'contact,grip,hold,foothold,support', '', 'noun', '[{\"text\":\"purchases\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1211, 'purchase', 'To buy, obtain by payment of a price in money or its equivalent.,To pursue and obtain; to acquire by seeking; to gain, obtain, or acquire.,To obtain by any outlay, as of labor, danger, or sacrifice, etc.,To expiate by a fine or forfeit.,To apply to (anything) a device for obtaining a mechanical advantage; to get a purchase upon, or apply a purchase to; to raise or move by mechanical means.,To put forth effort to obtain anything; to strive; to exert oneself.,To constitute the buying power for a purchase, have a trading value.', 'procure', '', 'verb', '[{\"text\":\"purchases\",\"type\":\"present singular third-person\"},{\"text\":\"purchasing\",\"type\":\"participle present\"},{\"text\":\"purchased\",\"type\":\"participle past\"},{\"text\":\"purchased\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1212, 'active', 'Having the power or quality of acting; causing change; communicating action or motion; acting;—opposed to passive, that receives.,Quick in physical movement; of an agile and vigorous body; nimble.,In action; actually proceeding; working; in force,Emitting hot materials, such as lava, smoke, or steam, or producing tremors.,Given to action; constantly engaged in action; energetic; diligent; busy,Requiring or implying action or exertion,Given to action rather than contemplation; practical; operative,Brisk; lively.,Implying or producing rapid action.,Applied to a form of the verb; — opposed to passive. See active voice.,Applied to verbs which assert that the subject acts upon or affects something else; transitive.,Applied to all verbs that express action as distinct from mere existence or state.,Eligible to be processed by a compiler or interpreter.,Not passive.,(of a homosexual man) enjoying a role in anal sex in which he penetrates, rather than being penetrated by his partner.', 'acting,agile,nimble,in action,working,in force,in action,working,in force,busy,deedful,diligent,energetic,operative,abuzz,agile,airy,alive [⇒ thesaurus],animated [⇒ thesaurus],brisk,busy,busy as a bee,buzzing,diligent,driven,driving,dynamic,eager,energetic,enthusiastic [⇒ thesaurus],expeditious,frisky,gay [⇒ thesaurus],glowing,happy [⇒ thesaurus],impetuous,industrious [⇒ thesaurus],keen,kinetic,lively [⇒ thesaurus],merry,mobile,motivated,moving [⇒ thesaurus],nimble,peppy,perky,restive,snappy,spirited,sprightly,sprunt,spry,vigorous,vivacious,vivid,zealous,zestful,zippy,top', 'passive,passive,indolent,still,quiescent,dormant,extinct,quiescent,dormant,extinct,dull,sluggish,indolent,inert,passive,tranquil,sedentary,theoretical,speculative,passive,slow,passive,bottom', 'adj', '[{\"text\":\"more active\",\"type\":\"comparative\"},{\"text\":\"most active\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1213, 'active', 'A person or thing that is acting or capable of acting.,Any component that is not passive. See Passivity (engineering).', '', '', 'noun', '[{\"text\":\"actives\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1214, 'response', 'An answer or reply, or something in the nature of an answer or reply.,The act of responding or replying; reply: as, to speak in response to a question.,An oracular answer.,A verse, sentence, phrase, or word said or sung by the choir or congregation in sequence or reply to the priest or officiant.,A versicle or anthem said or sung during or after a lection; a respond or responsory.,A reply to an objection in formal disputation.,An online advertising performance metric representing one click-through from an online ad to its destination URL.,A reaction to a stimulus or provocation.', '', '', 'noun', '[{\"text\":\"responses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1215, 'practice', 'Repetition of an activity to improve a skill.,An organized event for the purpose of performing such repetition.,The ongoing pursuit of a craft or profession, particularly in medicine or the fine arts.,A place where a professional service is provided, such as a general practice.,The observance of religious duties that a church requires of its members.,A customary action, habit, or behaviour; a manner or routine.,Actual operation or experiment, in contrast to theory.,The form, manner, and order of conducting and carrying on suits and prosecutions through their various stages, according to the principles of law and the rules laid down by the courts.,Skilful or artful management; dexterity in contrivance or the use of means; stratagem; artifice.,A easy and concise method of applying the rules of arithmetic to questions which occur in trade and business.', 'rehearsal,drill,dry run,exercise,training,trial,workout,general practice,custom,habit,pattern,routine,wont,wone', 'theory', 'noun', '[{\"text\":\"practices\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
