(1225, 'holiday', 'A day on which a festival, religious event, or national celebration is traditionally observed.,A day declared free from work by the state or government.,A period of one or more days taken off work for leisure and often travel; often plural.,A period during which pupils do not attend their school; often plural; rarely used for students at university (usually: vacation).,A period during which, by agreement, the usual payments are not made.,A gap in coverage, e.g. of paint on a surface, or sonar imagery.', 'feast day,holy day,bank holiday,national holiday,leave,time off,vacation,vacation,vacation,lacuna', '', 'noun', '[{\"text\":\"holidays\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
