(1234, 'writing', 'Graphism of symbols such as letters that express some meaning.,Something written, such as a document, article or book.,The process of representing a language with symbols or letters.,A work of an author.,The style of writing of a person.,Intended for or used in writing.', 'text,document,manuscript,text,work,hand,handwriting,alphabet,character,ideogram,logogram,pictogram,script,syllabary,writing system', '', 'noun', '[{\"text\":\"writings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
