(1236, 'yellow', 'Having yellow as its color.,Lacking courage.,Characterized by sensationalism, lurid content, and doubtful accuracy.,Of the skin, having the colour traditionally attributed to Far East Asians, especially Chinese.,Far East Asian (relating to Asian people).,Of mixed Aboriginal and Caucasian ancestry.,Synonym of high yellow,Related to the Liberal Democrats.,Related to the Free Democratic Party; a political party in Germany.', 'cowardly,high yellow', 'nonyellow,unyellow', 'adj', '[{\"text\":\"yellower\",\"type\":\"comparative\"},{\"text\":\"more yellow\",\"type\":\"comparative\"},{\"text\":\"yellowest\",\"type\":\"superlative\"},{\"text\":\"most yellow\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1237, 'yellow', 'The colour of gold, cheese, or a lemon; the colour obtained by mixing green and red light, or by subtracting blue from white light.,The intermediate light in a set of three traffic lights, the illumination of which indicates that drivers should stop short of the intersection if it is safe to do so.,One of the colour balls used in snooker, with a value of 2 points.,One of two groups of object balls, or a ball from that group, as used in the principally British version of pool that makes use of unnumbered balls (the (yellow(s) and red(s)); contrast stripes and solids in the originally American version with numbered balls).,A yellow card.,Any of various pierid butterflies of the subfamily Coliadinae, especially the yellow coloured species. Compare sulphur.', 'amber', '', 'noun', '[{\"text\":\"yellows\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
