(1243, 'increase', '(of a quantity, etc.) To become larger or greater.,To make (a quantity, etc.) larger.,To multiply by the production of young; to be fertile, fruitful, or prolific.,To become more nearly full; to show more of the surface; to wax.', 'wax,augment [⇒ thesaurus],grow,propagate,rise,increment,proliferate,propagate,teem,wax', '', 'verb', '[{\"text\":\"increases\",\"type\":\"present singular third-person\"},{\"text\":\"increasing\",\"type\":\"participle present\"},{\"text\":\"increased\",\"type\":\"participle past\"},{\"text\":\"increased\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
