(1245, 'speed', 'The state of moving quickly or the capacity for rapid motion.,The rate of motion or action, specifically the magnitude of the velocity; the rate distance is traversed in a given time.,The sensitivity to light of film, plates or sensor.,The duration of exposure, the time during which a camera shutter is open (shutter speed).,The largest size of the lens opening at which a lens can be used.,The ratio of the focal length to the diameter of a photographic objective.,Amphetamine or any amphetamine-based drug (especially methamphetamine) used as a stimulant, especially illegally.,Luck, success, prosperity.,Personal preference.,A third-order measure of derivative price sensitivity, expressed as the rate of change of gamma with respect to changes in the underlying asset price.', 'celerity,rapidity,velocity,speed,velocity,methamphetamine,DgammaDspot,gamma of the gamma', '', 'noun', '[{\"text\":\"speeds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1246, 'speed', 'Called by the soundman when the recording equipment has reached running speed and is ready to go.', '', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1247, 'speed', 'To succeed; to prosper, be lucky.,To help someone, to give them fortune; to aid or favour.,To go fast.,To exceed the speed limit.,To increase the rate at which something occurs.,To be under the influence of stimulant drugs, especially amphetamines.,To be expedient.,To hurry to destruction; to put an end to; to ruin.,To wish success or good fortune to, in any undertaking, especially in setting out upon a journey.,To cause to make haste; to dispatch with celerity; to drive at full speed; hence, to hasten; to hurry.,To hasten to a conclusion; to expedite.', '', '', 'verb', '[{\"text\":\"speeds\",\"type\":\"present singular third-person\"},{\"text\":\"speeding\",\"type\":\"participle present\"},{\"text\":\"sped\",\"type\":\"participle past\"},{\"text\":\"sped\",\"type\":\"past\"},{\"text\":\"speeded\",\"type\":\"UK participle past\"},{\"text\":\"speeded\",\"type\":\"UK past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1248, 'kingdom', 'A realm having a king and/or queen as its actual or nominal sovereign.,A realm, region, or conceptual space where something is dominant.,A rank in the classification of organisms, below domain and above phylum; a taxon at that rank (e.g. the plant kingdom, the animal kingdom).', 'kingric,riche,regnum', '', 'noun', '[{\"text\":\"kingdoms\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1249, 'nature', 'The way things are, the totality of all things in the physical universe and their order, especially the physical world in contrast to spiritual realms and flora and fauna as distinct from human conventions, art, and technology.,The essential or innate characteristics of a person or thing which will always tend to manifest, especially in contrast to specific contexts, reason, religious duty, upbringing, and personal pretense or effort.,The distinguishing characteristic of a person or thing, understood as its general class, sort, type, etc.,Synonym of caliber: the class of a gun.,The vital functions or strength of someone or something, especially (now dialect) as requiring nourishment or careful maintenance or (medicine) as a force of regeneration without special treatment.,The need to urinate and defecate.,Sexual desire.,Spontaneous love, affection, or reverence, especially between parent and child.,A product of the body\'s physical form, especially semen and vaginal fluids, menstrual fluid, and (obsolete) feces.,A part of the body\'s physical form, especially (obsolete) the female genitalia.', 'essence,caliber', '', 'noun', '[{\"text\":\"natures\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
