(1251, 'discount', 'To deduct from an account, debt, charge, and the like.,To lend money upon, deducting the discount or allowance for interest,To take into consideration beforehand; to anticipate and form conclusions concerning (an event).,To leave out of account or regard as unimportant.,To lend, or make a practice of lending, money, abating the discount,To believe, or act as though one believes, that one\'s own feelings are more important than the reality of a situation.', '', '', 'verb', '[{\"text\":\"discounts\",\"type\":\"present singular third-person\"},{\"text\":\"discounting\",\"type\":\"participle present\"},{\"text\":\"discounted\",\"type\":\"participle past\"},{\"text\":\"discounted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
