(1338, 'build', 'To form (something) by combining materials or parts.,To develop or give form to (something) according to a plan or process.,To increase or strengthen (something) by adding gradually to.,To establish a basis for (something).,To form by combining materials or parts.,To develop in magnitude or extent.,To construct (software) by compiling its source code.,To be converted into software by compilation, usually with minimal human intervention.', 'create,build up,enlarge,increase,strengthen,base,found,ground,construct,erect,artifice,assemble [⇒ thesaurus],betimber,build up,compile,construct,edify,erect,extruct,fabricate,fashion,form [⇒ thesaurus],knock up,make,manufacture,produce,put together,put up,raise,rear,timber,upbuild', '', 'verb', '[{\"text\":\"builds\",\"type\":\"present singular third-person\"},{\"text\":\"building\",\"type\":\"participle present\"},{\"text\":\"built\",\"type\":\"participle past\"},{\"text\":\"built\",\"type\":\"past\"},{\"text\":\"builded\",\"type\":\"archaic participle past poetic\"},{\"text\":\"builded\",\"type\":\"archaic past poetic\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"build\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1339, 'build', 'The physique of a human or animal body, or other object; constitution or structure.,Any of various versions of a software product as it is being developed for release to users.,A structure, such as a building, statue, pool or forest, or a configuration of a character\'s items or skills, created by the player.', '', '', 'noun', '[{\"text\":\"builds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1340, 'continue', 'To proceed with (doing an activity); to prolong (an activity).,To make last; to prolong.,To retain (someone or something) in a given state, position, etc.,To remain in a given place or condition; to remain in connection with; to abide; to stay.,To resume.,To adjourn, prorogue, put off.,To make a continuation bet.', 'carry on,go on,proceed,resume', '', 'verb', '[{\"text\":\"continues\",\"type\":\"present singular third-person\"},{\"text\":\"continuing\",\"type\":\"participle present\"},{\"text\":\"continued\",\"type\":\"participle past\"},{\"text\":\"continued\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1341, 'continue', 'An option allowing the player to resume play after game over, when all lives have been lost, while retaining their progress.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1342, 'remember', 'To recall from one\'s memory; to have an image in one\'s memory.,To memorize; to put something into memory.,To keep in mind, be mindful of,To not forget (to do something required),To convey greetings from.,To put in mind; to remind (also used reflexively),To engage in the process of recalling memories.,To give (a person) money as a token of appreciation of past service or friendship.,to commemorate, to have a remembrance ceremony', 'bear in mind,bethink,keep in mind,mind,recall,recollect,retrieve,think back,umbethink', '', 'verb', '[{\"text\":\"remembers\",\"type\":\"present singular third-person\"},{\"text\":\"remembering\",\"type\":\"participle present\"},{\"text\":\"remembered\",\"type\":\"participle past\"},{\"text\":\"remembered\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"remember\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
