(1344, 'season', 'Each of the four divisions of a year: spring, summer, autumn (fall) and winter,A part of a year when something particular happens.,A period of the year in which a place is most busy or frequented for business, amusement, etc.,The period over which a series of Test matches are played.,That which gives relish; seasoning.,A group of episodes of a television or radio program broadcast in regular intervals with a long break between each group, usually with one year between the beginning of each.,An extended, undefined period of time.,The full set of downloadable content for a game, which can be purchased with a season pass.,A fixed period of time in a massively multiplayer online game in which new content (themes, rules, modes, etc.) becomes available, sometimes replacing earlier content.', 'yeartide,yeartime,series', '', 'noun', '[{\"text\":\"seasons\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1345, 'season', 'To habituate, accustom, or inure (someone or something) to a particular use, purpose, or circumstance.,To prepare by drying or hardening, or removal of natural juices.,To become mature; to grow fit for use; to become adapted to a climate.,To become dry and hard, by the escape of the natural juices, or by being penetrated with other substance.,To mingle: to moderate, temper, or qualify by admixture.,To impregnate (literally or figuratively).', 'desiccate,dehydrate,exiccate,fordry,wont,age,desiccate,dry out,dry up,fordry,shrivel up,admix,inseminate,fertilize,seed', '', 'verb', '[{\"text\":\"seasons\",\"type\":\"present singular third-person\"},{\"text\":\"seasoning\",\"type\":\"participle present\"},{\"text\":\"seasoned\",\"type\":\"participle past\"},{\"text\":\"seasoned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
