(1347, 'across', 'To, toward, or from the far side of (something that lies between two points of interest).,On the opposite side of (something that lies between two points of interest).,across from: on the opposite side, relative to something that lies between, from (a point of interest).,From one side to the other within (a space being traversed).,At or near the far end of (a space).,Spanning.,Throughout.,So as to intersect or pass through or over at an angle.,In possession of full, up-to-date information about; abreast of.', '', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
