(1352, 'screen', 'A physical divider intended to block an area from view, or provide shelter from something dangerous.,A frame supporting a mesh of bars or wires used to classify fragments of stone by size, allowing the passage of fragments whose a diameter is smaller than the distance between the bars or wires.,The protective netting which protects the audience from flying objects,A stencil upon a framed mesh through which paint is forced onto printed-on material; the frame with the mesh itself.,Searching through a sample for a target; an act of screening,A technique used to identify genes so as to study gene functions.,The viewing surface or area of a movie, or moving picture or slide presentation.,The informational viewing area of electronic devices, where output is displayed.,One of the individual regions of a video game, etc. divided into separate screens.,The visualised data or imagery displayed on a computer screen.,A disguise; concealment.,Short for screen pass.,An offensive tactic in which a player stands so as to block a defender from reaching a teammate.,An erection of white canvas or wood placed on the boundary opposite a batsman to make the ball more easily visible.,A collection of less-valuable vessels that travel with a more valuable one for the latter\'s protection.,A dwarf wall or partition carried up to a certain height for separation and protection, as in a church, to separate the aisle from the choir, etc.,A large scarf.', 'pick', '', 'noun', '[{\"text\":\"screens\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1353, 'screen', 'To filter by passing through a screen.,To shelter or conceal.,To remove information, or censor intellectual material from viewing. To hide the facts.,To present publicly (on the screen).,To fit with a screen.,To examine patients or treat a sample in order to detect a chemical or a disease, or to assess susceptibility to a disease.,To search chemical libraries by means of a computational technique in order to identify chemical compounds which would potentially bind to a given biological target such as a protein.,To stand so as to block a defender from reaching a teammate.,To determine the source or subject matter of a call before deciding whether to answer the phone.', 'pick', '', 'verb', '[{\"text\":\"screens\",\"type\":\"present singular third-person\"},{\"text\":\"screening\",\"type\":\"participle present\"},{\"text\":\"screened\",\"type\":\"participle past\"},{\"text\":\"screened\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1354, 'apply', 'To lay or place; to put (one thing to another),To put to use; to use or employ for a particular purpose, or in a particular case,To make use of, declare, or pronounce, as suitable, fitting, or relative,To put closely; to join; to engage and employ diligently, or with attention,To address; to refer; generally used reflexively.,To submit oneself as a candidate (with the adposition \"to\" designating the recipient of the submission, and the adposition \"for\" designating the position).,To pertain or be relevant to a specified individual or group.,To busy; to keep at work; to ply.,To visit.', 'appropriate,devote,use,attach,incline', '', 'verb', '[{\"text\":\"applies\",\"type\":\"present singular third-person\"},{\"text\":\"applying\",\"type\":\"participle present\"},{\"text\":\"applied\",\"type\":\"participle past\"},{\"text\":\"applied\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
