(1364, 'effect', 'The result or outcome of a cause.,Impression left on the mind; sensation produced.,Execution; performance; realization; operation.,The state of being binding and enforceable, as in a rule, policy, or law.,An illusion produced by technical means (as in \"special effect\"),An alteration, or device for producing an alteration, in sound after it has been produced by an instrument.,A scientific phenomenon, usually named after its discoverer.,Belongings, usually as personal effects.,Consequence intended; purpose; meaning; general intent; with to.,Reality; actual meaning; fact, as distinguished from mere appearance.,Manifestation; expression; sign.', '', '', 'noun', '[{\"text\":\"effects\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
