(1366, 'sunday', 'The first day of the week in many religious traditions, and the seventh day of the week in systems using the ISO 8601 standard; the Christian Sabbath; the Lord\'s Day; it follows Saturday and precedes Monday.,A newspaper published on Sunday.,A comic strip published in a Sunday newspaper.', 'Sun,Sun.,Su', '', 'noun', '[{\"text\":\"Sundays\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1367, 'sunday', 'To spend Sunday (at a certain place, with a certain person or people, etc.).', '', '', 'verb', '[{\"text\":\"Sundays\",\"type\":\"present singular third-person\"},{\"text\":\"Sundaying\",\"type\":\"participle present\"},{\"text\":\"Sundayed\",\"type\":\"participle past\"},{\"text\":\"Sundayed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
