(1372, 'cross', 'To place across or athwart; to cause to intersect.,To lay or draw something across, such as a line.,To mark with an X.,To write lines of text at right angles to and over the top of one another in order to save paper.ᵂ,To make the sign of the cross over oneself.,To make the sign of the cross over (something or someone).,To go from one side of (something) to the other.,To travel in a direction or path that will intersect with that of another.,To pass, as objects going in an opposite direction at the same time.,Relative movement by a player or of players.,Relative movement by a player or of players.,Relative movement by a player or of players.,To contradict (another) or frustrate the plans of.,To interfere and cut off ; to debar.,To conduct a cross examination; to question a hostile witness.,To cross-fertilize or crossbreed.,To stamp or mark (a cheque) in such a way as to prevent it being cashed, thus requiring it to be deposited into a bank account.', '', '', 'verb', '[{\"text\":\"crosses\",\"type\":\"present singular third-person\"},{\"text\":\"crossing\",\"type\":\"participle present\"},{\"text\":\"crossed\",\"type\":\"participle past\"},{\"text\":\"crossed\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"cross\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1373, 'inside', 'The interior or inner part.,The left-hand side of a road if one drives on the left, or right-hand side if one drives on the right.,The side of a curved road, racetrack etc. that has the shorter arc length; the side of a racetrack nearer the interior of the course or some other point of reference.,(in the plural) The interior organs of the body, especially the guts.,A passenger within a coach or carriage, as distinguished from one upon the outside.,The inside scoop; information known only to certain involved people.', '', '', 'noun', '[{\"text\":\"insides\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1374, 'inside', 'Of or pertaining to the inner surface, limit or boundary.,Nearer to the interior or centre of something.,Originating from, arranged by, or being someone inside an organisation.,Legally married to or related to (e.g. born in wedlock to), and/or residing with, a specified other person (parent, child, or partner); (of a marriage, relationship, etc) existing between two such people.,Toward the batter as it crosses home plate.,At or towards or the left-hand side of the road if one drives on the left, or right-hand side if one drives on the right.', '', 'outside', 'adj', '[{\"text\":\"more inside\",\"type\":\"comparative\"},{\"text\":\"most inside\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1375, 'inside', 'Within or towards the interior of something; within the scope or limits of something (a place), especially a building.,In or to prison.,Indoors.,Intimately, secretly; without expressing what one is feeling or thinking.', '', '', 'adv', '[{\"text\":\"more inside\",\"type\":\"comparative\"},{\"text\":\"most inside\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1376, 'inside', 'Within the interior of something, closest to the center or to a specific point of reference.,Within a period of time.', '', '', 'prep', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1377, 'casino', 'A public building or room for gambling.,A small house; a pleasure house or holiday home, especially in Italy.,A card game for two to four players.', '', '', 'noun', '[{\"text\":\"casinos\",\"type\":\"plural\"},{\"text\":\"casinoes\",\"type\":\"plural\"},{\"text\":\"casini\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1378, 'volume', 'A three-dimensional measure of space that comprises a length, a width and a height. It is measured in units of cubic centimeters in metric, cubic inches or cubic feet in English measurement.,Strength of sound; loudness.,The issues of a periodical over a period of one year.,A bound book.,A single book of a publication issued in multi-book format, such as an encyclopedia.,A great amount (of meaning) about something.,A roll or scroll, which was the form of ancient books.,Quantity.,A rounded mass or convolution.,The total supply of money in circulation or, less frequently, total amount of credit extended, within a specified national market or worldwide.,An accessible storage area with a single file system, typically resident on a single partition of a hard disk.,The total of weight worked by a muscle in one training session, the weight of every single repetition summed up.', '', '', 'noun', '[{\"text\":\"volumes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1379, 'volume', 'To be conveyed through the air, waft.,To cause to move through the air, waft.,To swell.', '', '', 'verb', '[{\"text\":\"volumes\",\"type\":\"present singular third-person\"},{\"text\":\"voluming\",\"type\":\"participle present\"},{\"text\":\"volumed\",\"type\":\"participle past\"},{\"text\":\"volumed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1380, 'silver', 'A lustrous, white, metallic element, atomic number 47, atomic weight 107.87, symbol Ag.,Coins made from silver or any similar white metal.,Cutlery and other eating utensils, whether silver or made from some other white metal.,Any items made from silver or any other white metal.,A shiny gray color.,a silver medal,Anything resembling silver; something shiny and white.', 'argyr-,argyr-,silverware', '', 'noun', '[{\"text\":\"silvers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1381, 'silver', 'Made from silver.,Made from another white metal.,Having a color like silver: a shiny gray.,Denoting the twenty-fifth anniversary, especially of a wedding.,Premium, but inferior to gold.,Having the clear, musical tone of silver; soft and clear in sound.', 'silvern,silvery', '', 'adj', '[{\"text\":\"more silver\",\"type\":\"comparative\"},{\"text\":\"most silver\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1382, 'silver', 'To acquire a silvery colour.,To cover with silver, or with a silvery metal.,To polish like silver; to impart a brightness to, like that of silver.,To make hoary, or white, like silver.', '', '', 'verb', '[{\"text\":\"silvers\",\"type\":\"present singular third-person\"},{\"text\":\"silvering\",\"type\":\"participle present\"},{\"text\":\"silvered\",\"type\":\"participle past\"},{\"text\":\"silvered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1383, 'solution', 'A homogeneous mixture, which may be liquid, gas or solid, formed by dissolving one or more substances.,An act, plan or other means, used or proposed, to solve a problem.,An answer to a problem.,A product, service or suite thereof, especially software.,Satisfaction of a claim or debt.,The act of dissolving, especially of a solid by a fluid; dissolution.,The crisis of a disease.', '', '', 'noun', '[{\"text\":\"solutions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1384, 'solution', 'To treat with a solution.', '', '', 'verb', '[{\"text\":\"solutions\",\"type\":\"present singular third-person\"},{\"text\":\"solutioning\",\"type\":\"participle present\"},{\"text\":\"solutioned\",\"type\":\"participle past\"},{\"text\":\"solutioned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1385, 'mortgage', 'A special form of secured loan where the purpose of the loan must be specified to the lender, to purchase assets that must be fixed (not movable) property, such as a house or piece of farm land. The assets are registered as the legal property of the borrower but the lender can seize them and dispose of them if they are not satisfied with the manner in which the repayment of the loan is conducted by the borrower. Once the loan is fully repaid, the lender loses this right of seizure and the assets are then deemed to be unencumbered.,State of being pledged.', '', '', 'noun', '[{\"text\":\"mortgages\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1386, 'mortgage', 'To borrow against a property, to obtain a loan for another purpose by giving away the right of seizure to the lender over a fixed property such as a house or piece of land; to pledge a property in order to get a loan.,To pledge and make liable; to make subject to obligation; to achieve an immediate result by paying for it in the long term.', '', '', 'verb', '[{\"text\":\"mortgages\",\"type\":\"present singular third-person\"},{\"text\":\"mortgaging\",\"type\":\"participle present\"},{\"text\":\"mortgaged\",\"type\":\"participle past\"},{\"text\":\"mortgaged\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
