(1388, 'asked', 'simple past tense and past participle of ask', '', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1389, 'needed', 'Necessary; being required.', '', 'unneeded', 'adj', '[{\"text\":\"more needed\",\"type\":\"comparative\"},{\"text\":\"most needed\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
