(1534, 'spring', 'An act of springing: a leap, a jump.,The period from the moment of vernal equinox (around March 21 in the Northern Hemisphere) to the moment of the summer solstice (around June 21); the equivalent periods reckoned in other cultures and calendars.,The three months of March, April, and May in the Northern Hemisphere and September, October, and November in the Southern Hemisphere.,The season of the year in temperate regions in which plants spring from the ground and into bloom and dormant animals spring to life.,The time of something\'s growth; the early stages of some process.,a period of political liberalization and democratization,Someone with ivory or peach skin tone and eyes and hair that are not extremely dark, seen as best suited to certain colors of clothing.,A spray or body of water springing from the ground.,The rising of the sea at high tide.,Short for spring tide, the especially high tide shortly after full and new moons.,A mechanical device made of flexible or coiled material that exerts force and attempts to spring back when bent, compressed, or stretched.,A line from a vessel\'s end or side to its anchor cable used to diminish or control its movement.,A line laid out from a vessel\'s end to the opposite end of an adjacent vessel or mooring to diminish or control its movement.,A race, a lineage.,A youth.,A shoot, a young tree.,A grove of trees; a forest.,An erection of the penis.,A crack which has sprung up in a mast, spar, or (rare) a plank or seam.,Elasticity: the property of a body springing back to its original form after compression, stretching, etc.,Elastic energy, power, or force.,The source from which an action or supply of something springs.,A cause, a motive, etc.,A lively piece of music.', 'springtime,springtime,springtime,fount,source,coil,bounce,bounciness,elasticity,resilience,springiness,impetus,impulse', 'neap tide', 'noun', '[{\"text\":\"springs\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
