(1590, 'approach', 'To come or go near, in place or time; to move toward; to advance nearer; to draw nigh.,To play an approach shot.,Used intransitively, followed by to: to draw near (to someone or something); to make advances; to approximate or become almost equal.,Of an immovable object or a number of such objects: to be positioned as to (notionally) appear to be moving towards (a place).,To move toward (someone or something) in place, time, character, or value; to draw nearer to.,To bring (something) near something else; to cause (something) to draw near.,To attempt to make (a policy) or solve (a problem).,To bring up or propose to (someone) an idea, question, request, etc.,To have sexual intercourse with (someone).,To take approaches to (a place); to move towards (a place) by using covered roads, trenches, or other works.', 'copulate', '', 'verb', '[{\"text\":\"approaches\",\"type\":\"present singular third-person\"},{\"text\":\"approaching\",\"type\":\"participle present\"},{\"text\":\"approached\",\"type\":\"participle past\"},{\"text\":\"approached\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"approach\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1591, 'approach', 'An act of drawing near in place or time; an advancing or coming near.,An act of coming near in character or value; an approximation.,An avenue, passage, or way by which a building or place can be approached; an access.,A path taken to reach the climbing area, for example, from a car park, road, etc.,A manner of making (a policy) or solving (a problem, etc.).,An opportunity of drawing near; access.,The way an aircraft comes in to land at an airport.,A specific procedure used for approaching and landing at an airport.,The area before the lane in which a bowler may stand or run up before bowling the ball.,Short for approach shot.', '', '', 'noun', '[{\"text\":\"approaches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1592, 'cameras', 'plural of camera', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1593, 'focus', 'A point at which reflected or refracted rays of light converge.,A point of a conic at which rays reflected from a curve or surface converge.,The fact of the convergence of light on the photographic medium.,The quality of the convergence of light on the photographic medium.,Concentration of attention.,The exact point of where an earthquake occurs, in three dimensions (underneath the epicentre).,The status of being the currently active element in a user interface, often indicated by a visual highlight.,The most important word or phrase in a sentence or passage, or the one that imparts information.,An object used in casting a magic spell.', '', '', 'noun', '[{\"text\":\"foci\",\"type\":\"plural\"},{\"text\":\"focuses\",\"type\":\"plural\"},{\"text\":\"focusses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1594, 'focus', 'To concentrate during a task.,To direct attention, effort, or energy to a particular audience or task.,To cause (rays of light, etc) to converge at a single point.,To adjust (a lens, an optical instrument) in order to position an image with respect to the focal plane.,To concentrate one’s attention.,To transfer the input focus to (a visual element), so that it receives subsequent input.,To aggregate figures of accounts.', '', '', 'verb', '[{\"text\":\"focuses\",\"type\":\"present singular third-person\"},{\"text\":\"focusses\",\"type\":\"present singular third-person\"},{\"text\":\"focusing\",\"type\":\"participle present\"},{\"text\":\"focussing\",\"type\":\"participle present\"},{\"text\":\"focused\",\"type\":\"participle past\"},{\"text\":\"focused\",\"type\":\"past\"},{\"text\":\"focussed\",\"type\":\"participle past\"},{\"text\":\"focussed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1595, 'female', 'Belonging to the sex which typically produces eggs (ova), or to the gender which is typically associated with it.,Characteristic of this sex/gender. (Compare feminine, womanly.),Tending to lead to or regulate the development of sexual characteristics typical of this sex.,Feminine; of the feminine grammatical gender.,Lacking the F factor, and able to receive DNA from another bacterium which does have this factor (a male).,Having an internal socket, as in a connector or pipe fitting.', 'socket', '', 'adj', '[{\"text\":\"femaler\",\"type\":\"comparative\"},{\"text\":\"more female\",\"type\":\"comparative\"},{\"text\":\"femalest\",\"type\":\"superlative\"},{\"text\":\"most female\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1596, 'female', 'A human of the feminine sex.,An animal of the sex that produces eggs.,A plant which produces only that kind of reproductive organ capable of developing into fruit after impregnation or fertilization; a pistillate plant.,A bacterium which lacks the F factor, and is able to receive DNA from another bacterium which has that factor.,A female connector, pipe fitting, etc.', 'female', '', 'noun', '[{\"text\":\"females\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
