(1598, 'answer', 'A response or reply; something said or done in reaction to a statement or question.,A solution to a problem.,A document filed in response to a complaint, responding to each point raised in the complaint and raising counterpoints.', '', '', 'noun', '[{\"text\":\"answers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1599, 'answer', 'To make a reply or response to.,To speak in defence against; to reply to in defence.,To respond to a call by someone at a door or telephone, or other similar piece of equipment.,To suit a need or purpose satisfactorily.,To be accountable or responsible; to make amends.,To file a document in response to a complaint.,To correspond to; to be in harmony with; to be in agreement with.,To be opposite, or to act in opposition.,To be or act in conformity, or by way of accommodation, correspondence, relation, or proportion; to conform; to correspond; to suit; usually with to.,To respond to satisfactorily; to meet successfully by way of explanation, argument, or justification; to refute.,To be or act in compliance with, in fulfillment or satisfaction of, as an order, obligation, or demand.,To render account to or for.,To atone for; to be punished for.,To be or act as an equivalent to, or as adequate or sufficient for; to serve for; to repay.', 'answer for', '', 'verb', '[{\"text\":\"answers\",\"type\":\"present singular third-person\"},{\"text\":\"answering\",\"type\":\"participle present\"},{\"text\":\"answered\",\"type\":\"participle past\"},{\"text\":\"answered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
