(1602, 'almost', 'Something or someone that doesn\'t quite make it.', '', '', 'noun', '[{\"text\":\"almosts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1603, 'happy', 'Having a feeling arising from a consciousness of well-being or of enjoyment; enjoying good of any kind, such as comfort, peace, or tranquillity; blissful, contented, joyous.,Experiencing the effect of favourable fortune; favored by fortune or luck; fortunate, lucky, propitious.,Content, willing, satisfied (with or to do something); having no objection (to something).,Appropriate, apt, felicitous.,Favoring or inclined to use.,Dexterous, ready, skilful.,Implying \'May you have a happy ~\' or similar; used in phrases to wish someone happiness or good fortune at the time of a festival, celebration, or other event or activity.', 'cheerful,content,delighted,elated,exultant,glad,joyful,jubilant,merry,orgasmic,berserk,blissed out,blissful [⇒ thesaurus],bright,cheerful,cheerly,cheery,chuffed,cock-a-hoop,content,contented,convivial,delighted,ebullient,ecstatic,elated,euphoric,excited,exhilarated,exuberant,exultant,gassed,gay [⇒ thesaurus],glad,gleeful,gleesome,high on life,jovial,joyful,merry,merry as a cricket,merry as a grig,on cloud nine,overjoyed,overjoyous,over the moon,pacific,perky,placated,pleased,satisfied,thrilled,tickled pink,triumphant,vivacious,wealful,happy as a clam,happy as a clam at high water,happy as a lark,happy as a pig in mud,happy as a pig in shit,happy as a prince,happy as Larry,happy as the day is long,fortunate,lucky,propitious', '', 'adj', '[{\"text\":\"happier\",\"type\":\"comparative\"},{\"text\":\"more happy\",\"type\":\"comparative\"},{\"text\":\"happiest\",\"type\":\"superlative\"},{\"text\":\"most happy\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1604, 'happy', 'A happy event, thing, person, etc.', '', '', 'noun', '[{\"text\":\"happies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1605, 'happy', 'Often followed by up: to become happy; to brighten up, to cheer up.,Often followed by up: to make happy; to brighten, to cheer, to enliven.', 'happify', '', 'verb', '[{\"text\":\"happies\",\"type\":\"present singular third-person\"},{\"text\":\"happying\",\"type\":\"participle present\"},{\"text\":\"happied\",\"type\":\"participle past\"},{\"text\":\"happied\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1606, 'friendly', 'Generally warm, approachable and easy to relate with in character.,Inviting, characteristic of friendliness.,Having an easy or accepting relationship with something.,Compatible with, or not damaging to (the compounded noun).,Without any hostility.,Promoting the good of any person; favourable; propitious.,Of or pertaining to friendlies (friendly noun sense 2, below). Also applied to other bipolar confrontations, such as team sports.,Being or relating to two or more natural numbers with a common abundancy.', 'affectionate [⇒ thesaurus],amiable,amicable,chummy,companionable,congenial,cordial,facile,familiar [⇒ thesaurus],genial,hospitable,matey,personable,simpatico,welcoming', '', 'adj', '[{\"text\":\"friendlier\",\"type\":\"comparative\"},{\"text\":\"more friendly\",\"type\":\"comparative\"},{\"text\":\"friendliest\",\"type\":\"superlative\"},{\"text\":\"most friendly\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1607, 'friendly', 'A game which is of no consequence in terms of ranking, betting etc.,A person or entity on the same side in a conflict.', '', '', 'noun', '[{\"text\":\"friendlies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1608, 'friendly', 'In a friendly manner, like a friend.', 'amicably,friendlily', '', 'adv', '[{\"text\":\"more friendly\",\"type\":\"comparative\"},{\"text\":\"most friendly\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
