(1612, 'contract', 'An agreement between two or more parties, to perform a specific job or work order, often temporary or of fixed duration and usually governed by a written agreement.,An agreement which the law will enforce in some way. A legally binding contract must contain at least one promise, i.e., a commitment or offer, by an offeror to and accepted by an offeree to do something in the future. A contract is thus executory rather than executed.,The document containing such an agreement.,A part of legal studies dealing with laws and jurisdiction related to contracts.,An order, usually given to a hired assassin, to kill someone.,The declarer\'s undertaking to win the number of tricks bid with a stated suit as trump.', 'compact,pact,contract law', '', 'noun', '[{\"text\":\"contracts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1613, 'contract', 'Contracted; affianced; betrothed.,Not abstract; concrete.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1614, 'contract', 'To draw together or nearer; to shorten, narrow, or lessen.,To shorten by omitting a letter or letters or by reducing two or more vowels or syllables to one.,To enter into a contract with.,To enter into, with mutual obligations; to make a bargain or covenant for.,To make an agreement or contract; to covenant; to agree; to bargain.,To bring on; to incur; to acquire.,To gain or acquire (an illness).,To draw together so as to wrinkle; to knit.,To betroth; to affiance.', 'abate,decrease,lessen,reduce,shorten,shrink,catch,get', '', 'verb', '[{\"text\":\"contracts\",\"type\":\"present singular third-person\"},{\"text\":\"contracting\",\"type\":\"participle present\"},{\"text\":\"contracted\",\"type\":\"participle past\"},{\"text\":\"contracted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1615, 'foreign', 'Located outside a country or place, especially one\'s own.,Originating from, characteristic of, belonging to, or being a citizen of a country or place other than the one under discussion.,Relating to a different nation.,Not characteristic of or naturally taken in by an organism or system.,Alien; strange.,Held at a distance; excluded; exiled.,From a different one of the states of the United States, as of a state of residence or incorporation.,Belonging to a different organization, company etc.,Outside, outdoors, outdoor.', 'extraneous,alien,fremd,acquired,additional [⇒ thesaurus],adventitious,alien,ascititious,extraneous,fremd,intrusive,outlandish,supplemental', '', 'adj', '[{\"text\":\"more foreign\",\"type\":\"comparative\"},{\"text\":\"most foreign\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1616, 'foreign', 'A foreigner: a person from another country.,An outsider: a person from another place or group.,A non-guildmember.,A foreign ship.,A foreign whip, a car produced abroad.,Clipping of chamber foreign: an outhouse.,An area of a community that lies outside the legal town or parish limits.,An area of a monastery outside its legal limits or serving as an outer court.,Short for various phrases, including foreign language, foreign parts, and foreign service.', 'chamber foreign', '', 'noun', '[{\"text\":\"foreigns\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1617, 'featured', 'displayed with special treatment,Having features of a particular kind.', '', '', 'adj', '[{\"text\":\"more featured\",\"type\":\"comparative\"},{\"text\":\"most featured\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
