(1619, 'medicine', 'A substance which specifically promotes healing when ingested or consumed in some way; a pharmaceutical drug.,Any treatment or cure.,The study of the cause, diagnosis, prognosis and treatment of disease or illness.,The profession and practice of physicians, including surgeons.,The profession and practice of nonsurgical physicians as sometimes distinguished from that of surgeons.,Ritual magic used, as by a medicine man, to promote a desired outcome in healing, hunting, or warfare; traditional medicine.,Among the Native Americans, any object supposed to give control over natural or magical forces, to act as a protective charm, or to cause healing.,Black magic, superstition.,A philter or love potion.,A physician.,Recreational drugs, especially alcoholic drinks.', 'medication,drug,prescription,pharmaceutical,elixir,regimen,course,program,prescription', '', 'noun', '[{\"text\":\"medicines\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
