(1621, 'cause', 'The source of, or reason for, an event or action; that which produces or effects a result.,Sufficient reason for a state, as of emotion.,A goal, aim or principle, especially one which transcends purely selfish ends.,Sake; interest; advantage.,Any subject of discussion or debate; a matter; an affair.,A suit or action in court; any legal process by which a party endeavors to obtain his claim, or what he regards as his right; case; ground of action.', 'cause,basis,genesis,germ,origin,principle,reason,root,source,grounds,justification,goal', '', 'noun', '[{\"text\":\"causes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1622, 'cause', 'To set off an event or action.,To actively produce as a result, by means of force or authority.,To assign or show cause; to give a reason; to make excuse.', '', '', 'verb', '[{\"text\":\"causes\",\"type\":\"present singular third-person\"},{\"text\":\"causing\",\"type\":\"participle present\"},{\"text\":\"caused\",\"type\":\"participle past\"},{\"text\":\"caused\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1623, 'cause', 'Alternative form of \'cause; because', '', '', 'conj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1624, 'police', 'A department of local (usually municipal) government responsible for general law enforcement.,A branch of the Home Office responsible for general law enforcement within a specific territory.,Any of the formally enacted law enforcement agencies at various levels of government.,A public agency charged with enforcing laws and maintaining public order, usually being granted special privileges to do so, particularly,The staff of such a department or agency, particularly its officers; (regional, chiefly US, Caribbean, Jamaica, Scotland, countable) an individual police officer.,People who try to enforce norms or standards as if granted authority similar to the police.,Cleanup of a military facility, as a formal duty.,Synonym of administration, the regulation of a community or society.,Alternative form of policy.,Alternative form of polity, civilization, a regulated community.', 'administration', '', 'noun', '[{\"text\":\"police\",\"type\":\"singular\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1625, 'police', 'To enforce the law and keep order among (a group).,To clean up an area.,To enforce norms or standards upon.', '', '', 'verb', '[{\"text\":\"polices\",\"type\":\"present singular third-person\"},{\"text\":\"policing\",\"type\":\"participle present\"},{\"text\":\"policed\",\"type\":\"participle past\"},{\"text\":\"policed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1626, 'channel', 'The physical confine of a river or slough, consisting of a bed and banks.,The natural or man-made deeper course through a reef, bar, bay, or any shallow body of water.,A channel was dredged to allow ocean-going vessels to reach the city.,The navigable part of a river.,A narrow body of water between two land masses.,Something through which another thing passes; a means of conveying or transmitting.,A gutter; a groove, as in a fluted column.,A structural member with a cross section shaped like a squared-off letter C.,A connection between initiating and terminating nodes of a circuit.,The narrow conducting portion of a MOSFET transistor.,The part that connects a data source to a data sink.,A path for conveying electrical or electromagnetic signals, usually distinguished from other parallel paths.,A single path provided by a transmission medium via physical separation, such as by multipair cable.,A single path provided by a transmission medium via spectral or protocol separation, such as by frequency or time-division multiplexing.,A specific radio frequency or band of frequencies, usually in conjunction with a predetermined letter, number, or codeword, and allocated by international agreement.,A specific radio frequency or band of frequencies used for transmitting television.,The portion of a storage medium, such as a track or a band, that is accessible to a given reading or writing station or head.,The part of a turbine pump where the pressure is built up.,A distribution channel,A particular area for conversations on an IRC network, analogous to a chat room and often dedicated to a specific topic.,A means of delivering up-to-date Internet content.,A psychic or medium who temporarily takes on the personality of somebody else.', 'passage,groove,C-channel,side', '', 'noun', '[{\"text\":\"channels\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1627, 'channel', 'To make or cut a channel or groove in.,To direct or guide along a desired course.,To serve as a medium for.,To follow as a model, especially in a performance.', '', '', 'verb', '[{\"text\":\"channels\",\"type\":\"present singular third-person\"},{\"text\":\"channeling\",\"type\":\"participle present\"},{\"text\":\"channelling\",\"type\":\"participle present\"},{\"text\":\"channelled\",\"type\":\"participle past\"},{\"text\":\"channelled\",\"type\":\"past\"},{\"text\":\"channeled\",\"type\":\"participle past\"},{\"text\":\"channeled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1628, 'channel', 'The wale of a sailing ship which projects beyond the gunwale and to which the shrouds attach via the chains. One of the flat ledges of heavy plank bolted edgewise to the outside of a vessel, to increase the spread of the shrouds and carry them clear of the bulwarks.', '', '', 'noun', '[{\"text\":\"channels\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1629, 'purpose', 'The end for which something is done, is made or exists.,Function, role.,meaning for existing or doing something.,Resolution; determination.,The subject of discourse; the point at issue.', 'end,aim,aim,meaning,determination,intention,resolution,matter,subject,topic', '', 'noun', '[{\"text\":\"purposes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1630, 'purpose', 'To have or set as one\'s purpose or aim; resolve to accomplish; intend; plan.,To have (an) intention, purpose, or design; to intend; to mean.,To discourse.', 'aim,intend,mean,plan,set out,intend', '', 'verb', '[{\"text\":\"purposes\",\"type\":\"present singular third-person\"},{\"text\":\"purposing\",\"type\":\"participle present\"},{\"text\":\"purposed\",\"type\":\"participle past\"},{\"text\":\"purposed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1631, 'multiple', 'More than one (followed by plural).,Having more than one element, part, component, or function, having more than one instance, occurring more than once, usually contrary to expectations (can be followed by a singular).', 'manifold', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1632, 'multiple', 'A whole number that can be divided by another number with no remainder.,Price-earnings ratio.,One of a set of the same thing; a duplicate.,A single individual who has multiple personalities.,One of a set of siblings produced by a multiple birth.,A chain store.,A discovery resulting from the work of many people throughout history, not merely the work of the person who makes the final connection.,More than one piercing in a single ear.', '', '', 'noun', '[{\"text\":\"multiples\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
