(1635, 'primary', 'first or earliest in a group or series.,main; principal; chief; placed ahead of others.,Earliest formed; fundamental.,Illustrating, possessing, or characterized by, some quality or property in the first degree; having undergone the first stage of substitution or replacement.,Relating to the place where a disorder or disease started to occur.,Relating to day-to-day care provided by health professionals such as nurses, general practitioners, dentists etc.', '', '', 'adj', '[{\"text\":\"more primary\",\"type\":\"comparative\"},{\"text\":\"most primary\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1636, 'primary', 'A primary election; a preliminary election to select a political candidate of a political party.,The first year of grade school.,A base or fundamental component; something that is irreducible.,The most massive component of a gravitationally bound system, such as a planet in relation to its satellites.,A primary school.,Any flight feather attached to the manus (hand) of a bird.,A primary colour.,The first stage of a thermonuclear weapon, which sets off a fission explosion to help trigger a fusion reaction in the weapon\'s secondary stage.,A radar return from an aircraft (or other object) produced solely by the reflection of the radar beam from the aircraft\'s skin, without additional information from the aircraft\'s transponder.,Primary site of disease; original location or source of the disease.,A directly driven inductive coil, as in a transformer or induction motor that is magnetically coupled to a secondary', '', '', 'noun', '[{\"text\":\"primaries\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1637, 'primary', 'To challenge (an incumbent sitting politician) for their political party\'s nomination to run for re-election, through running a challenger campaign in a primary election, especially one that is more ideologically extreme.,To take part in a primary election.', '', '', 'verb', '[{\"text\":\"primaries\",\"type\":\"present singular third-person\"},{\"text\":\"primarying\",\"type\":\"participle present\"},{\"text\":\"primaried\",\"type\":\"participle past\"},{\"text\":\"primaried\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1638, 'smith', 'A craftsperson who works metal into desired forms using a hammer and other tools, sometimes heating the metal to make it more workable, especially a blacksmith.,One who makes anything; wright.,An artist.', '', '', 'noun', '[{\"text\":\"smiths\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1639, 'smith', 'To forge, to form, usually on an anvil; by heating and pounding.', '', '', 'verb', '[{\"text\":\"smiths\",\"type\":\"present singular third-person\"},{\"text\":\"smithing\",\"type\":\"participle present\"},{\"text\":\"smithed\",\"type\":\"participle past\"},{\"text\":\"smithed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1640, 'unique', 'Being the only one of its kind; unequaled, unparalleled or unmatched.,Of a feature, such that only one holder has it.,Particular, characteristic.,Of a rare quality, unusual.', 'one of a kind,sui generis,singular,alone,azygous,incomparable,matchless,nonpareil,peerless,singular,sui generis,unequaled,unparalleled,unmatched,unrivalled', '', 'adj', '[{\"text\":\"uniquer\",\"type\":\"comparative\"},{\"text\":\"more unique\",\"type\":\"comparative\"},{\"text\":\"uniquest\",\"type\":\"superlative\"},{\"text\":\"most unique\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
