(1707, 'impact', 'The striking of one body against another; collision.,The force or energy of a collision of two objects.,A forced impinging.,A significant or strong influence or effect.', '', '', 'noun', '[{\"text\":\"impacts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1708, 'impact', 'To collide or strike, the act of impinging.,To compress; to compact; to press into something or pack together.,To significantly or strongly influence or affect; to have an impact on.,To stamp or impress onto something.', '', '', 'verb', '[{\"text\":\"impacts\",\"type\":\"present singular third-person\"},{\"text\":\"impacting\",\"type\":\"participle present\"},{\"text\":\"impacted\",\"type\":\"participle past\"},{\"text\":\"impacted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1709, 'kitchen', 'A room or area for preparing food.,Cuisine; style of cooking.,The nape of a person\'s hairline, often referring to its uncombed or \"nappy\" look.,The percussion section of an orchestra.,A utensil for roasting meat.,A domesticated or uneducated form of a language.,A public gaming room in a casino.,Anything eaten as a relish with bread, potatoes, etc.; a condiment.', '', '', 'noun', '[{\"text\":\"kitchens\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1710, 'kitchen', 'To do kitchen work; to prepare food.,To embellish a basic food; to season, add condiments, etc.,To embellish; to dress up.', '', '', 'verb', '[{\"text\":\"kitchens\",\"type\":\"present singular third-person\"},{\"text\":\"kitchening\",\"type\":\"participle present\"},{\"text\":\"kitchened\",\"type\":\"participle past\"},{\"text\":\"kitchened\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1711, 'transfer', 'To move or pass from one place, person or thing to another.,To convey the impression of (something) from one surface to another.,To exit one mass transit vehicle and board another (typically one belonging to a different line or mode of transportation) to continue a journey.,To be or become transferred.,To arrange for something to belong to or be officially controlled by somebody else.', 'carry over,move,onpass,copy,transpose,abalienate,alien,alienate,assign,change hands,consign,convey,grant', '', 'verb', '[{\"text\":\"transfers\",\"type\":\"present singular third-person\"},{\"text\":\"transferring\",\"type\":\"participle present\"},{\"text\":\"transferred\",\"type\":\"participle past\"},{\"text\":\"transferred\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1712, 'transfer', 'The act of conveying or removing something from one place, person or thing to another.,An instance of conveying or removing from one place, person or thing to another; a transferal.,An act of exiting one mass transit vehicle and boarding another (typically one belonging to a different line or mode of transportation) to continue a journey.,A paper receipt given to a rider of one bus (and historically also certain elevated or subway lines), allowing free entry onto another bus to continue a journey.,A design conveyed by contact from one surface to another; a heat transfer.,A soldier removed from one troop, or body of troops, and placed in another.,A pathological process by which a unilateral morbid condition on being abolished on one side of the body makes its appearance in the corresponding region upon the other side.,The conveying of genetic material from one cell to another.,A conventional bid which requests partner to bid the next available suit.,A person who transfers or is transferred from one club or team to another.,Short for transfer student.', 'transferal,transfer student', '', 'noun', '[{\"text\":\"transfers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
