(1716, 'ground', 'The surface of the Earth, as opposed to the sky or water or underground.,Terrain.,Soil, earth.,The bottom of a body of water.,Basis, foundation, groundwork, legwork.,Reason, (epistemic) justification, cause.,Background, context, framework, surroundings.,The area on which a battle is fought, particularly as referring to the area occupied by one side or the other. Often, according to the eventualities, \"to give ground\" or \"to gain ground\".,Advantage given or gained in any contest; e.g. in football, chess, debate or academic discourse.,The plain surface upon which the figures of an artistic composition are set.,A flat surface upon which figures are raised in relief.,The net of small meshes upon which the embroidered pattern is applied.,A gummy substance spread over the surface of a metal to be etched, to prevent the acid from eating except where an opening is made by the needle.,One of the pieces of wood, flush with the plastering, to which mouldings etc. are attached.,A soccer stadium.,An electrical conductor connected to the earth, or a large conductor whose electrical potential is taken as zero (such as a steel chassis).,The area of grass on which a match is played (a cricket field); the entire arena in which it is played; the part of the field behind a batsman\'s popping crease where he can not be run out (hence to make one\'s ground).,A composition in which the bass, consisting of a few bars of independent notes, is continually repeated to a varying melody.,The tune on which descants are raised; the plain song.,The pit of a theatre.', '', '', 'noun', '[{\"text\":\"grounds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1717, 'ground', 'To connect (an electrical conductor or device) to a ground.,To punish, especially a child or teenager, by forcing them to stay at home and/or give up certain privileges.,To forbid (an aircraft or pilot) to fly.,To give a basic education in a particular subject; to instruct in elements or first principles.,To hit a ground ball. Compare fly (verb (regular)) and line (verb).,To place something on the ground.,To run aground; to strike the bottom and remain fixed.,To found; to fix or set, as on a foundation, reason, or principle; to furnish a ground for; to fix firmly.,To cover with a ground, as a copper plate for etching, or as paper or other materials with a uniform tint as a preparation for ornament.,To improve or focus the mental or emotional state of.', 'earth,gate', '', 'verb', '[{\"text\":\"grounds\",\"type\":\"present singular third-person\"},{\"text\":\"grounding\",\"type\":\"participle present\"},{\"text\":\"grounded\",\"type\":\"participle past\"},{\"text\":\"grounded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
