(1720, 'strong', 'Capable of producing great physical force.,Capable of withstanding great physical force.,Having a lot of power.,Determined; unyielding.,Highly stimulating to the senses.,Having an offensive or intense odor or flavor.,Having a high concentration of an essential or active ingredient.,Having a high alcoholic content.,Inflecting in a different manner than the one called weak, such as Germanic verbs which change vowels.,That completely ionizes into anions and cations in a solution.,Not easily subdued or taken.,Having wealth or resources.,Impressive, good.,Having a specified number of people or units.,Severe; very bad or intense.,Having a wide range of logical consequences; widely applicable. (Often contrasted with a weak statement which it implies.),Convincing.', 'forceful,powerful,derf,durable,tough,sturdy,ardent,determined,swith,unyielding,zealous,extreme,intense,rank,concentrated,potent', '', 'adj', '[{\"text\":\"stronger\",\"type\":\"comparative\"},{\"text\":\"strongest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
