(1725, 'perfect', 'Fitting its definition precisely.,Having all of its parts in harmony with a common purpose.,Without fault or mistake; thoroughly skilled or talented.,Excellent and delightful in all respects.,Of a number: equal to the sum of its proper divisors.,Representing a completed action.,Sexually mature and fully differentiated.,Of flowers, having both male parts (stamens) and female parts (carpels).,Of a set: equal to its set of limit points, i.e. set A is perfect if A=A\'.,Describing an interval or any compound interval of a unison, octave, or fourths and fifths that are not tritones.,Made with equal parts of sweet and dry vermouth.,Well informed; certain; sure.,Innocent, guiltless.', 'accurate,flawless,faultless,infallible,expert,proficient,mature,bisexual', '', 'adj', '[{\"text\":\"perfecter\",\"type\":\"comparative\"},{\"text\":\"more perfect\",\"type\":\"comparative\"},{\"text\":\"perfectest\",\"type\":\"superlative\"},{\"text\":\"most perfect\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
