(1730, 'improve', 'To make (something) better; to increase the value or productivity (of something).,To become better.,To disprove or make void; to refute.,To disapprove of; to find fault with; to reprove; to censure.,To use or employ to good purpose; to turn to profitable account.', 'ameliorate,get better,look up', '', 'verb', '[{\"text\":\"improves\",\"type\":\"present singular third-person\"},{\"text\":\"improving\",\"type\":\"participle present\"},{\"text\":\"improved\",\"type\":\"participle past\"},{\"text\":\"improved\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1731, 'disease', 'An abnormal condition of a human, animal or plant that causes discomfort or dysfunction; distinct from injury insofar as the latter is usually instantaneously acquired.,Any abnormal or harmful condition, as of society, people\'s attitudes, way of living etc.,Lack of ease; uneasiness; trouble; vexation; disquiet.', 'affliction,ailment,coath,complaint,disorder [⇒ thesaurus],egritude,ill health,illness,indisposition,sickness,malady,morbus,rot,dis-ease', '', 'noun', '[{\"text\":\"diseases\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
