(1734, 'command', 'An order to do something.,The right or authority to order, control or dispose of; the right to be obeyed or to compel obedience.,power of control, direction or disposal; mastery.,A position of chief authority; a position involving the right or power to order or control.,The act of commanding; exercise or authority of influence.,A body or troops, or any naval or military force, under the control of a particular officer; by extension, any object or body in someone\'s charge.,Dominating situation; range or control or oversight; extent of view or outlook.,A directive to a computer program acting as an interpreter of some kind, in order to perform a specific task.,The degree of control a pitcher has over his pitches.,A command performance.', 'behest,bidding,commandment,decree,demand,dictate,diktat,directive,direction,edict,fiat,hest,injunction,instruction [⇒ thesaurus],mandate,order,precept,ruling', '', 'noun', '[{\"text\":\"commands\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1735, 'command', 'To order, give orders; to compel or direct with authority.,To have or exercise supreme power, control or authority over, especially military; to have under direction or control.,To require with authority; to demand, order, enjoin.,to dominate through ability, resources, position etc.; to overlook.,To exact, compel or secure by influence; to deserve, claim.,To hold, to control the use of.,To have a view, as from a superior position.,To direct to come; to bestow.', 'decree,order', '', 'verb', '[{\"text\":\"commands\",\"type\":\"present singular third-person\"},{\"text\":\"commanding\",\"type\":\"participle present\"},{\"text\":\"commanded\",\"type\":\"participle past\"},{\"text\":\"commanded\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"command\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1736, 'basis', 'A physical base or foundation.,A starting point, base or foundation for an argument or hypothesis.,An underlying condition or circumstance.,A regular frequency.,The difference between the cash price a dealer pays to a farmer for his produce and an agreed reference price, which is usually the futures price at which the given crop is trading at a commodity exchange.,In a vector space, a linearly independent set of vectors spanning the whole vector space.,Amount paid for an investment, including commissions and other expenses.,A collection of subsets (\"basis elements\") of a set, such that this collection covers the set, and for any two basis elements which both contain an element of the set, there is a third basis element contained in the intersection of the first two, which also contains that element.', 'base', '', 'noun', '[{\"text\":\"bases\",\"type\":\"plural\"},{\"text\":\"baseis\",\"type\":\"plural rare\"},{\"text\":\"basises\",\"type\":\"nonstandard plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1737, 'classic', 'Of or relating to the first class or rank, especially in literature or art.,Exemplary of a particular style; defining a class/category; typical.,Exhibiting timeless quality and excellence.,Characteristic of or from the past; old; retro; vintage.,Of or pertaining to the ancient Greeks and Romans, especially to Greek or Roman authors of the highest rank, or of the period when their best literature was produced; of or pertaining to places inhabited by the ancient Greeks and Romans, or rendered famous by their deeds.,Traditional; original.', '', '', 'adj', '[{\"text\":\"more classic\",\"type\":\"comparative\"},{\"text\":\"most classic\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1738, 'classic', 'A perfect and/or early example of a particular style.,An artistic work of lasting worth, such as a film or song; a work of enduring excellence.,The author of such a work.,A major, long-standing sporting event.,Any of the British Classic Races, five long-standing Group 1 horse races run during the traditional flat racing season.,One learned in the literature of Ancient Greece and Ancient Rome; a student of classical literature.', '', '', 'noun', '[{\"text\":\"classics\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
