(1779, 'quite', 'With verbs, especially past participles.,With prepositional phrases and spatial adverbs.,With predicative adjectives.,With attributive adjectives, following an (especially indefinite) article; chiefly as expressing contrast, difference etc.,Preceding nouns introduced by the indefinite article. Chiefly in negative constructions.,With adverbs of manner.,Coming before the indefinite article and an attributive adjective. (Now largely merged with moderative senses, below.),With plain adjectives, past participles, and adverbs.,Coming before the definite article and an attributive superlative.,Before a noun preceded by an indefinite article; now often with ironic implications that the noun in question is particularly noteworthy or remarkable.,Before a noun preceded by the definite article.,With prepositional or adverbial phrases.,To a moderate extent or degree; somewhat, rather.', 'very,absolutely,fully,thoroughly,totally,utterly,completely,very,absolutely,fully,thoroughly,totally,utterly,completely,very,absolutely,fully,thoroughly,totally,utterly,completely,very,absolutely,fully,thoroughly,totally,utterly,completely,very,absolutely,fully,thoroughly,totally,utterly,completely,very,absolutely,fully,thoroughly,totally,utterly,completely,moderately', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
