(1787, 'forward', 'Situated toward or at the front of something.,Situated toward or near the enemy lines.,Acting in or pertaining to the direction in which someone or something is facing.,Acting in or pertaining to the direction of travel or movement.,Moving in the desired direction of progress.,Having the usual order or sequence.,Expected or scheduled to take place in the future.,Advanced beyond the usual degree; advanced for the season; precocious.,Without customary restraint or modesty; bold, cheeky, pert, presumptuous or pushy.,Ready; prompt; ardently inclined; in a bad sense, eager or hasty.', 'forecast,predicted,bold,fresh,impertinent,brazen', '', 'adj', '[{\"text\":\"more forward\",\"type\":\"comparative\"},{\"text\":\"most forward\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1788, 'forward', 'At, near or towards the front of something.,At, near, or towards the bow of a vessel (with the frame of reference within the vessel).,In the direction in which someone or something is facing.,In the desired or usual direction of movement or progress, physically or figuratively; onwards.,So that front and back are in the usual orientation.,In the usual order or sequence.,Into the future.,To an earlier point in time. See also bring forward.', 'ahead,forth,on,onward,onwards,forth,forwards,hereon,on,onward,onwards', '', 'adv', '[{\"text\":\"further forward\",\"type\":\"comparative\"},{\"text\":\"furthest forward\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
