(1790, 'forward', 'One of the eight players (comprising two props, one hooker, two locks, two flankers and one number eight, collectively known as the pack) whose primary task is to gain and maintain possession of the ball (compare back).,A player on a team in football (soccer) in the row nearest to the opposing team\'s goal, who are therefore principally responsible for scoring goals.,An umbrella term for a centre or winger in ice hockey.,The small forward or power forward position; two frontcourt positions that are taller than guards but shorter than centers.,The front part of a vessel.,An e-mail message that is forwarded to another recipient or recipients; an electronic chain letter.,A direct agreement between two parties to buy or sell an asset at a specific point in the future; distinguished from a futures contract in that the latter is standardized and traded on an exchange.,Misspelling of foreword (“preface or introduction”)..', 'attacker,centre forward,striker,forward contract', '', 'noun', '[{\"text\":\"forwards\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
