(1796, 'horse', 'Any member of the species Equus ferus, including the Przewalski\'s horse and the extinct Equus ferus ferus.,Any current or extinct animal of the family Equidae, including zebras and asses.,Cavalry soldiers (sometimes capitalized when referring to an official category).,A component of certain games.,A component of certain games.,A large and sturdy person.,A timber frame shaped like a horse, which soldiers were made to ride for punishment.,A hoofed mammal, Equus ferus caballus, often used throughout history for riding and draft work.,In gymnastics, a piece of equipment with a body on two or four legs, approximately four feet high, sometimes (pommel horse) with two handles on top.,A frame with legs, used to support something.,A rope stretching along a yard, upon which men stand when reefing or furling the sails; footrope.,A breastband for a leadsman.,An iron bar for a sheet traveller to slide upon.,A jackstay.,A mass of earthy matter, or rock of the same character as the wall rock, occurring in the course of a vein, as of coal or ore; hence, to take horse (said of a vein) is to divide into branches for a distance.,The sedative, antidepressant, and anxiolytic drug morphine, chiefly when used illicitly.,An informal variant of basketball in which players match shots made by their opponent(s), each miss adding a letter to the word \"horse\", with 5 misses spelling the whole word and eliminating a player, until only the winner is left. Also HORSE, H-O-R-S-E or H.O.R.S.E. (see H-O-R-S-E on Wikipedia.Wikipedia).,The flesh of a horse as an item of cuisine.,A prison guard who smuggles contraband in or out for prisoners.,A translation or other illegitimate aid in study or examination.,Horseplay; tomfoolery.', 'caple,cheval,equine,horsy,keffel,prad,widge,caple,knight,Morgan\'s mule,Spanish donkey,dobbin,pony,trot', '', 'noun', '[{\"text\":\"horses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1797, 'horse', 'To frolic, to act mischievously. (Usually followed by \"around\".),To play mischievous pranks on.,To provide with a horse; supply horses for.,To get on horseback.,To sit astride of; to bestride.,To copulate with (a mare).,To take or carry on the back.,To place (someone) on the back of another person, or on a wooden horse, chair, etc., to be flogged or punished.,To flog.,To pull, haul, or move (something) with great effort, like a horse would.,To cram (food) quickly, indiscriminately or in great volume.,To urge at work tyrannically.,To charge for work before it is finished.', '', '', 'verb', '[{\"text\":\"horses\",\"type\":\"present singular third-person\"},{\"text\":\"horsing\",\"type\":\"participle present\"},{\"text\":\"horsed\",\"type\":\"participle past\"},{\"text\":\"horsed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
