(1816, 'mother', 'A (human) female who has given birth to a baby; this person in relation to their child or children.,A human female who parents an adopted or fostered child.,A human female who donates a fertilized egg or donates a body cell which has resulted in a clone.,A pregnant female, possibly as a shortened form of mother-to-be.,A female parent of an animal.,A female ancestor.,A source or origin.,Something that is the greatest or most significant of its kind. (See mother of all.),A title of respect for one\'s mother-in-law.,A term of address for one\'s wife.,Any elderly woman, especially within a particular community.,Any person or entity which performs mothering.,Dregs, lees; a stringy, mucilaginous or film- or membrane-like substance (consisting of acetobacters) which develops in fermenting alcoholic liquids (such as wine, or cider), and turns the alcohol into acetic acid with the help of oxygen from the air.,A locomotive which provides electrical power for a slug.,The principal piece of an astrolabe, into which the others are fixed.,The female superior or head of a religious house; an abbess, etc.,Hysterical passion; hysteria; the uterus.,A disc produced from the electrotyped master, used in manufacturing phonograph records.', 'dam,mater,matriarch,Mother,Colloquial or slang synonyms:,ma,mam,mama,mamaw,mamma,mammaw,mammy,mamsie,mamsy,meemaw,memaw,mom,Mom,moms,momma,mommy,Mommy,momsy,motherling,mum,Mum,mummy,Mummy,mumsy,mutha,old lady,father,grandfather,granddaddy', '', 'noun', '[{\"text\":\"mothers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
