(1888, 'abstract', 'Derived; extracted.,Drawn away; removed from; apart from; separate.,Insufficiently factual.,Apart from practice or reality; vague; theoretical; impersonal; not applied.,As a noun, denoting a concept or intangible as opposed to an object, place, or person.,Not concrete: conceptual, ideal.,Difficult to understand; abstruse; hard to conceptualize.,Separately expressing a property or attribute of an object that is considered to be inherent to that object: attributive, ascriptive.,Pertaining comprehensively to, or representing, a class or group of objects, as opposed to any specific object; considered apart from any application to a particular object: general, generic, nonspecific; representational.,Absent-minded.,Free from representational qualities, in particular the non-representational styles of the 20ᵗʰ century.,Absolute.,Lacking a story.,Being a partial basis for subclasses rather than a complete template for objects.', 'conceptual,ideal,imaginary,incorporeal,intangible,nonempirical,theoretical,formal,conceptual,ideal,imaginary,incorporeal,intangible,nonempirical,theoretical,conceptual,theoretical,conceptual,ideal,imaginary,incorporeal,intangible,nonempirical,theoretical,conceptual,ideal,imaginary,incorporeal,intangible,nonempirical,theoretical,abstruse,attributive,ascriptive,general,generalized,generic,nonspecific,representational', 'actual,concrete,corporeal,empirical,actual,concrete,corporeal,empirical,applied,practical,actual,concrete,corporeal,empirical,actual,concrete,corporeal,empirical,discrete,specific,particular,precise', 'adj', '[{\"text\":\"more abstract\",\"type\":\"comparative\"},{\"text\":\"abstracter\",\"type\":\"comparative\"},{\"text\":\"most abstract\",\"type\":\"superlative\"},{\"text\":\"abstractest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1889, 'abstract', 'To separate; to disengage.,To remove; to take away; withdraw.,To steal; to take away; to remove without permission.,To summarize; to abridge; to epitomize.,To conceptualize an ideal subgroup by means of the generalization of an attribute, as follows: by apprehending an attribute inherent to one individual, then separating that attribute and contemplating it by itself, then conceiving of that attribute as a general quality, then despecifying that conceived quality with respect to several or many individuals, and by then ideating a group composed of those individuals perceived to possess said quality.,To extract by means of distillation.,To consider abstractly; to contemplate separately or by itself; to consider theoretically; to look at as a general quality.,To withdraw oneself; to retire.,To draw off (interest or attention).,He was wholly abstracted by other objects.,To perform the process of abstraction.,To create abstractions.,To produce an abstraction, usually by refactoring existing code. Generally used with \"out\".', 'filch,purloin,steal,abridge,epitomize,summarize', '', 'verb', '[{\"text\":\"abstracts\",\"type\":\"present singular third-person\"},{\"text\":\"abstracting\",\"type\":\"participle present\"},{\"text\":\"abstracted\",\"type\":\"participle past\"},{\"text\":\"abstracted\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"abstract\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
