(1906, 'trust', 'Confidence in or reliance on some person or quality.,Dependence upon something in the future; hope.,Confidence in the future payment for goods or services supplied; credit.,That which is committed or entrusted; something received in confidence; a charge.,That upon which confidence is reposed; ground of reliance; hope.,Trustworthiness, reliability.,The condition or obligation of one to whom anything is confided; responsible charge or office.,The confidence vested in a person who has legal ownership of a property to manage for the benefit of another.,An arrangement whereby property or money is given to be held by a third party (a trustee), on the basis that it will be managed for the benefit of, or eventually transferred to, a stated beneficiary; for example, money to be given to a child when he or she reaches adulthood.,A group of businessmen or traders organised for mutual benefit to produce and distribute specific commodities or services, and managed by a central body of trustees.,Affirmation of the access rights of a user of a computer system.', 'belief,confidence,faith', '', 'noun', '[{\"text\":\"trusts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1907, 'trust', 'To place confidence in, to rely on, to confide in.,To have faith in; to rely on for continuing support or aid.,To give credence to; to believe; to credit.,To hope confidently; to believe (usually with a phrase or infinitive clause as the object),to show confidence in a person by entrusting them with something.,To commit, as to one\'s care; to entrust.,To give credit to; to sell to upon credit, or in confidence of future payment.,To rely on (something), as though having trust (on it).,To risk; to venture confidently.,To have trust; to be credulous; to be won to confidence; to confide.,To sell or deliver anything in reliance upon a promise of payment; to give credit.', '', '', 'verb', '[{\"text\":\"trusts\",\"type\":\"present singular third-person\"},{\"text\":\"trusting\",\"type\":\"participle present\"},{\"text\":\"trusted\",\"type\":\"participle past\"},{\"text\":\"trusted\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"trust\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
