(1912, 'guest', 'A recipient of hospitality, especially someone staying by invitation at the house of another.,A patron or customer in a hotel etc.,An invited visitor or performer to an institution or to a broadcast.,A user given temporary access to a system despite not having an account of their own.,Any insect that lives in the nest of another without compulsion and usually not as a parasite.,An inquiline.', '', '', 'noun', '[{\"text\":\"guests\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
