(1915, 'filter', 'A device which separates a suspended, dissolved, or particulate matter from a fluid, solution, or other substance; any device that separates one substance from another.,Electronics or software that separates unwanted signals (for example noise) from wanted signals or that attenuates selected frequencies.,Any item, mechanism, device or procedure that acts to separate or isolate.,self-restraint in speech.,A non-empty upper set (of a partially ordered set) which is closed under binary infima (a.k.a. meets).,A translucent object placed in the light path of a camera to remove certain wavelengths (colors), or a computer program that simulates such an effect.', '', '', 'noun', '[{\"text\":\"filters\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1916, 'filter', 'To sort, sift, or isolate.,To diffuse; to cause to be less concentrated or focused.,To pass through a filter or to act as though passing through a filter.,To move slowly or gradually; to come or go a few at a time.,To ride a motorcycle between lanes on a road', 'to filter out', '', 'verb', '[{\"text\":\"filters\",\"type\":\"present singular third-person\"},{\"text\":\"filtering\",\"type\":\"participle present\"},{\"text\":\"filtered\",\"type\":\"participle past\"},{\"text\":\"filtered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1917, 'session', 'A period devoted to a particular activity, e.g. the annual or semiannual periods of a legislative body (that together comprise the legislative term) whose individual meetings are also called sessions.,A meeting of a council, court, school, or legislative body to conduct its business.,The sequence of interactions between client and server, or between user and system; the period during which a user is logged in or connected.,Any of the three scheduled two hour playing sessions, from the start of play to lunch, from lunch to tea and from tea to the close of play.,The act of sitting, or the state of being seated.,Ellipsis of jam session.,An academic term,An extended period of drinking, typically consuming beer with low alcohol content.', '', '', 'noun', '[{\"text\":\"sessions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
