(1919, 'republic', 'A state where sovereignty rests with the people or their representatives, rather than with a monarch or emperor; a country with no monarchy.,A state, which may or may not be a monarchy, in which the executive and legislative branches of government are separate.,One of the subdivisions constituting Russia. See oblast.', '', '', 'noun', '[{\"text\":\"republics\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
