(1930, 'academic', 'Belonging to the school or philosophy of Plato,Belonging to an academy or other higher institution of learning, or a scholarly society or organization.,In particular: relating to literary, classical, or artistic studies like the humanities, rather than to technical or vocational studies like engineering or welding.,Having little practical use or value, as by being overly detailed and unengaging, or by being theoretical and speculative with no practical importance.,Having a love of or aptitude for learning.,Conforming to set rules and traditions; conventional; formalistic.,Subscribing to the architectural standards of Vitruvius.,So scholarly as to be unaware of the outside world; lacking in worldliness; inexperienced in practical matters.', '', '', 'adj', '[{\"text\":\"more academic\",\"type\":\"comparative\"},{\"text\":\"most academic\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1931, 'academic', 'A follower of Plato, a Platonist.,A senior member of an academy, college, or university; a person who attends an academy; a person engaged in scholarly pursuits; one who is academic in practice.,A member of the Academy; an academician.,A student in a college.,Academic dress; academicals.,Academic studies.', '', '', 'noun', '[{\"text\":\"academics\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
