(1936, 'consider', 'To think about seriously.,To think about something seriously or carefully: to deliberate.,To think of doing.,To assign some quality to.,To look at attentively.,To take up as an example.,To debate (or dispose of) a motion.,To have regard to; to take into view or account; to pay due attention to; to respect.,To believe or opine (that).', 'bethink,reflect,ponder,ponder,think of,bethink,deem,regard,think of,deem,regard,observe,pay attention,deliberate,bethink,take into account', '', 'verb', '[{\"text\":\"considers\",\"type\":\"present singular third-person\"},{\"text\":\"considering\",\"type\":\"participle present\"},{\"text\":\"considered\",\"type\":\"participle past\"},{\"text\":\"considered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
