(1941, 'floor', 'The interior bottom or surface of a house or building; the supporting surface of a room.,Ground (surface of the Earth, as opposed to the sky or water or underground).,The lower inside surface of a hollow space.,A structure formed of beams, girders, etc, with proper covering, which divides a building horizontally into storeys/stories.,The supporting surface or platform of a structure such as a bridge.,A storey/story of a building.,In a parliament, the part of the house assigned to the members, as opposed to the viewing gallery.,Hence, the right to speak at a given time during a debate or other public event.,That part of the bottom of a vessel on each side of the keelson which is most nearly horizontal.,A horizontal, flat ore body; the rock underlying a stratified or nearly horizontal deposit.,The bottom of a pit, pothole or mine.,The largest integer less than or equal to a given number.,An event performed on a floor-like carpeted surface; floor exercise,A floor-like carpeted surface for performing gymnastic movements.,A lower limit on the interest rate payable on an otherwise variable-rate loan, used by lenders to defend against falls in interest rates. Opposite of a cap.,A dance floor.,The trading floor of a stock exchange, pit; the area in which business is conducted at a convention or exhibition.,The area of a casino where gambling occurs.,The area of an establishment where food and drink are served to customers.', 'flooring,ground,possession', '', 'noun', '[{\"text\":\"floors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1942, 'floor', 'To cover or furnish with a floor.,To strike down or lay level with the floor; to knock down.,To hang (a picture on exhibition) near the base of a wall, where it cannot easily be seen.,To push (a pedal) down to the floor, especially to accelerate.,To silence by a conclusive answer or retort.,To amaze or greatly surprise.,To finish or make an end of.,To set a lower bound.', '', 'sky', 'verb', '[{\"text\":\"floors\",\"type\":\"present singular third-person\"},{\"text\":\"flooring\",\"type\":\"participle present\"},{\"text\":\"floored\",\"type\":\"participle past\"},{\"text\":\"floored\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
