(1946, 'match', 'A competitive sporting event such as a boxing meet, a baseball game, or a cricket match.,Any contest or trial of strength or skill, or to determine superiority.,Someone with a measure of an attribute equaling or exceeding the object of comparison.,A marriage.,A candidate for matrimony; one to be gained in marriage.,Suitability.,Equivalence; a state of correspondence.,Equality of conditions in contest or competition.,A pair of items or entities with mutually suitable characteristics.,An agreement or compact.,A perforated board, block of plaster, hardened sand, etc., in which a pattern is partly embedded when a mould is made, for giving shape to the surfaces of separation between the parts of the mould.', '', '', 'noun', '[{\"text\":\"matches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1947, 'match', 'To agree; to be equal; to correspond.,To agree with; to be equal to; to correspond to.,To make a successful match or pairing.,To equal or exceed in achievement.,To unite in marriage, to mate.,To fit together, or make suitable for fitting together; specifically, to furnish with a tongue and groove at the edges.,To be an example of a rule or regex.', '', '', 'verb', '[{\"text\":\"matches\",\"type\":\"present singular third-person\"},{\"text\":\"matching\",\"type\":\"participle present\"},{\"text\":\"matched\",\"type\":\"participle past\"},{\"text\":\"matched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
