(1955, 'morning', 'The early part of the day, especially from dawn to noon.,The early part of anything.,That part of the day from dawn until the main meal (typically in late afternoon).,The first alcoholic drink of the day; a morning draught.', 'a.m.,forenoon,yeender,beforenoon,foreday,forenoon,matin,morn,morrow,prime,sparrow-fart,undertime', '', 'noun', '[{\"text\":\"mornings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
