(1957, 'century', 'A period of 100 consecutive years; often specifically a numbered period with conventional start and end dates, e.g., the twentieth century, which stretches from (strictly) 1901 through 2000, or (informally) 1900 through 1999. The first century AD was from 1 to 100.,A unit in ancient Roman army, originally of 100 army soldiers as part of a cohort, later of more varied sizes (but typically containing 60 to 70 or 80) soldiers or other men (guards, police, firemen), commanded by a centurion.,A political division of ancient Rome, meeting in the Centuriate Assembly.,A hundred things of the same kind; a hundred.,A hundred runs scored either by a single player in one innings, or by two players in a partnership.,A score of one hundred points.,A race a hundred units (as meters, kilometres, miles) in length.,A banknote in the denomination of one hundred dollars.', 'centennium,yearhundred,centenary,centuria', '', 'noun', '[{\"text\":\"centuries\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1958, 'default', 'The condition of failing to meet an obligation.,The condition of being an obligation that has not been met.,the original software programming settings as set by the factory,A loss incurred by failing to compete.,A selection made in the absence of an alternative.,A value used when none has been given; a tentative value or standard that is presumed.,The failure of a defendant to appear and answer a summons and complaint.,A failing or failure; omission of that which ought to be done; neglect to do what duty or law requires.,Lack; absence.,Fault; offence; wrong act.', '', '', 'noun', '[{\"text\":\"defaults\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
