(1964, 'outdoor', 'Situated in, designed to be used in, or carried on in the open air.,Pertaining to charity administered or received away from, or independently from, a workhouse or other institution.', 'out-of-door,outside', 'indoor,inside', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
