(1966, 'protein', 'Any of numerous large, complex naturally-produced molecules composed of one or more long chains of amino acids, in which the amino acid groups are held together by peptide bonds.,One of three major classes of food or source of food energy (4 kcal/gram) abundant in animal-derived foods (i.e. meat) and some vegetables, such as legumes.,A food rich in protein, often a meat or meat substitute.', 'protein,protein', '', 'noun', '[{\"text\":\"proteins\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1967, 'plant', 'An organism that is not an animal, especially an organism capable of photosynthesis. Typically a small or herbaceous organism of this kind, rather than a tree.,An organism of the kingdom Plantae; now specifically, a living organism of the Embryophyta (land plants) or of the Chlorophyta (green algae), a eukaryote that includes double-membraned chloroplasts in its cells containing chlorophyll a and b, or any organism closely related to such an organism.,Now specifically, a multicellular eukaryote that includes chloroplasts in its cells, which have a cell wall.,Any creature that grows on soil or similar surfaces, including plants and fungi.,A factory or other industrial or institutional building or facility.,An object placed surreptitiously in order to cause suspicion to fall upon a person.,Anyone assigned to behave as a member of the public during a covert operation (as in a police investigation).,A person, placed amongst an audience, whose role is to cause confusion, laughter etc.,A play in which the cue ball knocks one (usually red) ball onto another, in order to pot the second; a set.,Machinery, such as the kind used in earthmoving or construction.,A young tree; a sapling; hence, a stick or staff.,The sole of the foot.,A plan; a swindle; a trick.,An oyster which has been bedded, in distinction from one of natural growth.,A young oyster suitable for transplanting.,The combination of process and actuator.', '', '', 'noun', '[{\"text\":\"plants\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
