(2038, 'pressure', 'A pressing; a force applied to a surface.,A contrasting force or impulse of any kind,Distress.,Urgency,Impression; stamp; character impressed.,The amount of force that is applied over a given area divided by the size of this area; force per unit area.', 'affliction,grievance,press', '', 'noun', '[{\"text\":\"pressures\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2039, 'pressure', 'To encourage or heavily exert force or influence.', '', '', 'verb', '[{\"text\":\"pressures\",\"type\":\"present singular third-person\"},{\"text\":\"pressuring\",\"type\":\"participle present\"},{\"text\":\"pressured\",\"type\":\"participle past\"},{\"text\":\"pressured\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2040, 'youth', 'The quality or state of being young.,The part of life following childhood; the period of existence preceding maturity or age; the whole early part of life, from childhood, or, sometimes, from infancy, to adulthood.,A young person.,A young man; a male adolescent or young adult.,Young persons, collectively.', 'juvenility,youngness,youngth,youthfulness,adolescent,child,kid,lad,teen,teenager,youngster,boy,young man,adolescents,kids,teenagers,teens,young people,youngsters', 'age,dotage,old age,senility,adult,grown-up', 'noun', '[{\"text\":\"youths\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2041, 'southern', 'Of, facing, situated in, or related to the south.,Of or pertaining to a southern region, especially Southern Europe or the southern United States.,Of a wind: blowing from the south; southerly.', '', '', 'adj', '[{\"text\":\"more southern\",\"type\":\"comparative\"},{\"text\":\"most southern\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
