(2044, 'battery', 'A device used to power electric devices, consisting of a set of electrically connected electrochemical or, archaically, electrostatic cells. A single such cell when used by itself.,The infliction of unlawful physical violence on a person, legally distinguished from assault, which includes the threat of impending violence.,A coordinated group of artillery weapons.,An elevated platform on which cannon could be placed.,An array of similar things.,A set of small cages where hens are kept for the purpose of farming their eggs.,The catcher and the pitcher together,Two or more major pieces on the same rank, file, or diagonal,A marching percussion ensemble; a drumline.,The state of a firearm when it is possible to be fired.,Apparatus for preparing or serving meals.', '', '', 'noun', '[{\"text\":\"batteries\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
