(2047, 'break', 'To separate into two or more pieces, to fracture or crack, by a process that cannot easily be reversed for reassembly.,To crack or fracture (bone) under a physical strain.,To divide (something, often money) into smaller units.,To cause (a person or animal) to lose spirit or will; to crush the spirits of.,To turn an animal into a beast of burden.,To be crushed, or overwhelmed with sorrow or grief.,To interrupt; to destroy the continuity of; to dissolve or terminate.,To end the run of (a play).,To ruin financially.,To fail in business; to go broke, to become bankrupt.,Of prices on the stock exchange: to fall suddenly.,To violate; to fail to adhere to.,To go down, in terms of temperature, indicating that the most dangerous part of the illness has passed.,To end.,To begin or end.,To arrive.,To render (a game) unchallenging by altering its rules or exploiting loopholes or weaknesses in them in a way that gives a player an unfair advantage.,To stop, or to cause to stop, functioning properly or altogether.,To cause (some feature of a program or piece of software) to stop functioning properly; to cause a regression.,To cause the shell of (an egg) to crack, so that the inside (yolk) is accessible.,To open (a safe) without using the correct key, combination, or the like.,To cause (a barrier) to no longer bar.,To destroy the arrangement of; to throw into disorder; to pierce.,To collapse into surf, after arriving in shallow water.,To burst forth; to make its way; to come into view.,To interrupt or cease one\'s work or occupation temporarily; to go on break.,To interrupt (a fall) by inserting something so that the falling object does not (immediately) hit something else beneath.,To disclose or make known an item of news, a band, etc.,To become audible suddenly.,To change a steady state abruptly.,To (attempt to) disengage and flee to; to make a run for.,To suddenly become.,To become deeper at puberty.,To alter in type due to emotion or strain: in men, generally to go up, in women, sometimes to go down; to crack.,To surpass or do better than (a specific number); to do better than (a record), setting a new record.,To win a game (against one\'s opponent) as receiver.,To make the first shot; to scatter the balls from the initial neat arrangement.,To remove one of the two men on (a point).,To demote; to reduce the military rank of.,To end (a connection); to disconnect.,To demulsify.,To counter-attack.,To lay open, as a purpose; to disclose, divulge, or communicate.,To become weakened in constitution or faculties; to lose health or strength.,To destroy the strength, firmness, or consistency of.,To destroy the official character and standing of; to cashier; to dismiss.,To make an abrupt or sudden change; to change gait.,To fall out; to terminate friendship.,To terminate the execution of a program before normal completion.,To suspend the execution of a program during debugging so that the state of the program can be investigated.,To cause, or allow the occurrence of, a line break.', 'break in,break down,crack', '', 'verb', '[{\"text\":\"breaks\",\"type\":\"present singular third-person\"},{\"text\":\"breaking\",\"type\":\"participle present\"},{\"text\":\"broke\",\"type\":\"past\"},{\"text\":\"brake\",\"type\":\"archaic past\"},{\"text\":\"broken\",\"type\":\"participle past\"},{\"text\":\"broke\",\"type\":\"nonstandard participle past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"break\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
