(2048, 'break', 'An instance of breaking something into two or more pieces.,A physical space that opens up in something or between two things.,A time for students to talk or play between lessons.,A scheduled interval of days or weeks between periods of school instruction; a holiday.,A rest or pause, usually from work.,A short holiday.,A temporary split with a romantic partner.,An interval or intermission between two parts of a performance, for example a theatre show, broadcast, or sports game.,A significant change in circumstance, attitude, perception, or focus of attention.,A sudden fall in prices on the stock exchange.,The beginning (of the morning).,An act of escaping.,The separation between lines, paragraphs or pages of a written text.,A keystroke or other signal that causes a program to terminate or suspend execution.,Short for breakpoint.,A change, particularly the end of a spell of persistent good or bad weather.,A game won by the receiving player(s).,The first shot in a game of billiards.,The number of points scored by one player in one visit to the table.,The counter-attack.,The curve imparted to the ball\'s motion on the green due to slope or grass texture.,A place where waves break (that is, where waves pitch or spill forward creating white water).,The start of a horse race.,A large four-wheeled carriage, having a straight body and calash top, with the driver\'s seat in front and the footman\'s behind.,A sharp bit or snaffle.,A short section of music, often between verses, in which some performers stop while others continue.,The point in the musical scale at which a woodwind instrument is designed to overblow, that is, to move from its lower to its upper register.,The transition area between a singer\'s vocal registers; the passaggio.,An area along a river that features steep banks, bluffs, or gorges (e.g., Upper Missouri River Breaks National Monument, US).,An error.', 'split,breach,gap,space,interspace,hole,time-out,pause,playtime,recess,time-out,pause,