(2053, 'behind', 'At or in the rear or back part of something.,In a rearward direction.,So as to come after someone or something in position, distance, advancement, ranking, time, etc.,So as to be still in place after someone or something has departed or ceased to exist.,Backward in time or order of succession; past.,Behind the scenes in a theatre; backstage.,Not yet brought forward, produced, or exhibited to view; out of sight; remaining.', '', '', 'adv', '[{\"text\":\"more behind\",\"type\":\"comparative\"},{\"text\":\"behinder\",\"type\":\"comparative nonstandard rare\"},{\"text\":\"most behind\",\"type\":\"superlative\"},{\"text\":\"behindest\",\"type\":\"nonstandard rare superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2054, 'behind', 'Not advanced to the required or expected degree; overdue or in arrears.,Slow.', '', '', 'adj', '[{\"text\":\"more behind\",\"type\":\"comparative\"},{\"text\":\"behinder\",\"type\":\"comparative nonstandard rare\"},{\"text\":\"most behind\",\"type\":\"superlative\"},{\"text\":\"behindest\",\"type\":\"nonstandard rare superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2055, 'behind', 'The rear, back-end.,The buttocks, bottom, butt.,A one-point score.,The catcher.,In the Eton College field game, any of a group of players consisting of two \"shorts\" (who try to kick the ball over the bully) and a \"long\" (who defends the goal).', '', '', 'noun', '[{\"text\":\"behinds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2056, 'dance', 'A sequence of rhythmic steps or movements usually performed to music, for pleasure or as a form of social interaction.,A social gathering where dancing is the main activity.,The art, profession, and study of dancing.,A genre of modern music characterised by sampled beats, repetitive rhythms and few lyrics.,A piece of music with a particular dance rhythm.,A battle of wits, especially one commonly fought between two rivals.,Any strenuous or difficult movement, action, or task.,A normally horizontal stripe called a fess that has been modified to zig-zag across the center of a coat of arms from dexter to sinister.,A repetitive movement used in communication between worker honey bees.,The death throes of a hanged person.', '', '', 'noun', '[{\"text\":\"dances\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2057, 'dance', 'To move with rhythmic steps or movements, especially in time to music.,To leap or move lightly and rapidly.,To perform the steps to.,To cause to dance, or move nimbly or merrily about.,To make love or have sex.,To make a repetitive movement in order to communicate to other worker honey bees.,To kick and convulse from the effects of being hanged.', 'throw shapes,do the deed', '', 'verb', '[{\"text\":\"dances\",\"type\":\"present singular third-person\"},{\"text\":\"dancing\",\"type\":\"participle present\"},{\"text\":\"danced\",\"type\":\"participle past\"},{\"text\":\"danced\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2058, 'medium', 'The material of the surrounding environment, e.g. solid, liquid, gas, vacuum, or a specific substance such as a solvent.,The materials or empty space through which signals, waves, or forces pass.,A format for communicating or presenting information.,A nutrient substance, commonly a solution or solid, for the growth of cells in vitro.,A substance, structure, or environment in which living organisms subsist, grow or are cultured.,A means, channel, agency or go-between through which communication, commerce, etc is conveyed or carried on, or by which an aim is achieved.,The materials used to finish a workpiece using a mass finishing or abrasive blasting process.', '', '', 'noun', '[{\"text\":\"media\",\"type\":\"plural\"},{\"text\":\"mediums\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
