(2060, 'medium', 'Someone who supposedly conveys information from the spirit world.,One of several common sizes to which an item may be manufactured.,An item labelled or denoted as being that size.,One who fits an item of that size.,A half-pint serving of Guinness (or other stout in some regions).,A middle place or degree.,An average; sometimes the mathematical mean.,The mean or middle term of a syllogism, that by which the extremes are brought into connection.', 'M', '', 'noun', '[{\"text\":\"mediums\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
