(2078, 'steel', 'To edge, cover, or point with steel.,To harden or strengthen; to nerve or make obdurate; to fortify against.,To back with steel.,To treat a liquid with steel for medicinal purposes.,To press with a flat iron.,To cause to resemble steel in appearance.,To steelify; to turn iron into steel.,To electroplate an item, particularly an engraving plate, with a layer of iron.,To sharpen with a honing steel.', '', '', 'verb', '[{\"text\":\"steels\",\"type\":\"present singular third-person\"},{\"text\":\"steeling\",\"type\":\"participle present\"},{\"text\":\"steeled\",\"type\":\"participle past\"},{\"text\":\"steeled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2079, 'virtual', 'In effect or essence, if not in fact or reality; imitated, simulated.,Having the power of acting or of invisible efficacy without the agency of the material or measurable part; potential.,Nearly, almost. (A relatively recent development in meaning),Simulated in a computer or online.,Operating by computer or in cyberspace; not physically present.,Capable of being overridden with a different implementation in a subclass.,Pertaining to particles in temporary existence due to the Heisenberg uncertainty principle.', 'de facto', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
