(2081, 'detail', 'A part small enough to escape casual notice.,A profusion of details.,The small parts that can escape casual notice.,A part considered trivial enough to ignore.,A person\'s name, address and other personal information.,A temporary unit or assignment.,An individual feature, fact, or other item, considered separately from the whole of which it is a part.,A narrative which relates minute points; an account which dwells on particulars.,A selected portion of a painting.', 'minutia,technicality,trifle,triviality,contingent,detachment,portion,section', '', 'noun', '[{\"text\":\"details\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
