(2083, 'manual', 'A handbook.,A booklet that instructs on the usage of a particular machine or product.,A drill in the use of weapons, etc.,An old office-book like the modern Roman Catholic ritual.', '', '', 'noun', '[{\"text\":\"manuals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
