(2085, 'manual', 'A manual transmission; a gearbox, especially of a motorized vehicle, shifted by the operator.,A vehicle with a manual transmission.,A keyboard for the hands on a harpsichord, organ, or other musical instrument.,A manual typewriter (as contrasted with an electronic one).,Manual measurement of the blood pressure, done with a manual sphygmomanometer.,A bicycle technique whereby the front wheel is held aloft by the rider, without the use of pedal force.,A similar maneuver on a skateboard, lifting the front or back wheels while keeping the tail or nose of the board from touching the ground.,Manual control or operation.', '', '', 'noun', '[{\"text\":\"manuals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2086, 'reader', 'A person who reads.,A person who reads a publication.,A person who recites literary works, usually to an audience.,A proofreader.,A person employed by a publisher to read works submitted for publication and determine their merits.,A position attached to aristocracy, or to the wealthy, with the task of reading aloud, often in a foreign language.,A university lecturer ranking below a professor.,Any device that reads something.,A book of exercises to accompany a textbook.,An elementary textbook for those learning to read, especially for foreign languages.,A literary anthology.,A lay or minor cleric who reads lessons in a church service.,A newspaper advertisement designed to look like a news article rather than a commercial solicitation.,Reading glasses.,Marked playing cards used by cheaters.', 'proofreader,printer\'s reader,publisher\'s reader,first reader,reading notice', '', 'noun', '[{\"text\":\"readers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
