(2165, 'scale', 'To change the size of something whilst maintaining proportion; especially to change a process in order to produce much larger amounts of the final product.,To climb to the top of.,To tolerate significant increases in throughput or other potentially limiting factors.,To weigh, measure or grade according to a scale or system.', '', '', 'verb', '[{\"text\":\"scales\",\"type\":\"present singular third-person\"},{\"text\":\"scaling\",\"type\":\"participle present\"},{\"text\":\"scaled\",\"type\":\"participle past\"},{\"text\":\"scaled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2166, 'scale', 'Part of an overlapping arrangement of many small, flat and hard pieces of keratin covering the skin of an animal, particularly a fish or reptile.,A small piece of pigmented chitin, many of which coat the wings of a butterfly or moth to give them their color.,A flake of skin of an animal afflicted with dermatitis.,Part of an overlapping arrangement of many small, flat and hard protective layers forming a pinecone that flare when mature to release pine nut seeds.,The flaky material sloughed off heated metal.,Scale mail (as opposed to chain mail).,Limescale.,A scale insect.,The thin metallic side plate of the handle of a pocketknife.', '', '', 'noun', '[{\"text\":\"scales\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
