(2176, 'frame', 'To fit, as for a specific end or purpose; make suitable or comfortable; adapt; adjust.,To construct by fitting together or uniting various parts; fabricate by union of constituent parts.,To bring or put into form or order; adjust the parts or elements of; compose; contrive; plan; devise.,Of a constructed object such as a building, to put together the structural elements.,Of a picture such as a painting or photograph, to place inside a decorative border.,To position visually within a fixed boundary.,To construct in words so as to establish a context for understanding or interpretation.,Conspire to falsely incriminate a presumably innocent person. See frameup.,To wash ore with the aid of a frame.,To move.,To proceed; to go.,To hit (the ball) with the frame of the racquet rather than the strings (normally a mishit).,To strengthen; refresh; support.,To execute; perform.,To cause; to bring about; to produce.,To profit; avail.,To fit; accord.,To succeed in doing or trying to do something; manage.', 'fit up', '', 'verb', '[{\"text\":\"frames\",\"type\":\"present singular third-person\"},{\"text\":\"framing\",\"type\":\"participle present\"},{\"text\":\"framed\",\"type\":\"participle past\"},{\"text\":\"framed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
