(2226, 'stand', 'The act of standing.,A defensive position or effort.,A resolute, unwavering position; firm opinion; action for a purpose in the face of opposition.,A period of performance in a given location or venue.,A device to hold something upright or aloft.,The platform on which a witness testifies in court; the witness stand or witness box.,An area of raised seating for waiters at the stock exchange.,A particular grove or other group of trees or shrubs.,A contiguous group of trees sufficiently uniform in age-class distribution, composition, and structure, and growing on a site of sufficiently uniform quality, to be a distinguishable unit.,A standstill, a motionless state, as of someone confused, or a hunting dog who has found game.,A small building, booth, or stage, as in a bandstand or hamburger stand.,A designated spot where someone or something may stand or wait.,The situation of a shop, store, hotel, etc.,Short for tavern stand (“a roadside inn”).,Grandstand. (often in the plural),A partnership.,A single set, as of arms.,Rank; post; station; standing.,A state of perplexity or embarrassment.,A young tree, usually reserved when other trees are cut; also, a tree growing or standing upon its own root, in distinction from one produced from a scion set in a stock, either of the same or another kind of tree.,A location or position where one may stand.,An advertisement filling an entire billboard, comprising many sheets of paper.,A type of supernatural ability from the anime and manga series JoJo\'s Bizarre Adventure, named for the fact that they appear to \'stand\' next to their user.', '', '', 'noun', '[{\"text\":\"stands\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
