(2238, 'complex', 'Made up of multiple parts; composite; not simple.,Not simple, easy, or straightforward; complicated.,Having the form a + bi, where a and b are real numbers and i is (by definition) the imaginary square root of −1.,Whose range is a subset of the complex numbers.,Whose coefficients are complex numbers; defined over the field of complex numbers.,A curve, polygon or other figure that crosses or intersects itself.', '', '', 'adj', '[{\"text\":\"complexer\",\"type\":\"comparative\"},{\"text\":\"more complex\",\"type\":\"comparative\"},{\"text\":\"complexest\",\"type\":\"superlative\"},{\"text\":\"most complex\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
