(2244, 'musical', 'Of, belonging or relating to music, or to its performance or notation.,Pleasing to the ear; sounding agreeably; having the qualities of music; melodious; harmonious.,Fond of music; discriminating with regard to music; gifted or skilled in music.,Pertaining to a class of games in which players move while music plays, but have to take a fixed position when it stops; by extension, any situation where people repeatedly change positions.', '', '', 'adj', '[{\"text\":\"more musical\",\"type\":\"comparative\"},{\"text\":\"most musical\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
