(2401, 'stone', 'A hard earthen substance that can form large rocks.,A small piece of stone, a pebble.,A gemstone, a jewel, especially a diamond.,A unit of mass equal to 14 pounds (≈6.3503 kilograms), formerly used for various commodities (wool, cheese, etc.), but now principally used for personal weight.,The central part of some fruits, particularly drupes; consisting of the seed and a hard endocarp layer.,A hard, stone-like deposit.,A playing piece made of any hard material, used in various board games such as backgammon and go.,A dull light grey or beige, like that of some stones.,A 42-pound, precisely shaped piece of granite with a handle attached, which is bowled down the ice.,A monument to the dead; a gravestone or tombstone.,A mirror, or its glass.,A testicle.,A stand or table with a smooth, flat top of stone, commonly marble, on which to arrange the pages of a book, newspaper, etc. before printing.', 'rock,pebble,petra,pip,pit,calculus,rock,imposing stone', '', 'noun', '[{\"text\":\"stones\",\"type\":\"plural\"},{\"text\":\"stone\",\"type\":\"as unit of mass plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2402, 'stone', 'To pelt with stones, especially to kill by pelting with stones.,To wall with stones.,To remove a stone from (fruit etc.).,To form a stone during growth, with reference to fruit etc.,To intoxicate, especially with narcotics. (Usually in passive),To do nothing, to stare blankly into space and not pay attention when relaxing or when bored.,To lap with an abrasive stone to remove surface irregularities.', 'lapidate,chill,chillax,chill out,hang out,rilek,daydream,veg out', '', 'verb', '[{\"text\":\"stones\",\"type\":\"present singular third-person\"},{\"text\":\"stoning\",\"type\":\"participle present\"},{\"text\":\"stoned\",\"type\":\"participle past\"},{\"text\":\"stoned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
