(2419, 'amateur', 'A lover of something.,A person attached to a particular pursuit, study, science, or art (such as music or painting), especially one who cultivates any study, interest, taste, or attachment without engaging in it professionally.,Someone who is unqualified or insufficiently skillful.', 'hobbyist,dabbler,dilettante,punk', '', 'noun', '[{\"text\":\"amateurs\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
