(2438, 'balance', 'A state in which opposing forces harmonise; equilibrium.,Mental equilibrium; mental health; calmness, a state of remaining clear-headed and unperturbed.,Something of equal weight used to provide equilibrium; counterweight.,A pair of scales.,Awareness of both viewpoints or matters; neutrality; rationality; objectivity.,The overall result of conflicting forces, opinions etc.; the influence which ultimately \"weighs\" more than others.,Apparent harmony in art (between differing colours, sounds, etc.).,A list accounting for the debits on one side, and for the credits on the other.,The result of such a procedure; the difference between credit and debit of an account.,A device used to regulate the speed of a watch, clock etc.,The remainder.,Libra.', 'equilibrium,pair of scales,set of scales,scales,weighing machine,weighbridge,disinterest,even-handedness,fairness,impartiality,neutrality,nonpartisanship,account', '', 'noun', '[{\"text\":\"balances\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
