(2456, 'graduate', 'To be recognized by a school or university as having completed the requirements of a degree studied at the institution.,The man graduated in 1967.,To be certified as having earned a degree from; to graduate from (an institution).,To certify (a student) as having earned a degree,To mark (something) with degrees; to divide into regular steps or intervals, as the scale of a thermometer, a scheme of punishment or rewards, etc.,To change gradually.,To prepare gradually; to arrange, temper, or modify by degrees or to a certain degree; to determine the degrees of.,To bring to a certain degree of consistency, by evaporation, as a fluid.,To taper, as the tail of certain birds.,Of an idol: to exit a group; or of a virtual YouTuber, to leave a management agency; usually accompanied with \"graduation ceremony\" send-offs, increased focus on the leaving member, and the like.', '', '', 'verb', '[{\"text\":\"graduates\",\"type\":\"present singular third-person\"},{\"text\":\"graduating\",\"type\":\"participle present\"},{\"text\":\"graduated\",\"type\":\"participle past\"},{\"text\":\"graduated\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2457, 'square', 'A polygon with four sides of equal length and four right angles; an equilateral rectangle; a regular quadrilateral.,A cell in a grid.,A square piece, part, or surface.,The front of a woman\'s dress over the bosom, usually worked or embroidered.,A dessert cut into rectangular pieces, or a piece of such a dessert.,A certain number of lines, forming a portion of a column, nearly square; used chiefly in reckoning the prices of advertisements in newspapers.,An L- or T-shaped tool used to place objects or draw lines at right angles.,A true measure, standard, or pattern.,An open space or park, often in the center of a town, not necessarily square in shape, often containing trees, seating and other features pleasing to the eye.,A street surrounding a public square or plaza.,The product of a number or quantity multiplied by itself; the second power of a number, value, term or expression.,A body of troops drawn up in a square formation.,A socially conventional or conservative person; a person who has little or no interest in the latest fads or trends: still sometimes used in modern terminology.,The symbol # on a telephone; hash.,The central area of a cricket field, with one or more pitches of which only one is used at a time.,A unit of measurement of area, equal to a 10 foot by 10 foot square, i.e. 100 square feet or roughly 9.3 square metres. Used in real estate for the size of a house or its rooms, though progressively being replaced by square metres in metric countries such as Australia.,A unit used in measuring roof area equivalent to 100 square feet (9.29 m²) of roof area. The materials for roofing jobs are often billed by the square in the United States.,A mortarboard.,Ellipsis of square meal.,Exact proportion; justness of workmanship and conduct; regularity; rule.,The relation of harmony, or exact agreement; equality; level.,The position of planets distant ninety degrees from each other; a quadrate.,The act of squaring, or quarrelling; a quarrel.,Ciga