(2458, 'square', 'Shaped like a square (the polygon).,Hypernyms: rectangular, polygonal,Forming right angles in all planes as intended; not racked or leaning.,Forming right angles with the mast or the keel, and parallel to the horizon; said of the yards of a square-rigged vessel when they are so braced.,Forming a right angle (90°).,Used in the names of units of area formed by multiplying a unit of length by itself.,Honest; straightforward; fair.,Satisfied; comfortable with; not experiencing any conflict.,Even; tied,Socially conventional; boring.,In line with the batsman\'s popping crease.,Solid, decent, substantial.,Having a shape broad for the height, with angular rather than curving outlines.', 'orthogonal,perpendicular,normal,orthogonal,perpendicular,normal,orthogonal,perpendicular,normal,above board,on the level,on the square,on the up and up,straight,bourgeois', 'crooked,out of square,oblique,out of square,crooked,racked,crooked,out of square,oblique,crooked,out of square,oblique', 'adj', '[{\"text\":\"squarer\",\"type\":\"comparative\"},{\"text\":\"squarest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
