(2493, 'waste', 'Excess of material, useless by-products, or damaged, unsaleable products; garbage; rubbish.,Excrement or urine.,A wasteland; an uninhabited desolate region; a wilderness or desert.,A place that has been laid waste or destroyed.,A large tract of uncultivated land.,The part of the land of a manor (of whatever size) not used for cultivation or grazing, nowadays treated as common land.,A vast expanse of water.,A disused mine or part of one.,The action or progress of wasting; extravagant consumption or ineffectual use.,Large abundance of something, specifically without it being used.,Gradual loss or decay.,A decaying of the body by disease; atrophy; wasting away.,Destruction or devastation caused by war or natural disasters; see \"to lay waste\".,A cause of action which may be brought by the owner of a future interest in property against the current owner of that property to prevent the current owner from degrading the value or character of the property, either intentionally or through neglect.,Material derived by mechanical and chemical erosion from the land, carried by streams to the sea.', '', '', 'noun', '[{\"text\":\"wastes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
