(2499, 'platform', 'A raised stage from which speeches are made and on which musical and other performances are made.,A raised floor for any purpose, e.g. for workmen during construction, or formerly for military cannon.,A place or an opportunity to express one\'s opinion.,Something that allows an enterprise to advance.,A political stance on a broad set of issues, which are called planks.,A raised structure from which passengers can enter or leave a train, metro etc.,Ellipsis of platform shoe: a kind of high shoe with an extra layer between the inner and outer soles.,Ellipsis of digital platform: a software system used to provide online services to clients, such as social media, e-commerce, cloud computing etc.,Ellipsis of computing platform: a particular type of operating system or environment such as a database or other specific software, and/or a particular type of computer or microprocessor, used to describe a particular environment for running other software.,Ellipsis of car platform: a set of components shared by several vehicle models.,A flat expanse of rock, often the result of wave erosion.,A light deck, usually placed in a section of the hold or over the floor of the magazine.,A plan; a sketch; a model; a pattern.,sidewalk', 'dais,podium,tribune,foundation,stage', '', 'noun', '[{\"text\":\"platforms\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2500, 'platform', 'To furnish with or shape into a platform,To place on, or as if on, a platform.,To place a train alongside a station platform.,To include in a political platform,To publish or make visible; to provide a platform for (a topic etc.).,To open (a film) in a small number of theaters before a broader release in order to generate enthusiasm.,To form a plan of; to model; to lay out.', '', 'deplatform,no-platform', 'verb', '[{\"text\":\"platforms\",\"type\":\"present singular third-person\"},{\"text\":\"platforming\",\"type\":\"participle present\"},{\"text\":\"platformed\",\"type\":\"participle past\"},{\"text\":\"platformed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2501, 'phase', 'A distinguishable part of a sequence or cycle occurring over time.,That which is exhibited to the eye; the appearance which anything manifests, especially any one among different and varying appearances of the same object.,Any appearance or aspect of an object of mental apprehension or view.,A particular appearance or state in a regularly recurring cycle of changes with respect to quantity of illumination or form, or the absence, of its enlightened disk. Illustrated in Wikipedia\'s article Lunar phase.,Any one point or portion in a recurring series of changes, as in the changes of motion of one of the particles constituting a wave or vibration; one portion of a series of such changes, in distinction from a contrasted portion, as the portion on one side of a position of equilibrium, in contrast with that on the opposite side.,A component in a material system that is distinguished by chemical composition and/or physical state (solid, liquid or gas) and/or crystal structure. It is delineated from an adjoining phase by an abrupt change in one or more of those conditions.,In certain organisms, one of two or more colour variations characteristic of the species, but independent of the ordinary seasonal and sexual differences, and often also of age.,The period of play between consecutive breakdowns.,A haplotype.,The arctangent of the quotient formed by dividing the imaginary part of a complex number by the real part.,A distortion caused by a difference in the speed of propagation for different frequencies,In a polyphase electrical power system, one of the power-carrying conductors, or the alternating current carried by it.', 'argument', '', 'noun', '[{\"text\":\"phases\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2502, 'phase', 'To begin—if construed with \"in\"—or to discontinue—if construed with out—(doing) something over a period of time (i.e. in phases).,Obsolete form of faze.,To determine haplotypes in (data) when genotypes are known.,To pass into or through a solid object.,To use a phaser.', '', '', 'verb', '[{\"text\":\"phases\",\"type\":\"present singular third-person\"},{\"text\":\"phasing\",\"type\":\"participle present\"},{\"text\":\"phased\",\"type\":\"participle past\"},{\"text\":\"phased\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
