(2505, 'argument', 'A fact or statement used to support a proposition; a reason.,A series of propositions organized so that the final proposition is a conclusion which is intended to follow logically from the preceding propositions, which function as premises.,A process of reasoning; argumentation.,An abstract or summary of the content of a literary work such as a book, a poem or a major section such as a chapter, included in the work before the content itself; (figuratively) the contents themselves.,A verbal dispute; a quarrel.,Any dispute, altercation, or collision.,Any of the phrases that bears a syntactic connection to the verb of a clause.,The independent variable of a function.,The phase of a complex number.,A quantity on which the calculation of another quantity depends.,A value, or a reference to a value, passed to a function.,A parameter at a function call; an actual parameter, as opposed to a formal parameter.,A matter in question; a business in hand.,The subject matter of an artistic representation, discourse, or writing; a theme or topic.,Evidence, proof; (countable) an item of such evidence or proof.', 'argument,argument,dispute,actual argument,passed parameter', '', 'noun', '[{\"text\":\"arguments\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2506, 'argument', 'To put forward as an argument; to argue.,To adduce evidence, to provide proof.', '', '', 'verb', '[{\"text\":\"arguments\",\"type\":\"present singular third-person\"},{\"text\":\"argumenting\",\"type\":\"participle present\"},{\"text\":\"argumented\",\"type\":\"participle past\"},{\"text\":\"argumented\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"argument\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2507, 'myself', 'Me, as direct or indirect object the speaker as the object of a verb or preposition, when the speaker is also the subject.,Personally, for my part; used in apposition to I, sometimes for simple emphasis and sometimes with implicit exclusion of any others performing the activity described.,In my normal state of body or mind.,Me (as the object of a verb or preposition).,I (as the subject of a verb).,my name is...', '', '', 'pron', '[{\"text\":\"case of I\",\"type\":\"reflexive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2508, 'myself', 'Alternative letter-case form of myself used when speaking as God or another important figure who is understood from context.', '', '', 'pron', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2509, 'install', 'To connect, set up or prepare something for use, often specifically (in Computing) to transfer software onto a device\'s permanent storage and put it in a state where it is ready to be run when needed, usually decompressing it if necessary and performing any necessary pre-first-run configuration.,To admit formally into an office, rank or position.,To establish or settle in.', '', '', 'verb', '[{\"text\":\"installs\",\"type\":\"present singular third-person\"},{\"text\":\"installing\",\"type\":\"participle present\"},{\"text\":\"installed\",\"type\":\"participle past\"},{\"text\":\"installed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2510, 'install', 'Installer. A software utility that installs an application.,An installation. (Usage originated as a truncated form of the word installation.)', '', '', 'noun', '[{\"text\":\"installs\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2511, 'religion', 'Belief in a spiritual or metaphysical reality (often including at least one deity), accompanied by practices or rituals pertaining to the belief.,A particular system of such belief, and the rituals and practices proper to it.,The way of life committed to by monks and nuns.,Rituals and actions associated with religious beliefs, but considered apart from them.,Any practice to which someone or some group is seriously devoted.,Faithfulness to a given principle; conscientiousness.', 'faith,faith,faith,superstition', '', 'noun', '[{\"text\":\"religions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2512, 'religion', 'Engage in religious practice.,Indoctrinate into a specific religion.,To make sacred or symbolic; sanctify.', '', '', 'verb', '[{\"text\":\"religions\",\"type\":\"present singular third-person\"},{\"text\":\"religioning\",\"type\":\"participle present\"},{\"text\":\"religioned\",\"type\":\"participle past\"},{\"text\":\"religioned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2513, 'breast', 'Either of the two organs on the front of a female human\'s chest, which contain the mammary glands; also the analogous organs in males.,The chest, or front of the human thorax.,A section of clothing covering the breast area.,The figurative seat of the emotions, feelings etc.; one\'s heart or innermost thoughts.,The ventral portion of an animal\'s thorax.,A choice cut of poultry, especially chicken or turkey, taken from the bird’s breast; also a cut of meat from other animals, breast of mutton, veal, pork.,The front or forward part of anything.,The face of a coal working.,The front of a furnace.,The power of singing; a musical voice.,The breaststroke.', 'chest,heart,soul,white meat,brisket', '', 'noun', '[{\"text\":\"breasts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2514, 'breast', 'To push against with the breast; to meet full on, oppose, face.,To reach the top (of a hill).,To debreast.', '', '', 'verb', '[{\"text\":\"breasts\",\"type\":\"present singular third-person\"},{\"text\":\"breasting\",\"type\":\"participle present\"},{\"text\":\"breasted\",\"type\":\"participle past\"},{\"text\":\"breasted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2515, 'shirt', 'An article of clothing that is worn on the upper part of the body, and often has sleeves, either long or short, that cover the arms.,An interior lining in a blast furnace.,A member of the shirt-wearing team in a shirts and skins game.', 'sark', '', 'noun', '[{\"text\":\"shirts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
