(2520, 'exercise', 'Any activity designed to develop or hone a skill or ability.,Activity intended to improve physical, or sometimes mental, strength and fitness.,A setting in action or practicing; employment in the proper mode of activity; exertion; application; use.,The performance of an office, ceremony, or duty.,That which gives practice; a trial; a test.', '', '', 'noun', '[{\"text\":\"exercises\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2521, 'exercise', 'To exert for the sake of training or improvement; to practice in order to develop.,To perform physical activity for health or training.,To use (a right, an option, etc.); to put into practice.,To occupy the attention and effort of; to task; to tax, especially in a painful or vexatious manner; harass; to vex; to worry or make anxious.,To set in action; to cause to act, move, or make exertion; to give employment to.', '', '', 'verb', '[{\"text\":\"exercises\",\"type\":\"present singular third-person\"},{\"text\":\"exercising\",\"type\":\"participle present\"},{\"text\":\"exercised\",\"type\":\"participle past\"},{\"text\":\"exercised\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2522, 'quickly', 'Rapidly; with speed; fast.,Very soon.,If we go this way, we\'ll get there quickly.', 'apace,expeditiously,fast,hastily,hurriedly,posthaste,quicksome,rapidly,speedily,soon [⇒ thesaurus],swiftly,with dispatch,at the high port,balls-out,balls to the wall,cranking,flat out,full throttle,hauling,hauling ass,hell-for-leather,hell-bent for leather,lickety-split,like a bat out of hell,like a blue-arsed fly,like a dose of salts,like a rat up a drainpipe,like gangbusters,like shit through a goose,like the clappers,like there is no tomorrow,like the wind,screaming,before you can say Jack Robinson,in a flash,in a jiffy,in no time [⇒ thesaurus],in the twinkling of an eye,in two shakes,on the double,PDQ,pronto,quick as a flash,quick as a wink,on the pdq,toot sweet', '', 'adv', '[{\"text\":\"quicklier\",\"type\":\"comparative\"},{\"text\":\"more quickly\",\"type\":\"comparative\"},{\"text\":\"quickliest\",\"type\":\"superlative\"},{\"text\":\"most quickly\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2523, 'congress', 'A coming together of two or more people; a meeting.,A formal gathering or assembly; a conference held to discuss or decide on a specific question.,A legislative body of a state, originally the bicameral legislature of the United States of America.,An association, especially one consisting of other associations or representatives of interest groups.,Coitus; sexual intercourse.,A group of baboons; the collective noun for baboons.', 'assembly,legislature,parliament,federation,sexual intercourse', '', 'noun', '[{\"text\":\"congresses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
