(2541, 'himself', 'Him; the male object of a verb or preposition that also appears as the subject,He; used as an intensifier, often to emphasize that the referent is the exclusive participant in the predicate,The subject or non-reflexive object of a predicate; he himself.,The subject or non-reflexive object of a predicate; he (used of upper-class gentlemen, or sarcastically, of men who imagine themselves to be more important than others)', '', '', 'pron', '[{\"text\":\"herself\",\"type\":\"feminine\"},{\"text\":\"itself\",\"type\":\"neuter\"},{\"text\":\"themselves\",\"type\":\"plural\"},{\"text\":\"himself\",\"type\":\"gender-neutral singular\"},{\"text\":\"themself\",\"type\":\"gender-neutral singular\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
