(2544, 'italian', 'An inhabitant of Italy, or a person of Italian descent.,The official language of Italy, also spoken in San Marino, the Vatican, and parts of Argentina, Slovenia and Switzerland.,A style of cuisine or individual dishes of or associated with Italy or Italian people.,A type of linen or cotton cloth with satin finish used primarily for linings, Italian cloth.,Italian vermouth, a dark-colored, sweet or mildly bitter vermouth.,An Italian sandwich.', 'Eyetie,greaseball,goombah,guido,guinea,wop', '', 'noun', '[{\"text\":\"Italians\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2545, 'flight', 'The act of flying.,An instance of flying.,A collective term for doves or swallows.,A trip made by an aircraft, particularly one between two cities or countries, which is often planned or reserved in advance.,A series of stairs between landings.,A group of canal locks with a short distance between them,A floor which is reached by stairs or escalators.,The feathers on an arrow or dart used to help it follow an even path.,A paper airplane.,The movement of a spinning ball through the air - concerns its speed, trajectory and drift.,The ballistic trajectory of an arrow or other projectile.,An aerodynamic surface designed to guide such a projectile\'s trajectory.,An air force unit.,Several sample glasses of a specific wine varietal or other beverage. The pours are smaller than a full glass and the flight will generally include three to five different samples.,The shaped material forming the thread of a screw.,An episode of imaginative thinking or dreaming.', '', '', 'noun', '[{\"text\":\"flights\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2546, 'flight', 'Fast, swift, fleet.', '', '', 'adj', '[{\"text\":\"more flight\",\"type\":\"comparative\"},{\"text\":\"most flight\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2547, 'flight', 'To throw the ball in such a way that it has more airtime and more spin than usual.,To throw or kick something so as to send it flying with more loft or airtime than usual.', '', '', 'verb', '[{\"text\":\"flights\",\"type\":\"present singular third-person\"},{\"text\":\"flighting\",\"type\":\"participle present\"},{\"text\":\"flighted\",\"type\":\"participle past\"},{\"text\":\"flighted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
