(2549, 'league', 'A group or association of cooperating members.,An organization of sports teams which play against one another for a championship.,Ellipsis of rugby league.,A class or type of people or things that are evenly matched or on the same level.,A prefecture-level administrative unit in Inner Mongolia (Chinese: 盟).,An alliance or coalition.', '', '', 'noun', '[{\"text\":\"leagues\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2550, 'league', 'To form an association; to unite in a league or confederacy; to combine for mutual support.', '', '', 'verb', '[{\"text\":\"leagues\",\"type\":\"present singular third-person\"},{\"text\":\"leaguing\",\"type\":\"participle present\"},{\"text\":\"leagued\",\"type\":\"participle past\"},{\"text\":\"leagued\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2551, 'league', 'The distance that a person can walk in one hour, commonly taken to be approximately three English miles (about five kilometers).,A stone erected near a public road to mark the distance of a league.', '', '', 'noun', '[{\"text\":\"leagues\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
