(2554, 'prime', 'First in importance, degree, or rank.,First in time, order, or sequence.,First in excellence, quality, or value.,Having exactly two integral factors: itself and unity (1 in the case of integers).,Such that if it divides a product, it divides one of the multiplicands.,Having its complement closed under multiplication: said only of ideals.,Marked or distinguished by the prime symbol.,Early; blooming; being in the first stage.,Lecherous, lewd, lustful.', 'greatest,main,most important,primary,principal,top,earliest,first,original,excellent,top quality,indivisible', '', 'adj', '[{\"text\":\"primer\",\"type\":\"comparative\"},{\"text\":\"primest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2555, 'prime', 'The first hour of daylight; the first canonical hour.,The religious service appointed to this hour.,The early morning generally.,The earliest stage of something.,The most active, thriving, or successful stage or period.,The chief or best individual or part.,The first note or tone of a musical scale.,The first defensive position, with the sword hand held at head height, and the tip of the sword at head height.,A prime element of a mathematical structure, particularly a prime number.,A four-card hand containing one card of each suit in the game of primero; the opposite of a flush in poker.,Six consecutive blocks, which prevent the opponent\'s pieces from passing.,The symbol ′ used to indicate feet, minutes, derivation and other measures and mathematical operations.,Any number expressing the combining weight or equivalent of any particular element; so called because these numbers were respectively reduced to their lowest relative terms on the fixed standard of hydrogen as 1.,An inch, as composed of twelve seconds in the duodecimal system.,The priming in a flintlock.,Contraction of prime lens, a film lens.,A feather, from the wing of the cock ostrich, that is of the palest possible shade.', 'early morning,bloom,blossom,efflorescence,flower,flush,heyday,peak,choice,prize,quality,select,prime number,white', '', 'noun', '[{\"text\":\"primes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2556, 'prime', 'To prepare a mechanism for its main work.,To apply a coat of primer paint to.,To be renewed.,To serve as priming for the charge of a gun.,To work so that foaming occurs from too violent ebullition, which causes water to become mixed with, and be carried along with, the steam that is formed.,To apply priming to (a musket or cannon); to apply a primer to (a metallic cartridge).,To prepare; to make ready; to instruct beforehand; to coach.,To trim or prune.,To mark with a prime mark.', 'ground,undercoat', '', 'verb', '[{\"text\":\"primes\",\"type\":\"present singular third-person\"},{\"text\":\"priming\",\"type\":\"participle present\"},{\"text\":\"primed\",\"type\":\"participle past\"},{\"text\":\"primed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
