(2559, 'doctor', 'A physician; a member of the medical profession; one who is trained and licensed to heal the sick or injured. The final examination and qualification may award a doctor degree in which case the post-nominal letters are D.O., DPM, M.D., DMD, DDS, in the US or MBBS in the UK.,A person who has attained a doctorate, such as a Ph.D. or Th.D. or one of many other terminal degrees conferred by a college or university.,A veterinarian; a medical practitioner who treats non-human animals.,A nickname for a person who has special knowledge or talents to manipulate or arrange transactions.,A teacher; one skilled in a profession or a branch of knowledge; a learned man.,Any mechanical contrivance intended to remedy a difficulty or serve some purpose in an exigency.,A fish, the friar skate.,A ship\'s cook.', 'doc,vet,veterinarian,veterinary,veterinary surgeon', '', 'noun', '[{\"text\":\"doctors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2560, 'doctor', 'To act as a medical doctor to.,To act as a medical doctor.,To make (someone) into an (academic) doctor; to confer a doctorate upon.,To physically alter (medically or surgically) a living being in order to change growth or behavior.,To genetically alter an extant species.,To alter or make obscure, as with the intention to deceive, especially a document.,To adulterate, drug, or poison (drink).,To take medicine.', '', '', 'verb', '[{\"text\":\"doctors\",\"type\":\"present singular third-person\"},{\"text\":\"doctoring\",\"type\":\"participle present\"},{\"text\":\"doctored\",\"type\":\"participle past\"},{\"text\":\"doctored\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2561, 'doctor', 'The title of an academic or medical doctor (a person who holds a doctorate); used before or instead of the doctor\'s name.', 'Dr,Dr.', '', 'noun', '[{\"text\":\"Doctors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2562, 'enable', 'To make somebody able (to do, or to be, something); to give sufficient ability or power to do or to be; to give strength or ability to.,To affirm; to make firm and strong.,To qualify or approve for some role or position; to render sanction or authorization to; to confirm suitability for.,To yield the opportunity or provide the possibility for something; to provide with means, opportunities, and the like.,To imply or tacitly confer excuse for an action or a behavior.,To put a circuit element into action by supplying a suitable input pulse.,To activate, to make operational (especially of a function of an electronic or mechanical device).', 'empower,endow,let,permit,authorize,allow,activate,turn on', 'disable', 'verb', '[{\"text\":\"enables\",\"type\":\"present singular third-person\"},{\"text\":\"enabling\",\"type\":\"participle present\"},{\"text\":\"enabled\",\"type\":\"participle past\"},{\"text\":\"enabled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2563, 'stream', 'A small river; a large creek; a body of moving water confined by banks.,A thin connected passing of a liquid through a lighter gas (e.g. air).,Any steady flow or succession of material, such as water, air, radio signal or words.,All moving waters.,A source or repository of data that can be read or written only sequentially.,A particular path, channel, division, or way of proceeding.,A division of a school year by perceived ability.,A live stream.', 'beck,brook,burn', '', 'noun', '[{\"text\":\"streams\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2564, 'stream', 'To flow in a continuous or steady manner, like a liquid.,To extend; to stretch out with a wavy motion; to float in the wind.,To discharge in a stream.,To push continuous data (e.g. music) from a server to a client computer while it is being used (played) on the client.', '', '', 'verb', '[{\"text\":\"streams\",\"type\":\"present singular third-person\"},{\"text\":\"streaming\",\"type\":\"participle present\"},{\"text\":\"streamed\",\"type\":\"participle past\"},{\"text\":\"streamed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
