(2567, 'diamond', 'A glimmering glass-like mineral that is an allotrope of carbon in which each atom is surrounded by four others in the form of a tetrahedron.,A gemstone made from this mineral.,A ring containing a diamond.,A very pale blue color.,Something that resembles a diamond.,A rhombus, especially when oriented so that its longer axis is vertical.,The polyiamond made up of two triangles.,The entire field of play used in the game.,The infield of a baseball field.,A card of the diamonds suit.,A size of type, standardised as 4+¹⁄₂ point.', 'sparkler,diamond ring,adamant,lozenge,2-iamond,ball field,baseball diamond', '', 'noun', '[{\"text\":\"diamonds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2568, 'diamond', 'made of, or containing diamond, a diamond or diamonds.,of, relating to, or being a sixtieth anniversary.,of, relating to, or being a seventy-fifth anniversary.,First-rate; excellent.', 'diamantine', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
