(2587, 'joint', 'The point where two components of a structure join, but are still able to rotate.,The point where two components of a structure join rigidly.,Any part of the body where two bones join, in most cases allowing that part of the body to be bent or straightened.,The means of securing together the meeting surfaces of components of a structure.,A cut of meat, especially (but not necessarily) (a) one containing a joint in the sense of an articulation or (b) one rolled up and tied.,The part or space included between two joints, knots, nodes, or articulations.,A fracture in which the strata are not offset; a geologic joint.,A place of resort for tramps.,An opium den.,A place of business, particularly in the food service or hospitality industries.,Prison.,A marijuana cigarette.,A syringe used to inject an illicit drug.,The penis.,A thing.', 'hinge,pivot,marijuana cigarette,penis', '', 'noun', '[{\"text\":\"joints\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
