(2596, 'patch', 'A piece of cloth, or other suitable material, sewed or otherwise fixed upon a garment to repair or strengthen it, especially upon an old garment to cover a hole.,A small piece of anything used to repair damage or a breach; as, a patch on a kettle, a roof, etc.,A piece of any size, used to repair something for a temporary period only, or that it is temporary because it is not meant to last long or will be removed as soon as a proper repair can be made, which will happen in the near future.,A small, usually contrasting but always somehow different or distinct, part of something else (location, time, size),A small area, a small plot of land or piece of ground.,A local region of professional responsibility.,A small piece of black silk stuck on the face or neck to heighten beauty by contrast, worn by ladies in the 17th and 18th centuries; an imitation beauty mark.,A piece of material used to cover a wound.,An adhesive piece of material, impregnated with a drug, which is worn on the skin, the drug being slowly absorbed over a period of time.,A cover worn over a damaged eye, an eyepatch.,A block on the muzzle of a gun, to do away with the effect of dispart, in sighting.,A patch file, a file that describes changes to be made to a computer file or files, usually changes made to a computer program that fix a programming bug.,A small piece of material that is manually passed through a gun barrel to clean it.,A piece of greased cloth or leather used as wrapping for a rifle ball, to make it fit the bore.,A cable connecting two pieces of electrical equipment.,A sound setting for a musical synthesizer (originally selected by means of a patch cable).,An overlay used to obtain a stronger impression.', 'section,area,blotch,spot,period of time,spell,stretch,tract,beauty spot,diff file', '', 'noun', '[{\"text\":\"patches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
