(2622, 'pocket', 'A bag stitched to an item of clothing, used for carrying small items.,Such a receptacle seen as housing someone\'s money; hence, financial resources.,An indention and cavity with a net sack or similar structure (into which the balls are to be struck) at each corner and one centered on each side of a pool or snooker table.,An enclosed volume of one substance surrounded by another.,An area of land surrounded by a loop of a river.,The area of the field to the side of the goal posts (four pockets in total on the field, one to each side of the goals at each end of the ground). The pocket is only a roughly defined area, extending from the behind post, at an angle, to perhaps about 30 meters out.,The area behind the line of scrimmage subject to certain rules regarding intentional grounding, illegal contact, etc., formally extending to the end zone but more usually understood as the central area around the quarterback directly protected by the offensive line.,An area where military units are completely surrounded by enemy units.,The position held by a second defensive middle, where an advanced middle must retreat after making a touch on the attacking middle.,The unbroken part of a wave that offers the surfer the most power.,A large bag or sack formerly used for packing various articles, such as ginger, hops, or cowries; the pocket of wool held about 168 pounds.,A hole or space covered by a movable piece of board, as in a floor, boxing, partitions, etc.,A cavity in a rock containing a nugget of gold, or other mineral; a small body of ore contained in such a cavity.,A strip of canvas sewn upon a sail so that a batten or a light spar can placed in the interspace.,The pouch of an animal.,The ideal point where the pins are hit by the bowling ball.,A socket for receiving the base of a post, stake, etc.,A bight on a lee shore.,A small space between a tooth and the adjoining gum, formed by an abnormal separation of the two.,A small, isolated group or area.', '', '