(2715, 'spirit', 'The soul of a person or other creature.,A supernatural being, often but not exclusively without physical form; ghost, fairy, angel.,Enthusiasm.,The manner or style of something.,A volatile liquid, such as alcohol. The plural form spirits is a generic term for distilled alcoholic beverages.,Energy; ardour.,One who is vivacious or lively; one who evinces great activity or peculiar characteristics of mind or temper.,Temper or disposition of mind; mental condition or disposition; intellectual or moral state.,Air set in motion by breathing; breath; hence, sometimes, life itself.,A rough breathing; an aspirate, such as the letter h; also, a mark denoting aspiration.,Intent; real meaning; opposed to the letter, or formal statement.,Any of the four substances: sulphur, sal ammoniac, quicksilver, and arsenic (or, according to some, orpiment).,Stannic chloride.', 'apparition,specter,vision [⇒ thesaurus],liqueur,liquor', '', 'noun', '[{\"text\":\"spirits\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2716, 'spirit', 'To carry off, especially in haste, secrecy, or mystery.,Sometimes followed by up: to animate with vigour; to excite; to encourage; to inspirit.', '', '', 'verb', '[{\"text\":\"spirits\",\"type\":\"present singular third-person\"},{\"text\":\"spiriting\",\"type\":\"participle present\"},{\"text\":\"spirited\",\"type\":\"participle past\"},{\"text\":\"spirited\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
