(2720, 'magic', 'The application of rituals or actions, especially those based on occult knowledge, to subdue or manipulate natural or supernatural beings and forces in order to have some benefit from them.,A specific ritual or procedure associated with such magic; a spell.,The supernatural forces which are drawn on in such a ritual.,Something producing successful and remarkable results, especially when not fully understood; an enchanting quality; exceptional skill.,Complicated or esoteric code that is not expected to be generally understood.,A conjuring trick or illusion performed to give the appearance of supernatural phenomena or powers.,The art or practice of performing conjuring tricks and illusions.', 'dwimmer,dweomercraft,dwimmercraft,thaumaturgy,conjuring,sorcery,witchcraft,wizardry,wizardcraft,warlockry,hexcraft,spellcraft,spellcasting,spellwork,charmwork,wandwork,enchantment,sleight of hand,illusionism,legerdemain,dwimmer', '', 'noun', '[{\"text\":\"magics\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2721, 'magic', 'Having supernatural talents, properties or qualities attributed to magic.,Producing extraordinary results, as though through the use of magic.,Pertaining to conjuring tricks or illusions performed for entertainment etc.,Great; excellent.,Describing the number of nucleons in a particularly stable isotopic nucleus; 2, 8, 20, 28, 50, 82, 126, and 184.,Being a literal number or string value with no meaning or context, not defined as a constant or variable', 'magical,wonderful,amazing,magical', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
