(2729, 'branch', 'The woody part of a tree arising from the trunk and usually dividing.,Any of the parts of something that divides like the branch of a tree.,A creek or stream which flows into a larger river.,One of the portions of a curve that extends outwards to an indefinitely great distance.,A location of an organization with several locations.,A line of family descent, in distinction from some other line or lines from the same stock; any descendant in such a line.,A local congregation of the LDS Church that is not large enough to form a ward; see Wikipedia article on ward in LDS church.,An area in business or of knowledge, research.,A certificate given by Trinity House to a pilot qualified to take navigational control of a ship in British waters.,A sequence of code that is conditionally executed.,A group of related files in a source control system, including for example source code, build scripts, and media such as images.,A branch line.', 'bough,limb,tiller,tillow,twig,tree', '', 'noun', '[{\"text\":\"branches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2730, 'branch', 'To arise from the trunk or a larger branch of a tree.,To produce branches.,To (cause to) divide into separate parts or subdivisions.,To jump to a different location in a program, especially as the result of a conditional statement.,To strip of branches.,To discipline (a union member) at a branch meeting.', '', '', 'verb', '[{\"text\":\"branches\",\"type\":\"present singular third-person\"},{\"text\":\"branching\",\"type\":\"participle present\"},{\"text\":\"branched\",\"type\":\"participle past\"},{\"text\":\"branched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
