(2733, 'mount', 'A hill or mountain.,Any of seven fleshy prominences in the palm of the hand, taken to represent the influences of various heavenly bodies.,A bulwark for offence or defence; a mound.,A bank; a fund.,A green hillock in the base of a shield.', 'mons', '', 'noun', '[{\"text\":\"mounts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2734, 'mount', 'An animal, usually a horse, used to ride on (unlike a draught horse).,A car, bicycle, or motorcycle used for racing.,A mounting; an object on which another object is mounted.,A rider in a cavalry unit or division.,A step or block to assist in mounting a horse.,A signal for mounting a horse.,A dominant ground grappling position, where one combatant sits on the other combatants torso with the face pointing towards the opponent\'s head.', '', '', 'noun', '[{\"text\":\"mounts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2735, 'mount', 'To get upon; to ascend; to climb.,To place oneself on (a horse, a bicycle, etc.); to bestride.,To cause to mount; to put on horseback; to furnish with animals for riding.,To cause (something) to rise or ascend; to drive up; to raise; to elevate; to lift up.,To sit on a combatants torso with the face pointing towards the opponent\'s head; to assume the mount position in ground grappling.,To rise on high; to go up; to be upraised or uplifted; to tower aloft; to ascend; often with up.,To attach (an object) to a support, backing, framework etc.,To attach (a drive or device) to the file system in order to make it available to the operating system.,To increase in quantity or intensity.,To attain in value; to amount (to).,To get on top of (another) for the purpose of copulation.,To have sexual intercourse with someone.,To begin (a campaign, military assault, etc.); to launch.,To deploy (cannon) for use.,To prepare and arrange the scenery, furniture, etc. for use in (a play or production).,To incorporate fat, especially butter, into (a dish, especially a sauce to finish it).', 'coitize', '', 'verb', '[{\"text\":\"mounts\",\"type\":\"present singular third-person\"},{\"text\":\"mounting\",\"type\":\"participle present\"},{\"text\":\"mounted\",\"type\":\"participle past\"},{\"text\":\"mounted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2736, 'election', 'A process of choosing a leader, members of parliament, councillors, or other representatives by popular vote.,The choice of a leader or representative by popular vote.,An option that is selected.,Any conscious choice.,In Calvinism, God\'s predestination of saints including all of the elect.,Those who are elected.', '', '', 'noun', '[{\"text\":\"elections\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
