(2742, 'touch', 'To make physical contact with; to bring the hand, finger or other part of the body into contact with.,To come into (involuntary) contact with; to meet or intersect.,To come into physical contact, or to be in physical contact.,To make physical contact with a thing.,To physically disturb; to interfere with, molest, or attempt to harm through contact.,To make intimate physical contact with a person.,To sexually excite with the fingers; to finger or masturbate.,To cause to be briefly in contact with something.,To physically affect in specific ways implied by context.,To consume, or otherwise use.,Of a ship or its passengers: to land, to make a short stop (at).,To lay hands on (someone suffering from scrofula) as a form of cure, as formerly practised by English and French monarchs.,To fasten; to take effect; to make impression.,To bring (a sail) so close to the wind that its weather leech shakes.,To be brought, as a sail, so close to the wind that its weather leech shakes.,To keep the ship as near (the wind) as possible.,To imbue or endow with a specific quality.,To deal with in speech or writing; to mention briefly, to allude to.,To deal with in speech or writing; briefly to speak or write (on or upon something).,To concern, to have to do with.,To affect emotionally; to bring about tender or painful feelings in.,To affect in a negative way, especially only slightly.,To give royal assent to by touching it with the sceptre.,To obtain money from, usually by borrowing (from a friend).,To disturb the mental functions of; to make somewhat insane; often followed with \"in the head\".,To be on the level of; to approach in excellence or quality.,To come close to; to approach.,To mark (a file or document) as having been modified.,To try; to prove, as with a touchstone.,To mark or delineate with touches; to add a slight stroke to with the pencil or brush.,To infect; to affect slightly.,To strike; to manipulate; to play on.,To perform, as a tune; to play.,To influence by impulse; to impel forcibly.', '', '', 'verb', '[{\"text\":\"touches\",\"type\":\"present singular third-person\"},{\"text\":\"touching\",\"type\":\"participle present\"},{\"text\":\"touched\",\"type\":\"participle past\"},{\"text\":\"touched\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"touch\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2743, 'touch', 'An act of touching, especially with the hand or finger.,The faculty or sense of perception by physical contact.,The style or technique with which one plays a musical instrument.,The particular or characteristic mode of action, or the resistance of the keys of an instrument to the fingers.,A distinguishing feature or characteristic.,A little bit; a small amount.,The part of a sports field beyond the touchlines or goal-lines.,A relationship of close communication or understanding.,The ability to perform a task well; aptitude.,Act or power of exciting emotion.,An emotion or affection.,Personal reference or application.,A single stroke on a drawing or a picture.,A brief essay.,A touchstone; hence, stone of the sort used for touchstone.,Examination or trial by some decisive standard; test; proof; tried quality.,The broadest part of a plank worked top and but, or of one worked anchor-stock fashion (that is, tapered from the middle to both ends); also, the angles of the stern timbers at the counters.,The children\'s game of tag.,A set of changes less than the total possible on seven bells, i.e. less than 5,040.,An act of borrowing or stealing something.,Tallow.,Form; standard of performance.,A disposal of the ball during a game, i.e. a kick or a handball.', '', '', 'noun', '[{\"text\":\"touches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2744, 'serve', 'An act of putting the ball or shuttlecock in play in various games.,A portion of food or drink, a serving.,An impressive presentation (especially of a person\'s appearance).', 'service,serving', '', 'noun', '[{\"text\":\"serves\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2745, 'serve', 'To be a formal servant for (a god or deity); to worship in an official capacity.,To be a servant for; to work for, to be employed by.,To wait upon (someone) at table; to set food and drink in front of, to help (someone) to food, meals etc.,To be a servant or worker; to perform the duties of a servant or employee; to render service.,To set down (food or drink) on the table to be eaten; to bring (food, drink) to a person.,To treat (someone) in a given manner.,To be suitor to; to be the lover of.,To be useful to; to meet the needs of.,To have a given use or purpose; to function for something or to do something.,To usefully take the place as, instead of something else.,To officially deliver (a legal notice, summons etc.).,To make legal service upon (a person named in a writ, summons, etc.),To lead off with the first delivery over the net in tennis, volleyball, ping pong, badminton etc.,To copulate with (of male animals); to cover.,To be in military service.,To work, to operate (a weapon).,To work through (a given period of time in prison, a sentence).,To wind spun yarn etc. tightly around (a rope or cable, etc.) so as to protect it from chafing or from the weather.,To perform (a public obligation).,To provide crack cocaine (to), usually by selling, dealing, or distributing.,To present an attractive personal appearance.,To attractively display something (especially a body part) as part of one\'s personal appearance.,To evoke something (especially a person) with one\'s personal appearance.', '', '', 'verb', '[{\"text\":\"serves\",\"type\":\"present singular third-person\"},{\"text\":\"serving\",\"type\":\"participle present\"},{\"text\":\"served\",\"type\":\"participle past\"},{\"text\":\"served\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
