(2748, 'suggest', 'To imply but stop short of explicitly stating (something).,To cause one to suppose (something); to bring to one\'s mind the idea (of something).,To explicitly mention (something) as a possibility for consideration, often to recommend it,To seduce; to prompt to evil; to tempt.', 'allude,hint,imply,insinuate,evoke,propose', '', 'verb', '[{\"text\":\"suggests\",\"type\":\"present singular third-person\"},{\"text\":\"suggesting\",\"type\":\"participle present\"},{\"text\":\"suggested\",\"type\":\"participle past\"},{\"text\":\"suggested\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2749, 'latin', 'Of or relating to the language spoken in ancient Rome and other cities of Latium which is now rarely used.,Of or relating to the script of the language spoken in ancient Rome and many modern alphabets.,Of or relating to ancient Rome or its Empire.,Of or relating to Latium (modern Lazio), the region around Rome.,Of or relating to the customs and people descended from the ancient Romans and their Empire.,Of or from Latin America or of Latin American culture.,Roman Catholic; of or pertaining to the Roman Rite of the Catholic Church.', 'Roman,Roman,Latian,Romance,Latin American,Latino,Catholic,Roman,Roman Catholic', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2750, 'latin', 'A person native to ancient Rome or its Empire.,A person from one of the modern European countries (including Italy, Spain etc.) whose language is descended from Latin.,A person from Latin America.,A person adhering to Roman Catholic practice.,A person native to the ancient region of Latium.', 'Roman,Latin American,Latino,Catholic,Roman,Roman Catholic', '', 'noun', '[{\"text\":\"Latins\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2751, 'virus', 'A submicroscopic, non-cellular structure consisting of a core of DNA or RNA surrounded by a protein coat, that requires a living host cell to replicate, and often causes disease in the host organism; such agents are often classed as nonliving infectious particles and less often as microorganisms.,A quantity of such infectious agents,A disease caused by such an infectious agent; a viral illness.,Venom, as produced by a poisonous animal etc.,A type of malware which can covertly transmit itself between computers via networks (especially the Internet) or removable storage such as disks, often causing damage to systems and data; also computer virus.,Any type of malware.,Any malicious or dangerous entity that spreads from one place or person to another.', 'virus', '', 'noun', '[{\"text\":\"viruses\",\"type\":\"plural\"},{\"text\":\"virusses\",\"type\":\"plural\"},{\"text\":\"vira\",\"type\":\"plural rare\"},{\"text\":\"viri\",\"type\":\"plural proscribed\"},{\"text\":\"virii\",\"type\":\"plural proscribed\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2752, 'virus', 'To send or infect an electronic device with a computer virus.', '', '', 'verb', '[{\"text\":\"viruses\",\"type\":\"present singular third-person\"},{\"text\":\"virusing\",\"type\":\"participle present\"},{\"text\":\"virused\",\"type\":\"participle past\"},{\"text\":\"virused\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2753, 'quarter', 'Each of four equal parts into which something can be divided; a fourth part.,A measure of capacity used chiefly for grain or coal, varying greatly in quantity by time and location.,A fourth part of a pound; approximately 113 grams.,A measure of length; originally a fourth part of an ell, now chiefly a fourth part of a yard.,A fourth part of the night; one of the watches or divisions of the night.,A fourth part of the year; 3 months; a term or season.,A fourth part of an hour; a period of fifteen minutes, especially with reference to the quarter before or after the hour.,A fourth part of a hundredweight.,A fourth part of a coat of arms, or the charge on it, larger than a canton and normally on the upper dexter side, formed by a perpendicular line from the top meeting a horizontal line from the side.,A quarter-dollar, divided into 25 cents; the coin of that value minted in the United States or Canada.,One of four equal periods into which a game is divided.,A quarter of an acre or 40 roods.,A region or place.,Each of four parts into which the earth or sky is divided, corresponding to the four cardinal points of the compass.,A division or section of a town or city, especially having a particular character of its own, or associated with a particular group etc.,One\'s residence or dwelling-place; (in plural) rooms, lodgings, especially as allocated to soldiers or domestic staff.,A topic or area of endeavour.,The aftmost part of a vessel\'s side, roughly from the last mast to the stern.,The part on either side of a horse\'s hoof between the toe and heel, the side of its coffin.,A section (of a population), especially one having a particular set of values or interests.,Relations between people.,Accommodation given to a defeated opponent; mercy; exemption from being killed.,A quarterback.,A quartermaster; a quartermaster sergeant.,A quarterfinal.', 'fourth,fourth part,¼,district,ward,neighborhood,ghetto,borough,capitoulate', '', 'noun', '[{\"text\":\"quarters\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2754, 'quarter', 'Pertaining to an aspect of a quarter.,Consisting of a fourth part, a quarter (¹⁄₄, 25%).,Related to a three-month term, a quarter of a year.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2755, 'quarter', 'To divide into quarters; to divide by four.,To provide housing for military personnel or other equipment.,To lodge; to have a temporary residence.,To quartersaw.', 'stay over', '', 'verb', '[{\"text\":\"quarters\",\"type\":\"present singular third-person\"},{\"text\":\"quartering\",\"type\":\"participle present\"},{\"text\":\"quartered\",\"type\":\"participle past\"},{\"text\":\"quartered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2756, 'quarter', 'To drive a carriage so as to prevent the wheels from going into the ruts, or so that a rut shall be between the wheels.', '', '', 'verb', '[{\"text\":\"quarters\",\"type\":\"present singular third-person\"},{\"text\":\"quartering\",\"type\":\"participle present\"},{\"text\":\"quartered\",\"type\":\"participle past\"},{\"text\":\"quartered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2757, 'define', 'To determine with precision; to mark out with distinctness; to ascertain or exhibit clearly.,To settle, decide (an argument etc.),To express the essential nature of something.,To state the meaning of a word, phrase, sign, or symbol.,To describe, explain, or make definite and clear; used to request the listener or other person to elaborate or explain more clearly his or her intended meaning of a word or expression.,To demark sharply the outlines or limits of an area or concept.,To establish the referent of a term or notation.', '', '', 'verb', '[{\"text\":\"defines\",\"type\":\"present singular third-person\"},{\"text\":\"defining\",\"type\":\"participle present\"},{\"text\":\"defined\",\"type\":\"participle past\"},{\"text\":\"defined\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
