(2759, 'abuse', 'Improper treatment or usage; application to a wrong or bad purpose; an unjust, corrupt or wrongful practice or custom.,Misuse; improper use; perversion.,A delusion; an imposture; misrepresentation; deception.,Coarse, insulting speech; abusive language; language that unjustly or angrily vilifies.,Catachresis.,Physical maltreatment; injury; cruel treatment.,Violation; defilement; rape; forcing of undesired sexual activity by one person on another, often on a repeated basis.', 'misuse,invective,contumely,reproach,scurrility,insult,opprobrium,abusio', '', 'noun', '[{\"text\":\"abuses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2760, 'abuse', 'To put to a wrong use; to misapply; to use improperly; to misuse; to use for a wrong purpose or end; to pervert,To injure; to maltreat; to hurt; to treat with cruelty, especially repeatedly.,To attack with coarse language; to insult; to revile; malign; to speak in an offensive manner to or about someone; to disparage.,To imbibe a drug for a purpose other than it was intended; to intentionally take more of a drug than was prescribed for recreational reasons; to take illegal drugs habitually.,To violate; defile; to rape; (reflexive) to masturbate.,Misrepresent; adulterate.,To deceive; to trick; to impose on; misuse the confidence of.,Disuse.', 'maltreat,injure,revile,reproach,vilify,vituperate,offend', '', 'verb', '[{\"text\":\"abuses\",\"type\":\"present singular third-person\"},{\"text\":\"abusing\",\"type\":\"participle present\"},{\"text\":\"abused\",\"type\":\"participle past\"},{\"text\":\"abused\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
