(2763, 'manage', 'To direct or be in charge of.,To handle or control (a situation, job).,To handle with skill, wield (a tool, weapon etc.).,To succeed at an attempt in spite of difficulty.,To achieve (something) without fuss, or without outside help.,To manage to say; to say while fighting back embarrassment, laughter, etc.,To train (a horse) in the manège; to exercise in graceful or artful action.,To treat with care; to husband.,To bring about; to contrive.', 'bewield', '', 'verb', '[{\"text\":\"manages\",\"type\":\"present singular third-person\"},{\"text\":\"managing\",\"type\":\"participle present\"},{\"text\":\"managed\",\"type\":\"participle past\"},{\"text\":\"managed\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"manage\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
