(2765, 'corner', 'The space in the angle between converging lines or walls which meet in a point.,The projection into space of an angle in a solid object.,An intersection of two streets; any of the four outer points off the street at that intersection.,Denoting a premises that is in a convenient local location, notionally, but not necessarily literally, on the corner of two streets.,The point where two converging lines meet; an angle, either external or internal.,An edge or extremity; the part farthest from the center; hence, any quarter or part, or the direction in which it lies.,A secret or secluded place; a remote or out of the way place; a nook.,An embarrassing situation; a difficulty.,A sufficient interest in a salable security or commodity to allow the cornering party to influence prices.,One of the four vertices of the strike zone.,First base or third base.,A corner kick.,A cornerback.,The corner of the ring, which is where the boxer rests before and during a fight.,The group of people who assist a boxer during a bout.,A place where people meet for a particular purpose.,A point scored in a rubber at whist.', '', '', 'noun', '[{\"text\":\"corners\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2766, 'corner', 'To drive (someone or something) into a corner or other confined space.,To trap in a position of great difficulty or hopeless embarrassment.,To put (someone) in an awkward situation.,To get sufficient command of (a stock, commodity, etc.), so as to be able to manipulate its price.,To turn a corner or drive around a curve.,To handle while moving around a corner in a road or otherwise turning.,To supply with corners.', '', '', 'verb', '[{\"text\":\"corners\",\"type\":\"present singular third-person\"},{\"text\":\"cornering\",\"type\":\"participle present\"},{\"text\":\"cornered\",\"type\":\"participle past\"},{\"text\":\"cornered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2767, 'element', 'Any one of the simplest chemical substances that cannot be decomposed in a chemical reaction or by any chemical means and made up of atoms all having the same number of protons.,One of the four basic building blocks of matter in theories of ancient philosophers and alchemists: water, earth, fire, and air.,A basic, simple substance out of which something is made, raw material.,A required aspect or component of a cause of action. A deed is regarded as a violation of law only if each element can be proved.,One of the objects in a set.,One of the entries of a matrix.,Any of the teeth of a zip fastener.,One of the simplest or essential parts or principles of which anything consists, or upon which the constitution or fundamental powers of anything are based.,A small part of the whole.,A small but present amount of a quality, a hint.,A factor, one of the conditions contributing to a result.,The sky.,Any one of the heavenly spheres believed to carry the celestial bodies.,Atmospheric forces such as strong winds and rains.,A place or state of being that an individual or object is best suited to.,The bread and wine taken at Holy Communion.,A group of people within a larger group having a particular common characteristic.,The basic principles of a field of knowledge, basics, fundamentals, rudiments.,A component in electrical equipment, often in the form of a coil, having a high resistance, thereby generating heat when a current is passed through it.,An infinitesimal interval of a quantity, a differential.,An orbital element; one of the parameters needed to uniquely specify a particular orbit.,One of the conceptual objects in a markup language, usually represented in text by tags.', 'chemical element,firststuff,member', '', 'noun', '[{\"text\":\"elements\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
