(2793, 'moment', 'A brief, unspecified amount of time.,The smallest portion of time; an instant.,Weight or importance.,Ellipsis of moment of force.,A definite period of time, specifically one-tenth of a point, or one-fortieth or one-fiftieth of an hour.,A petit mal episode; such a spell.,A fit; a brief tantrum.,An infinitesimal change in a varying quantity; an increment or decrement.,A quantitative measure of the shape of a set of points.,(As in \"X moment\") An embarrassing event, supposed to be characteristic of some person, group, or situation.', 'stound,instant,trice,bit [⇒ thesaurus],blink of an eye,crack,flash,half a mo,instant,jiffy,minute,mo,New York minute,in nothing flat,overnight,sec,second,span,spurt,stound,tick,trice,twinkle,twinkling,torque', '', 'noun', '[{\"text\":\"moments\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
