(2795, 'reach', 'To extend, stretch, or thrust out (for example a limb or object held in the hand).,To give to someone by stretching out a limb, especially the hand; to give with the hand; to pass to another person; to hand over.,To stretch out the hand.,To attain or obtain by stretching forth the hand; to extend some part of the body, or something held, so as to touch, strike, grasp, etc.,To strike or touch.,To extend an action, effort, or influence to; to penetrate to; to pierce, or cut.,To extend to; to stretch out as far as; to touch by virtue of extent.,To arrive at (a place) by effort of any kind.,To make contact with.,To connect with (someone) on an emotional level, making them receptive of (one); to get through to (someone).,To arrive at a particular destination.,To continue living until or up to (a certain age).,To understand; to comprehend.,To strain after something; to make (sometimes futile or pretentious) efforts.,To extend in dimension, time etc.; to stretch out continuously (past, beyond, above, from etc. something).,To sail on the wind, as from one point of tacking to another, or with the wind nearly abeam.,To arrive at a particular destination, especially to join someone; to meet up.', 'contact,get hold of,get in touch,link up', '', 'verb', '[{\"text\":\"reaches\",\"type\":\"present singular third-person\"},{\"text\":\"reaching\",\"type\":\"participle present\"},{\"text\":\"reached\",\"type\":\"participle past\"},{\"text\":\"reached\",\"type\":\"past\"},{\"text\":\"raught\",\"type\":\"obsolete participle past\"},{\"text\":\"raught\",\"type\":\"obsolete past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"reach\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
