(2799, 'column', 'A solid upright structure designed usually to support a larger structure above it, such as a roof or horizontal beam, but sometimes for decoration.,A vertical line of entries in a table, usually read from top to bottom.,A body of troops or army vehicles, usually strung out along a road.,A body of text meant to be read line by line, especially in printed material that has multiple adjacent such on a single page.,A unit of width, especially of advertisements, in a periodical, equivalent to the width of a usual column of text.,A recurring feature in a periodical, especially an opinion piece, especially by a single author or small rotating group of authors, or on a single theme.,Something having similar vertical form or structure to the things mentioned above, such as a spinal column.,The gynostemium,An object used to separate the different components of a liquid or to purify chemical compounds.', 'post,pillar,sile', '', 'noun', '[{\"text\":\"columns\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2800, 'chain', 'A series of interconnected rings or links usually made of metal.,A series of interconnected things.,A series of stores or businesses with the same brand name.,A number of atoms in a series, which combine to form a molecule.,A series of interconnected links of known length, used as a measuring device.,A long measuring tape.,A unit of length equal to 22 yards. The length of a Gunter\'s surveying chain. The length of a cricket pitch. Equal to 20.12 metres, 4 rods, or 100 links.,A totally ordered set, especially a totally ordered subset of a poset.,A sequence of linked house purchases, each of which is dependent on the preceding and succeeding purchase (said to be \"broken\" if a buyer or seller pulls out).,That which confines, fetters, or secures; a bond.,Iron links bolted to the side of a vessel to bold the dead-eyes connected with the shrouds; also, the channels.,A livery collar, a chain of office.,The warp threads of a web.', 'rackle', '', 'noun', '[{\"text\":\"chains\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
