(2802, 'identify', 'To establish the identity of someone or something.,To disclose the identity of someone.,To establish the taxonomic classification of an organism.,To equate or make the same; to unite or combine into one.,To have a strong affinity with; to feel oneself to be modelled on or connected to.,To associate oneself with some group; to feel, or believe one feels, the same way.,To claim an identity; to describe oneself as a member of a group; to assert the use of a particular term to describe oneself.', 'clock,ID,ken,to make someone,notice,recognize,twig', '', 'verb', '[{\"text\":\"identifies\",\"type\":\"present singular third-person\"},{\"text\":\"identifying\",\"type\":\"participle present\"},{\"text\":\"identified\",\"type\":\"participle past\"},{\"text\":\"identified\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
