(2819, 'attack', 'An attempt to cause damage, injury to, or death of opponent or enemy.,An attempt to detract from the worth or credibility of, a person, position, idea, object, or thing, by physical, verbal, emotional, or other assault.,A time in which one attacks; the offence of a battle.,The beginning of active operations on anything.,An attempt to exploit a vulnerability in a computer system.,Collectively, the bowlers of a cricket side.,Any contact with the ball other than a serve or block which sends the ball across the plane of the net.,The three attackmen on the field or all the attackmen of a team.,The sudden onset of a disease or condition.,An active episode of a chronic or recurrent disease.,The onset of a musical note, particularly with respect to the strength (and duration) of that onset.,The amount of time it takes for the volume of an audio signal to go from zero to maximum level (e.g. an audio waveform representing a snare drum hit would feature a very fast attack, whereas that of a wave washing to shore would feature a slow attack).', 'hit,spike', 'decay,release', 'noun', '[{\"text\":\"attacks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2820, 'attack', 'To apply violent force to someone or something.,To aggressively challenge a person, idea, etc., with words (particularly in newspaper headlines, because it typesets into less space than \"criticize\" or similar).,To begin to affect; to act upon injuriously or destructively; to begin to decompose or waste.,To deal with something in a direct way; to set to work upon.,To aim balls at the batsman’s wicket.,To set a field, or bowl in a manner designed to get wickets.,To bat aggressively, so as to score runs quickly.,To move forward in an active attempt to score a point, as opposed to trying not to concede.,To accelerate quickly in an attempt to get ahead of the other riders.,(Of a chemical species) To approach a chemical species or bond in order to form a bond with it.', '', '', 'verb', '[{\"text\":\"attacks\",\"type\":\"present singular third-person\"},{\"text\":\"attacking\",\"type\":\"participle present\"},{\"text\":\"attacked\",\"type\":\"participle past\"},{\"text\":\"attacked\",\"type\":\"past\"},{\"text\":\"attackt\",\"type\":\"obsolete participle past\"},{\"text\":\"attackt\",\"type\":\"obsolete past\"},{\"text\":\"attackted\",\"type\":\"dialectal obsolete participle past\"},{\"text\":\"attackted\",\"type\":\"dialectal obsolete past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"attack\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2821, 'sequence', 'A set of things next to each other in a set order; a series,The state of being sequent or following; order of succession.,A series of musical phrases where a theme or melody is repeated, with some change each time, such as in pitch or length (example: opening of Beethoven\'s Fifth Symphony).,A musical composition used in some Catholic Masses between the readings. The most famous sequence is the Dies Irae (Day of Wrath) formerly used in funeral services.,An ordered list of objects, typically indexed with natural numbers.,A subsequent event; a consequence or result.,A series of shots that depict a single action or style in a film, television show etc.,A meld consisting of three or more cards of successive ranks in the same suit, such as the four, five and six of hearts.', 'chain,consecution,series,succession', '', 'noun', '[{\"text\":\"sequences\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
