(2824, 'sorry', 'Expresses regret, remorse, or sorrow.,Used as a request for someone to repeat something not heard or understood clearly.,Used to correct oneself in speech.,Said as a request to pass somebody.', 'soz,I beg your pardon?,I\'m sorry?,say again,come again,excuse me?,say again,excuse me', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2825, 'sorry', 'The act of saying sorry; an apology.', '', '', 'noun', '[{\"text\":\"sorries\",\"type\":\"plural\"},{\"text\":\"sorrys\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2826, 'damage', 'Injury or harm; the condition or measure of something not being intact.,Cost or expense.', '', '', 'noun', '[{\"text\":\"damages\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2827, 'damage', 'To impair the soundness, goodness, or value of; to harm or cause destruction.,To undergo damage.,To remove a damaged or unsalable item from the sales floor for processing.', '', '', 'verb', '[{\"text\":\"damages\",\"type\":\"present singular third-person\"},{\"text\":\"damaging\",\"type\":\"participle present\"},{\"text\":\"damaged\",\"type\":\"participle past\"},{\"text\":\"damaged\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
