(2829, 'opening', 'Pertaining to the start or beginning of a series of events.,describing the first period of play, usually up to the fall of the first wicket; describing a batsman who opens the innings or a bowler who opens the attack', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2830, 'opening', 'An act or instance of making or becoming open.,A gap permitting passage through.,An act or instance of beginning.,The first performance of a show or play by a particular troupe.,The initial period when a show at an art gallery or museum is first opened, especially the first evening.,The first few measures of a musical composition.,The first few moves in a game.,A time available in a schedule.,An unoccupied employment position.,A vacant position, especially in an array.,An opportunity, as in a competitive activity.,In mathematical morphology, the dilation of the erosion of a set.', 'hole,availability,slot,job opening', '', 'noun', '[{\"text\":\"openings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2831, 'reserve', 'The act of reserving or keeping back; reservation; exception.,Restraint of freedom in words or actions; backwardness; caution in personal behavior.,A natural resource known to exist but not currently exploited.,A tract of land reserved, or set apart, for a particular purpose,A tract of land set apart for the use of an Aboriginal group; Indian reserve (compare US reservation.),A body of troops kept in the rear of an army drawn up for battle, reserved to support the other lines as occasion may require; a force or body of troops kept for an exigency.,Funds kept on hand to meet planned or unplanned financial requirements.,A reserve price in an auction.,Wine held back and aged before being sold.,Absence of color or decoration; the state of being left plain.,A member of a team who does not participate from the start of the game, but can be used to replace tired or injured team-mates.,A group or pile of cards dealt out at the beginning of a patience or solitaire game to be used during play.,In exhibitions, a distinction indicating that the recipient will get a prize in the event of another person being disqualified.,A resist.,A preparation used on an object being electroplated to fix the limits of the deposit.', 'self-restraint,reticence,taciturnity,reservation,res,rez,Army Reserve,substitute', '', 'noun', '[{\"text\":\"reserves\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2832, 'reserve', 'To keep back; to retain.,To keep in store for future or special use.,To book in advance; to make a reservation.,To make an exception of; to except.', 'sign up,register,schedule,enroll,book', '', 'verb', '[{\"text\":\"reserves\",\"type\":\"present singular third-person\"},{\"text\":\"reserving\",\"type\":\"participle present\"},{\"text\":\"reserved\",\"type\":\"participle past\"},{\"text\":\"reserved\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2833, 'gamma', 'The third letter of the Greek alphabet (Γ, γ), preceded by beta (Β, β) and followed by delta, (Δ, δ).,A gamma ray or gamma-ray photon.,The Gamma function, symbolized by Γ.,A constant approximately equal to 0.57721566, symbolized by γ (also known as the Euler–Mascheroni constant).,A non-SI unit of measure of magnetic flux density, equal to 1 nT.,A non-SI unit of measure of mass, equal to 1 microgramme.,Slope of log-log plot of video input and luminance output.,Flight path angle; the angle by which an aircraft\'s flight path deviates from the horizontal plane.,A second-order measure of derivative price sensitivity, expressed as the rate of change in delta with respect to changes in the underlying asset price.,Synonym of gamma correction.', 'gamma correction', '', 'noun', '[{\"text\":\"gammas\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
