(2840, 'weekend', 'The break in the working week, usually two days including the traditional holy or sabbath day. Thus in western countries, Saturday and Sunday.', '', '', 'noun', '[{\"text\":\"weekends\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2841, 'weekend', 'To spend the weekend.', '', '', 'verb', '[{\"text\":\"weekends\",\"type\":\"present singular third-person\"},{\"text\":\"weekending\",\"type\":\"participle present\"},{\"text\":\"weekended\",\"type\":\"participle past\"},{\"text\":\"weekended\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
