(2843, 'failure', 'State or condition of not meeting a desirable or intended objective, opposite of success.,Omission to do something, whether or not it was attempted, especially something that ought to have been done.,An object, person or endeavour in a state of failure or incapable of success.,Termination of the ability of an item to perform its required function; breakdown.,Bankruptcy.', 'loser', '', 'noun', '[{\"text\":\"failures\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2844, 'dollar', 'Official designation for currency in some parts of the world, including Canada, the United States, Australia, New Zealand, Hong Kong, and elsewhere. Its symbol is $.,Money generally.,A quarter of a pound or one crown, historically minted as a coin of approximately the same size and composition as a then-contemporary dollar coin of the United States, and worth slightly more.,Imported from the United States, and paid for in U.S. dollars. (Note: distinguish \"dollar wheat\", North American farmers\' slogan, meaning a market price of one dollar per bushel.),A unit of reactivity equal to the interval between delayed criticality and prompt criticality.', 'buck,smackeroo', '', 'noun', '[{\"text\":\"dollars\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2845, 'truth', 'True facts, genuine depiction or statements of reality.,Conformity to fact or reality; correctness, accuracy.,The state or quality of being true to someone or something.,Faithfulness, fidelity.,A pledge of loyalty or faith.,Conformity to rule; exactness; close correspondence with an example, mood, model, etc.,That which is real, in a deeper sense; spiritual or ‘genuine’ reality.,Something acknowledged to be true; a true statement or axiom.,Topness; the property of a truth quark.,In the game truth or dare, the choice to truthfully answer a question put forth.', 'straight goods,verity', '', 'noun', '[{\"text\":\"truths\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2846, 'truth', 'To assert as true; to declare; to speak truthfully.,To make exact; to correct for inaccuracy.,To tell the truth.', '', '', 'verb', '[{\"text\":\"truths\",\"type\":\"present singular third-person\"},{\"text\":\"truthing\",\"type\":\"participle present\"},{\"text\":\"truthed\",\"type\":\"participle past\"},{\"text\":\"truthed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2847, 'counter', 'One who counts.,A reckoner; someone who collects data by counting; an enumerator.,An object (now especially a small disc) used in counting or keeping count, or as a marker in games, etc.,A telltale; a contrivance attached to an engine, printing press, or other machine, for the purpose of counting the revolutions or the pulsations.,A variable, memory location, etc. whose contents are incremented to keep a count.,A hit counter.,A table or board on which money is counted and over which business is transacted,A shop tabletop on which goods are examined, weighed or measured.,In a kitchen, a surface, often built into the wall and above a cabinet, designed to be used for food preparation.,In a bathroom, a surface, often built into the wall and above a cabinet, which holds the washbasin.,Any stone lying closer to the center than any of the opponent\'s stones.,The prison attached to a city court; a compter.,A class of word used along with numbers to count objects and events, typically mass nouns. Although rare and optional in English (e.g. \"20 head of cattle\"), they are numerous and required in Chinese, Japanese, and Korean.', '', '', 'noun', '[{\"text\":\"counters\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2848, 'counter', 'Contrary, in opposition; in an opposite direction.,In the wrong way; contrary to the right course.', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2849, 'counter', 'Something opposite or contrary to something else.,A proactive defensive hold or move in reaction to a hold or move by one\'s opponent.,The overhanging stern of a vessel above the waterline, below and somewhat forward of the stern proper.,The piece of a shoe or a boot around the heel of the foot (above the heel of the shoe/boot).,Alternative form of contra Formerly used to designate any under part which served for contrast to a principal part, but now used as equivalent to countertenor.,The breast of a horse; that part of a horse between the shoulders and under the neck.,The enclosed or partly closed negative space of a glyph.,An encounter.', '', '', 'noun', '[{\"text\":\"counters\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2850, 'counter', 'To contradict, oppose.,To return a blow while receiving one, as in boxing.,To take action in response to; to respond.,To encounter.', '', '', 'verb', '[{\"text\":\"counters\",\"type\":\"present singular third-person\"},{\"text\":\"countering\",\"type\":\"participle present\"},{\"text\":\"countered\",\"type\":\"participle past\"},{\"text\":\"countered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
