(2852, 'produce', 'To bring forth, to yield, make, manufacture, or otherwise generate.,To make (a thing) available to a person, an authority, etc.; to provide for inspection.,To sponsor and present (a motion picture, etc) to an audience or to the public.,To extend an area, or lengthen a line.,To draw out; to extend; to lengthen or prolong.,To alter using technology, as opposed to simply performing.', 'bring forth,come up with,present,offer', '', 'verb', '[{\"text\":\"produces\",\"type\":\"present singular third-person\"},{\"text\":\"producing\",\"type\":\"participle present\"},{\"text\":\"produced\",\"type\":\"participle past\"},{\"text\":\"produced\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2853, 'produce', 'That which is produced.,Harvested agricultural goods collectively, especially vegetables and fruit, but possibly including eggs, dairy products and meat; the saleable food products of farms.,Offspring.,Livestock and pet food supplies.', 'output,proceeds,product,yield', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
