(2856, 'bridge', 'A construction spanning a waterway, ravine, or valley from an elevated height, allowing for the passage of vehicles, pedestrians, trains, etc.,The upper bony ridge of the human nose.,A prosthesis replacing one or several adjacent teeth.,The gap between the holes on a bowling ball,An elevated platform above the upper deck of a mechanically propelled ship from which it is navigated and from which all activities on deck can be seen and controlled by the captain, etc; smaller ships have a wheelhouse, and sailing ships were controlled from a quarterdeck.,The piece, on string instruments, that supports the strings from the sounding board.,A particular form of one hand placed on the table to support the cue when making a shot in cue sports.,A cue modified with a convex arch-shaped notched head attached to the narrow end, used to support a player\'s (shooter\'s) cue for extended or tedious shots. Also called a spider.,Anything supported at the ends and serving to keep some other thing from resting upon the object spanned, as in engraving, watchmaking, etc., or which forms a platform or staging over which something passes or is conveyed.,A defensive position in which the wrestler is supported by his feet and head, belly-up, in order to prevent touch-down of the shoulders and eventually to dislodge an opponent who has established a position on top.,A similar position in gymnastics.,A rudimentary procedure before definite solution,A device which connects two or more computer buses, typically in a transparent manner.,A software component connecting two or more separate systems.,A system which connects two or more local area networks at layer 2 of OSI model.,An intramolecular valence bond, atom or chain of atoms that connects two different parts of a molecule; the atoms so connected being bridgeheads.,An unintended solder connection between two or more components or pins.,A contrasting section within a song that prepares for the return of the original material section.,An edge which, if removed, changes a connected graph to one that is not connected.,A point in a line where a break in a word unit cannot occur.,A statement, such as an offer, that signals a possibility of accord.,A day falling between two public holidays and consequently designated as an additional holiday.,A connection, real or abstract.,Any of several electrical devices that measure characteristics such as impedance and inductance by balancing different parts of a circuit,A low wall or vertical partition in the fire chamber of a furnace, for deflecting flame, etc.; a bridge wall.,The situation where a lone rider or small group of riders closes the space between them and the rider or group in front.,A solid crust of undissolved salt in a water softener.,An elongated chain of teammates, connected to the pack, for improved blocking potential.', '', '', 'noun', '[{\"text\":\"bridges\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2857, 'bridge', 'To be or make a bridge over something.,To span as if with a bridge.,To transition from one piece or section of music to another without stopping.,To connect two or more computer buses, networks etc. with a bridge.,To go to the bridge position.,To employ the bridge tactic. (See Noun section.)', '', '', 'verb', '[{\"text\":\"bridges\",\"type\":\"present singular third-person\"},{\"text\":\"bridging\",\"type\":\"participle present\"},{\"text\":\"bridged\",\"type\":\"participle past\"},{\"text\":\"bridged\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2858, 'bridge', 'A card game played with four players playing as two teams of two players each.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2859, 'native', 'Belonging to one by birth.,Characteristic of or relating to people inhabiting a region from prehistoric times.,Alternative letter-case form of Native (of or relating to the native inhabitants of the Americas, or of Australia).,Born or grown in the region in which it lives or is found; not foreign or imported.,Which occurs of its own accord in a given locality, to be contrasted with a species introduced by humans.,Pertaining to the system or architecture in question.,Occurring naturally in its pure or uncombined form.,Arising by birth; having an origin; born.,Original; constituting the original substance of anything.,Naturally related; cognate; connected (with).', 'inborn,aboriginal,aboriginal,autochthonal,autochthonous,endemic,indigenous', '', 'adj', '[{\"text\":\"more native\",\"type\":\"comparative\"},{\"text\":\"most native\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2860, 'native', 'A person who is native to a place; a person who was born in a place.,A person of aboriginal descent, as distinguished from a person who was or whose ancestors were foreigners or settlers/colonizers. Alternative letter-case form of Native (aboriginal inhabitant of the Americas or Australia).,A native speaker.,Ostrea edulis, a kind of oyster.', '', '', 'noun', '[{\"text\":\"natives\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2861, 'native', 'Indian: Native American or First Nation; of or relating to (North) American Indians.,Aboriginal; of or relating to Australian Aboriginal peoples, Aborigines.,Related to black Africans, especially Bantu.,Aboriginal to a colonized region, especially one colonized by English-speaking people. (Compare native, which is more general.)', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2862, 'native', 'A Native American.,An Aborigine.,A black African, especially a Bantu.,An aboriginal inhabitant of a colonized region, especially one colonized by English-speaking people. (Compare native, which is more general.)', '', '', 'noun', '[{\"text\":\"Natives\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
