(2863, 'movement', 'Physical motion between points in space.,A system or mechanism for transmitting motion of a definite character, or for transforming motion, such as the wheelwork of a watch.,The impression of motion in an artwork, painting, novel etc.,A trend in various fields or social categories, a group of people with a common ideology who try together to achieve certain general goals,A large division of a larger composition.,Melodic progression, accentual character, tempo or pace.,An instance of an aircraft taking off or landing.,The deviation of a pitch from ballistic flight.,A pattern in which pairs change opponents and boards move from table to table in duplicate bridge.,An act of emptying the bowels.,Motion of the mind or feelings; emotion.', 'motion', 'stasis', 'noun', '[{\"text\":\"movements\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2864, 'printing', 'The process or business of producing printed material by means of inked type and a printing press or similar technology.,Material that has been printed.,All the copies of a publication that have been printed in one batch.,Written characters that are not joined up.', 'imprintery', '', 'noun', '[{\"text\":\"printings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2865, 'printing', 'present participle of print,To inadequately carry a concealed weapon such that its silhouette is visible on the person wearing it.', '', '', 'verb', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2866, 'baseball', 'A sport common in North America, the Caribbean, and Japan, in which the object is to strike a ball so that one of a nine-person team can run counter-clockwise among four bases, resulting in the scoring of a run. The team with the most runs after termination of play, usually nine innings, wins.,The ball used to play the sport of baseball.,A variant of poker in which cards with baseball-related values have special significance.', '', '', 'noun', '[{\"text\":\"baseballs\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2867, 'approval', 'An expression granting permission; an indication of agreement with a proposal; an acknowledgement that a person, thing, or event meets requirements.,An expression of favorable acceptance and encouragement; a compliment that also condones.,Something mailed by a seller to a collector to match their stated interests; the collector can approve of or return the item.', 'approbation,approbation,assent [⇒ thesaurus],assentment,consent,sanction [⇒ thesaurus],commendation', '', 'noun', '[{\"text\":\"approvals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
