(2872, 'plastic', 'A synthetic, solid, hydrocarbon-based polymer, whether thermoplastic or thermosetting.,Credit or debit cards used in place of cash to buy goods and services.,insincerity; fakeness, or a person who is fake or arrogant, or believes that they are better than the rest of the population.,An instance of plastic surgery.,A sculptor, moulder.,Any solid but malleable substance.', '', '', 'noun', '[{\"text\":\"plastics\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2873, 'plastic', 'Capable of being moulded; malleable, flexible, pliant.,Producing tissue.,Creative, formative.,Capable of adapting to varying conditions; characterized by environmental adaptability.,Of or pertaining to the inelastic, non-brittle, deformation of a material.,Made of plastic.,Inferior or not the real thing.,fake; insincere.', 'malleable,flexible,pliant,moldable,ersatz,fake,insincere', 'elastic,genuine,sincere', 'adj', '[{\"text\":\"more plastic\",\"type\":\"comparative\"},{\"text\":\"most plastic\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
