(2875, 'equal', 'To be equal to, to have the same value as; to correspond to.,To make equivalent to; to cause to match.,To have as its consequence.', 'be,is,entail,imply,lead to,mean,result in,spell', '', 'verb', '[{\"text\":\"equals\",\"type\":\"present singular third-person\"},{\"text\":\"equalling\",\"type\":\"Commonwealth participle present\"},{\"text\":\"equaling\",\"type\":\"US participle present\"},{\"text\":\"equalled\",\"type\":\"Commonwealth participle past\"},{\"text\":\"equalled\",\"type\":\"Commonwealth past\"},{\"text\":\"equaled\",\"type\":\"US participle past\"},{\"text\":\"equaled\",\"type\":\"US past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
