(3014, 'promote', 'To raise (someone) to a more important, responsible, or remunerative job or rank.,To advocate or urge on behalf of (something or someone); to attempt to popularize or sell by means of advertising or publicity.,To encourage, urge or incite.,To elevate to a higher league.,To increase the activity of (a catalyst) by changing its surface structure.,To exchange (a pawn) for a queen or other piece when it reaches the eighth rank.,To move on to a subsequent stage of education.', '', '', 'verb', '[{\"text\":\"promotes\",\"type\":\"present singular third-person\"},{\"text\":\"promoting\",\"type\":\"participle present\"},{\"text\":\"promoted\",\"type\":\"participle past\"},{\"text\":\"promoted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
