(3171, 'speak', 'To communicate with one\'s voice, to say words out loud.,To have a conversation.,To communicate or converse by some means other than orally, such as writing or facial expressions.,To deliver a message to a group; to deliver a speech.,To be able to communicate in a language.,To be able to communicate in the manner of specialists in a field.,To utter.,To communicate (some fact or feeling); to bespeak, to indicate.,To understand (as though it were a language).,To produce a sound; to sound.,Of a bird, to be able to vocally reproduce words or phrases from a human language.,To address; to accost; to speak to.', '', '', 'verb', '[{\"text\":\"speaks\",\"type\":\"present singular third-person\"},{\"text\":\"speaking\",\"type\":\"participle present\"},{\"text\":\"spoke\",\"type\":\"past\"},{\"text\":\"spake\",\"type\":\"archaic past\"},{\"text\":\"or (colloquial, nonstandard) spoke\",\"type\":\"colloquial participle past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"speak\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
