(3246, 'marriage', 'The state of being married.,The union of only two people, to the exclusion of all others.\n My grandparents\' marriage lasted for forty years.,The union of only two people, to the exclusion of all others.\n My grandparents\' marriage lasted for forty years.,The union of two people of opposite sex, to the exclusion of all others.,A union of two or more people that creates a family tie and carries legal, social, and/or religious rights and responsibilities.,A wedding; a ceremony in which people wed.,A close union.,A joining of two parts.,A king and a queen, when held as a hand in some versions of poker or melded in pinochle.,In solitaire or patience games, the placing a card of the same suit on the next one above or below it in value.,A homosexual relationship between male prisoners.', '', '', 'noun', '[{\"text\":\"marriages\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
