(3250, 'remain', 'To stay after others or other parts have been removed or otherwise disappeared.,To be left after a number or quantity has been subtracted or cut off; to be left as not included or comprised.,To continue unchanged in place, form, or condition, or undiminished in quantity; to abide; to stay; to endure; to last.,To await; to be left to.,To continue in a state of being.', 'rest,abide,beleave,belive,continue,dwell,keep,linger,rest,stay,linger,endure,await,stay', '', 'verb', '[{\"text\":\"remains\",\"type\":\"present singular third-person\"},{\"text\":\"remaining\",\"type\":\"participle present\"},{\"text\":\"remained\",\"type\":\"participle past\"},{\"text\":\"remained\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
