(3256, 'equity', 'Fairness, impartiality, or justice as determined in light of \"natural law\" or \"natural right\".,The power of a court of law having extra-statutory discretion, to decide legal matters and to provide legal relief apart from, though not in violation of, the prevailing legal code; in some cases, a court \"sitting in equity\" may provide relief to a complainant should the code be found either inapplicable or insufficient to do so.,A right which accrues to a party in a transaction because of the nature of the transaction itself, and which is exercisable upon a change of circumstances or conditions; in other words, an equitable claim.,The body of law which was developed in the English Court of Chancery, which Court had extra-statutory discretion, and is now administered alongside the common law of Britain.,Value of property minus liens or other encumbrances.,Ownership, especially in terms of net monetary value of some business.,Ownership interest in a company as determined by subtracting liabilities from assets.,A player\'s expected share of the pot.,Equality', '', 'inequity,iniquity', 'noun', '[{\"text\":\"equities\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3257, 'lawyer', 'A professional person with a graduate law degree that qualifies for legal work (such as Juris Doctor),A professional person qualified (as by a law degree or bar exam) and authorized to practice law as an attorney-at-law, solicitor, advocate, barrister or equivalent, i.e. represent parties in lawsuits or trials and give legal advice.,A lawyer\'s time and advice are his stock in trade. - aphorism often credited to Abraham Lincoln, but without attestation,A legal layman who argues points of law.,The burbot.,The stem of a bramble.,A relative of the raspberry found in Australia and New Zealand, Rubus australis,Various species of Calamus, including Calamus australis, Calamus muelleri, Calamus obstruens, Calamus vitiensis, Calamus warburgii, and Calamus moti.,A woody climbing rainforest vine, Flagellaria indica.', '', '', 'noun', '[{\"text\":\"lawyers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3258, 'lawyer', 'To practice law.,To perform, or attempt to perform, the work of a lawyer.,To make legalistic arguments.,To barrage (a person) with questions in order to get them to admit something.', '', '', 'verb', '[{\"text\":\"lawyers\",\"type\":\"present singular third-person\"},{\"text\":\"lawyering\",\"type\":\"participle present\"},{\"text\":\"lawyered\",\"type\":\"participle past\"},{\"text\":\"lawyered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
