(3428, 'static', 'Unchanging; that cannot or does not change.,Making no progress; stalled, without movement or advancement.,Immobile; fixed in place; having no motion.,Computed, created, or allocated before the program starts running, as opposed to at runtime.,Defined for the class itself, as opposed to instances of it; thus shared between all instances and accessible even without an instance.', 'stable,stable,still', 'dynamic,dynamic,kinetic,mobile,moving,dynamic,nonstatic', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
