(3432, 'presence', 'The fact or condition of being present, or of being within sight or call, or at hand.,The part of space within one\'s immediate vicinity.,A quality of poise and effectiveness that enables a performer to achieve a close relationship with their audience.,A quality that sets an individual out from others; a quality that makes them noticed and/or admired even if they are not speaking or performing.,Something (as a spirit) felt or believed to be present.,A company\'s business activity in a particular market.,An assembly of great persons.,The state of being closely focused on the here and now, not distracted by irrelevant thoughts.,Synonym of room tone', 'room tone', '', 'noun', '[{\"text\":\"presences\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
