(3434, 'phoenix', 'A mythological bird, said to be the only one of its kind, which lives for 500 years and then dies by burning to ashes on a pyre of its own making, ignited by the sun. It then arises anew from the ashes.,Anything that is reborn after apparently being destroyed.,A mythological Chinese chimerical bird whose physical body symbolizes the six celestial bodies; a fenghuang.,A Greek silver coin used briefly from 1828 to 1832, divided into 100 lepta.,A marvelous person or thing.', '', '', 'noun', '[{\"text\":\"phoenix\",\"type\":\"plural\"},{\"text\":\"phoenixes\",\"type\":\"plural\"},{\"text\":\"phoenices\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
