(3438, 'matrix', 'A table of data.,The cavity or mold in which anything is formed.,The material or tissue in which more specialized structures are embedded.,An extracellular matrix, the material or tissue between the cells of animals or plants.,Part of the mitochondrion.,The medium in which bacteria are cultured.,a term describing a controlled environment or situation in which people act or behave in ways that conform to roles pre-determined by a powerful person(s) who decides how the world is supposed to function (as if the world is but virtual reality and people but brains in a vat).,A rectangular arrangement of numbers or terms having various uses such as transforming coordinates in geometry, solving systems of linear equations in linear algebra and representing graphs in graph theory.,A two-dimensional array.,A grid-like arrangement of electronic components, especially one intended for information coding, decoding or storage.,A geological matrix.,The sediment surrounding and including the artifacts, features, and other materials at a site.,The environment from which a given sample is taken.,In hot metal typesetting, a mold for casting a letter.,In printmaking, the plate or block used, with ink, to hold the image that makes up the print.,The five simple colours (black, white, blue, red, and yellow) from which all the others are formed.,A binding agent of composite materials, e.g. resin in fibreglass.,The womb.', 'array,grid,spreadsheet,table,printing form', '', 'noun', '[{\"text\":\"matrices\",\"type\":\"plural\"},{\"text\":\"matrixes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
