(3454, 'proper', 'Suited or acceptable to the purpose or circumstances; fit, suitable.,Following the established standards of behavior or manners; correct or decorous.,Used to designate a particular person, place, or thing. Proper nouns are usually written with an initial capital letter.,Pertaining exclusively to a specific thing or person; particular.,In the strict sense; within the strict definition or core (of a specified place, taxonomic order, idea, etc).,Belonging to oneself or itself; own.,Portrayed in natural or usual coloration, as opposed to conventional tinctures.,Being strictly part of some other thing (not necessarily explicitly mentioned, but of definitional importance), and not being the thing itself.,Eigen-; designating a function or value which is an eigenfunction or eigenvalue.,Excellent, of high quality; such as the specific person or thing should ideally be. (Now often merged with later senses.),Attractive, elegant.,In the very strictest sense of the word.,Utter, complete.', 'complete', '', 'adj', '[{\"text\":\"more proper\",\"type\":\"comparative\"},{\"text\":\"most proper\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
