(3461, 'cruise', 'To sail about, especially for pleasure.,To travel at constant speed for maximum operating efficiency.,To move about an area leisurely in the hope of discovering something, or looking for custom.,To inspect (forest land) for the purpose of estimating the quantity of lumber it will yield.,To actively seek a romantic partner or casual sexual partner by moving about a particular area; to troll.,To walk while holding on to an object (stage in development of ambulation, typically occurring at 10 months).,To win easily and convincingly.,To take part in a cruise (car enthusiasts\' event where they drive their vehicles in a group).', '', '', 'verb', '[{\"text\":\"cruises\",\"type\":\"present singular third-person\"},{\"text\":\"cruising\",\"type\":\"participle present\"},{\"text\":\"cruised\",\"type\":\"participle past\"},{\"text\":\"cruised\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
