(3466, 'alpha', 'The name of the first letter of the Greek alphabet (Α, α), followed by beta. In the Latin alphabet it is the predecessor to A.,Latin alpha: the Latin letter Ɑ (minuscule: ɑ).,The name of the symbols Α and α used in science and mathematics, often interchangeable with the symbols when used as a prefix.,The return of a given asset or portfolio adjusted for systematic risk.,A person, especially a male, who is dominant, successful and attractive; (see alpha male).,Short for alphabet.,The first versions of a program, usually only available to the developer, and only tested by the developer.,Angle of attack.,The level of translucency of a color, as determined by the alpha channel.,The significance level of a statistical test; the alpha level.,In omegaverse fiction, a person of a dominant secondary sex driven by biology, magic, or other means to bond with an omega, with males of this type often having canine-like genitalia.', '', '', 'noun', '[{\"text\":\"alphas\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
