(3477, 'appeal', 'An application to a superior court or judge for a decision or order by an inferior court or judge to be reviewed and overturned.,The legal document or form by which such an application is made; also, the court case in which the application is argued.,A person\'s legal right to apply to court for such a review.,An accusation or charge against someone for wrongdoing (especially treason).,A process which formerly might be instituted by one private person against another for some heinous crime demanding punishment for the particular injury suffered, rather than for the offence against the public; an accusation.,At common law, an accusation made against a felon by one of their accomplices (called an approver).,A call to a person or an authority for a decision, help, or proof; an entreaty, an invocation.,The act, by the fielding side, of asking an umpire for a decision on whether a batsman is out or not.,A resort to some physical means; a recourse.,A power to attract or interest.,A call to, or the use of, a principle or quality for purposes of persuasion.,A summons to defend one\'s honour in a duel, or one\'s innocence in a trial by combat; a challenge.', '', '', 'noun', '[{\"text\":\"appeals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3478, 'appeal', 'Often followed by against (the inferior court\'s decision) or to (the superior court): to apply to a superior court or judge for a decision or order by an inferior court or judge to be reviewed and overturned.,To apply to a superior court or judge to review and overturn (a decision or order by an inferior court or judge).,To accuse or charge (someone) with wrongdoing (especially treason).,Of a private person: to instituted legal proceedings (against another private person) for some heinous crime, demanding punishment for the particular injury suffered.,Of the accomplice of a felon: to make an accusation at common law against (the felon).,To call upon a person or an authority to corroborate a statement, to decide a controverted question, or to vindicate one\'s rights; to entreat, to invoke.,Of a fielding side; to ask an umpire for a decision on whether a batsman is out or not, usually by saying \"How\'s that?\" or \"Howzat?\".,To call upon someone for a favour, help, etc.,To have recourse or resort to some physical means.,To be attractive.,To summon (someone) to defend their honour in a duel, or their innocence in a trial by combat; to challenge.', '', '', 'verb', '[{\"text\":\"appeals\",\"type\":\"present singular third-person\"},{\"text\":\"appealing\",\"type\":\"participle present\"},{\"text\":\"appealed\",\"type\":\"participle past\"},{\"text\":\"appealed\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"appeal\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
