(3539, 'dress', 'To put clothes (or, formerly, armour) on (oneself or someone, a doll, a mannequin, etc.); to clothe.,To attire (oneself or someone) for a particular (especially formal) occasion, or in a fashionable manner.,To design, make, provide, or select clothes (for someone).,To arrange or style (someone\'s hair).,To arrange a display of goods in, or to decorate (a shop or shop window).,To ornament (a ship) by hoisting the national colours at the peak and mastheads, and setting the jack forward; when \"dressed full\", the signal flags and pennants are added.,To adorn or ornament (something).,To apply a dressing to or otherwise treat (a wound); (obsolete) to give (a wounded person) medical aid.,To prepare, treat, or curry (animal hide or leather).,To prepare the surface of (a material, usually lumber or stone).,To remove chaff or impurities from (flour, grain, etc.) by bolting or sifting, winnowing, and other methods.,To prepare (an artificial fly) to be attached to a fish hook.,To fit or prepare (something) for use; to render (something) suitable for an intended purpose; to get ready.,To cultivate or tend to (a garden, land, plants, etc.); especially, to add fertilizer or manure to (soil); to fertilize, to manure.,To cut up (an animal or its flesh) for food; specifically (hunting), to remove the internal organs (of a game animal) shortly after it has been killed so that the carcass cools more quickly; to field dress.,To prepare (food) for cooking or eating, especially by seasoning it; specifically, to add a dressing or sauce (to food, especially a salad).,To design, make, or prepare costumes (for a play or other performance); also, to present (a production) in a particular costume style.,To prepare (a set) by installing the props, scenery, etc.,To arrange (soldiers or troops) into proper formation; especially, to adjust (soldiers or troops) into straight lines and at a proper distance from each other; to align.,To treat (someone) in a particular manner; specifically, in an appropriate or fitting manner; (by extension, ironic) to give (someone) a deserved beating; also, to give (someone) a good scolding; to dress down.,To break in and train (a horse or other animal) for use.,To prepare (oneself); to make ready.,To put on clothes.,To attire oneself for a particular (especially formal) occasion, or in a fashionable manner.,Of a thing: to attain a certain condition after undergoing some process or treatment to fit or prepare it for use.,To allow one\'s penis to fall to one side or the other within one\'s trousers.,Ellipsis of cross-dress.,Of an animal carcass: to have a certain quantity or weight after removal of the internal organs and skin; also, to have a certain appearance after being cut up and prepared for cooking.,Of soldiers or troops: to arrange into proper formation; especially, to form into straight lines and at a proper distance from each other.,Of a sportsperson: to put on the uniform and have the equipment needed to play a sport.', 'attire,don,clothe,attire,don,clothe,bandage,put a bandage on,get dressed,get dressed', 'strip,undress,undress,strip,undress,undress,disrobe,get undressed,strip,undress,disrobe,get undressed,strip,undress', 'verb', '[{\"text\":\"dresses\",\"type\":\"present singular third-person\"},{\"text\":\"dressing\",\"type\":\"participle present\"},{\"text\":\"dressed\",\"type\":\"past\"},{\"text\":\"dressed\",\"type\":\"participle past\"},{\"text\":\"drest\",\"type\":\"obsolete participle past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"dress\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
