(3683, 'generic', 'Very comprehensive; pertaining or appropriate to large classes or groups (genera) as opposed to specific instances.,Pertaining to genera of life instead of particular species thereof.,lacking in precision, often in an evasive fashion; vague; imprecise,not having a brand name; nonproprietary in design or contents; fungible with the rest of its class.,Relating to gender.,specifying neither masculine nor feminine; epicene; unisex.,Written so as to operate on any data type, the type required being passed as a parameter.,Having coordinates that are algebraically independent over the base field.', 'catholic,ecumenical,general,nonsingular,nonspecific,universal,unparticular,unsingular,unspecific,fuzzy', 'specific,instantial,specific,instantial,specific', 'adj', '[{\"text\":\"more generic\",\"type\":\"comparative\"},{\"text\":\"most generic\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
