(3689, 'trouble', 'A distressing or dangerous situation.,A difficulty, problem, condition, or action contributing to such a situation.,A violent occurrence or event.,Efforts taken or expended, typically beyond the normal required.,A malfunction.,Liability to punishment; conflict with authority.,A fault or interruption in a stratum.,Wife. Clipping of trouble and strife.', '', '', 'noun', '[{\"text\":\"troubles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3690, 'trouble', 'To disturb, stir up, agitate (a medium, especially water).,To mentally distress; to cause (someone) to be anxious or perplexed.,In weaker sense: to bother or inconvenience.,To take pains to do something.,To worry; to be anxious.', '', '', 'verb', '[{\"text\":\"troubles\",\"type\":\"present singular third-person\"},{\"text\":\"troubling\",\"type\":\"participle present\"},{\"text\":\"troubled\",\"type\":\"participle past\"},{\"text\":\"troubled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3691, 'affect', 'To influence or alter.,To move to emotion.,Of an illness or condition, to infect or harm (a part of the body).,To dispose or incline.,To tend to by affinity or disposition.,To assign; to appoint.,To burden (property) with a fixed charge or payment, or other condition or restriction.', 'alter,change,have an effect on,have an impact on,influence,move,touch,attack,harm,infect', '', 'verb', '[{\"text\":\"affects\",\"type\":\"present singular third-person\"},{\"text\":\"affecting\",\"type\":\"participle present\"},{\"text\":\"affected\",\"type\":\"participle past\"},{\"text\":\"affected\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"affect\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3692, 'affect', 'To make a show of; to put on a pretense of; to feign; to assume. To make a false display of.,To aim for, to try to obtain.,To feel affection for (someone); to like, be fond of.,To show a fondness for (something); to choose.', 'fake,simulate,feign', '', 'verb', '[{\"text\":\"affects\",\"type\":\"present singular third-person\"},{\"text\":\"affecting\",\"type\":\"participle present\"},{\"text\":\"affected\",\"type\":\"participle past\"},{\"text\":\"affected\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
