(3696, 'heritage', 'An inheritance; property that may be inherited.,A tradition; a practice or set of values that is passed down from preceding generations through families or through institutional memory.,A birthright; the status acquired by birth, especially of but not exclusive to the firstborn.,Having a certain background, such as growing up with a second language.', '', '', 'noun', '[{\"text\":\"heritages\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3697, 'wheel', 'A steering wheel and its implied control of a vehicle.,The instrument attached to the rudder by which a vessel is steered.,A spinning wheel.,A potter\'s wheel.,A circular device capable of rotating on its axis, facilitating movement or transportation or performing labour in machines.,The breaking wheel, an old instrument of torture.,A person with a great deal of power or influence; a big wheel.,A superuser on certain systems.,The lowest straight in poker: ace, 2, 3, 4, 5.,A wheelrim.,A round portion of cheese.,A Catherine wheel firework.,A rolling or revolving body; anything of a circular form; a disk; an orb.,A turn or revolution; rotation; compass.,A recurring or cyclical course of events.,A dollar.,A crown coin; a \"cartwheel\".,A bicycle or tricycle.,A manoeuvre in marching in which the marchers turn in a curving fashion to right or left so that the order of marchers does not change.', 'breaking wheel,rim', '', 'noun', '[{\"text\":\"wheels\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3698, 'wheel', 'To roll along on wheels.,To transport something or someone using any wheeled mechanism, such as a wheelchair.,To ride a bicycle or tricycle.,To change direction quickly, turn, pivot, whirl, wheel around.,To cause to change direction quickly, turn.,To travel around in large circles, particularly in the air.,To put into a rotatory motion; to cause to turn or revolve; to make or perform in a circle.', '', '', 'verb', '[{\"text\":\"wheels\",\"type\":\"present singular third-person\"},{\"text\":\"wheeling\",\"type\":\"participle present\"},{\"text\":\"wheeled\",\"type\":\"participle past\"},{\"text\":\"wheeled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3699, 'climate', 'The long-term manifestations of weather and other atmospheric conditions in a given area or country, now usually represented by the statistical summary of its weather conditions during a period long enough to ensure that representative values are obtained (generally 30 years).,The context in general of a particular political, moral, etc., situation.,Clipping of climate change.,An area of the earth\'s surface between two parallels of latitude.,A region of the Earth.', '', '', 'noun', '[{\"text\":\"climates\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
