(3701, 'template', 'A physical object whose shape is used as a guide to make other objects.,A generic model or pattern from which other objects are based or derived.,document template (file with a basic outline for a work),A macromolecule which provides a pattern for the synthesis of another molecule.,A partially defined class or function, that can be instantiated in a variety of ways depending on the instantiation arguments.,A strip of metal used in boiler-making, pierced with a series of holes, and serving as a guide in marking out a line of rivet-holes.', '', '', 'noun', '[{\"text\":\"templates\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
