(3709, 'greek', 'To display a placeholder (instead of text), especially to optimize speed in displaying text that would be too small to read.,To fill a template with nonsense text (particularly the Lorem ipsum), so that form can be focused on instead of content.', '', '', 'verb', '[{\"text\":\"greeks\",\"type\":\"present singular third-person\"},{\"text\":\"greeking\",\"type\":\"participle present\"},{\"text\":\"greeked\",\"type\":\"participle past\"},{\"text\":\"greeked\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3710, 'describe', 'To represent in words.,To represent by drawing; to draw a plan of; to delineate; to trace or mark out.,To give rise to a geometrical structure.,To introduce a new taxon to science by explaining its characteristics and particularly how it differs from other taxa.,To distribute into parts, groups, or classes; to mark off; to class.', 'portray,bewrite,betell,delineate,depict,chronicle,explain,narrate,portray,recount,relate,report,represent,set forth,state [⇒ thesaurus]', '', 'verb', '[{\"text\":\"describes\",\"type\":\"present singular third-person\"},{\"text\":\"describing\",\"type\":\"participle present\"},{\"text\":\"described\",\"type\":\"participle past\"},{\"text\":\"described\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3711, 'sharp', 'Terminating in a point or edge, especially one that can cut easily; not obtuse or rounded.,Intelligent.,Higher than usual by one semitone (denoted by the symbol ♯ after the name of the note).,Higher in pitch than required.,Having an intense, acrid flavour.,Sudden and intense.,Illegal or dishonest.,Keenly or unduly attentive to one\'s own interests; shrewd.,Exact, precise, accurate; keen.,Offensive, critical, or acrimonious.,Stylish or attractive.,Observant; alert; acute.,Forming a small angle; especially, forming an angle of less than ninety degrees.,Steep; precipitous; abrupt.,Said of as extreme a value as possible.,Tactical; risky.,Piercing; keen; severe; painful.,Eager or keen in pursuit; impatient for gratification.,Fierce; ardent; fiery; violent; impetuous.,Composed of hard, angular grains; gritty.,Uttered in a whisper, or with the breath alone; aspirated; unvoiced.,Hungry.', 'keen,razor,razor-sharp,brainy,bright,intelligent,keen,smart,witty,acrid,pungent,abrupt,acute,stabbing,dishonest,dodgy,illegal,illicit,underhand,accurate,exact,keen,precise,acrimonious,bitter,cutting,harsh,hostile,nasty,chic,elegant,smart,stylish,acute,alert,keen,observant,sharp-eyed', '', 'adj', '[{\"text\":\"sharper\",\"type\":\"comparative\"},{\"text\":\"sharpest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3712, 'sharp', 'To a point or edge; piercingly; eagerly; sharply.,Exactly.,In a higher pitch than is correct or desirable.', 'exactly', '', 'adv', '[{\"text\":\"sharper\",\"type\":\"comparative\"},{\"text\":\"sharpest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3713, 'sharp', 'The symbol ♯, placed after the name of a note in the key signature or before a note on the staff to indicate that the note is to be played a semitone higher.,A note that is played a semitone higher than usual; denoted by the name of the note that is followed by the symbol ♯.,A note that is sharp in a particular key.,The scale having a particular sharp note as its tonic.,A hypodermic syringe.,A scalpel or other edged instrument used in surgery.,A sharp tool or weapon.,Something that is sharp.,A dishonest person; a cheater.,Part of a stream where the water runs very rapidly.,A sewing needle with a very slender point, more pointed than a blunt or a between.,Fine particles of husk mixed with coarse particle of flour of cereals; middlings.,An expert.,A sharpie (member of Australian gangs of the 1960s and 1970s).', '', '', 'noun', '[{\"text\":\"sharps\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
