(3744, 'organic', 'Pertaining to or derived from living organisms.,Pertaining to an organ of the body of a living organism.,Relating to the compounds of carbon, relating to natural products.,Of food or food products, grown in an environment free from artificial agrichemicals, and possibly certified by a regulatory body.,Describing a form of social solidarity theorized by Emile Durkheim that is characterized by voluntary engagements in complex interdependencies for mutual benefit (such as business agreements), rather than mechanical solidarity, which depends on ascribed relations between people (as in a family or tribe).,Of a military unit or formation, or its elements, belonging to a permanent organization (in contrast to being temporarily attached).,Instrumental; acting as instruments of nature or of art to a certain destined function or end.,Generated according to the ranking algorithms of a search engine, as opposed to paid placement by advertisers.,Developing in a gradual or natural fashion.,Harmonious; coherent; structured.', '', '', 'adj', '[{\"text\":\"more organic\",\"type\":\"comparative\"},{\"text\":\"most organic\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
