(3746, 'spread', 'To stretch out, open out (a material etc.) so that it more fully covers a given area of space.,To extend (individual rays, limbs etc.); to stretch out in varying or opposing directions.,To disperse, to scatter or distribute over a given area.,To proliferate; to become more widely present, to be disseminated.,To disseminate; to cause to proliferate, to make (something) widely known or present.,To take up a larger area or space; to expand, be extended.,To smear, to distribute in a thin layer.,To cover (something) with a thin layer of some substance, as of butter.,To prepare; to set and furnish with provisions.,To open one’s legs, especially for sexual favours.', '', '', 'verb', '[{\"text\":\"spreads\",\"type\":\"present singular third-person\"},{\"text\":\"spreading\",\"type\":\"participle present\"},{\"text\":\"spread\",\"type\":\"participle past\"},{\"text\":\"spread\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
