(3790, 'circle', 'A two-dimensional geometric figure, a line, consisting of the set of all those points in a plane that are equally distant from a given point (center).,A two-dimensional geometric figure, a disk, consisting of the set of all those points of a plane at a distance less than or equal to a fixed distance (radius) from a given point.,Any thin three-dimensional equivalent of the geometric figures.,A curve that more or less forms part or all of a circle.,Any shape, curve or arrangement of objects that approximates to or resembles the geometric figures.,A specific group of persons; especially one who shares a common interest.,The orbit of an astronomical body.,A line comprising two semicircles of 30 yards radius centred on the wickets joined by straight lines parallel to the pitch used to enforce field restrictions in a one-day match.,A ritual circle that is cast three times deosil and closes three times widdershins either in the air with a wand or literally with stones or other items used for worship.,A traffic circle or roundabout.,Compass; circuit; enclosure.,An instrument of observation, whose graduated limb consists of an entire circle. When fixed to a wall in an observatory, it is called a mural circle; when mounted with a telescope on an axis and in Y\'s, in the plane of the meridian, a meridian or transit circle; when involving the principle of reflection, like the sextant, a reflecting circle; and when that of repeating an angle several times continuously along the graduated limb, a repeating circle.,A series ending where it begins, and repeating itself.,A form of argument in which two or more unproved statements are used to prove each other; inconclusive reasoning.,Indirect form of words; circumlocution.,A territorial division or district.,A bagginess of the skin below the eyes from lack of sleep.', 'coil,ring,loop,disc,disk,round,bunch,gang,group', '', 'noun', '[{\"text\":\"circles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NUL