(3795, 'logic', 'A method of human thought that involves thinking in a linear, step-by-step manner about how a problem can be solved. Logic is the basis of many principles including the scientific method.,The study of the principles and criteria of valid inference and demonstration.,The mathematical study of relationships between rigorously defined concepts and of mathematical proof of statements.,A formal or informal language together with a deductive system or a model-theoretic semantics.,Any system of thought, whether rigorous and productive or not, especially one associated with a particular person.,It\'s hard to work out his system of logic.,The part of a system (usually electronic) that performs the boolean logic operations, short for logic gates or logic circuit.', 'formal system', '', 'noun', '[{\"text\":\"logics\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
