(3842, 'launch', 'To throw (a projectile such as a lance, dart or ball); to hurl; to propel with force.,To pierce with, or as with, a lance.,To cause (a vessel) to move or slide from the land or a larger vessel into the water; to set afloat.,To cause (a rocket, balloon, etc., or the payload thereof) to begin its flight upward from the ground.,To send out; to start (someone) on a mission or project; to give a start to (something); to put in operation,To start (a program or feature); to execute or bring into operation.,To release; to put onto the market for sale,Of a ship, rocket, balloon, etc.: to depart on a voyage; to take off.,To move with force and swiftness like a sliding from the stocks into the water; to plunge; to begin.,To start to operate.', 'lance,pierce', '', 'verb', '[{\"text\":\"launches\",\"type\":\"present singular third-person\"},{\"text\":\"launching\",\"type\":\"participle present\"},{\"text\":\"launched\",\"type\":\"participle past\"},{\"text\":\"launched\",\"type\":\"past\"},{\"text\":\"launcht\",\"type\":\"obsolete participle past\"},{\"text\":\"launcht\",\"type\":\"obsolete past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3843, 'launch', 'The movement of a vessel from land into the water; especially, the sliding on ways from the stocks on which it is built. (Compare: to splash a ship.),The act or fact of launching (a ship/vessel, a project, a new book, etc.).,An event held to celebrate the launch of a ship/vessel, project, a new book, etc.; a launch party.', '', '', 'noun', '[{\"text\":\"launches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
