(3851, 'trail', 'To follow behind (someone or something); to tail (someone or something).,To drag (something) behind on the ground.,To leave (a trail of).,To show a trailer of (a film, TV show etc.); to release or publish a preview of (a report etc.) in advance of the full publication.,To hang or drag loosely behind; to move with a slow sweeping motion.,To run or climb like certain plants.,To drag oneself lazily or reluctantly along.,To be losing, to be behind in a competition.,To carry (a firearm) with the breech near the ground and the upper part inclined forward, the piece being held by the right hand near the middle.,To create a trail in.,To travel by following or creating trails.,To transport (livestock) by herding it along a trail.,To take advantage of the ignorance of; to impose upon.', '', '', 'verb', '[{\"text\":\"trails\",\"type\":\"present singular third-person\"},{\"text\":\"trailing\",\"type\":\"participle present\"},{\"text\":\"trailed\",\"type\":\"participle past\"},{\"text\":\"trailed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
