(3853, 'plain', 'Flat, level.,Ordinary; lacking adornment or ornamentation; unembellished.,Of just one colour; lacking a pattern.,Simple in habits or qualities; unsophisticated, not exceptional, ordinary.,Having only few ingredients, or no additional ingredients or seasonings; not elaborate, without toppings or extras.,Containing no extended or nonprinting characters (especially in plain text).,Evident to one\'s senses or reason; manifest, clear, unmistakable.,Downright; total, unmistakable (as intensifier).,Honest and without deception; candid, open; blunt.,Clear; unencumbered; equal; fair.,Not unusually beautiful; unattractive.,Not a trump.', 'no-frills,monochrome,normal,ordinary,frank', '', 'adj', '[{\"text\":\"plainer\",\"type\":\"comparative\"},{\"text\":\"plainest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
