(3972, 'fruit', 'In general, a product of plant growth useful to man or animals.,Specifically, a sweet and/or sour, edible part of a plant that resembles seed-bearing fruit (see next sense), even if it does not develop from a floral ovary; also used in a technically imprecise sense for some sweet or sweetish vegetables, such as the petioles of rhubarb, that resemble a true fruit or are used in cookery as if they were a fruit.,The seed-bearing part of a plant, often edible, colourful and fragrant, produced from a floral ovary after fertilization.,The spores of cryptogams and their accessory organs.,A product of fertilization in a plant, specifically,An end result, effect, or consequence; advantageous or disadvantageous result.,Of, belonging to, related to, or having fruit or its characteristics; (of living things) producing or consuming fruit.,A homosexual man; (derogatory, figurative) an effeminate man.,Offspring from a sexual union.,A crazy person.', '', '', 'noun', '[{\"text\":\"fruits\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
