(3975, 'reform', 'The change of something that is defective, broken, inefficient or otherwise negative, in order to correct or improve it', 'reformation,amendment,rectification,correction', '', 'noun', '[{\"text\":\"reforms\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3976, 'reform', 'To put into a new and improved form or condition; to restore to a former good state, or bring from bad to good; to change from worse to better,to reform a profligate man; to reform corrupt manners or morals; to reform a criminal,To return to a good state; to amend or correct one\'s own character or habits,To form again or in a new configuration.', '', '', 'verb', '[{\"text\":\"reforms\",\"type\":\"present singular third-person\"},{\"text\":\"reforming\",\"type\":\"participle present\"},{\"text\":\"reformed\",\"type\":\"participle past\"},{\"text\":\"reformed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
