(3982, 'reflect', 'To bend back (light, etc.) from a surface.,To be bent back (light, etc.) from a surface.,To mirror, or show the image of something.,To be mirrored.,To agree with; to closely follow.,To give evidence of someone\'s or something\'s character etc.,To think seriously; to ponder or consider.', '', '', 'verb', '[{\"text\":\"reflects\",\"type\":\"present singular third-person\"},{\"text\":\"reflecting\",\"type\":\"participle present\"},{\"text\":\"reflected\",\"type\":\"participle past\"},{\"text\":\"reflected\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3983, 'wonder', 'Something that causes amazement or awe; a marvel.,Something astonishing and seemingly inexplicable.,Someone very talented at something, a genius.,The sense or emotion which can be inspired by something curious or unknown; surprise; astonishment, often with awe or reverence.,A mental pondering, a thought.,A kind of donut; a cruller.', '', '', 'noun', '[{\"text\":\"wonders\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3984, 'wonder', 'To be affected with surprise or admiration; to be struck with astonishment; to be amazed; to marvel; often followed by at.,To ponder; to feel doubt and curiosity; to query in the mind.', 'ponder', '', 'verb', '[{\"text\":\"wonders\",\"type\":\"present singular third-person\"},{\"text\":\"wondering\",\"type\":\"participle present\"},{\"text\":\"wondered\",\"type\":\"participle past\"},{\"text\":\"wondered\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"wonder\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
