(3991, 'alliance', 'The state of being allied.,The act of allying or uniting.,A union or connection of interests between families, states, parties, etc., especially between families by marriage and states by compact, treaty, or league.,Any union resembling that of families or states; union by relationship in qualities; affinity.,The persons or parties allied.,Marriage.', 'union,connection,affinity,union,allyship,coalition,league,confederation,team', '', 'noun', '[{\"text\":\"alliances\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
