(3996, 'lewis', 'A cramp iron inserted into a cavity in order to lift heavy stones; used as a symbol of strength in Freemasonry.,The son of a Freemason, envisaged as assisting his father in heavy work or in old age.,A kind of shears used in cropping woollen cloth.', 'lewisson', '', 'noun', '[{\"text\":\"lewises\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
