(4000, 'engineer', 'A soldier engaged in designing or constructing military works for attack or defence, or other engineering works.,A soldier in charge of operating a weapon; an artilleryman, a gunner.,A person professionally engaged in the technical design and construction of large-scale private and public works such as bridges, buildings, harbours, railways, roads, etc.; a civil engineer.,Originally, a person engaged in designing, constructing, or maintaining engines or machinery; now (more generally), a person qualified or professionally engaged in any branch of engineering, or studying to do so.,A person who operates a steam engine; specifically (nautical), a person employed to operate the steam engine in the engine room of a ship.,A person who drives or operates a fire engine.,A person who drives or operates a locomotive; a train driver.,Preceded by a qualifying word: a person who uses abilities or knowledge to manipulate events or people.,A person who formulates plots or schemes; a plotter, a schemer.', '', '', 'noun', '[{\"text\":\"engineers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4001, 'engineer', 'To employ one\'s abilities and knowledge as an engineer to design, construct, and/or maintain (something, such as a machine or a structure), usually for industrial or public use.,To use genetic engineering to alter or construct (a DNA sequence), or to alter (an organism).,To plan or achieve (a goal) by contrivance or guile; to finagle, to wangle.,To formulate plots or schemes; to plot, to scheme.,To work as an engineer.', 'machinate', '', 'verb', '[{\"text\":\"engineers\",\"type\":\"present singular third-person\"},{\"text\":\"engineering\",\"type\":\"participle present\"},{\"text\":\"engineered\",\"type\":\"participle past\"},{\"text\":\"engineered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
