(4004, 'offline', 'Of a system, currently not connected (generally electrically) to a larger network. For example, a power plant which is not connected to the grid, or a computer which is not connected to the Internet or to any other communications service.,Happening in the physical world (the real world) as opposed to on the internet.', 'IRL', 'online,online', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4005, 'offline', 'While offline; with an offline system.,Outside the current meeting, in a more private setting.,From (\"off\") the Internet', '', 'online', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
