(4007, 'replace', 'To restore to a former place, position, condition, etc.; to put back,To refund; to repay; to pay back,To supply or substitute an equivalent for,To take over the position or role from.,To take the place of; to be used instead of,To demolish (a building) and build an updated form of that building in its place.,To place again.,To put in a new or different place.', 'exchange', '', 'verb', '[{\"text\":\"replaces\",\"type\":\"present singular third-person\"},{\"text\":\"replacing\",\"type\":\"participle present\"},{\"text\":\"replaced\",\"type\":\"participle past\"},{\"text\":\"replaced\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
