(4014, 'safari', 'A trip into any undeveloped area to see, photograph or hunt wild animals in their own environment.,A caravan going on a safari.,Any trip for the purpose of discovering something new or acquiring prizes or trophies.', '', '', 'noun', '[{\"text\":\"safaris\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4015, 'safari', 'To take part in a safari.', '', '', 'verb', '[{\"text\":\"safaris\",\"type\":\"present singular third-person\"},{\"text\":\"safariing\",\"type\":\"participle present\"},{\"text\":\"safaried\",\"type\":\"participle past\"},{\"text\":\"safaried\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4016, 'sugar', 'Sucrose in the form of small crystals, obtained from sugar cane or sugar beet and used to sweeten food and drink.,A specific variety of sugar.,Any of various small carbohydrates that are used by organisms to store energy.,A small serving of this substance (typically about one teaspoon), used to sweeten a drink.,A term of endearment.,Affection shown by kisses or kissing.,Effeminacy in a male, often implying homosexuality.,Diabetes.,Anything resembling sugar in taste or appearance, especially in chemistry.,Compliment or flattery used to disguise or render acceptable something obnoxious; honeyed or soothing words.,Heroin.,Money.,Syntactic sugar.', 'sweetheart,buss,heroin', '', 'noun', '[{\"text\":\"sugars\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4017, 'sugar', 'To add sugar to; to sweeten with sugar.,To make (something unpleasant) seem less so.,In making maple sugar, to complete the process of boiling down the syrup till it is thick enough to crystallize; to approach or reach the state of granulation; with the preposition off.,To apply sugar to trees or plants in order to catch moths.,To rewrite (source code) using syntactic sugar.,To compliment (a person).,To remove hair using a paste of sugar, water, and lemon juice.', 'sweeten,sweeten,sugar-coat', '', 'verb', '[{\"text\":\"sugars\",\"type\":\"present singular third-person\"},{\"text\":\"sugaring\",\"type\":\"participle present\"},{\"text\":\"sugared\",\"type\":\"participle past\"},{\"text\":\"sugared\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4018, 'sugar', 'Used in place of shit!', '', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4019, 'debate', 'An argument, or discussion, usually in an ordered or formal setting, often with more than two people, generally ending with a vote or other decision.,An informal and spirited but generally civil discussion of opposing views.,Discussion of opposing views.,A type of literary composition, taking the form of a discussion or disputation, commonly found in the vernacular medieval poetry of many European countries, as well as in medieval Latin.,Strife, discord.', '', '', 'noun', '[{\"text\":\"debates\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4020, 'debate', 'To participate in a debate; to dispute, argue, especially in a public arena.,To fight.,To engage in combat for; to strive for.,To consider (to oneself), to think over, to attempt to decide', '', '', 'verb', '[{\"text\":\"debates\",\"type\":\"present singular third-person\"},{\"text\":\"debating\",\"type\":\"participle present\"},{\"text\":\"debated\",\"type\":\"participle past\"},{\"text\":\"debated\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
