(4022, 'adapter', 'One who is capable of adapting to differing situations.,One who adapts a thing, e.g. a play.,Specifically, a device that permits two, three, or more plugs to be used at a single electrical power point.,Specifically, a device that allows one format of plug to be used with a different format of socket.,Specifically, an AC adapter: a device that reduces voltage and converts AC to DC to allow a battery-powered device to use mains power.,A device or application used to achieve operative compatibility between devices that otherwise are incompatible.', '', '', 'noun', '[{\"text\":\"adapters\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4023, 'gourmet', 'Fine; of superior quality.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
