(4025, 'slide', 'To (cause to) move in continuous contact with a surface.,To move on a low-friction surface.,To drop down and skid into a base.,To lose one’s balance on a slippery surface.,To pass or put imperceptibly; to slip.,To subtly direct a facial expression at (someone).,To pass inadvertently.,To pass along smoothly or unobservedly; to move gently onward without friction or hindrance.,To decrease in amount or value.,To smoothly pass from one note to another by bending the pitch upwards or downwards.,To ride down snowy hills upon a toboggan or similar object for recreation.,To go; to move from one place or to another.,To kick so that the ball slides along the ground with little or no turning.', 'slip,slip,toboggan,sled', '', 'verb', '[{\"text\":\"slides\",\"type\":\"present singular third-person\"},{\"text\":\"sliding\",\"type\":\"participle present\"},{\"text\":\"slid\",\"type\":\"past\"},{\"text\":\"slid\",\"type\":\"participle past\"},{\"text\":\"slidden\",\"type\":\"archaic participle past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4026, 'slide', 'An item of play equipment that children can climb up and then slide down again.,A surface of ice, snow, butter, etc. on which someone can slide for amusement or as a practical joke.,The falling of large amounts of rubble, earth and stones down the slope of a hill or mountain; avalanche.,An inclined plane on which heavy bodies slide by the force of gravity, especially one constructed on a mountainside for conveying logs by sliding them down.,A mechanism consisting of a part which slides on or against a guide.,The act of sliding; smooth, even passage or progress.,A lever that can be moved in two directions.,A valve that works by sliding, such as in a trombone.,A transparent plate bearing an image to be projected to a screen.,A page of a computer presentation package such as PowerPoint.,A flat, usually rectangular piece of glass or similar material on which a prepared sample may be viewed through a microscope Generally referred to as a microscope slide.,The act of dropping down and skidding into a base,A hand-held device made of smooth, hard material, used in the practice of slide guitar.,A lively dance from County Kerry, in 12/8 time.,A small dislocation in beds of rock along a line of fissure.,A grace consisting of two or more small notes moving by conjoint degrees, and leading to a principal note either above or below.,A sound which, by a gradual change in the position of the vocal organs, passes imperceptibly into another sound.,A clasp or brooch for a belt, etc.,A pocket in one\'s pants (trousers).,A shoe that is backless and open-toed.,A voluntary stutter used as a technique to control stuttering in one\'s speech.,A promiscuous woman, slut.', 'slippery dip,chute,runner', '', 'noun', '[{\"text\":\"slides\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4027, 'consent', 'To express willingness, to give permission.,To cause to sign a consent form.,To grant; to allow; to assent to.,To agree in opinion or sentiment; to be of the same mind; to accord; to concur.', '', '', 'verb', '[{\"text\":\"consents\",\"type\":\"present singular third-person\"},{\"text\":\"consenting\",\"type\":\"participle present\"},{\"text\":\"consented\",\"type\":\"participle past\"},{\"text\":\"consented\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4028, 'consent', 'Voluntary agreement or permission.,Unity or agreement of opinion, sentiment, or inclination.,Advice; counsel.', 'agreement,approval,assent,consensualness,permission,willingness,yes', '', 'noun', '[{\"text\":\"consents\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4029, 'stick', 'A small, thin branch from a tree or bush; a twig; a branch.,A relatively long, thin piece of wood, of any size.,A timber board, especially a two by four (inches).,A cane or walking stick (usually wooden, metal or plastic) to aid in walking.,A cudgel or truncheon (usually of wood, metal or plastic), especially one carried by police or guards.,The vertical member of a cope-and-stick joint.,A mast or part of a mast of a ship; also, a yard.,A piece (of furniture, especially if wooden).,A small rectangular block, with a length several times its width, which contains by volume one half of a cup of shortening (butter, margarine or lard).,A standard rectangular strip of chewing gum.,A cigarette (usually a tobacco cigarette, less often a marijuana cigarette).,Any roughly cylindrical (or rectangular) unit of a substance.,A bunch of something wrapped around or attached to a stick.,A scroll that is rolled around (mounted on, attached to) a stick.,The structure to which a set of bombs in a bomber aircraft are attached and which drops the bombs when it is released. The bombs themselves and, by extension, any load of similar items dropped in quick succession such as paratroopers or containers.,A manual transmission, a vehicle equipped with a manual transmission, so called because of the stick-like, i.e. twig-like, control (the gear shift) with which the driver of such a vehicle controls its transmission.,A manual transmission, a vehicle equipped with a manual transmission, so called because of the stick-like, i.e. twig-like, control (the gear shift) with which the driver of such a vehicle controls its transmission.,The control column of an aircraft; a joystick. (By convention, a wheel-like control mechanism with a handgrip on opposite sides, similar to the steering wheel of an automobile, can also be called the \"stick\", although \"yoke\" or \"control wheel\" is more commonly seen.),Use of the stick to control the aircraft.,A memory stick.,A handgun.,A composing stick, the tool used by compositors to assemble lines of type.,The clarinet.,A long thin implement used to control a ball or puck in sports like hockey, polo, and lacrosse.,The short whip carried by a jockey.,A board as used in board sports, such as a surfboard, snowboard, or skateboard.,The pole bearing a small flag that marks the hole.,The cue used in billiards, pool, snooker, etc.,The cue used in billiards, pool, snooker, etc.,The long-range driving ability of a golf club.,The potential hitting power of a specific bat.,General hitting ability.,The potential accuracy of a hockey stick, implicating also the player using it.,A thin or wiry person; particularly a flat-chested woman.,An assistant planted in the audience.,A shill or house player.,A stiff, stupidly obstinate person.,A fighter pilot.,A small group of (infantry) soldiers.,A person or group of people. (Perhaps, in some senses, because people are, broadly speaking, tall and thin, like pieces of wood.),A negative stimulus or a punishment. (This sense derives from the metaphor of using a stick, a long piece of wood, to poke or beat a beast of burden to compel it to move forward. Compare carrot.),Corporal punishment; beatings.,Vigor; spirit; effort, energy, intensity.,Vigorous driving of a car; gas.,An English Imperial unit of length equal to 2 inches.,A quantity of eels, usually 25.', 'branch,twig,rice,kindling,brush,two by four,cane,walking stick,piece,item,joint,reefer,train,stickshift,gearstick,stickshift,gearstick,licorice stick,liquorice stick,pin,flagstick,plant,shill,stich,broach', '', 'noun', '[{\"text\":\"sticks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4030, 'stick', 'To cut a piece of wood to be the stick member of a cope-and-stick joint.,To compose; to set, or arrange, in a composing stick.,To furnish or set with sticks.', '', '', 'verb', '[{\"text\":\"sticks\",\"type\":\"present singular third-person\"},{\"text\":\"sticking\",\"type\":\"participle present\"},{\"text\":\"sticked\",\"type\":\"participle past\"},{\"text\":\"sticked\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
