(4125, 'broad', 'Wide in extent or scope.,Extended, in the sense of diffused; open; clear; full.,Having a large measure of any thing or quality; unlimited; unrestrained.,Comprehensive; liberal; enlarged.,Plain; evident.,General rather than specific.,Unsubtle; obvious.,Free; unrestrained; unconfined.,Gross; coarse; indelicate.,Strongly regional.,Velarized, i.e. not palatalized.', '', '', 'adj', '[{\"text\":\"broader\",\"type\":\"comparative\"},{\"text\":\"broadest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4126, 'broad', 'A shallow lake, one of a number of bodies of water in eastern Norfolk and Suffolk.,A lathe tool for turning down the insides and bottoms of cylinders.,A British gold coin worth 20 shillings, issued by the Commonwealth of England in 1656.,A kind of floodlight.,A playing card.', '', '', 'noun', '[{\"text\":\"broads\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
