(4128, 'episode', 'An incident, action, or time period standing out by itself, but more or less connected with a complete series of events.,An instalment of a drama told in parts, as in a TV series.', '', '', 'noun', '[{\"text\":\"episodes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4129, 'terminal', 'A building in an airport where passengers transfer from ground transportation to the facilities that allow them to board airplanes.,A harbour facility where ferries embark and disembark passengers and load and unload vehicles.,A rail station where service begins and ends; the end of the line. For example: Grand Central Terminal in New York City.,A rate charged on all freight, regardless of distance, and supposed to cover the expenses of station service, as distinct from mileage rate, generally proportionate to the distance and intended to cover movement expenses.,A town lying at the end of a railroad, in which the terminal is located; more properly called a terminus.,A storage tank for bulk liquids (such as oil or chemicals) prior to further distribution.,the end of a line where signals are either transmitted or received, or a point along the length of a line where the signals are made available to apparatus.,An electric contact on a battery.,The apparatus to send and/or receive signals on a line, such as a telephone or network device.,A device for entering data into a computer or a communications system and/or displaying data received, especially a device equipped with a keyboard and some sort of textual display.,A computer program that emulates a physical terminal.,A terminal symbol in a formal grammar.,The end ramification (of an axon, etc.) or one of the extremities of a polypeptide.', '', '', 'noun', '[{\"text\":\"terminals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4130, 'terminal', 'Fatal; resulting in death.,Appearing at the end; top or apex of a physical object.,Occurring at the end of a word, sentence, or period of time, and serves to terminate it,Occurring every term; termly.', 'endly,final,late,endsome', '', 'adj', '[{\"text\":\"more terminal\",\"type\":\"comparative\"},{\"text\":\"most terminal\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4131, 'terminal', 'To store bulk liquids (such as oil or chemicals) in storage tanks prior to further distribution.', '', '', 'verb', '[{\"text\":\"terminals\",\"type\":\"present singular third-person\"},{\"text\":\"terminaling\",\"type\":\"participle present\"},{\"text\":\"terminalling\",\"type\":\"participle present\"},{\"text\":\"terminaled\",\"type\":\"participle past\"},{\"text\":\"terminaled\",\"type\":\"past\"},{\"text\":\"terminalled\",\"type\":\"participle past\"},{\"text\":\"terminalled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4132, 'illegal', 'Contrary to or forbidden by law, especially criminal law.,Breaching certain enacted statutes of positive law; not lawful, not legal (cf. immoral, unethical),Forbidden by established rules.,Totally fictitious, and often issued on behalf of a non-existent territory or country.,Being or doing something illegally.,Being an illegal immigrant; residing in a country illegally.', 'criminal,felonious,illicit,unlawful,irregular,unethical,bogus,undocumented', '', 'adj', '[{\"text\":\"more illegal\",\"type\":\"comparative\"},{\"text\":\"most illegal\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
