(4136, 'lodge', 'A building for recreational use such as a hunting lodge or a summer cabin.,Short for porter\'s lodge: a building or room near the entrance of an estate or building, especially (UK, Canada) as a college mailroom.,A local chapter of some fraternities, such as freemasons.,A local chapter of a trade union.,A rural hotel or resort, an inn.,A beaver\'s shelter constructed on a pond or lake.,A den or cave.,The chamber of an abbot, prior, or head of a college.,The space at the mouth of a level next to the shaft, widened to permit wagons to pass, or ore to be deposited for hoisting; called also platt.,A collection of objects lodged together.,An indigenous American home, such as tipi or wigwam. By extension, the people who live in one such home; a household.,A family of Native Americans, or the persons who usually occupy an Indian lodge; as a unit of enumeration, reckoned from four to six persons.', '', '', 'noun', '[{\"text\":\"lodges\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4137, 'lodge', 'To be firmly fixed in a specified position.,To firmly fix in a specified position.,To stay in a boarding-house, paying rent to the resident landlord or landlady.,To stay in any place or shelter.,To drive (an animal) to covert.,To supply with a room or place to sleep in for a time.,To put money, jewellery, or other valuables for safety.,To place (a statement, etc.) with the proper authorities (such as courts, etc.).,To become flattened, as grass or grain, when overgrown or beaten down by the wind.,To cause to flatten, as grass or grain.', 'stay over', '', 'verb', '[{\"text\":\"lodges\",\"type\":\"present singular third-person\"},{\"text\":\"lodging\",\"type\":\"participle present\"},{\"text\":\"lodged\",\"type\":\"participle past\"},{\"text\":\"lodged\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
