(4139, 'pilot', 'A person who steers a ship, a helmsman.,A person who knows well the depths and currents of a harbor or coastal area, who is hired by a vessel to help navigate the harbor or coast.,A guide book for maritime navigation.,An instrument for detecting the compass error.,A pilot vehicle.,A person authorised to drive such a vehicle during an escort.,A guide or escort through an unknown or dangerous area.,Something serving as a test or trial.,The heading or excavation of relatively small dimensions, first made in the driving of a larger tunnel.,A person who is in charge of the controls of an aircraft.,A sample episode of a proposed TV series produced to decide if it should be made or not. If approved, typically the first episode of an actual TV series.,A cowcatcher.,A driver.,A pilot light.,One who flies a kite.,A short plug, sometimes made interchangeable, at the end of a counterbore to guide the tool.', '', '', 'noun', '[{\"text\":\"pilots\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
