(4151, 'novel', 'Newly made, formed or evolved; having no precedent; of recent origin; new.,Original, especially in an interesting way; new and striking; not of the typical or ordinary type.', 'new,unusual', '', 'adj', '[{\"text\":\"more novel\",\"type\":\"comparative\"},{\"text\":\"most novel\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
