(4161, 'ultra', 'An ultraroyalist in France.,An extremist, especially an ultranationalist.,An especially devoted football fan, typically associated with the intimidating use of extremist slogans, pyrotechnics and sometimes hooligan violence.,An ultramarathon.,An ultra-prominent peak.,Code name used by British codebreakers during World War 2 for decrypted information gained from the enemy.', '', '', 'noun', '[{\"text\":\"ultras\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
