(4170, 'mirror', 'A smooth surface, usually made of glass with reflective material painted on the underside, that reflects light so as to give an image of what is in front of it.,An object, person, or event that reflects or gives a picture of another.,A disk, website or other resource that contains replicated data.,A mirror carp.,A kind of political self-help book, advising kings, princes, etc. on how to behave.', 'glass,looking-glass', '', 'noun', '[{\"text\":\"mirrors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
