(4233, 'audit', 'A judicial examination.,An examination in general.,An independent review and examination of records and activities to assess the adequacy of system controls, to ensure compliance with established policies and operational procedures, and to recommend necessary changes in controls, policies, or procedures,The result of such an examination, or an account as adjusted by auditors; final account.,Spiritual counseling, which forms the core of Dianetics.,A general receptacle or receiver.,An audience; a hearing.', '', '', 'noun', '[{\"text\":\"audits\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
