(4239, 'attend', 'To listen to (something or someone); to pay attention to; regard; heed.,To listen (to, unto).,To turn one\'s consideration (to); to deal with (a task, problem, concern etc.), to look after.,To wait upon as a servant etc.; to accompany to assist (someone).,To be present at (an event or place) in order to take part in some action or proceedings; to regularly go to (an event or place).,To go to (a place) for some purpose (with at).,To be present with; to accompany; to be united or consequent to.,To wait for; to await; to remain, abide, or be in store for.', 'notice,bestand', '', 'verb', '[{\"text\":\"attends\",\"type\":\"present singular third-person\"},{\"text\":\"attending\",\"type\":\"participle present\"},{\"text\":\"attended\",\"type\":\"participle past\"},{\"text\":\"attended\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
