(4278, 'shell', 'The calcareous or chitinous external covering of mollusks, crustaceans, and some other invertebrates.,Any mollusk having such a covering.,The exoskeleton or wing covers of certain insects.,The conjoined scutes that constitute the \"shell\" (carapace) of a tortoise or turtle.,The overlapping hard plates comprising the armor covering the armadillo\'s body.,The hard calcareous covering of a bird egg.,One of the outer layers of skin of an onion.,The covering, or outside part, of a nut.,A pod containing the seeds of certain plants, such as the legume Phaseolus vulgaris.,Husks of cacao seeds, a decoction of which is sometimes used as a substitute or adulterant for cocoa and its products such as chocolate.,The accreted mineral formed around a hollow geode.,The casing of a self-contained single-unit artillery projectile.,A hollow, usually spherical or cylindrical projectile fired from a siege mortar or a smoothbore cannon. It contains an explosive substance designed to be ignited by a fuse or by percussion at the target site so that it will burst and scatter at high velocity its contents and fragments. Formerly called a bomb.,The cartridge of a breechloading firearm; a load; a bullet; a round.,Any slight hollow structure; a framework, or exterior structure, regarded as not complete or filled in, as the shell of a house.,A garment, usually worn by women, such as a shirt, blouse, or top, with short sleeves or no sleeves, that often fastens in the rear.,A coarse or flimsy coffin; a thin interior coffin enclosed within a more substantial one.,A string instrument, as a lyre, whose acoustical chamber is formed like a shell.,The body of a drum; the often wooden, often cylindrical acoustic chamber, with or without rims added for tuning and for attaching the drum head.,An engraved copper roller used in print works.,The thin coating of copper on an electrotype.,The watertight outer covering of the hull of a vessel, often made with planking or metal plating.,The outer