(4360, 'shift', 'A type of women\'s undergarment of dress length worn under dresses or skirts, a slip or chemise.,A simple straight-hanging, loose-fitting dress.,A change of workers, now specifically a set group of workers or period of working time.,An act of shifting; a slight movement or change.,The gear mechanism in a motor vehicle.,Alternative spelling of Shift (“a modifier button of computer keyboards”).,A control code or character used to change between different character sets.,An instance of the use of such a code or character.,A bit shift.,An infield shift.,The act of kissing passionately.,A contrivance, a device to try when other methods fail.,A trick, an artifice.,The extent, or arrangement, of the overlapping of plank, brick, stones, etc., that are placed in courses so as to break joints.,A breaking off and dislocation of a seam; a fault.,A mutation in which the DNA or RNA from two different sources (such as viruses or bacteria) combine.,In violin-playing, any position of the left hand except that nearest the nut.,A period of time in which one\'s consciousness resides in another reality, usually achieved through meditation or other means.', '', '', 'noun', '[{\"text\":\"shifts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
