(4363, 'superior', 'Of high standard or quality.,Greater in size or power.,Beyond the power or influence of; too great or firm to be subdued or affected by.,Greater or better than average.,Higher in rank, status, or quality.,Courageously or serenely indifferent (as to something painful or disheartening).,Printed in superscript.,Located above or higher, a direction that in humans corresponds to cephalad.,(of a calyx) Above the ovary; said of parts of the flower which, although normally below the ovary, adhere to it, and so appear to originate from its upper part.,(of an ovary) Above and free from the other floral organs.,Belonging to the part of an axillary flower which is toward the main stem.,(of the radicle) Pointing toward the apex of the fruit.,Located above or out; higher in position.,More comprehensive.,Affecting or assuming an air of superiority.,(of a planet) Closer to the Earth than to the Sun.', 'extraordinary,posterior,ascending,supercilious', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
