(4401, 'bright', 'Emitting much light; visually dazzling; luminous, lucent, radiant.,Of light: brilliant, intense.,Of an object, surface, etc.: reflecting much light; having a high lustre; gleaming, shiny.,Of a place: not dark; well-lit.,Of climate or weather: not cloudy or gloomy; fair; also, of a period of time, the sky, etc.: characterized by much sunshine and good weather.,Clearly apparent; conspicuous.,Of a colour: not muted or pale; bold, brilliant, vivid.,Of an object, surface, etc.: having vivid colour(s); colourful.,Of a musical instrument, sound, or a voice: clearly audible; clear, resounding, and often high-pitched.,Of a room or other place: having acoustic qualities that tend to cause much echoing or reverberation of sound, particularly at high frequencies.,Of a scent or taste: not bland or mild; bold, sharp, strong.,Of a substance: clear, transparent; also, pure, unadulterated; (specifically) of wine: free of suspended particles; not cloudy; fine.,Glorious; illustrious.,In good spirits; happy, optimistic.,Of the face or eyes, or a smile: showing happiness or hopefulness; cheerful, lively.,Of a person: lively, vivacious.,Of a period of history or time: happy, prosperous, successful.,Of an opportunity or outlook: having a reasonable chance of success; favourable, good.,Of conversation, writing, etc.: imaginative or sparkling with wit; clever, witty.,Having a clear, quick intellect; intelligent.,Of the eyes: able to see clearly; of eyesight: keen, sharp.,Manifest to the mind as light is to the eyes; clear, evident, plain.,Of a rhythm or tempo: lively, upbeat.,Of a metal object or surface: lacking any protective coating or surface treatment for the prevention of corrosion.', 'lustrous,shiny,happy,intelligent', 'dull,sad,stupid', 'adj', '[{\"text\":\"brighter\",\"type\":\"comparative\"},{\"text\":\"brightest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4402, 'bright', 'Brightness, glow.,Glory, splendour.,Something (especially a product intended for sale) that has vivid colours or a lustrous appearance.,A person with a naturalistic worldview with no mystical or supernatural elements.,An artist\'s brush used in acrylic and oil painting with a long ferrule and a flat, somewhat tapering bristle head.', 'humanist,nonsupernaturalist', 'super,supernaturalist', 'noun', '[{\"text\":\"brights\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4403, 'bright', 'In a bright manner; brightly, glowingly, luminously, lustrously.,Referring to colour: with bold or vivid colours; brightly, boldly, vividly.,Referring to sight, sound, understanding, etc.: clearly, distinctly; brightly.', '', '', 'adv', '[{\"text\":\"more bright\",\"type\":\"comparative\"},{\"text\":\"most bright\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4404, 'bright', 'Often followed by up: to cast light on (someone or something); to brighten, to illuminate.,Often followed by up: to cause (someone or something) to be bright (in various senses); to brighten; specifically, to make (someone or something) energetic, or happy and optimistic.,Often followed by up: to become bright (in various senses); to brighten.', 'embrighten,enliven,delight,gladden,please', '', 'verb', '[{\"text\":\"brights\",\"type\":\"present singular third-person\"},{\"text\":\"brighting\",\"type\":\"participle present\"},{\"text\":\"brighted\",\"type\":\"participle past\"},{\"text\":\"brighted\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"bright\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4405, 'teach', 'To pass on knowledge to.,To pass on knowledge generally, especially as one\'s profession; to act as a teacher.,To cause (someone) to learn or understand (something).,To cause to know the disagreeable consequences of some action.,To show (someone) the way; to guide, conduct; to point, indicate.', 'educate,instruct', 'learn', 'verb', '[{\"text\":\"teaches\",\"type\":\"present singular third-person\"},{\"text\":\"teaching\",\"type\":\"participle present\"},{\"text\":\"taught\",\"type\":\"participle past\"},{\"text\":\"taught\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"teach\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
