(4464, 'router', 'Someone who routes or directs items from one location to another.,Any device that directs packets of information using the equivalent of Open Systems Interconnection layer 3 (network layer) information. Most commonly used in reference to Internet Protocol routers.,A device that connects local area networks to form a larger internet by, at minimum, selectively passing those datagrams having a destination IP address to the network which is able to deliver them to their destination; a network gateway.,In integrated circuit or printed circuit board design, an algorithm for adding all wires needed to properly connect all of the placed components while obeying all design rules.', '', '', 'noun', '[{\"text\":\"routers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
