(4470, 'strike', 'To delete or cross out; to scratch or eliminate.,To hit.,To give, as a blow; to impel, as with a blow; to give a force to; to dash; to cast.,To deliver a quick blow or thrust; to give blows.,To manufacture, as by stamping.,To run upon a rock or bank; to be stranded; to run aground.,To cause to sound by one or more beats; to indicate or notify by audible strokes. Of a clock, to announce (an hour of the day), usually by one or more sounds.,To sound by percussion, with blows, or as if with blows.,To cause or produce by a stroke, or suddenly, as by a stroke.,To cause to ignite by friction.,To thrust in; to cause to enter or penetrate.,To punish; to afflict; to smite.,To carry out a violent or illegal action.,To act suddenly, especially in a violent or criminal way.,To impinge upon.,To stop working as a protest to achieve better working conditions.,To quit (one\'s job).,To impress, seem or appear (to).,To create an impression.,To score a goal.,To make a sudden impression upon, as if by a blow; to affect with some strong emotion.,To affect by a sudden impression or impulse.,To steal or rob; to take forcibly or fraudulently.,To borrow money from; to make a demand upon.,To touch; to act by appulse.,To haul down or lower (a flag, mast, etc.),To capitulate; to signal a surrender by hauling down the colours.,To dismantle and take away (a theater set; a tent; etc.).,To unfasten, to loosen (chains, bonds, etc.).,To set off on a walk or trip.,To pass with a quick or strong effect; to dart; to penetrate.,To break forth; to commence suddenly; with into.,To become attached to something; said of the spat of oysters.,To make and ratify.,To level (a measure of grain, salt, etc.) with a straight instrument, scraping off what is above the level of the top.,To cut off (a mortar joint, etc.) even with the face of the wall, or inward at a slight angle.,To hit upon, or light upon, suddenly.,To lade thickened sugar cane juice from a teache into a cooler.,To stroke or pass lightly; to wave.,To advance; to cause to go forward; used only in the past participle.,To balance (a ledger or account).,To discover a source of something, often a buried raw material such as ore (especially gold) or crude oil.', 'strike work', '', 'verb', '[{\"text\":\"strikes\",\"type\":\"present singular third-person\"},{\"text\":\"striking\",\"type\":\"participle present\"},{\"text\":\"struck\",\"type\":\"past\"},{\"text\":\"striked\",\"type\":\"past\"},{\"text\":\"stroke\",\"type\":\"obsolete past\"},{\"text\":\"strook\",\"type\":\"obsolete past\"},{\"text\":\"strake\",\"type\":\"obsolete past\"},{\"text\":\"struck\",\"type\":\"obsolete participle past\"},{\"text\":\"stricken\",\"type\":\"obsolete participle past\"},{\"text\":\"strucken\",\"type\":\"obsolete participle past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4471, 'strike', 'A status resulting from a batter swinging and missing a pitch, or not swinging at a pitch when the ball goes in the strike zone, or hitting a foul ball that is not caught.,The act of knocking down all ten pins in on the first roll of a frame.,A work stoppage (or otherwise concerted stoppage of an activity) as a form of protest.,A blow or application of physical force against something.,In an option contract, the price at which the holder buys or sells if they choose to exercise the option.,An old English measure of corn equal to the bushel.,The status of being the batsman that the bowler is bowling at.,The primary face of a hammer, opposite the peen.,The compass direction of the line of intersection between a rock layer and the surface of the Earth.,An instrument with a straight edge for levelling a measure of grain, salt, etc., scraping off what is above the level of the top; a strickle.,Fullness of measure; hence, excellence of quality.,An iron pale or standard in a gate or fence.,A puddler\'s stirrer.,The extortion of money, or the attempt to extort money, by threat of injury; blackmail.,The discovery of a source of something.,The strike plate of a door.,A nibble on the bait by a fish.,A cancellation postmark.', 'walkout', 'industrial peace,lockout,non-strike,nonstrike', 'noun', '[{\"text\":\"strikes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
