(4492, 'resident', 'A person, animal or plant living at a certain location or in a certain area.,A bird which does not migrate during the course of the year.,A physician receiving specialized medical training.,A diplomatic representative who resides at a foreign court, usually of inferior rank to an ambassador.,A legal permanent resident, someone who maintains residency.,Alternative form of rezident', '', '', 'noun', '[{\"text\":\"residents\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4493, 'resident', 'Dwelling, or having an abode, in a place for a continued length of time; residing on one\'s own estate.,Based in a particular place; on hand; local.,Fixed; stable; certain.,Currently loaded into RAM; contrasted with virtual memory.', '', '', 'adj', '[{\"text\":\"more resident\",\"type\":\"comparative\"},{\"text\":\"most resident\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
