(4498, 'pearl', 'A shelly concretion, usually rounded, and having a brilliant luster, with varying tints, found in the mantle, or between the mantle and shell, of certain bivalve mollusks, especially in the pearl oysters and river mussels, and sometimes in certain univalves. It is usually due to a secretion of shelly substance around some irritating foreign particle. Its substance is the same as nacre, or mother-of-pearl. Round lustrous pearls are used in jewellery.,Something precious.,A capsule of gelatin or similar substance containing liquid for e.g. medicinal application.,Nacre, or mother-of-pearl.,A whitish speck or film on the eye.,A fish allied to the turbot; the brill.,A light-colored tern.,One of the circle of tubercles which form the bur on a deer\'s antler.,The size of type between diamond and agate, standardized as 5-point.,A fringe or border.,A jewel or gem.,A valuable little nugget of information; especially, an aphorism or tip that is operationally useful for decision-making.,The clitoris.', '', '', 'noun', '[{\"text\":\"pearls\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4499, 'pearl', 'To set or adorn with pearls, or with mother-of-pearl.,To cause to resemble pearls in shape; to make into small round grains.,To cause to resemble pearls in lustre or iridescence.,To resemble pearl or pearls.,To hunt for pearls,To sink the nose of one\'s surfboard into the water, often on takeoff.,Of the nose of the surfboard: to sink in this manner.', '', '', 'verb', '[{\"text\":\"pearls\",\"type\":\"present singular third-person\"},{\"text\":\"pearling\",\"type\":\"participle present\"},{\"text\":\"pearled\",\"type\":\"participle past\"},{\"text\":\"pearled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4500, 'barbara', 'A syllogism in which all three propositions are of the form \"All X are Y\" or \"X is a Y\".', '', '', 'noun', '[{\"text\":\"barbaras\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4501, 'earnings', 'Wages, money earned, income.,Business profits.,Gains on investments; returns.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4502, 'reverse', 'Opposite, contrary; going in the opposite direction.,Pertaining to engines, vehicle movement etc. moving in a direction opposite to the usual direction.,To be in the non-default position; to be set for the lesser-used route.,Turned upside down; greatly disturbed.,Reversed.,In which cDNA synthetization is obtained from an RNA template.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4503, 'reverse', 'In a reverse way or direction; in reverse; upside-down.', 'upside down', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4504, 'reverse', 'The opposite of something.,The act of going backwards; a reversal.,A piece of misfortune; a setback.,The tails side of a coin, or the side of a medal or badge that is opposite the obverse.,The side of something facing away from a viewer, or from what is considered the front; the other side.,The gear setting of an automobile that makes it travel backwards.,A thrust in fencing made with a backward turn of the hand; a backhanded stroke.,A turn or fold made in bandaging, by which the direction of the bandage is changed.', 'reverse gear', '', 'noun', '[{\"text\":\"reverses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4505, 'reverse', 'To turn something around so that it faces the opposite direction or runs in the opposite sequence.,To turn something inside out or upside down.,To transpose the positions of two things.,To change totally; to alter to the opposite.,To return, come back.,To turn away; to cause to depart.,To cause to return; to recall.,To revoke a law, or to change a decision into its opposite.,To cause a mechanism or a vehicle to operate or move in the opposite direction to normal.,To change the direction of a reaction such that the products become the reactants and vice-versa.,To place (a set of points) in the reverse position.,To move from the normal position to the reverse position.,To engage reverse thrust on (an engine).,To overthrow; to subvert.,Short for reverse-engineer.', '', '', 'verb', '[{\"text\":\"reverses\",\"type\":\"present singular third-person\"},{\"text\":\"reversing\",\"type\":\"participle present\"},{\"text\":\"reversed\",\"type\":\"participle past\"},{\"text\":\"reversed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4506, 'vietnam', 'A long and protracted war or conflict in which the dominating foreign occupier is unable to secure a victory.,A place that is very dangerous, especially if afflicted by violence.,A situation in which one cannot win.', '', '', 'noun', '[{\"text\":\"Vietnams\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4507, 'dutch', 'Of or pertaining to the Netherlands, the Dutch people or the Dutch language.,Pertaining to Germanic-speaking peoples on the European continent, chiefly the Dutch, the Germans, and the Goths; Teutonic; Germanic. Especially refers to Germans, and specific use to established German-speaking communities in parts of the USA.,Substitute, inferior, ersatz.,Thrifty.,Pertaining to Afrikaner culture (Cape Dutch).', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4508, 'dutch', 'The people of the Netherlands, or one of certain ethnic groups descending from the people of the Netherlands.,Afrikaner people (Cape Dutch).,The Pennsylvania Dutch people.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4509, 'dutch', 'To treat cocoa beans or powder with an alkali solution to darken the color and lessen the bitterness of the flavor.', '', '', 'verb', '[{\"text\":\"Dutches\",\"type\":\"present singular third-person\"},{\"text\":\"Dutching\",\"type\":\"participle present\"},{\"text\":\"Dutched\",\"type\":\"participle past\"},{\"text\":\"Dutched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4510, 'dutch', 'wife', '', '', 'noun', '[{\"text\":\"dutches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4511, 'dutch', 'Alternative letter-case form of Dutch (“treat cocoa with alkali”)', '', '', 'verb', '[{\"text\":\"dutches\",\"type\":\"present singular third-person\"},{\"text\":\"dutching\",\"type\":\"participle present\"},{\"text\":\"dutched\",\"type\":\"participle past\"},{\"text\":\"dutched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4512, 'header', 'The upper portion of a page (or other) layout.,Text, or other visual information, used to mark off a quantity of text, often titling or summarizing it.,Text, or other visual information, that goes at the top of a column of information in a table.,A font, text style, or typesetting used for any of the above.,The first part of a file or record that describes its contents.,Clipping of header file.,the first part of a packet or stream, often containing its address and descriptors.,A brick that is laid sideways at the top of a wall or within the brickwork with the short side showing.,A horizontal structural or finish piece over an opening.,A machine that separates and gathers the heads of grain etc.,The act of hitting the ball with the head.,Someone who heads the ball.,A headlong fall, jump or dive.,A raised tank that supplies water at constant pressure, especially to a central heating and hot water system.,A pipe which connects several smaller pipes.,The rodeo performer who drives the steer toward the heeler to be tied.,One who puts a head on something.', 'head,heading,bonder,coping,cope,lintel', '', 'noun', '[{\"text\":\"headers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4513, 'header', 'To strike (a ball) with one\'s head.', '', '', 'verb', '[{\"text\":\"headers\",\"type\":\"present singular third-person\"},{\"text\":\"headering\",\"type\":\"participle present\"},{\"text\":\"headered\",\"type\":\"participle past\"},{\"text\":\"headered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4514, 'upload', 'To transfer data to a computer on a network, especially to a server on the Internet.', '', 'download', 'verb', '[{\"text\":\"uploads\",\"type\":\"present singular third-person\"},{\"text\":\"uploading\",\"type\":\"participle present\"},{\"text\":\"uploaded\",\"type\":\"participle past\"},{\"text\":\"uploaded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
