(4518, 'mention', 'A speaking or notice of anything, usually in a brief or cursory manner. Used especially in the phrase make mention of.,A social media feed, a list of replies or posts mentioning a person.', '', '', 'noun', '[{\"text\":\"mentions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4519, 'mention', 'To make a short reference to something.,To utter a word or expression in order to refer to the expression itself, as opposed to its usual referent.', 'bring up,reference,toss up,touch,touch on', '', 'verb', '[{\"text\":\"mentions\",\"type\":\"present singular third-person\"},{\"text\":\"mentioning\",\"type\":\"participle present\"},{\"text\":\"mentioned\",\"type\":\"participle past\"},{\"text\":\"mentioned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
