(4523, 'toshiba', 'A computer manufactured by the Japanese Toshiba company.', '', '', 'noun', '[{\"text\":\"Toshibas\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4524, 'banner', 'A flag or standard used by a military commander, monarch or nation.,The military unit under such a flag or standard.,A military or administrative subdivision.,Any large sign, especially when made of soft material or fabric.,A large piece of cloth with a slogan, motto, or emblem carried in a demonstration or other procession or suspended in some conspicuous place.,A cause or purpose; a campaign or movement.,The title of a newspaper as printed on its front page; the nameplate; masthead.,A type of advertisement on a web page or on television, usually taking the form of a graphic or animation above or alongside the content.,The principal standard of a knight.,A type of administrative division in Inner Mongolia and Tuva, made during the Qing dynasty; at that time, Outer Mongolia and part of Xinjiang were also divided into banners.', '', '', 'noun', '[{\"text\":\"banners\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4525, 'banner', 'Exceptional; very good.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
