INSERT INTO `vocabulary` (`id`, `word`, `meaning`, `similar_word`, `opposite_word`, `part_of_speech`, `forms`, `status`, `sequence`, `created_user_id`, `updated_user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(4528, 'pulse', 'A normally regular beat felt when arteries near the skin (for example, at the neck or wrist) are depressed, caused by the heart pumping blood through them.,The nature or rate of this beat as an indication of a person\'s health.,A beat or throb; also, a repeated sequence of such beats or throbs.,The focus of energy or vigour of an activity, place, or thing; also, the feeling of bustle, busyness, or energy in a place; the heartbeat.,An (increased) amount of a substance (such as a drug or an isotopic label) given over a short time.,A setting on a food processor which causes it to work in a series of short bursts rather than continuously, in order to break up ingredients without liquidizing them; also, a use of this setting.,The beat or tactus of a piece of music or verse; also, a repeated sequence of such beats.,A brief burst of electromagnetic energy, such as light, radio waves, etc.,Synonym of autosoliton (“a stable solitary localized structure that arises in nonlinear spatially extended dissipative systems due to mechanisms of self-organization”),A brief increase in the strength of an electrical signal; an impulse.', 'autosoliton', '', 'noun', '[{\"text\":\"pulses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4529, 'pulse', 'To emit or impel (something) in pulses or waves.,To give to (something, especially a cell culture) an (increased) amount of a substance, such as a drug or an isotopic label, over a short time.,To operate a food processor on (some ingredient) in short bursts, to break it up without liquidizing it.,To apply an electric current or signal that varies in strength to (something).,To manipulate (an electric current, electromagnetic wave, etc.) so that it is emitted in pulses.,To expand and contract repeatedly, like an artery when blood is flowing though it, or the heart; to beat, to throb, to vibrate, to pulsate.,Of an activity, place, or thing: to bustle with energy and liveliness; to pulsate.', 'undulate', '', 'verb', '[{\"text\":\"pulses\",\"type\":\"present singular third-person\"},{\"text\":\"pulsing\",\"type\":\"participle present\"},{\"text\":\"pulsed\",\"type\":\"participle past\"},{\"text\":\"pulsed\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"pulse\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4530, 'pulse', 'Annual leguminous plants (such as beans, lentils, and peas) yielding grains or seeds used as food for humans or animals; (countable) such a plant; a legume.,Edible grains or seeds from leguminous plants, especially in a mature, dry condition; (countable) a specific kind of such a grain or seed.', '', '', 'noun', '[{\"text\":\"pulses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4531, 'antique', 'Having existed in ancient times, descended from antiquity; used especially in reference to Greece and Rome.,Belonging to former times, not modern, out of date, old-fashioned.,Designating a style of type.,Embossed without gilt.,Synonym of antic, specifically,Fantastic, odd, wild, antic.', 'antiquated,antic,specifically', '', 'adj', '[{\"text\":\"antiquer\",\"type\":\"comparative\"},{\"text\":\"antiquest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4532, 'antique', 'An old object perceived as having value because of its aesthetic or historical significance.,An object of ancient times.,The style or manner of ancient times, used especially of Greek and Roman art.,An old person.,A man of ancient times.,A style of type of thick and bold face in which all lines are of equal or nearly equal thickness.,Grotesque entertainment; an antic.,A performer in an antic; or in general, a burlesque performer, a buffoon.', 'coffin dodger,ancient', '', 'noun', '[{\"text\":\"antiques\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4533, 'antique', 'To search or shop for antiques.,To make (an object) appear to be an antique in some way.,To emboss without gilding.', '', '', 'verb', '[{\"text\":\"antiques\",\"type\":\"present singular third-person\"},{\"text\":\"antiquing\",\"type\":\"participle present\"},{\"text\":\"antiqued\",\"type\":\"participle past\"},{\"text\":\"antiqued\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
