(4537, 'piano', 'a percussive keyboard musical instrument, usually ranging over seven octaves, with white and black colored keys, played by pressing these keys, causing hammers to strike strings', 'pianoforte', '', 'noun', '[{\"text\":\"pianos\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4538, 'piano', 'To play the piano.,To move (the fingers) up and down on, similar to the motions of a pianist playing the piano.,To equip with a piano.', '', '', 'verb', '[{\"text\":\"pianos\",\"type\":\"present singular third-person\"},{\"text\":\"pianoing\",\"type\":\"participle present\"},{\"text\":\"pianoed\",\"type\":\"participle past\"},{\"text\":\"pianoed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4539, 'piano', 'softly, as a musical direction (abbreviated to p. in sheet music)', '', '', 'adv', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4540, 'piano', 'Soft, quiet.,Gentle, soft, subdued.', '', '', 'adj', '[{\"text\":\"more piano\",\"type\":\"comparative\"},{\"text\":\"most piano\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4541, 'piano', 'To become softer and less intense.', '', '', 'verb', '[{\"text\":\"pianos\",\"type\":\"present singular third-person\"},{\"text\":\"pianoing\",\"type\":\"participle present\"},{\"text\":\"pianoed\",\"type\":\"participle past\"},{\"text\":\"pianoed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4542, 'threat', 'An expression of intent to injure or punish another.,An indication of potential or imminent danger.,A person or object that is regarded as a danger; a menace.', 'intimidation,warning,menace', '', 'noun', '[{\"text\":\"threats\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4543, 'threat', 'To press; urge; compel.,To threaten.,To use threats; act or speak menacingly; threaten.', '', '', 'verb', '[{\"text\":\"threats\",\"type\":\"present singular third-person\"},{\"text\":\"threating\",\"type\":\"participle present\"},{\"text\":\"threated\",\"type\":\"participle past\"},{\"text\":\"threated\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4544, 'regard', 'A steady look, a gaze.,One\'s concern for another; esteem; relation, reference.,A particular aspect or detail; respect, sense.,The worth or estimation in which something or someone is held.,Slang for retard, a very bad stock trader.', 'esteem,repute', '', 'noun', '[{\"text\":\"regards\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4545, 'regard', 'To look at; to observe.,To consider, look upon (something) in a given way etc.,To take notice of, pay attention to.,To face toward.,To have to do with, to concern.,To set store by (something), to hold (someone) in esteem; to consider to have value, to respect.', 'look,deem,pay attention', '', 'verb', '[{\"text\":\"regards\",\"type\":\"present singular third-person\"},{\"text\":\"regarding\",\"type\":\"participle present\"},{\"text\":\"regarded\",\"type\":\"participle past\"},{\"text\":\"regarded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4546, 'smooth', 'Having a texture that lacks friction. Not rough.,Without difficulty, problems, or unexpected consequences or incidents.,Bland; glib.,Flowing or uttered without check, obstruction, or hesitation; not harsh; fluent.,Suave; sophisticated.,Natural; unconstrained.,Unbroken.,Placid, calm.,Lacking projections or indentations; not serrated.,Not grainy; having an even texture.,Having a pleasantly rounded flavor; neither rough nor astringent.,Having derivatives of all finite orders at all points within the function’s domain.,That factors completely into small prime numbers.,Lacking marked aspiration.,Involuntary and non-striated.', 'downy,even,flat,frictionless,lanate,level,silken,silklike,silky,sleek,slick,slight,velutinous,velvety,fluid', '', 'adj', '[{\"text\":\"smoother\",\"type\":\"comparative\"},{\"text\":\"smoothest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4547, 'smooth', 'Smoothly.', '', '', 'adv', '[{\"text\":\"smoother\",\"type\":\"comparative\"},{\"text\":\"smoothest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4548, 'smooth', 'Something that is smooth, or that goes smoothly and easily.,A smoothing action.,A domestic animal having a smooth coat.,A member of an anti-hippie fashion movement in 1970s Britain.,The analysis obtained through a smoothing procedure.', '', '', 'noun', '[{\"text\":\"smooths\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4549, 'smooth', 'To make smooth or even.,To reduce to a particular shape or form by pressure; to press, to flatten.,To make straightforward or easy.,To calm or palliate.,To capture important patterns in the data, while leaving out noise.,To stroke; especially to stroke an animal\'s fur.', 'smoothen', '', 'verb', '[{\"text\":\"smooths\",\"type\":\"present singular third-person\"},{\"text\":\"smoothing\",\"type\":\"participle present\"},{\"text\":\"smoothed\",\"type\":\"participle past\"},{\"text\":\"smoothed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4550, 'accident', 'An unexpected event with negative consequences occurring without the intention of the one suffering the consequences, and (in the strict sense) not directly caused by humans.,casus; such unforeseen, extraordinary, extraneous interference as is out of the range of ordinary calculation.,A collision or crash of a vehicle, aircraft, or other form of transportation that causes damage to the transportation involved; and sometimes injury or death to the transportation\'s occupants or bystanders in close proximity. (but see Usage notes),Any chance event.,Chance; random chance.,Any property, fact, or relation that is the result of chance or is nonessential or nonsubstantive.,A property attached to a word, but not essential to it, such as gender, number, or case.,An instance of incontinence.,Urine or feces excreted due to incontinence.,An unintended pregnancy.,A person born from an unintended pregnancy.,An irregular surface feature with no apparent cause.,A sudden discontinuity of ground such as fault of great thickness, bed or lentil of unstable ground.,A point or mark which may be retained or omitted in a coat of arms.', 'fortune', '', 'noun', '[{\"text\":\"accidents\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4551, 'accident', 'Designating any form of transportation involved in an accident.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4552, 'parallel', 'Equally distant from one another at all points.,Having the same overall direction; the comparison is indicated with \"to\".,Either not intersecting, or coinciding.,Involving the processing of multiple tasks at the same time.', '', 'perpendicular,skew,serial,sequential', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
