(4554, 'parallel', 'One of a set of parallel lines.,Direction conformable to that of another line.,A line of latitude.,An arrangement of electrical components such that a current flows along two or more paths; see in parallel.,Something identical or similar in essential respects.,A comparison made; elaborate tracing of similarity.,One of a series of long trenches constructed before a besieged fortress, by the besieging force, as a cover for troops supporting the attacking batteries. They are roughly parallel to the line of outer defenses of the fortress.,A character consisting of two parallel vertical lines, used in the text to direct attention to a similarly marked note in the margin or at the foot of a page.', '', '', 'noun', '[{\"text\":\"parallels\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
