(4787, 'grace', 'Charming, pleasing qualities.,A short prayer of thanks before or after a meal.,In the games of patience or solitaire: a special move that is normally against the rules.,A grace note.,Elegant movement; balance or poise.,An allowance of time granted to a debtor during which he or she is free of at least part of his normal obligations towards the creditor.,Free and undeserved favour, especially of God; unmerited divine assistance given to humans for their regeneration or sanctification, or for resisting sin.,An act or decree of the governing body of an English university.', '', '', 'noun', '[{\"text\":\"graces\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
