(4809, 'angle', 'A figure formed by two rays which start from a common point (a plane angle) or by three planes that intersect (a solid angle).,The measure of such a figure. In the case of a plane angle, this is the ratio (or proportional to the ratio) of the arc length to the radius of a section of a circle cut by the two rays, centered at their common point. In the case of a solid angle, this is the ratio of the surface area to the square of the radius of the section of a sphere.,A corner where two walls intersect.,A change in direction.,A viewpoint; a way of looking at something.,The focus of a news story.,Any of various hesperiid butterflies.,A storyline between two wrestlers, providing the background for and approach to a feud.,An ulterior motive; a scheme or means of benefitting from a situation, usually hidden, often immoral,A projecting or sharp corner; an angular fragment.,Any of the four cardinal points of an astrological chart: the Ascendant, the Midheaven, the Descendant and the Imum Coeli.', 'swerve,opinion,perspective,point of view,slant,view,viewpoint,-gon', '', 'noun', '[{\"text\":\"angles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4810, 'angle', 'To place (something) at an angle.,To change direction rapidly.,To present or argue something in a particular way or from a particular viewpoint.,To hamper (oneself or one\'s opponent) by leaving the cue ball in the jaws of a pocket such that the surround of the pocket (the \"angle\") blocks the path from cue ball to object ball.', '', '', 'verb', '[{\"text\":\"angles\",\"type\":\"present singular third-person\"},{\"text\":\"angling\",\"type\":\"participle present\"},{\"text\":\"angled\",\"type\":\"participle past\"},{\"text\":\"angled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
