(4874, 'crown', 'A royal, imperial or princely headdress; a diadem.,A wreath or band for the head, especially one given as reward of victory or a mark of honor.,Any reward of victory or mark of honor.,Imperial or regal power, or those who wield it.,The sovereign (in a monarchy), as head of state.,The state, the government (headed by a monarch).,The topmost part of the head.,The highest part of a hill.,The top section of a hat, above the brim.,The raised centre of a road.,The highest part of an arch.,The upper range of facets in a rose diamond.,The dome of a furnace.,The upper part of certain fruits, as the pineapple or strawberry, that is removed before eating.,A kind of spire or lantern formed by converging flying buttresses.,Splendor; culmination; acme.,Any currency (originally) issued by the crown (regal power) and often bearing a crown (headdress); (translation) various currencies known by similar names in their native languages, such as the koruna, kruna, krone, korona.,A former pre-decimalization British coin worth five shillings.,The part of a plant where the root and stem meet.,The top of a tree.,The part of a tooth above the gums.,A prosthetic covering for a tooth.,A knot formed in the end of a rope by tucking in the strands to prevent them from unravelling,The part of an anchor where the arms and the shank meet,The rounding, or rounded part, of the deck from a level line.,In England, a standard size of printing paper measuring 20 × 15 inches.,In American, a standard size of writing paper measuring 19 × 15 inches.,A monocyclic ligand having three or more binding sites, capable of holding a guest in a central location,During childbirth, the appearance of the baby\'s head from the mother\'s vagina,A rounding or smoothing of the barrel opening,The area enclosed between two concentric perimeters.,A round spot shaved clean on the top of the head, as a mark of the clerical state; the tonsure.,A whole bird with the legs and wings removed to produce a joint of white meat.,A formal hat worn by women to Sunday church services; a church crown.,The knurled knob or dial, on the outside of a watch case, used to wind it or adjust the hands.', 'coronet,diadem,garland,wreath,award,garland,honor,prize,wreath,monarchy,royalty,apex,top,apex,peak,summit,top,completion,culmination,finish,splendor,caser,tusheroon,tush,tosheroon,tosh,bull,caroon,thick-un,coachwheel,cartwheel,corona,dental crown,dental cap', 'base,bottom,foot', 'noun', '[{\"text\":\"crowns\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4875, 'crown', 'Of, related to, or pertaining to a crown.,Of, related to, pertaining to the top of a tree or trees.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4876, 'crown', 'To place a crown on the head of.,To formally declare (someone) a king, queen, emperor, etc.,To bestow something upon as a mark of honour, dignity, or recompense; to adorn; to dignify.,To form the topmost or finishing part of; to complete; to consummate; to perfect.,To declare (someone) a winner.,Of a baby, during the birthing process; for the surface of the baby\'s head to appear in the vaginal opening.,To cause to round upward; to make anything higher at the middle than at the edges, such as the face of a machine pulley.,To hit on the head.,To shoot an opponent in the back of the head with a shotgun in a first-person shooter video game.,In checkers, to stack two checkers to indicate that the piece has become a king.,To widen the opening of the barrel.,To effect a lodgment upon, as upon the crest of the glacis, or the summit of the breach.,To lay the ends of the strands of (a knot) over and under each other.,being about to take a poop (usually trying to hold it in, derived from obstetric use: metaphor of \"giving birth\" to solid poo)', 'grow a tail', '', 'verb', '[{\"text\":\"crowns\",\"type\":\"present singular third-person\"},{\"text\":\"crowning\",\"type\":\"participle present\"},{\"text\":\"crowned\",\"type\":\"participle past\"},{\"text\":\"crowned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
