(4882, 'crack', 'To form cracks.,To break apart under force, stress, or pressure.,To become debilitated by psychological pressure.,To break down or yield, especially under interrogation or torture.,To make a cracking sound.,To change rapidly in register.,To alternate between high and low register in the process of eventually lowering.,To make a sharply humorous comment.,To make a crack or cracks in.,To break open or crush to small pieces by impact or stress.,To strike forcefully.,To open slightly.,To cause to yield under interrogation or other pressure.,To solve a difficult problem.,To overcome a security system or component.,To cause to make a sharp sound.,To tell (a joke).,To break down (a complex molecule), especially with the application of heat: to pyrolyse.,To circumvent software restrictions such as regional coding or time limits.,To open a canned beverage, or any packaged drink or food.,To brag; to boast.,To be ruined or impaired; to fail.,To barely reach, attain to (a measurement, extent).', '', '', 'verb', '[{\"text\":\"cracks\",\"type\":\"present singular third-person\"},{\"text\":\"cracking\",\"type\":\"participle present\"},{\"text\":\"cracked\",\"type\":\"participle past\"},{\"text\":\"cracked\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
