(4886, 'fetish', 'Something which is believed to possess, contain, or cause spiritual or magical powers; an amulet or a talisman.,Sexual attraction to or arousal at something abnormally sexual or nonsexual, such as an object or a nonsexual part of the body.,An irrational, or abnormal fixation or preoccupation; an obsession.', 'paraphilia', '', 'noun', '[{\"text\":\"fetishes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4887, 'smoke', 'The visible vapor/vapour, gases, and fine particles given off by burning or smoldering material.,A cigarette.,Anything to smoke (e.g. cigarettes, marijuana, etc.),An instance of smoking a cigarette, cigar, etc.; the duration of this act.,A fleeting illusion; something insubstantial, evanescent, unreal, transitory, or without result.,Something used to obscure or conceal; an obscuring condition; see also smoke and mirrors.,A light grey colour/color tinted with blue.,Bother; problems; hassle.,A particulate of solid or liquid particles dispersed into the air on the battlefield to degrade enemy ground or for aerial observation. Smoke has many uses--screening smoke, signaling smoke, smoke curtain, smoke haze, and smoke deception. Thus it is an artificial aerosol.,A fastball.,A distinct column of smoke, such as indicating a burning area or fire.', 'cig,ciggy,cancer stick,coffin nail,fag', '', 'noun', '[{\"text\":\"smokes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4888, 'smoke', 'To inhale and exhale the smoke from a burning cigarette, cigar, pipe, etc.,To inhale and exhale tobacco smoke.,To give off smoke.,Of a fire in a fireplace: to emit smoke outward instead of up the chimney, owing to imperfect draught.,To preserve or prepare (food) for consumption by treating with smoke.,To dry or medicate by smoke.,To fill or scent with smoke; hence, to fill with incense; to perfume.,To make unclear or blurry.,To perform (e.g. music) energetically or skillfully.,To beat someone at something.,To kill, especially with a gun.,To thrash; to beat.,To smell out; to hunt out; to find out; to detect.,To ridicule to the face; to mock.,To burn; to be kindled; to rage.,To raise a dust or smoke by rapid motion.,To suffer severely; to be punished.,To punish (a person) for a minor offense by excessive physical exercise.,To cover (a key blank) with soot or carbon to aid in seeing the marks made by impressioning.', 'have a smoke', '', 'verb', '[{\"text\":\"smokes\",\"type\":\"present singular third-person\"},{\"text\":\"smoking\",\"type\":\"participle present\"},{\"text\":\"smoked\",\"type\":\"participle past\"},{\"text\":\"smoked\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
