(4899, 'craft', 'Strength; power; might; force .,Ability, skilfulness, especially skill in making plans and carrying them into execution; dexterity in managing affairs, adroitness, practical cunning; ingenuity in constructing, dexterity .,Cunning, art, skill, or dexterity applied to bad purposes; artifice; guile; subtlety; shrewdness as demonstrated by being skilled in deception .,Occult art, magic .,A work or product of art .,Handmade items, especially domestic or decorative objects; handicrafts .,A device, a means; a magical device, spell or enchantment .,Learning of the schools, scholarship; a branch of learning or knowledge, a science, especially one of the ‘seven liberal arts’ of the medieval universities .,Skill, skilfulness, art, especially the skill needed for a particular profession .,A branch of skilled work or trade, especially one requiring manual dexterity or artistic skill, but sometimes applied equally to any business, calling or profession; the skilled practice of a practical occupation .,A trade or profession as embodied in its practitioners collectively; the members of a trade or handicraft as a body; an association of these; a trade\'s union, guild, or ‘company’ .,Boats, especially of smaller size than ships. Historically primarily applied to vessels engaged in loading or unloading of other vessels, as lighters, hoys, and barges.,Those vessels attendant on a fleet, such as cutters, schooners, and gun-boats, generally commanded by lieutenants.,A woman.,Implements used in catching fish, such as net, line, or hook. Modern use primarily in whaling, as in harpoons, hand-lances, etc. .', 'craftiness,cunning,foxiness,guile,slyness,wiliness,craftsmanship,workmanship,art,trade,handicraft,business,profession', '', 'noun', '[{\"text\":\"craft\",\"type\":\"plural\"},{\"text\":\"crafts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
