(4905, 'fellow', 'A companion; a comrade.,An animal which is a member of a breed or species, or a flock, herd, etc.,An object which is associated with another object; especially, as part of a set.,A person with abilities, achievements, skills, etc., equal to those of another person; a thing with characteristics, worth, etc., equal to those of another thing.,One in the same condition, or situation of need, as another.,An equal in character, power, rank, etc.; a peer.,A person living at the same time, or about the same age as another, especially when in the same field of study or work.,A person or thing comparable in characteristics with another person or thing; especially, as belonging to the same class or group.,Originally, one of a group of academics who make up a college or similar educational institution; now, a senior member of a college or similar educational institution involved in teaching, research, and management of the institution.,An honorary title bestowed by a college or university upon a distinguished person (often an alumna or alumnus).,A (senior) member of a learned or professional society.,A (senior) member of a learned or professional society.,A scholar appointed to a fellowship, that is, a paid academic position held for a certain period which usually requires the scholar to conduct research.,A physician undergoing a fellowship (supervised subspecialty medical training) after having completed a residency (specialty training program).,A member of a college or university who manages its business interests.,A senior researcher or technician in a corporation, especially one engaged in research and development.,A male person; a bloke, a chap, a guy, a man; also, preceded by a modifying word, sometimes with a sense of mild reproach: used as a familiar term of address to a man.,Usually qualified by an adjective or used in the plural: an individual or person regardless of gender.,An animal or object.,One of a pair of things suited to each other or used together; a counterpart, a mate.,Originally (obsolete), a person\'s partner (of either sex) in life or marriage; a spouse; also, the mate of an animal; now (dated), a person\'s male lover or partner; a boyfriend; a husband.,Alternative form of fella (“used as a general intensifier”),A colleague or partner.,An associate in the commission of a crime or other wrongful act; an accomplice.,A close companion or friend; also, a companion or friend whom one eats or drinks with.,Followed by of: one who participates in an activity; a participant.,A man without good breeding or of lower social status; a common or ignoble man; also, used as a polite term of address to such a person.,A person\'s servant or slave.,A worthless person; a churl, a knave; also, used as a term of address to a person regarded as such.,Synonym of schoolmate (“a student at the same school”),A black man.', 'associate,man,schoolmate', '', 'noun', '[{\"text\":\"fellows\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4906, 'fellow', 'To address (someone) as \"fellow\", especially in an insulting manner (see noun sense 10.6).,To equal (someone or something); also, to cause or find someone or something to be equal to (some other person or thing).,To pair or suit (someone or something) with some other person or thing; also, to pair or suit someone or something with (some other person or thing); to arrange (things) in pairs.,Followed by to or with: to associate or join (oneself, someone, or something) with some other person or thing in companionship or a partnership.,Followed by to or with: to cause or portray (someone or something) to be equal to some other person or thing.,To associate or go together with (someone or something); to become a partner of (someone or something).,Followed by with: to associate or join with a person or thing in companionship or a partnership.', '', '', 'verb', '[{\"text\":\"fellows\",\"type\":\"present singular third-person\"},{\"text\":\"fellowing\",\"type\":\"participle present\"},{\"text\":\"fellowed\",\"type\":\"participle past\"},{\"text\":\"fellowed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
