(4918, 'convert', 'To transform or change (something) into another form, substance, state, or product.,To change (something) from one use, function, or purpose to another.,To induce (someone) to adopt a particular religion, faith, ideology or belief (see also sense 11).,To exchange for something of equal value.,To express (a quantity) in alternative units.,To express (a unit of measurement) in terms of another; to furnish a mathematical formula by which a quantity, expressed in the former unit, may be given in the latter.,To appropriate wrongfully or unlawfully; to commit the common law tort of conversion.,To score extra points after (a try) by completing a conversion.,To score (especially a penalty kick).,To score a spare.,To undergo a conversion of religion, faith or belief (see also sense 3).,To become converted.,To cause to turn; to turn.,To change (one proposition) into another, so that what was the subject of the first becomes the predicate of the second.,To turn into another language; to translate.,To increase one\'s individual score, especially from 50 runs (a fifty) to 100 runs (a century), or from a century to a double or triple century.,To perform the action that an online advertisement is intended to induce; to reach the point of conversion.,To transform a material or positional advantage into a win.', '', '', 'verb', '[{\"text\":\"converts\",\"type\":\"present singular third-person\"},{\"text\":\"converting\",\"type\":\"participle present\"},{\"text\":\"converted\",\"type\":\"participle past\"},{\"text\":\"converted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
