(4920, 'blind', 'Unable to see, due to physiological or neurological factors.,Failing to see, acknowledge, perceive.,Of a place, having little or no visibility.,Closed at one end; having a dead end; exitless.,Having no openings for light or passage; both dark and exitless.,Smallest or slightest.,Without any prior knowledge.,Unconditional; without regard to evidence, logic, reality, accidental mistakes, extenuating circumstances, etc.,Using blinded study design, wherein information is purposely limited to prevent bias.,Unintelligible or illegible.,Abortive; failing to produce flowers or fruit.,Uncircumcised', 'sightless', 'seeing,sighted', 'adj', '[{\"text\":\"blinder\",\"type\":\"comparative\"},{\"text\":\"blindest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4921, 'blind', 'A movable covering for a window to keep out light, made of cloth or of narrow slats that can block light or allow it to pass.,A destination sign mounted on a public transport vehicle displaying the route destination, number, name and/or via points, etc.,Any device intended to conceal or hide.,Something to mislead the eye or the understanding, or to conceal some covert deed or design; a subterfuge.,A blindage.,A hiding place.,The blindside.,No score.,A forced bet: the small blind or the big blind.,A player who is forced to pay such a bet.', 'rollsign', '', 'noun', '[{\"text\":\"blinds\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
