(4947, 'citizen', 'A resident of a city or town, especially one with legally-recognized rights or duties.,A legally-recognized member of a state, with associated rights and obligations; a person considered in terms of this role.,I am a Roman citizen.,An inhabitant or occupant: a member of any place.,A resident of the heavenly city or (later) of the kingdom of God: a Christian; a good Christian.,A civilian, as opposed to a police officer, soldier, or member of some other specialized (usually state) group.,An ordinary person, as opposed to nobles and landed gentry on one side and peasants, craftsmen, and laborers on the other.,A term of address among French citizens during the French Revolution or towards its supporters elsewhere; (later, dated) a term of address among socialists and communists.,An object.', 'burgess,burgher,cityite,freeman,countryman,national,countryman,national,denizen,local,inhabitant,native,occupant,resident,comrade', 'alien,illegal alien,foreigner,illegal,alien,illegal alien,foreigner,illegal,alien,outsider,stranger', 'noun', '[{\"text\":\"citizens\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
