(4950, 'vertical', 'Standing, pointing, or moving straight up or down; parallel to the local direction of gravity; along the direction of a plumb line; perpendicular to something horizontal.,In a two-dimensional Cartesian co-ordinate system, describing the axis y oriented normal (perpendicular, at right angles) to the horizontal axis x.,In a three-dimensional co-ordinate system, describing the axis z oriented normal (perpendicular, orthogonal) to the basic plane xy.,Of or pertaining to vertical markets.,Involving different vintages of the same wine type from the same winery.,Of an interval: having the two notes sound simultaneously.', 'harmonic', 'horizontal', 'adj', '[{\"text\":\"more vertical\",\"type\":\"comparative\"},{\"text\":\"most vertical\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
