(4953, 'absolute', 'Free of restrictions, limitations, qualifications or conditions; unconditional.,Unrestricted by laws, a constitution, or parliamentary or judicial or other checks; (legally) unlimited in power, especially if despotic.,Unrestricted by laws, a constitution, or parliamentary or judicial or other checks; (legally) unlimited in power, especially if despotic.,Free from imperfection, perfect, complete; especially, perfectly embodying a quality in its essential characteristics or to its highest degree.,Pure, free from mixture or adulteration; unmixed.,Complete, utter, outright; unmitigated, not qualified or diminished in any way.,Positive, certain; unquestionable; not in doubt.,Certain; free from doubt or uncertainty (e.g. a person, opinion or prediction).,Fundamental, ultimate, intrinsic; not relative; independent of references or relations to other things or standards.,Having reference to or derived in the simplest manner from the fundamental units of mass, time, and length.,Relating to the absolute temperature scale (based on absolute zero); kelvin.,Independent of arbitrary units of measurement, standards, or properties; not comparative or relative.,Syntactically connected to the rest of the sentence in an atypical manner, or not relating to or depending on it, like in the nominative absolute or genitive absolute, accusative absolute or ablative absolute.,Lacking a modified substantive, like \"hungry\" in \"feed the hungry\".,Expressing a relative term without a definite comparison, like \"older\" in \"an older person should be treated with respect\".,Positive; not graded (not comparative or superlative).,Having no direct object, like \"kill\" in \"if looks could kill\".,Being or pertaining to an inflected verb that is not preceded by any number of particles or compounded with a preverb.,As measured using an absolute value.,Indicating an expression that is true for all real numbers, or of all values of the variable; unconditional.,Pertaining to a grading system based on the knowledge of the individual and not on the comparative knowledge of the group of students.,Independent of (references to) other arts; expressing things (beauty, ideas, etc) only in one art.,Indicating that a tenure or estate in land is not conditional or liable to terminate on (strictly) any occurrence or (sometimes contextually) certain kinds of occurrence.,Absolved; free.', '', 'conjunct', 'adj', '[{\"text\":\"more absolute\",\"type\":\"comparative\"},{\"text\":\"absoluter\",\"type\":\"comparative\"},{\"text\":\"most absolute\",\"type\":\"superlative\"},{\"text\":\"absolutest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4954, 'absolute', 'That which exists (or has a certain property, nature, size, etc) independent of references to other standards or external conditions; that which is universally valid; that which is not relative, conditional, qualified or mitigated.,In a plane, the two imaginary circular points at infinity; in space of three dimensions, the imaginary circle at infinity.,A realm which exists without reference to anything else; that which can be imagined purely by itself; absolute ego.,The whole of reality; the totality to which everything is reduced; the unity of spirit and nature; God.,A concentrated natural flower oil, used for perfumes; an alcoholic extract of a concrete.', '', '', 'noun', '[{\"text\":\"absolutes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
