(5055, 'throw', 'To hurl; to cause an object to move rapidly through the air.,To eject or cause to fall off.,To move to another position or condition; to displace.,To make (a pot) by shaping clay as it turns on a wheel.,To deliver (the ball) illegally by straightening the bowling arm during delivery.,To send (an error) to an exception-handling mechanism in order to interrupt normal processing.,To intentionally lose a game.,To confuse or mislead.,To send desperately.,To imprison.,To organize an event, especially a party.,To roll (a die or dice).,To cause a certain number on the die or dice to be shown after rolling it.,To discard.,To lift the opponent off the ground and bring him back down, especially into a position behind the thrower.,To change in order to give the illusion that the voice is that of someone else.,To show sudden emotion, especially anger.,To project or send forth.,To put on hastily; to spread carelessly.,To twist two or more filaments of (silk, etc.) so as to form one thread; to twist together, as singles, in a direction contrary to the twist of the singles themselves; sometimes applied to the whole class of operations by which silk is prepared for the weaver.,To select (a pitcher); to assign a pitcher to a given role (such as starter or reliever).,To install (a bridge).,To twist or turn.,Synonym of pass,To deliver.,Of animals: to give birth to (young).', 'bowl,bung,buzz,cast,catapult,chuck,dash,direct,fire,fling,flip,heave,hurl,launch,lob,pitch,project,propel,cast,chuck,feck,fling,hurl,launch,lob,pitch,shy [⇒ thesaurus],skew,sling,toss,eject,throw off,displace,relocate,take a dive,pass', '', 'verb', '[{\"text\":\"throws\",\"type\":\"present singular third-person\"},{\"text\":\"throwing\",\"type\":\"participle present\"},{\"text\":\"threw\",\"type\":\"past\"},{\"text\":\"throwed\",\"type\":\"nonstandard past\"},{\"text\":\"thrown\",\"type\":\"participle past\"},{\"text\":\"throwed\",\"type\":\"nonstandard participle past\"}]', NULL, NULL, NULL, NULL