(5181, 'purple', 'Having a colour/color that is a dark blend of red and blue.,Not predominantly red or blue, but having a mixture of Democrat and Republican support, as in purple state, purple city.,Mixed between social democrats and liberals.,Imperial; regal.,Blood-red; bloody.,Extravagantly ornate, like purple prose.,Completed in the fastest time so far in a given session.', 'purpureal', '', 'adj', '[{\"text\":\"purpler\",\"type\":\"comparative\"},{\"text\":\"more purple\",\"type\":\"comparative\"},{\"text\":\"purplest\",\"type\":\"superlative\"},{\"text\":\"most purple\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
