(5210, 'packet', 'A small pack or package; a little bundle or parcel,Originally, a vessel employed by government to convey dispatches or mails; hence, a vessel employed in conveying dispatches, mails, passengers, and goods, and having fixed days of sailing; a mail boat. Packet boat, ship, vessel (Wikipedia).,A specimen envelope containing small, dried plants or containing parts of plants when attached to a larger sheet.,A small fragment of data as transmitted on some types of network, notably Ethernet networks (Wikipedia).,A plastic bag.,Synonym of package (“male genitalia”),A large amount of money.', 'package', '', 'noun', '[{\"text\":\"packets\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
