(5213, 'shadow', 'A dark image projected onto a surface where light (or other radiation) is blocked by the shade of an object.,Relative darkness, especially as caused by the interruption of light; gloom; obscurity.,A area protected by an obstacle (likened to an object blocking out sunlight).,A reflected image, as in a mirror or in water.,That which looms as though a shadow.,A small degree; a shade.,An imperfect and faint representation.,A trainee, assigned to work with an experienced officer.,One who secretly or furtively follows another.,An inseparable companion.,A drop shadow effect applied to lettering in word processors etc.,An influence, especially a pervasive or a negative one.,A spirit; a ghost; a shade.,An uninvited guest accompanying one who was invited.,An unconscious aspect of the personality.', 'umbra', '', 'noun', '[{\"text\":\"shadows\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
