(5218, 'spray', 'A fine, gentle, dispersed mist of liquid.,Something resembling a spray of liquid.,A pressurized container; an atomizer.,Any of numerous commercial products, including paints, cosmetics, and insecticides, that are dispensed from containers in this manner.,A jet of fine medicated vapour, used either as an application to a diseased part or to charge the air of a room with a disinfectant or a deodorizer.,A side channel or branch of the runner of a flask, made to distribute the metal to all parts of the mold.,A group of castings made in the same mold and connected by sprues formed in the runner and its branches.,The allocation and filling of blocks of memory with the same byte sequence, hoping to establish that sequence in a certain predetermined location as part of an exploit.,A loud scolding or reprimand, usually delivered by a sports coach or similar figure.', 'spray can,spray can', '', 'noun', '[{\"text\":\"sprays\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
