(5370, 'copper', 'A reddish-brown, malleable, ductile metallic element with high electrical and thermal conductivity, symbol Cu, and atomic number 29.,The reddish-brown colour/color of copper.,A copper coin, typically of a small denomination, such as a penny.,A large pot, often used for heating water or washing clothes over a fire. In Australasia at least, it could also be a fixed installation made of copper, with a fire underneath and its own chimney. Generally made redundant by the advent of the washing machine.,Any of various specialized items that are made of copper, where the use of copper is either traditional or vital to the function of the item.,Any of various lycaenid butterflies with copper-coloured upperwings, especially those of the genera Lycaena and Paralucia.', '', '', 'noun', '[{\"text\":\"coppers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
