(5374, 'globe', 'Any spherical (or nearly spherical) object.,The planet Earth.,A spherical model of Earth or other planet.,A light bulb.,A circular military formation used in Ancient Rome, corresponding to the modern infantry square.,A woman\'s breast.,A group.,A land snail of the genus Mesodon', 'Earth,world,Terra,Sol III', '', 'noun', '[{\"text\":\"globes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
