(5383, 'receipt', 'The act of receiving, or the fact of having been received.,The fact of having received a blow, injury etc.,A quantity or amount received; takings.,A written acknowledgment that a specified article or sum of money has been received.,(A piece of) evidence, documentation, etc. to prove one\'s past actions, accomplishments, etc.,(A piece of) evidence (e.g. documentation or screen captures) of past wrongdoing.,A recipe, instructions, prescription.,A receptacle.,A revenue office.,Reception, as an act of hospitality.,Capability of receiving; capacity.,A recess; a retired place.', '', '', 'noun', '[{\"text\":\"receipts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
