(5387, 'ordinary', 'A person having immediate jurisdiction in a given case of ecclesiastical law, such as the bishop within a diocese.,A courier; someone delivering mail or post.,A judge with the authority to deal with cases himself or herself rather than by delegation.,The chaplain of Newgate prison, who prepared condemned prisoners for death.,Customary fare, one\'s regular daily allowance of food; (hence) a regular portion or allowance.,A meal provided for a set price at an eating establishment.,A place where such meals are served; a public tavern, inn.,One of the standard geometric designs placed across the center of a coat of arms, such as a pale or fess.,An ordinary person or thing; something commonplace.,The usual course of things; normal condition or health; a standard way of behaviour or action.,A penny farthing bicycle.,A part of the Christian liturgy that is reasonably constant without regard to the date on which the service is performed.,A devotional manual; a book setting our rules for proper conduct.,A rule, or book of rules, prescribing the order of service, especially of Mass.', '', '', 'noun', '[{\"text\":\"ordinaries\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5388, 'ordinary', 'Having regular jurisdiction; now only used in certain phrases.,Being part of the natural order of things; normal, customary, routine.,Having no special characteristics or function; everyday, common, mundane; often deprecatory.,Bad or undesirable.', '', '', 'adj', '[{\"text\":\"more ordinary\",\"type\":\"comparative\"},{\"text\":\"most ordinary\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
