(5394, 'ghost', 'The spirit; the human soul.,The disembodied soul; the soul or spirit of a deceased person; a spirit appearing after death.,Any faint shadowy semblance; an unsubstantial image.,A false image formed in a telescope, camera, or other optical device by reflection from the surfaces of one or more lenses.,An unwanted image similar to and overlapping or adjacent to the main one on a television screen, caused by the transmitted image being received both directly and via reflection.,A ghostwriter.,A nonexistent person invented to obtain some fraudulent benefit.,A dead person whose identity is stolen by another. See ghosting.,An unresponsive user on IRC, resulting from the user\'s client disconnecting without notifying the server.,An image of a file or hard disk.,An understudy.,A covert (and deniable) agent.,The faint image that remains after an attempt to remove graffiti.,An opponent in a racing game that follows a previously recorded route, allowing players to compete against previous best times.,Someone whose identity cannot be established because there are no records of him/her.,An unphysical state in a gauge theory.,A formerly nonexistent character that was at some point mistakenly encoded into a character set standard, which might have since become used opportunistically for some genuine purpose.,Clipping of ghost pepper.,A game in which players take turns to add a letter to a possible word, trying not to complete a word.,White or pale.,Transparent or translucent.,Abandoned.,Remnant; the remains of a(n).,Perceived or listed but not real.,Of cryptid, supernatural or extraterrestrial nature.,Substitute.', 'essence,soul,spirit,ghost,apparition,bogey,haint,phantom,revenant,specter,spook,wraith,apparition,barghest,duppy,eidolon,empuse,haint,haunt,jumbie,phantom,poltergeist,revenant,shade,specter,spectre,spirit [⇒ thesaurus],spook,visitant,wraith,glimmer,glimmering,glimpse,hint,inkling,phantom,spark,suggestion,echo,backup,spook,spy,shadow', '', 'noun', '[{\"text\":\"ghosts\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5395, 'ghost', 'To haunt; to appear to in the form of an apparition.,To die; to expire.,To imbue with a ghost-like hue or effect.,To ghostwrite.,To sail seemingly without wind.,To copy a file or hard drive image.,To gray out (a visual item) to indicate that it is unavailable.,To forcibly disconnect an IRC user who is using one\'s reserved nickname.,To appear or move without warning, quickly and quietly; to slip.,To transfer (a prisoner) to another prison without the prior knowledge of other inmates.,To kill.,To perform an act of ghosting: to break up with someone without warning or explanation; to ignore someone, especially on social media.,To provide the speaking or singing voice for another actor, who is lip-syncing.', '', '', 'verb', '[{\"text\":\"ghosts\",\"type\":\"present singular third-person\"},{\"text\":\"ghosting\",\"type\":\"participle present\"},{\"text\":\"ghosted\",\"type\":\"participle past\"},{\"text\":\"ghosted\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5396, 'pride', 'The quality or state of being proud; an unreasonable overestimation of one\'s own superiority in terms of talents, looks, wealth, importance etc., which manifests itself in lofty airs, distance, reserve and often contempt of others.,A sense of one\'s own worth, and scorn for what is beneath or unworthy of oneself; lofty self-respect; noble self-esteem; elevation of character; dignified bearing; rejection of shame,Proud or disdainful behavior or treatment; insolence or arrogance of demeanor; haughty bearing and conduct; insolent exultation.,That of which one is proud; that which excites boasting or self-congratulation; the occasion or ground of self-esteem, or of arrogant and presumptuous confidence, as beauty, ornament, noble character, children, etc.,Show; ostentation; glory.,Highest pitch; elevation reached; loftiness; prime; glory.,Consciousness of power; fullness of animal spirits; mettle; wantonness.,Lust; sexual desire; especially, excitement of sexual appetite in a female animal.,A company of lions or other large felines.,The small European lamprey species Petromyzon branchialis.,Alternative letter-case form of Pride (“festival for LGBT people”).', 'dignity,amour propre,dignity,manship,self-belief,self-confidence,self-esteem,self-love,self-pride,self-regard,self-respect,self-worth,disdain,hubris,conceit,prid,sandpiper', '', 'noun', '[{\"text\":\"prides\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
