(5631, 'loaded', 'Burdened by some heavy load; packed.,Having a live round of ammunition in the chamber.,Possessing great wealth.,Drunk.,Pertaining to a situation where there is a runner at each of the three bases.,Of a die or dice: weighted asymmetrically, and so biased to produce predictable throws.,Designed to produce a predictable answer, or to lay a trap.,Having strong connotations that colour the literal meaning and are likely to provoke an emotional response. Sometimes used loosely to describe a word that simply has many different meanings.,Equipped with numerous options.,Covered with a topping or toppings.,Weighted with lead or similar.', 'crammed,laden,packed,stuffed,armed,primed,wealthy,drunk,fixed,rigged,weighted,leading,charged,freighted,pregnant,deluxe', '', 'adj', '[{\"text\":\"more loaded\",\"type\":\"comparative\"},{\"text\":\"most loaded\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5632, 'finger', 'A slender jointed extremity of the human hand, (often) exclusive of the thumb.,The lower, smaller segment of an arthropod claw.,One of the supporting structures of wings in birds, bats, etc. evolved from earlier toes or fingers.,One of the slender bony structures before the pectoral fins of gurnards and sea robins (Triglidae).,Similar or similar-looking extremities in other animals,Finger-shaped pieces of food.,A tube extending from a sealed system, or sometimes into one in the case of a cold finger.,Synonym of foxglove (D. purpurea).,Something similar in shape to the human finger,Various protruding plant structures, as a banana from its hand.,A lobe of the liver.,The teeth parallel to the blade of a scythe, fitted to a wooden frame called a crade.,The projections of a reaper or mower which similarly separate the stalks for cutting.,Clipping of finger pier: a shorter, narrower pier projecting from a larger dock.,Synonym of jet bridge: the narrow elevated walkway connecting a plane to an airport.,A leaf in a finger tree data structure.,Something similarly extending, (especially) from a larger body,Synonym of hand, the part of a clock pointing to the hour, minute, or second.,A policeman or prison guard.,An informer to the police, (especially) one who identifies a criminal during a lineup.,A criminal who scouts for prospective victims and targets or who performs reconnaissance before a crime.,That which points; an indicator, as of guilt, blame, or suspicion.,Something similar in function or agency to the human finger, (usually) with regard to touching, grasping, or pointing.,Synonym of digit: former units of measure notionally based on its width but variously standardized, (especially) the English digit of ¹⁄₁₆ foot (about 1.9 cm).,A unit of length notionally based on the length of an adult human\'s middle finger, standardized as 4½ inches (11.43 cm).,Synonym of digit: ¹⁄₁₂ the observed diameter of the sun or moon, (especially) with regard to eclipses