(5633, 'finger', 'To identify or point out. Also put the finger on. To report to or identify for the authorities, rat on, rat out, squeal on, tattle on, turn in.,To poke, probe, feel, or fondle with a finger or fingers.,To use the fingers to penetrate and sexually stimulate one\'s own or another person\'s vagina or anus; to fingerbang.,To use specified finger positions in producing notes on a musical instrument.,To provide instructions in written music as to which fingers are to be used to produce particular notes or passages.,To query (a user\'s status) using the Finger protocol.,To steal; to purloin.,To execute, as any delicate work.', 'inform,fingerbang,fingerfuck', '', 'verb', '[{\"text\":\"fingers\",\"type\":\"present singular third-person\"},{\"text\":\"fingering\",\"type\":\"participle present\"},{\"text\":\"fingered\",\"type\":\"participle past\"},{\"text\":\"fingered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
