(5838, 'cherry', 'A small fruit, usually red, black or yellow, with a smooth hard seed and a short hard stem.,Prunus subg. Cerasus, trees or shrubs that bear cherries.,The wood of a cherry tree.,Cherry red.,The fruit of the coffee plant, containing the seeds or beans.,Virginity, especially female virginity as embodied by a hymen.,A subtree consisting of a node with exactly two leaves.,A cricket ball.,A round, red light of the kind that is typically mounted on top of a police car.,The burning tip of a cigarette.', 'cherrytop', '', 'noun', '[{\"text\":\"cherries\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
