(5843, 'warren', 'The system of burrows where rabbits live.,A mazelike place of passages and/or rooms in which it\'s easy to lose oneself; especially one that may be overcrowded.,The class of small game such as hare, pheasants, stoats, etc., as opposed to beasts of chase such as deer, bear, and foxes.,A place legally authorized for the keeping, breeding and hunting of beasts of warren, especially rabbits.,The right to maintain and hunt an area of small beasts, similar to a free warren, but with certain limitations, such as restricting the right to hunt on parts of the land held by freeholders.', '', '', 'noun', '[{\"text\":\"warrens\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5844, 'devil', 'An evil creature, the objectification of a hostile and destructive force.,A fictional image of a man, usually red or orange in skin color; with a set of horns on his head, a pointed goatee and a long tail and carrying a pitchfork; that represents evil and portrayed to children in an effort to discourage bad behavior.,The bad part of the conscience; the opposite to the angel.,A wicked or naughty person, or one who harbors reckless, spirited energy, especially in a mischievous way; usually said of a young child.,A thing that is awkward or difficult to understand or do.,Hell.,A person, especially a man; used to express a particular opinion of him, usually in the phrases poor devil and lucky devil.,A printer\'s assistant. Also (India) \"a poltergeist that haunts printing works\".,A dust devil.,A barren, unproductive and unused area.,A dish, as a bone with the meat, broiled and excessively peppered; a grill with Cayenne pepper.,A machine for tearing or cutting rags, cotton, etc.,A Tasmanian devil.,An endurance event where riders who fall behind are periodically eliminated.,Ellipsis of devil seam.: The seam between garboard strake and the keel (a seam on wooden boats)', 'demon,imp,rascal,scamp,scoundrel,bastard,bitch,bugger,stinker,deuce,dickens,fuck,heck,hell,bugger,cow,sod', 'angel,god,angel,conscience,angel,saint,cakewalk,piece of cake', 'noun', '[{\"text\":\"devils\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5845, 'devil', 'To make like a devil; to invest with the character of a devil.,To annoy or bother.,To work as a ‘devil’; to work for a lawyer or writer without fee or recognition.,To grill with cayenne pepper; to season highly in cooking, as with pepper.,To finely grind cooked ham or other meat with spices and condiments.,To prepare a sidedish of shelled halved boiled eggs to whose extracted yolks are added condiments and spices, which mixture then is placed into the halved whites to be served.', 'bedevil,annoy', '', 'verb', '[{\"text\":\"devils\",\"type\":\"present singular third-person\"},{\"text\":\"deviling\",\"type\":\"US participle present\"},{\"text\":\"devilling\",\"type\":\"participle present\"},{\"text\":\"deviled\",\"type\":\"US participle past\"},{\"text\":\"deviled\",\"type\":\"US past\"},{\"text\":\"devilled\",\"type\":\"participle past\"},{\"text\":\"devilled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
