(5847, 'funeral', 'A ceremony to honour and remember a deceased person. Often distinguished from a memorial service by the presence of the body of the deceased.,A funeral sermon.', '', '', 'noun', '[{\"text\":\"funerals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
