(5850, 'grass', 'Any plant of the family Poaceae, characterized by leaves that arise from nodes in the stem and leaf bases that wrap around the stem, especially those grown as ground cover rather than for grain.,Various plants not in family Poaceae that resemble grasses.,A lawn.,Marijuana.,An informer, police informer; one who betrays a group (of criminals, etc) to the authorities.,Sharp, closely spaced discontinuities in the trace of a cathode-ray tube, produced by random interference.,Noise on an A-scope or similar type of radar display.,The season of fresh grass; spring or summer.,That which is transitory.,Asparagus; \"sparrowgrass\".,The surface of a mine.', '', '', 'noun', '[{\"text\":\"grasses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5851, 'grass', 'To lay out on the grass; to knock down (an opponent etc.).,To act as a grass or informer, to betray; to report on (criminals etc) to the authorities.,To cover with grass or with turf.,To feed with grass.,To expose, as flax, on the grass for bleaching, etc.,To bring to the grass or ground; to land.', '', '', 'verb', '[{\"text\":\"grasses\",\"type\":\"present singular third-person\"},{\"text\":\"grassing\",\"type\":\"participle present\"},{\"text\":\"grassed\",\"type\":\"participle past\"},{\"text\":\"grassed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
