(5867, 'analog', 'In which the value of a data item (such as time) is represented by a continuous(ly) variable physical quantity that can be measured (such as the shadow of a sundial).,Not relating to, or pre-dating, digital technology such as computers and the Internet; relating to real life.', 'material', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5868, 'analog', 'Something that bears an analogy to something else.,An organ or structure that is similar in function to one in another kind of organism but is of dissimilar evolutionary origin.,A structural derivative of a parent compound that differs from it by only one or a few atoms or substituent groups; (usually, especially) such a molecule that retains most of the same chemical properties.', '', '', 'noun', '[{\"text\":\"analogs\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5869, 'facial', 'Of or affecting the face.,Concerned with or used in improving the appearance of the face.,(of a law or regulation validity) On its face; as it appears (as opposed to, as it is applied).', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5870, 'facial', 'A personal care beauty treatment which involves cleansing and moisturizing of the human face.,A kind of early silent film focusing on the facial expressions of the actor.,(in some contact sports) A foul play which involves one player hitting another in the face.,A sex act of male ejaculation onto another person\'s face.', '', '', 'noun', '[{\"text\":\"facials\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5871, 'swing', 'To rotate about an off-centre fixed point.,To dance.,To ride on a swing.,To participate in the swinging lifestyle; to participate in wife-swapping.,To hang from the gallows; to be punished by hanging, swing for something or someone; (often hyperbolic) to be severely punished.,To move sideways in its trajectory.,(of a bowler) To make the ball move sideways in its trajectory.,To fluctuate or change.,To move (an object) backward and forward; to wave.,To change (a numerical result); especially to change the outcome of an election.,To make (something) work; especially to afford (something) financially.,To play notes that are in pairs by making the first of the pair slightly longer than written (augmentation) and the second shorter, resulting in a bouncy, uneven rhythm.,To move one\'s arm in a punching motion.,In dancing, to turn around in a small circle with one\'s partner, holding hands or arms.,To admit or turn something for the purpose of shaping it; said of a lathe.,To put (a door, gate, etc.) on hinges so that it can swing or turn.,To turn round by action of wind or tide when at anchor.,To turn in a different direction.', '', '', 'verb', '[{\"text\":\"swings\",\"type\":\"present singular third-person\"},{\"text\":\"swinging\",\"type\":\"participle present\"},{\"text\":\"swung\",\"type\":\"past\"},{\"text\":\"swang\",\"type\":\"archaic dialectal past\"},{\"text\":\"swung\",\"type\":\"participle past\"},{\"text\":\"swungen\",\"type\":\"archaic participle past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5872, 'swing', 'The manner in which something is swung.,The sweep or compass of a swinging body.,A line, cord, or other thing suspended and hanging loose, upon which anything may swing.,A hanging seat that can swing back and forth, in a children\'s playground, for acrobats in a circus, or on a porch for relaxing.,A dance style.,The genre of music associated with this dance style.,The amount of change towards or away from something.,In an election, the increase or decrease in the number of votes for opposition parties compared with votes for the incumbent party.,Sideways movement of the ball as it flies through the air.,Capacity of a turning lathe, as determined by the diameter of the largest object that can be turned in it.,In a musical theater production, a performer who understudies several roles.,A basic dance step in which a pair link hands and turn round together in a circle.,The maximum amount of change that has occurred or can occur; the sum of the maximum changes in any direction.,Free course; unrestrained liberty.,Influence or power of anything put in motion.,A type of hook with the arm more extended.', '', '', 'noun', '[{\"text\":\"swings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
