(6275, 'blade', 'A sword or knife.,Short for razor blade.,The (typically sharp-edged) part of a knife, sword, razor, or other tool with which it cuts.,The flat functional end or piece of a propeller, oar, hockey stick, chisel, screwdriver, skate, etc.,The narrow leaf of a grass or cereal.,The thin, flat part of a plant leaf, attached to a stem (petiole). The lamina.,A flat bone, especially the shoulder blade.,A cut of beef from near the shoulder blade (part of the chuck).,The part of the tongue just behind the tip, used to make laminal consonants.,A piece of prepared, sharp-edged stone, often flint, at least twice as long as it is wide; a long flake of ground-edge stone or knapped vitreous stone.,A throw characterized by a tight parabolic trajectory due to a steep lateral attitude.,The rudder, daggerboard, or centerboard of a vessel.,A bulldozer or surface-grading machine with mechanically adjustable blade that is nominally perpendicular to the forward motion of the vehicle.,A dashing young man.,A homosexual, usually male.,Thin plate, foil.,One of a series of small plates that make up the aperture or the shutter of a camera.,The principal rafters of a roof.,The four large shell plates on the sides, and the five large ones of the middle, of the carapace of the sea turtle, which yield the best tortoise shell.,A blade server.,Synonym of knifeblade,An exterior product of vectors. (The product may have more than two factors. Also, a scalar counts as a 0-blade, a vector as a 1-blade; an exterior product of k vectors may be called a k-blade.),The part of a key that is inserted into the lock.,An artificial foot used by amputee athletes, shaped like an upside-down interrogation mark.', 'knifeblade', '', 'noun', '[{\"text\":\"blades\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
