(6312, 'stroke', 'An act of striking with a weapon; a blow.,A single movement with a tool; also, an impact of a tool on an object.,An act, or the sound, of the clapper or hammer of a clock hitting a bell or other striking mechanism; hence, the time when such a strike occurs.,An act of hitting or trying to hit a ball; also, the manner in which this is done.,An act of hitting or trying to hit a ball; also, the manner in which this is done.,An act of hitting or trying to hit a ball; also, the manner in which this is done.,An act of hitting or trying to hit a ball; also, the manner in which this is done.,An act of hitting; a blow, a hit.,One of a series of beats or movements against a resisting medium, by means of which movement through or upon it is accomplished.,One of a series of beats or movements against a resisting medium, by means of which movement through or upon it is accomplished.,One of a series of beats or movements against a resisting medium, by means of which movement through or upon it is accomplished.,One of a series of beats or movements against a resisting medium, by means of which movement through or upon it is accomplished.,A beat or throb, as of the heart or pulse.,A single movement or thrust of a part (such as a piston) of a machine that moves back and forth; also, the length of this movement.,A single movement or thrust of a part (such as a piston) of a machine that moves back and forth; also, the length of this movement.,An act causing hurt or death, especially when seen as divine punishment.,A damaging occurrence, especially if sudden; a blow, a calamity.,An amount of work; specifically, a large amount of business or work.,A powerful or sudden effort by which something is done or produced; also, something accomplished by such an effort; an achievement, a feat.,A line making up a written character; specifically, a Chinese, Japanese, or Korean character.,In Unicode: the formal name of the individual horizontal strikethroughs (as in \"A̶\").,The oblique, slash, or virgule (\"/\").,A movement of a brush in painting, of a chisel in carving, of a pen, pencil, or such implement in drawing or writing, etc., in one direction; hence, a line or mark made on a surface by such an implement.,A distinctive expression in a written composition; a touch.,Influence; power.,Backstage influence.,A masterful or effective action.,The loss of brain function arising when the blood supply to the brain is suddenly interrupted.,An individual discharge of lightning, particularly if causing damage.,The effect or result of a striking; affliction or injury; a bruise or wound; soreness.,Chiefly in to have a good stroke: appetite.,A sudden attack of any illness, especially if causing loss of consciousness or movement, or when fatal.,A bow or pluck of a string or strings of a stringed instrument; also, the manner in which a musical instrument is played; hence, a melody, a tune.', 'beat,beat,beat,beat,beat,beat,beat,beat,pulsation,masterstroke,cerebrovascular accident,CVA', '', 'noun', '[{\"text\":\"strokes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6313, 'stroke', 'To draw the horizontal line across the upright part (of the letter t).,Followed by out or through: to draw a line or lines through (text) to indicate that it is deleted; to cancel, to strike or strike out.,Of a bell or clock: to chime or sound to indicate (the hour, the time, etc.).,To mark (something) with lines or stripes; to stripe.,To hit or kick (the ball) with a flowing or smooth motion; also, to score (a goal, a point, etc.) by doing so.,Of a rower or a crew: to row at (a rate of a certain number of strokes (“movements of the oar through water”) per minute).,To act as the stroke (“rower who is nearest the stern of the boat, the movement of whose oar sets the rowing rhythm for the other rowers”) of (a boat or its crew).,To strike (the water) with one\'s arms and legs when swimming.,To depict (something) with a paintbrush.,Chiefly followed by out: to suffer loss of brain function when the blood supply to the brain is suddenly interrupted; to have a stroke (noun sense 4).,To swim by making co-ordinated movements with the arms and legs.', '', '', 'verb', '[{\"text\":\"strokes\",\"type\":\"present singular third-person\"},{\"text\":\"stroking\",\"type\":\"participle present\"},{\"text\":\"stroked\",\"type\":\"participle past\"},{\"text\":\"stroked\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6314, 'stroke', 'To move one\'s hand or an object (such as a broom or brush) along (a surface) in one direction, touching it lightly; to caress.,To bring (something) to a certain condition by stroking (sense 1).,To give assurance to (someone) through encouragement.,To influence (someone) by convincing or flattering them.,To milk (a cow or other animal); especially, to squeeze the teat of (a cow, etc.) to extract the last bit of milk from the udder; to strap (dialectal), to strip.,To give a finely fluted surface to (stone) by carving it with a tool.,To sharpen (a knife or other cutting instrument) by honing or rubbing it against a surface.,To soothe (someone); also, to flatter or indulge (someone).', '', '', 'verb', '[{\"text\":\"strokes\",\"type\":\"present singular third-person\"},{\"text\":\"stroking\",\"type\":\"participle present\"},{\"text\":\"stroked\",\"type\":\"participle past\"},{\"text\":\"stroked\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"stroke\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6315, 'stroke', 'An act of moving one\'s hand or an object along a surface in one direction, touching it lightly; a caress.,A gesture of assurance given as encouragement; specifically (psychoanalysis) in transactional analysis: a (generally positive) reaction expressed to a person which fulfils their desires or needs.,A flattering or friendly act, comment, etc., done or made to a person to influence them.', '', '', 'noun', '[{\"text\":\"strokes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
