(6339, 'proceed', 'To move, pass, or go forward or onward; to advance; to carry on,To pass from one point, topic, or stage, to another.,To come from; to have as its source or origin.,To go on in an orderly or regulated manner; to begin and carry on a series of acts or measures; to act methodically,To be transacted; to take place; to occur.,To be applicable or effective; to be valid.,To begin and carry on a legal process.,To take an academic degree.', 'carry on,continue,go on,keep on,roll on', '', 'verb', '[{\"text\":\"proceeds\",\"type\":\"present singular third-person\"},{\"text\":\"proceeding\",\"type\":\"participle present\"},{\"text\":\"proceeded\",\"type\":\"participle past\"},{\"text\":\"proceeded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
