(6416, 'acute', 'Brief, quick, short.,High or shrill.,Intense, sensitive, sharp.,Urgent.,With the sides meeting directly to form an acute angle (at an apex or base).,Of an angle: less than 90 degrees.,Of a triangle: having all three interior angles measuring less than 90 degrees.,Of an accent or tone: generally higher than others.,Sharp, produced in the front of the mouth. (See Grave and acute on Wikipedia.Wikipedia),Of an abnormal condition of recent or sudden onset, in contrast to delayed onset; this sense does not imply severity, unlike the common usage.,Of a short-lived condition, in contrast to a chronic condition; this sense also does not imply severity.,After a letter of the alphabet: having an acute accent.', 'fast,rapid,keen,powerful,strong,emergent,pressing,sudden,acute-angled', 'leisurely,slow,grave,dull,obtuse,slow,witless,obtuse,obtuse,obtuse,obtuse-angled,chronic', 'adj', '[{\"text\":\"acuter\",\"type\":\"comparative\"},{\"text\":\"more acute\",\"type\":\"comparative\"},{\"text\":\"acutest\",\"type\":\"superlative\"},{\"text\":\"most acute\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
