(6427, 'stack', 'A large pile of hay, grain, straw, or the like, larger at the bottom than the top, sometimes covered with thatch.,A pile of similar objects, each directly on top of the last.,A pile of poles or wood, indefinite in quantity.,A pile of wood containing 108 cubic feet. (~3 m³),An extensive collection,A smokestack.,A linear data structure in which items inserted are removed in reverse order (the last item inserted is the first one to be removed).,A stack data structure stored in main memory that is manipulated during machine language procedure call related instructions.,An implementation of a protocol suite (set of protocols forming a layered architecture).,A combination of interdependent, yet individually replaceable, software components or technologies used together on a system.,A generalization of schemes in algebraic geometry and of sheaves.,A coastal landform, consisting of a large vertical column of rock in the sea.,Compactly spaced bookshelves used to house large collections of books.,A large amount of an object.,A pile of rifles or muskets in a cone shape.,The amount of money a player has on the table.,A number of flues embodied in one structure, rising above the roof.,A vertical drainpipe.,A fall or crash, a prang.,A blend of various dietary supplements or anabolic steroids with supposed synergistic benefits.,A holding pattern, with aircraft circling one above the other as they wait to land.,The quantity of a given item which fills up an inventory slot or bag.', 'protocol stack,technology stack', '', 'noun', '[{\"text\":\"stacks\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
