(6436, 'amber', 'Ambergris, the waxy product of the sperm whale.,A hard, generally yellow to brown translucent fossil resin, used for jewellery. One variety, blue amber, appears blue rather than yellow under direct sunlight.,A yellow-orange colour.,The intermediate light in a set of three traffic lights, which when illuminated indicates that drivers should stop short of the intersection when safe to do so.,The stop codon (nucleotide triplet) \"UAG\", or a mutant which has this stop codon at a premature place in its DNA sequence.,Hesitance to proceed, or limited approval to proceed; an amber light.', 'ambergris,yellow', '', 'noun', '[{\"text\":\"ambers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
