(6439, 'passage', 'A paragraph or section of text or music with particular meaning.,Part of a path or journey.,An incident or episode.,The official approval of a bill or act by a parliament.,The advance of time.,The use of tight brushwork to link objects in separate spatial plains. Commonly seen in Cubist works.,A passageway or corridor.,A strait or other narrow waterway.,An underground cavity, formed by water or falling rocks, which is much longer than it is wide.,The vagina.,The act of passing; movement across or through.,The right to pass from one place to another.,A fee paid for passing or for being conveyed between places.,Serial passage.,A gambling game for two players using three dice, in which the object is to throw a double over ten.', 'passing', '', 'noun', '[{\"text\":\"passages\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
