(6447, 'trunk', 'The usually single, more or less upright part of a tree, between the roots and the branches.,The torso.,The conspicuously extended, mobile, nose-like organ of an animal such as a sengi, a tapir or especially an elephant. The trunks of various kinds of animals might be adapted to probing and sniffing, as in the sengis, or be partly prehensile, as in the tapir, or be a versatile prehensile organ for manipulation, feeding, drinking and fighting as in the elephant.,A large suitcase, chest, or similar receptacle for carrying or storing personal possessions, usually with a hinged, often domed lid, and handles at each end, so that generally it takes two persons to carry a full trunk.,A box or chest usually covered with leather, metal, or cloth, or sometimes made of leather, hide, or metal, for holding or transporting clothes or other goods.,The luggage storage compartment of a sedan/saloon-style car.,A storage compartment fitted behind the seat of a motorcycle.,A circuit between telephone switchboards or other switching equipment.,A chute or conduit, or a watertight shaft connecting two or more decks.,A long, large box, pipe, or conductor, made of plank or metal plates, for various uses, as for conveying air to a mine or to a furnace, water to a mill, grain to an elevator, etc.,A long tube through which pellets of clay, peas, etc., are driven by the force of the breath. A peashooter,A flume or sluice in which ores are separated from the slimes in which they are contained.,In software projects under source control: the most current source tree, from which the latest unstable builds (so-called \"trunk builds\") are compiled.,A main line in a river, canal, railroad, or highway system.,The part of a pilaster between the base and capital, corresponding to the shaft of a column.,The main line or body of anything.,A large pipe forming the piston rod of a steam engine, of sufficient diameter to allow one end of the connecting rod to be attached to the crank, and t