(6738, 'grill', 'A grating; a grid of wire or a sheet of material with a pattern of holes or slots, usually used to protect something while allowing the passage of air and liquids. Typical uses: to allow air through a fan while preventing fingers or objects from passing; to allow people to talk to somebody, while preventing attack.,The criss-cross pieces that separate panes of glass in a window.,On a vehicle, a slotted cover as above, to protect and hide the radiator, while admitting air to cool it.,A cooking device comprising a source of radiative heat and a means of holding food under it; a broiler in US English,A cooking device comprising a source of radiative and convective heat and a means of holding food above it; a barbecue.,Food (designed to be) cooked on a grill.,A grillroom; a restaurant serving grilled food.,A type of jewelry worn on the front teeth.,The front teeth regarded collectively.,Misspelling of girl.', 'fronts,golds', '', 'noun', '[{\"text\":\"grills\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6739, 'grill', 'To cook (food) on a grill; to barbecue.,To cook food under the element of a stove or only under the top element of an oven – (US) broil, (cooking) salamander.,To interrogate; to question aggressively or harshly.,To feel very hot; to swelter.,To stamp or mark with a grill.', 'cook', '', 'verb', '[{\"text\":\"grills\",\"type\":\"present singular third-person\"},{\"text\":\"grilling\",\"type\":\"participle present\"},{\"text\":\"grilled\",\"type\":\"participle past\"},{\"text\":\"grilled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
