(6747, 'grain', 'The harvested seeds of various grass food crops eg: wheat, corn, barley.,Similar seeds from any food crop, e.g., buckwheat, amaranth, quinoa.,A single seed of grass food crops.,The crops from which grain is harvested.,A linear texture of a material or surface.,A single particle of a substance.,The English grain of ¹⁄₅₇₆₀ troy pound or ¹⁄₇₀₀₀ pound avoirdupois, now exactly 64.79891 mg.,The metric, carat, or pearl grain of ¹⁄₄ carat used for measuring precious stones and pearls, now exactly 50 mg.,The French grain of ¹⁄₉₂₁₆ livre, equivalent to 53.11 mg at metricization and equal to exactly 54.25 mg from 1812–1839 as part of the mesures usuelles.,Any of various small units of length originally notionally based on a grain\'s width, variously standardized at different places and times.,The carat grain of ¹⁄₄ carat as a measure of gold purity, creating a 96-point scale between 0% and 100% purity.,A region within a material having a single crystal structure or direction.,The solid piece of fuel in an individual solid-fuel rocket engine.,A reddish dye made from the coccus insect, or kermes; hence, a red color of any tint or hue, as crimson, scarlet, etc.; sometimes used by the poets as equivalent to Tyrian purple.,The hair side of a piece of leather, or the marking on that side.,The remains of grain, etc., after brewing or distillation; hence, any residuum. Also called draff.,A rounded prominence on the back of a sepal, as in the common dock.,Temper; natural disposition; inclination.,Visual texture in processed photographic film due to the presence of small particles of a metallic silver, or dye clouds, developed from silver halide that have received enough photons.', '', '', 'noun', '[{\"text\":\"grains\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
