(6869, 'monkey', 'A member of the clade Simiiformes other than those in the clade Hominoidea containing humans and apes, generally (but not universally) distinguished by small size, tails, and cheek pouches.,Any simian primate other than hominids, any monkey or ape.,A naughty or mischievous person, especially a child.,The person in the motorcycle sidecar in sidecar racing.,Synonym of idiot: a person of minimal intelligence.,Synonym of uggo: an unattractive person, especially one whose face supposedly resembles a monkey\'s.,Synonym of puppet: a person dancing to another\'s tune, a person controlled or directed by another.,A menial employee who does a repetitive job supposedly requiring minimal intelligence.,A black, a black person.,A small trading vessel of the sixteenth century.,The vessel in which a mess receives its full allowance of grog.,The weight of a pile driver or drop hammer.,A fluid consisting of hydrochloric acid and zinc, used in the process of soldering.,Synonym of five hundred, especially (Britain) 500 pounds sterling or (US, dated) 500 dollars.,Synonym of face card.,A person\'s temper, said to be \"up\" when they are angry.,A drug habit; an addiction; a compulsion.,A dance popularized by Major Lance in 1963, now usually only its upper-body dance move involving exaggerated drumming motions.', 'idiot,uggo,puppet,five hundred,face card', '', 'noun', '[{\"text\":\"monkeys\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
