(6884, 'spare', 'The act of sparing; moderation; restraint.,Parsimony; frugal use.,An opening in a petticoat or gown; a placket.,That which has not been used or expended.,A spare part, especially a spare tire.,A superfluous or second-best person.,The right of bowling again at a full set of pins, after having knocked all the pins down in less than three bowls. If all the pins are knocked down in one bowl it is a double spare; in two bowls, a single spare.,The act of knocking down all remaining pins in second ball of a frame; this entitles the pins knocked down on the next ball to be added to the score for that frame.,A free period; a block of school during which one does not have a class.,assistant or extra hand (typically on buses and lorries)', '', '', 'noun', '[{\"text\":\"spares\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
