(6960, 'laugh', 'To show mirth, satisfaction, or derision, by peculiar movement of the muscles of the face, particularly of the mouth, causing a lighting up of the face and eyes, and usually accompanied by the emission of explosive or chuckling sounds from the chest and throat; to indulge in laughter.,To be or appear cheerful, pleasant, mirthful, lively, or brilliant; to sparkle; to sport.,To make an object of laughter or ridicule; to make fun of; to deride; to mock.,To affect or influence by means of laughter or ridicule.,To express by, or utter with, laughter.', 'cackle,chortle,chuckle,giggle,guffaw,snicker,snigger,titter', '', 'verb', '[{\"text\":\"laughs\",\"type\":\"present singular third-person\"},{\"text\":\"laughing\",\"type\":\"participle present\"},{\"text\":\"laughed\",\"type\":\"participle past\"},{\"text\":\"laughed\",\"type\":\"past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"laugh\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
