(6967, 'pitch', 'A throw; a toss; a cast, as of something from the hand.,The act of pitching a baseball.,The field on which cricket, soccer, rugby, gridiron or field hockey is played. (In cricket, the pitch is in the centre of the field; see cricket pitch.) (Not often used in the US or Canada, where \"field\" is the preferred word.),The field of battle.,An effort to sell or promote something.,The distance between evenly spaced objects, e.g. the teeth of a saw or gear, the turns of a screw thread, the centres of holes, or letters in a monospace font.,The angle at which an object sits.,The degree to which a vehicle, especially a ship or aircraft, rotates on such an axis, tilting its bow or nose up or down. Compare with roll, yaw, and heave.,A measure of the angle of attack of a propeller.,An area in a market (or similar) allocated to a particular trader.,The place where a busker performs, a prostitute solicits clients, or an illegal gambling game etc. is set up before the public.,An area on a campsite intended for occupation by a single tent, caravan or similar.,A level or degree, or (by extension), a peak or highest degree.,A point or peak; the extreme point of elevation or depression.,The most thrust-out point of a headland or cape.,Collectively, the outermost points of some part of the body, especially the shoulders or hips.,The height a bird reaches in flight, especially a bird of prey preparing to swoop down on its prey.,A person\'s or animal\'s height.,Prominence; importance.,A section of a climb or rock face; specifically, the climbing distance between belays or stances.,A vertical cave passage, only negotiable by using rope or ladders.,That point of the ground on which the ball pitches or lights when bowled.,A descent; a fall; a thrusting down.,The point where a declivity begins; hence, the declivity itself; a descending slope; the degree or rate of descent or slope; slant.,The limit of ground set to a miner who receives a share of the ore taken out.', '', '',