(7197, 'calcium', 'The chemical element (Symbol Ca), with an atomic number 20. It is a soft, silvery-white alkaline earth metal which occurs naturally as carbonate in limestone and as silicate in many rocks.,An atom of this element.', '', '', 'noun', '[{\"text\":\"calciums\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
