(7199, 'harvest', 'To bring in a harvest; reap; glean.,To kill for meat, slaughter.,To be occupied bringing in a harvest,To win, achieve a gain.', '', '', 'verb', '[{\"text\":\"harvests\",\"type\":\"present singular third-person\"},{\"text\":\"harvesting\",\"type\":\"participle present\"},{\"text\":\"harvested\",\"type\":\"participle past\"},{\"text\":\"harvested\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
