(7305, 'warrant', 'Authorization or certification; a sanction, as given by a superior.,Something that provides assurance or confirmation; a guarantee or proof.,An order that serves as authorization; especially a voucher authorizing payment or receipt of money.,An option, usually issued together with another security and with a term at issue greater than a year, to buy other securities of the issuer.,A judicial writ authorizing an officer to make a search, seizure, or arrest, or to execute a judgment.,Short for warrant officer.,A certificate of appointment given to a warrant officer.,A document certifying that a motor vehicle meets certain standards of mechanical soundness and safety; a warrant of fitness.,A defender, a protector.,Underclay in a coal mine.', 'warren earth', '', 'noun', '[{\"text\":\"warrants\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7306, 'warrant', 'To protect, keep safe (from danger).,To give (someone) an assurance or guarantee (of something); also, with a double object: to guarantee (someone something).,To guarantee (something) to be (of a specified quality, value, etc.).,To guarantee as being true; (colloquial) to believe strongly.,To authorize; to give (someone) sanction or warrant (to do something).,To justify; to give grounds for.', '', '', 'verb', '[{\"text\":\"warrants\",\"type\":\"present singular third-person\"},{\"text\":\"warranting\",\"type\":\"participle present\"},{\"text\":\"warranted\",\"type\":\"participle past\"},{\"text\":\"warranted\",\"type\":\"past\"},{\"text\":\"en-conj-simple\",\"type\":\"inflection-template\"},{\"text\":\"warrant\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
