(7315, 'rally', 'A public gathering or mass meeting that is not mainly a protest and is organized to inspire enthusiasm for a cause.,A protest or demonstration for or against something, but often with speeches and often without marching, especially in North America.,A sequence of strokes between serving and scoring a point.,An event in which competitors drive through a series of timed special stages at intervals. The winner is the driver who completes all stages with the shortest cumulative time.,A recovery after a decline in prices (said of the market, stocks, etc.)', '', '', 'noun', '[{\"text\":\"rallies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
