(7320, 'strain', 'To hold tightly, to clasp.,To apply a force or forces to by stretching out.,To damage by drawing, stretching, or the exertion of force.,To act upon, in any way, so as to cause change of form or volume, as when bending a beam.,To exert or struggle (to do something), especially to stretch (one\'s senses, faculties etc.) beyond what is normal or comfortable.,To stretch beyond its proper limit; to do violence to, in terms of intent or meaning.,To separate solid from liquid by passing through a strainer or colander,To percolate; to be filtered.,To make uneasy or unnatural; to produce with apparent effort; to force; to constrain.,To urge with importunity; to press.,hug somebody; to hold somebody tightly.', '', '', 'verb', '[{\"text\":\"strains\",\"type\":\"present singular third-person\"},{\"text\":\"straining\",\"type\":\"participle present\"},{\"text\":\"strained\",\"type\":\"participle past\"},{\"text\":\"strained\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
