(7441, 'preserve', 'To protect; to keep from harm or injury.,To save from decay by the use of some preservative substance, such as sugar or salt; to season and prepare (fruits, meat, etc.) for storage.,To maintain throughout; to keep intact.', '', '', 'verb', '[{\"text\":\"preserves\",\"type\":\"present singular third-person\"},{\"text\":\"preserving\",\"type\":\"participle present\"},{\"text\":\"preserved\",\"type\":\"participle past\"},{\"text\":\"preserved\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7442, 'easter', 'A Christian feast commemorating the resurrection of Jesus Christ, celebrated on the first Sunday (and Monday) following the full moon that occurs on or next after the vernal equinox, ranging in most of Western Christianity (such as Protestantism and Roman Catholicism) from March 22 to April 25, and in Eastern Christianity (such as the Coptic Church and Eastern Orthodox Church) from April 4 to May 8.,Eastertide (“the period from Easter to Whitsun”).,Usually preceded by an inflection of make: the act of receiving the Eucharist during Easter.,Ellipsis of Easter term.,A festival held in honour of the goddess Eostre or Ostara, celebrated at the vernal equinox or within the month of April; Eostre, Ostara.,The Jewish Passover.', '', '', 'noun', '[{\"text\":\"Easters\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7443, 'easter', 'To celebrate Easter.,To spend the Easter season in some place.', '', '', 'verb', '[{\"text\":\"Easters\",\"type\":\"present singular third-person\"},{\"text\":\"Eastering\",\"type\":\"participle present\"},{\"text\":\"Eastered\",\"type\":\"participle past\"},{\"text\":\"Eastered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
