(7451, 'paste', 'One of flour, fat, or similar ingredients used in making pastry.,Pastry.,One of pounded foods, such as fish paste, liver paste, or tomato paste.,One used as an adhesive, especially for putting up wallpapers, etc.,A substance that behaves as a solid until a sufficiently large load or stress is applied, at which point it flows like a fluid,A hard lead-containing glass, or an artificial gemstone made from this glass.,Pasta.,The mineral substance in which other minerals are embedded.', '', '', 'noun', '[{\"text\":\"pastes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
