(7454, 'veteran', 'A person with long experience of a particular activity.,A group, animal, etc. with long experience of a particular activity.,A person who has served in the armed forces, especially an old soldier who has seen long service; also called a war veteran to distinguish from veterans who weren\'t in armed conflict.', 'old hand,warhorse', '', 'noun', '[{\"text\":\"veterans\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
