(7462, 'integral', 'Constituting a whole together with other parts or factors; not omittable or removable,Of, pertaining to, or being an integer.,Relating to integration.,Whole; undamaged.', 'immanent,inherent,necessary,intrinsic', '', 'adj', '[{\"text\":\"more integral\",\"type\":\"comparative\"},{\"text\":\"most integral\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7463, 'integral', 'One of the two fundamental operations of calculus (the other being differentiation), whereby a function\'s displacement, area, volume, or other qualities arising from the study of infinitesimal change are quantified, usually defined as a limiting process on a sequence of partial sums. Denoted using a long s: ∫, or a variant thereof.,Any of several analytic formalizations of this operation: the Riemann integral, the Lebesgue integral, etc.,A definite integral: the result of the application of such an operation onto a function and a suitable subset of the function\'s domain: either a number or positive or negative infinity. In the former case, the integral is said to be finite or to converge; in the latter, the integral is said to diverge. In notation, the domain of integration is indicated either below the sign, or, if it is an interval, with its endpoints as sub- and super-scripts, and the function being integrated forming part of the integrand (or, generally, differential form) appearing in front of the integral sign.,An indefinite integral: the result of the application of such an operation onto a function together with an indefinite domain, yielding a function; a function\'s antiderivative;,The fluent of a given fluxion in Newtonian calculus.', 'antiderivative,indefinite integral,∫,antiderivative,indefinite integral,∫', 'derivative,derivative', 'noun', '[{\"text\":\"integrals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
