(7467, 'relax', 'To calm down.,To make something loose.,To become loose.,To make something less severe or tense.,To become less severe or tense.,To make something (such as codes and regulations) more lenient.,To become more lenient.,To relieve (something) from stress.,To relieve from constipation; to loosen; to open.', '', '', 'verb', '[{\"text\":\"relaxes\",\"type\":\"present singular third-person\"},{\"text\":\"relaxing\",\"type\":\"participle present\"},{\"text\":\"relaxed\",\"type\":\"participle past\"},{\"text\":\"relaxed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7468, 'synopsis', 'A brief summary of the major points of a written work, either as prose or as a table; an abridgment or condensation of a work.,A reference work containing brief articles that taken together give an overview of an entire field.,A prayer book for use by the laity of the church.', 'abridgment,abstract,conspectus,outline,overview,summary', '', 'noun', '[{\"text\":\"synopses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
