(7487, 'coral', 'Any of many species of marine invertebrates in the class Anthozoa, most of which build hard calcium carbonate skeletons and form colonies, or a colony belonging to one of those species.,A hard substance made of the skeletons of these organisms.,A somewhat yellowish orange-pink colour; the colour of red coral (Corallium rubrum) of the Mediterranean Sea, commonly used as an ornament or gem.,The ovaries of a cooked lobster; so called from their colour.,A piece of coral, usually fitted with small bells and other appurtenances, used by children as a plaything.', '', '', 'noun', '[{\"text\":\"corals\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
