(7496, 'float', 'To be supported by a fluid of greater density (than the object).,To be supported by a liquid of greater density, such that part (of the object or substance) remains above the surface.,To cause something to be suspended in a liquid of greater density.,To be capable of floating.,To move in a particular direction with the liquid in which one is floating.,To drift or wander aimlessly.,To drift gently through the air.,To move in a fluid manner.,To circulate.,To remain airborne, without touching down, for an excessive length of time during landing, due to excessive airspeed during the landing flare.,(of an idea or scheme) To be viable.,To propose (an idea) for consideration.,To automatically adjust a parameter as related parameters change.,(of currencies) To have an exchange value determined by the markets, as opposed to by central fiat.,To allow (the exchange value of a currency) to be determined by the markets.,To extend a short-term loan to.,To issue or sell shares in a company (or units in a trust) to members of the public, followed by listing on a stock exchange.,To spread plaster over (a surface), using the tool called a float.,To use a float (rasp-like tool) upon.,To transport by float (vehicular trailer).,To perform a float.,To cause (an element within a document) to float above or beside others.', '', '', 'verb', '[{\"text\":\"floats\",\"type\":\"present singular third-person\"},{\"text\":\"floating\",\"type\":\"participle present\"},{\"text\":\"floated\",\"type\":\"participle past\"},{\"text\":\"floated\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7497, 'float', 'A buoyant device used to support something in water or another liquid.,A mass of timber or boards fastened together, and conveyed down a stream by the current; a raft.,A float board.,A tool similar to a rasp, used in various trades.,A sort of trowel used for finishing concrete surfaces or smoothing plaster.,An elaborately decorated trailer or vehicle, intended for display in a parade or pageant.,A floating toy made of foam, used in swimming pools.,A small vehicle used for local deliveries, especially in the term milk float.,Funds committed to be paid but not yet paid.,An offering of shares in a company (or units in a trust) to members of the public, normally followed by a listing on a stock exchange.,The total amount of checks/cheques or other drafts written against a bank account but not yet cleared and charged against the account.,Premiums taken in but not yet paid out.,A floating-point number, especially one that has lower precision than a double.,A soft beverage with a scoop of ice-cream floating in it.,A small sum of money put in a cashier\'s till, or otherwise secured, at the start of business, to enable change to be made.,A maneuver where a player calls on the flop or turn with a weak hand, with the intention of bluffing after a subsequent community card.,One of the loose ends of yarn on an unfinished work.,A car carrier or car transporter truck or truck-and-trailer combination.,A lowboy trailer.,The act of flowing; flux; flow.,A polishing block used in marble working; a runner.,A coal cart.,A breakdancing move in which the body is held parallel to the floor while balancing on one or both hands.,A visual style on a web page that causes the styled elements to float above or beside others.,The gas-filled sac, bag, or body of a siphonophore; a pneumatophore.,Any object (element) whose location in composition (page makeup, pagination) does not flow within body text but rather floats outside of it, usually anchored loosely (in buoy metaphor) to spots within it (citations, callouts): a figure (image), table, box, pull quote, ornament, or other floated element.', 'initial public offering', '', 'noun', '[{\"text\":\"floats\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
