(7592, 'parade', 'Synonym of military parade: A show of troops, an assembly of troops as a show of force, to receive orders, or especially for inspection at set times.,A public procession, especially one commemorating a holiday or special event or (dated) in protest.,Synonym of gaggle: A group of geese when on the move, particularly a line of goslings shepherded by one or more adults.,Synonym of herd: A group of elephants when on the move.,Synonym of parade ground: A place specially designated for such displays or for practicing close-order drills.,Synonym of promenade: A route, street, or square frequented by pedestrians or formerly used for military parades.,Synonym of road, used in place names.,The body of soldiers thus assembled.,The body of promenaders thus assembled.,Synonym of show: any similarly orderly or ostentatious display, especially of a variety of people or a series of things paraded around.,A row of shops beside a street.,Short for programme parade: a description of the programming schedule formerly announced on the radio and various television channels.', 'military parade,gaggle,herd,parade ground,promenade,road,used in place names,show', '', 'noun', '[{\"text\":\"parades\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7593, 'parade', 'To assemble for inspection, to receive orders, etc.,To march impressively or ostentatiously.,To march past.,To march through or along.,Synonym of promenade: to walk up and down, especially in public in order to show off and be seen by others.,To move slowly through or among.,To walk in a row led by one parent, often trailed by the other.,To assemble soldiers for inspection, to receive orders, etc.,Synonym of show off: to display or reveal prominently or ostentatiously, especially in a kind of procession.,To furnish with a parade or parades.', 'promenade,show off', '', 'verb', '[{\"text\":\"parades\",\"type\":\"present singular third-person\"},{\"text\":\"parading\",\"type\":\"participle present\"},{\"text\":\"paraded\",\"type\":\"participle past\"},{\"text\":\"paraded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
