(7595, 'execute', 'To kill, especially as punishment for a capital crime.,Coordinate term: murder,To carry out; to put into effect.,To perform.,To carry out, to perform an act; to put into effect or cause to become legally binding or valid (as a contract) by so doing.,To start, launch or run,To run, usually successfully.', 'start,launch,run,open', '', 'verb', '[{\"text\":\"executes\",\"type\":\"present singular third-person\"},{\"text\":\"executing\",\"type\":\"participle present\"},{\"text\":\"executed\",\"type\":\"participle past\"},{\"text\":\"executed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7596, 'anchor', 'A tool used to moor a vessel to the bottom of a sea or river to resist movement.,An iron device so shaped as to grip the bottom and hold a vessel at her berth by the chain or rope attached. (FM 55-501).,The combined anchoring gear (anchor, rode, bill/peak and fittings such as bitts, cat, and windlass.),Representation of the nautical tool, used as a heraldic charge.,Any instrument serving a purpose like that of a ship\'s anchor, such as an arrangement of timber to hold a dam fast; a device to hold the end of a bridge cable etc.; or a device used in metalworking to hold the core of a mould in place.,A marked point in a document that can be the target of a hyperlink.,An anchorman or anchorwoman.,The final runner in a relay race.,A point that is touched by the draw hand or string when the bow is fully drawn and ready to shoot.,A superstore or other facility that serves as a focus to bring customers into an area.,That which gives stability or security.,A metal tie holding adjoining parts of a building together.,A screw anchor.,Carved work, somewhat resembling an anchor or arrowhead; part of the ornaments of certain mouldings. It is seen in the echinus, or egg-and-anchor (called also egg-and-dart, egg-and-tongue) ornament.,One of the anchor-shaped spicules of certain sponges.,One of the calcareous spinules of certain holothurians, as in species of Synapta.,The thirty-fifth Lenormand card.,An anchorite or anchoress.,The brake of a vehicle.,A defensive player, especially one who counters the opposition\'s best offensive player.,A device for attaching a climber at the top of a climb, such as a chain or ring or a natural feature.', 'anchor tenant', '', 'noun', '[{\"text\":\"anchors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7597, 'anchor', 'To connect an object, especially a ship or a boat, to a fixed point.,To cast anchor; to come to anchor.,To stop; to fix or rest.,To provide emotional stability for a person in distress.,To perform as an anchorman or anchorwoman.,To be stuck; to be unable to move away from a position.', 'affix,fix,drop anchor,cease,support,host,present,bog down,embog,enmire', '', 'verb', '[{\"text\":\"anchors\",\"type\":\"present singular third-person\"},{\"text\":\"anchoring\",\"type\":\"participle present\"},{\"text\":\"anchored\",\"type\":\"participle past\"},{\"text\":\"anchored\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
