(7631, 'stylus', 'A small implement with a pointed end used for engraving and tracing.,A small device resembling a pen used to input handwritten text or drawings directly into an electronic device with a touch-sensitive screen.,An ancient writing implement consisting of a small rod with a pointed end for scratching letters on clay, wax-covered tablets or other surfaces, and a blunt end for obliterating them.,A hard-pointed pen-shaped instrument for marking on stencils used in a mimeograph machine.,A hard point, typically of diamond or sapphire, following a groove in a phonograph and transmitting the recorded sound for reproduction.,A pointed device formerly used to produce a groove in a record when recording sound.,A tool for making small dots on a piece of heavy paper, used to produce Braille writing for the blind by hand.,Synonym of style.', 'needle,needle,style', '', 'noun', '[{\"text\":\"styli\",\"type\":\"plural\"},{\"text\":\"styluses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
