(7646, 'cattle', 'Domesticated bovine animals (cows, bulls, steers etc).,Certain other livestock, such as sheep, pigs or horses.,People who resemble domesticated bovine animals in behavior or destiny.,chattel,Used in restricted contexts to refer to the meat derived from cattle.', 'beef,Bos,bovine,cattlebeast,cattlehead,neat,kine,sheeple', '', 'noun', '[{\"text\":\"cattle\",\"type\":\"singular\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7647, 'flame', 'The visible part of fire; a stream of burning vapour or gas, emitting light and heat.,A romantic partner or lover in a usually short-lived but passionate affair.,An aggressively insulting criticism or remark.,A brilliant reddish orange-gold fiery colour.,flame,The contrasting light and dark figure seen in wood used for stringed instrument making; the curl.,Burning zeal, passion, imagination, excitement, or anger.', 'lover', '', 'noun', '[{\"text\":\"flames\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
