(7816, 'drill', 'To create (a hole) by removing material with a drill (tool).,To practice, especially in (or as in) a military context.,To cause to drill (practice); to train in military arts.,To repeat an idea frequently in order to encourage someone to remember it.,To investigate or examine something in more detail or at a different level,To hit or kick with a lot of power.,To hit someone with a pitch, especially in an intentional context.,To have sexual intercourse with; to penetrate.,To shoot; to kill.', 'excavate,bore,gouge,make a hole,plow,poke,root,shaft,copulate with,drill up', '', 'verb', '[{\"text\":\"drills\",\"type\":\"present singular third-person\"},{\"text\":\"drilling\",\"type\":\"participle present\"},{\"text\":\"drilled\",\"type\":\"participle past\"},{\"text\":\"drilled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
