(8123, 'gather', 'Especially, to harvest food.,To accumulate over time, to amass little by little.,To congregate, or assemble.,To grow gradually larger by accretion.,To collect; normally separate things.,To add pleats or folds to a piece of cloth, normally to reduce its width.,To bring stitches closer together.,To bring together, or nearer together, in masonry, as for example where the width of a fireplace is rapidly diminished to the width of the flue.,To haul in; to take up.,To bring parts of a whole closer.,To infer or conclude; to know from a different source.,To be filled with pus,To collect molten glass on the end of a tool.,To gain; to win.', 'accrue,add up,accumulate,begather,assemble,assemble', '', 'verb', '[{\"text\":\"gathers\",\"type\":\"present singular third-person\"},{\"text\":\"gathering\",\"type\":\"participle present\"},{\"text\":\"gathered\",\"type\":\"participle past\"},{\"text\":\"gathered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8124, 'gather', 'A plait or fold in cloth, made by drawing a thread through it; a pucker.,The inclination forward of the axle journals to keep the wheels from working outward.,The soffit or under surface of the masonry required in gathering. See gather (transitive verb).,A blob of molten glass collected on the end of a blowpipe.,A gathering.', '', '', 'noun', '[{\"text\":\"gathers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8125, 'chick', 'A young bird.,A young chicken.,A young child.,A young, typically attractive, woman or teenage girl.,A friendly fighter aircraft.', 'fledgling,girl,woman', '', 'noun', '[{\"text\":\"chicks\",\"type\":\"plural\"},{\"text\":\"chicken\",\"type\":\"obsolete plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
