(8152, 'slight', 'gentle or weak, not aggressive or powerful,not thorough; superficial,trifling; unimportant; insignificant,not far away in space or time,of slender build,Even, smooth or level,still; with little or no movement on the surface,Foolish; silly; not intellectual.,Bad, of poor quality.,Slighting; treating with disdain.', 'ignorable,meaningless,negligible,tiny,tiny,insignificant,ignorable,meaningless,negligible,tiny,tiny,insignificant,ignorable,meaningless,negligible,tiny,tiny,insignificant,ignorable,meaningless,negligible,tiny,tiny,insignificant,lithe,svelte,willowy,slender,flat,glassy,slick,smooth,daft,fatuous,soft in the head,foolish,flimsy,lousy,shoddy,low-quality,contemptuous,disdainful,scornful,disdainful', '', 'adj', '[{\"text\":\"slighter\",\"type\":\"comparative\"},{\"text\":\"slightest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
