(8191, 'succeed', 'To follow something in sequence or time.,To replace or supplant someone in order vis-à-vis an office, position, or title.,To come after or follow; to be subsequent or consequent; (often with to).,To come in the place of another person, thing, or event; to come next in the usual, natural, or prescribed course of things; to follow; hence, to come next in the possession of anything; (often with to).,To ascend the throne after the removal or death of the occupant.,To prevail in obtaining an intended objective or accomplishment; to prosper as a result or conclusion of a particular effort.,To prosper or attain success and beneficial results in general.,To turn out, fare, do (well or ill).,To support; to prosper; to promote or give success to.,To descend, as an estate or an heirloom, in the same family; to devolve; (often with to).,To fall heir to; to inherit.,To go down or near (with to).', 'take the place of,come after,come after,ensue,follow,follow on,do well', '', 'verb', '[{\"text\":\"succeeds\",\"type\":\"present singular third-person\"},{\"text\":\"succeeding\",\"type\":\"participle present\"},{\"text\":\"succeeded\",\"type\":\"participle past\"},{\"text\":\"succeeded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
