(8194, 'observe', 'To notice or view, especially carefully or with attention to detail.,To follow or obey the custom, practice, or rules (especially of a religion).,To take note of and celebrate (a holiday or similar occurrence); to follow (a type of time or calendar reckoning).,To comment on something; to make an observation.', 'celebrate', '', 'verb', '[{\"text\":\"observes\",\"type\":\"present singular third-person\"},{\"text\":\"observing\",\"type\":\"participle present\"},{\"text\":\"observed\",\"type\":\"participle past\"},{\"text\":\"observed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
