(8250, 'seafood', 'A colloquial term for fish, shellfish, seaweed, and other edible aquatic life.,A nutritional term and culinary term for finned fish and shellfish used as food. In some cultures cartilaginous fish may be included. Contextually, other aquatic animals like tetrapods and aquatic plants like seaweed are excluded from the definition. In the nutritional context, culinary context and in some regional vernacular the term “seafood” is ordinarily differentiated from “meat”, which is defined as a separate category of food.,A general term and regional vernacular for edible marine fish and shellfish. In this context “seafood” is sometimes not deemed as its own food category; rather its considered to be a specific subcategory of meat when the broader definitions of “meat” are being used.', '', '', 'noun', '[{\"text\":\"seafoods\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
