(8264, 'bullet', 'A projectile, usually of metal, shot from a gun at high speed.,An entire round of unfired ammunition for a firearm, including the projectile, the cartridge casing, the propellant charge, etc.,Ammunition for a sling or slingshot which has been manufactured for such use.,A printed symbol in the form of a solid circle, “•”, often used to mark items in a list.,A large scheduled repayment of the principal of a loan; a balloon payment.,A rejection letter, as for employment, admission to a school or a competition.,One year of prison time.,An ace (the playing card).,Anything that is projected extremely fast.,Very fast (speedy).,chess played at an extremely fast time control, with one minute given to each player. (Short for bullet chess.),A plumb or sinker.,The heavy projectile thrown in a game of road bowling.,A roughly bullet-shaped sweet consisting of a cylinder of liquorice covered in chocolate.,A small ball.,A cannonball.,The fetlock of a horse.,A notation used on pop music charts to indicate that a song is climbing in the rankings.', 'cap,pill,slug,bullet point', '', 'noun', '[{\"text\":\"bullets\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
