(8267, 'scratch', 'To rub a surface with a sharp object, especially by a living creature to remove itching with nails, claws, etc.,To rub the skin with rough material causing a sensation of irritation; to cause itching.,To irritate someone\'s skin with one\'s unshaven beard when kissing.,To mark a surface with a sharp object, thereby leaving a scratch (noun).,to get such scratches,To cross out, strike out, strike through some text on a page.,Hence, to remove, ignore, or delete.,To produce a distinctive sound on a turntable by moving a vinyl record back and forth while manipulating the crossfader (see also scratching).,To commit a foul in pool, as where the cue ball is put into a pocket or jumps off the table.,To score, not by skillful play but by some fortunate chance of the game.,To write or draw hastily or awkwardly; scrawl.,To dig or excavate with the claws.,To dig or scrape (a person\'s skin) with claws or fingernails in self-defense or with the intention to injure.,To announce one\'s non-participation in a race or sports event part of a larger sports meeting that they were previously signed up for, usually in lieu of another event at the same meeting.', '', '', 'verb', '[{\"text\":\"scratches\",\"type\":\"present singular third-person\"},{\"text\":\"scratching\",\"type\":\"participle present\"},{\"text\":\"scratched\",\"type\":\"participle past\"},{\"text\":\"scratched\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8268, 'scratch', 'A disruption, mark or shallow cut on a surface made by scratching.,An act of scratching the skin to alleviate an itch or irritation.,A starting line (originally and simply, a line scratched in the ground), as in boxing.,A technical error of touching or surpassing the starting mark prior to the official start signal in the sporting events of long jump, discus, hammer throw, shot put, and similar. Originally the starting mark was a scratch on the ground but is now a board or precisely indicated mark.,The last riders to depart in a handicap race.,A foul in pool, as where the cue ball is put into a pocket or jumps off the table.,A shot which scores by chance and not as intended by the player; a fluke.,A horse withdrawn from a race prior to the start.,An injury.,Money.,A feed, usually a mixture of a few common grains, given to chickens.,Minute, but tender and troublesome, excoriations, covered with scabs, upon the heels of horses which have been used where it is very wet or muddy.,A scratch wig.,A genre of Virgin Islander music, better known as fungi.,Scrawled or illegible handwriting; chicken scratch.', 'fungi,quelbe', '', 'noun', '[{\"text\":\"scratches\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8269, 'scratch', 'For or consisting of preliminary or tentative, incomplete, etc. work.,Hastily assembled, arranged or constructed, from whatever materials are to hand, with little or no preparation,Relating to a scratchpad, a data structure or recording medium attached to a machine for testing or temporary use.,(of a player) Of a standard high enough to play without a handicap, i.e. to compete without the benefit of a variation in scoring based on ability.', '', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
