(8296, 'queue', 'A line of people, vehicles or other objects, in which one at the front end is dealt with first, the one behind is dealt with next, and so on, and which newcomers join at the opposite end (the back).,A waiting list or other means of organizing people or objects into a first-come-first-served order.,A data structure in which objects are added to one end, called the tail, and removed from the other, called the head (in the case of a FIFO queue). The term can also refer to a LIFO queue or stack where these ends coincide.,An animal\'s tail.,A men\'s hairstyle with a braid or ponytail at the back of the head, such as that worn by men in Imperial China.', 'line,lineup,line', '', 'noun', '[{\"text\":\"queues\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8297, 'queue', 'To put oneself or itself at the end of a waiting line.,To arrange themselves into a physical waiting queue.,To add to a queue data structure.,To fasten the hair into a queue.', 'join a queue,join the queue,line up', '', 'verb', '[{\"text\":\"queues\",\"type\":\"present singular third-person\"},{\"text\":\"queueing\",\"type\":\"participle present\"},{\"text\":\"queuing\",\"type\":\"participle present\"},{\"text\":\"queued\",\"type\":\"participle past\"},{\"text\":\"queued\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8298, 'trance', 'A dazed or unconscious condition.,A state of awareness, concentration, or focus that filters experience and information (for example, a state of meditation or possession by some being).,A state of low response to stimulus and diminished, narrow attention; particularly one induced by hypnosis.,Short for trance music (“genre of electronic dance music”).', '', '', 'noun', '[{\"text\":\"trances\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8299, 'trance', 'To (cause to) be in a trance; to entrance.,To create in or via a trance.', '', '', 'verb', '[{\"text\":\"trances\",\"type\":\"present singular third-person\"},{\"text\":\"trancing\",\"type\":\"participle present\"},{\"text\":\"tranced\",\"type\":\"participle past\"},{\"text\":\"tranced\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8300, 'trance', 'To walk heavily or with some difficulty; to tramp, to trudge.,To pass across or over; to traverse.,To travel quickly over a long distance.', 'trounce,trounce,trounce', '', 'verb', '[{\"text\":\"trances\",\"type\":\"present singular third-person\"},{\"text\":\"trancing\",\"type\":\"participle present\"},{\"text\":\"tranced\",\"type\":\"participle past\"},{\"text\":\"tranced\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
