INSERT INTO `vocabulary` (`id`, `word`, `meaning`, `similar_word`, `opposite_word`, `part_of_speech`, `forms`, `status`, `sequence`, `created_user_id`, `updated_user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(8304, 'locale', 'The place where something happens.,The set of settings related to the language and region in which a computer program executes. Examples are language, currency and time formats, character encoding etc.,A partially ordered set with the following additional axiomatic properties: any finite subset of it has a meet, any arbitrary subset of it has a join, and distributivity, which states that a binary meet distributes with respect to an arbitrary join. (Note: locales are just like frames except that the category of locales is opposite to the category of frames.)', '', '', 'noun', '[{\"text\":\"locales\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8305, 'invasion', 'A military action consisting of armed forces of one geopolitical entity entering territory controlled by another such entity, generally with the objective of conquering territory or altering the established government.,The entry without consent of an individual or group into an area where they are not wanted.,The spread of cancer cells, bacteries and such to the organism.,The breaching of the skin barrier.', '', '', 'noun', '[{\"text\":\"invasions\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8306, 'bundle', 'A group of objects held together by wrapping or tying.,A package wrapped or tied up for carrying.,A group of products or services sold together as a unit.,A large amount, especially of money.,A cluster of closely bound muscle or nerve fibres.,A sequence of two or more words that occur in language with high frequency but are not idiomatic; a chunk, cluster, or lexical bundle.,A directory containing related resources such as source code; application bundle.,A quantity of paper equal to two reams (1000 sheets).,A court bundle, the assemblage of documentation prepared for, and referred to during, a court case.,Topological space composed of a base space and fibers projected to the base space.', 'mint,pile,small fortune', '', 'noun', '[{\"text\":\"bundles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8307, 'bundle', 'To tie or wrap together into a bundle.,To hustle; to dispatch something or someone quickly.,To prepare for departure; to set off in a hurry or without ceremony; used with away, off, out.,To dress someone warmly.,To dress warmly. Usually bundle up,To sell hardware and software as a single product.,To hurry.,Synonym of dogpile: to form a pile of people upon a victim.,To hastily or clumsily push, put, carry or otherwise send something into a particular place.,To sleep on the same bed without undressing.', 'dogpile', '', 'verb', '[{\"text\":\"bundles\",\"type\":\"present singular third-person\"},{\"text\":\"bundling\",\"type\":\"participle present\"},{\"text\":\"bundled\",\"type\":\"participle past\"},{\"text\":\"bundled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8308, 'hammer', 'A tool with a heavy head and a handle used for pounding.,The act of using a hammer to hit something.,A moving part of a firearm that strikes the firing pin to discharge a gun.,The malleus, a small bone of the middle ear.,In a piano or dulcimer, a piece of wood covered in felt that strikes the string.,A device made of a heavy steel ball attached to a length of wire, and used for throwing.,The last stone in an end.,A frisbee throwing style in which the disc is held upside-down with a forehand grip and thrown above the head.,Part of a clock that strikes upon a bell to indicate the hour.,One who, or that which, smites or shatters.,Short for hammer headline.,The accelerator pedal.', '', '', 'noun', '[{\"text\":\"hammers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8309, 'hammer', 'To strike repeatedly with a hammer, some other implement, the fist, etc.,To form or forge with a hammer; to shape by beating.,To emphasize a point repeatedly.,To hit particularly hard.,To ride very fast.,To strike internally, as if hit by a hammer.,To defeat (a person, a team) resoundingly,To make high demands on (a system or service).,To declare (a person) a defaulter on the stock exchange.,To beat down the price of (a stock), or depress (a market).,To have hard sex with.', 'pound', '', 'verb', '[{\"text\":\"hammers\",\"type\":\"present singular third-person\"},{\"text\":\"hammering\",\"type\":\"participle present\"},{\"text\":\"hammered\",\"type\":\"participle past\"},{\"text\":\"hammered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
