(8311, 'priest', 'a religious clergyman (clergywoman, clergyperson) who is trained to perform services or sacrifices at a church or temple,a blunt tool, used for quickly stunning and killing fish,the highest office in the Aaronic priesthood', '', '', 'noun', '[{\"text\":\"priests\",\"type\":\"plural\"},{\"text\":\"priestess\",\"type\":\"feminine\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
