(8316, 'runner', 'A person who moves, on foot, at a fast pace, especially an athlete.,Any entrant, person or animal (especially a horse), for a race or any competition; a candidate for an election.,Somebody who controls or manages (e.g. a system).,A person or vessel who runs blockades or engages in smuggling. (Especially used in combination, e.g. gunrunner).,A player who runs for a batsman who is too injured to run; he is dressed exactly as the injured batsman, and carries a bat.,A baserunner.,A person (from one or the other team) who runs out onto the field during the game to take verbal instructions from the coach to the players. A runner mustn\'t interfere with play, and may have to wear an identifying shirt to make clear his or her purpose on the field.,Anyone sent on an errand or with communications, especially for a bank (or, historically, a foot soldier responsible for carrying messages during war).,A person hired by a gambling establishment to locate potential customers and bring them in.,A quick escape away from a scene.,One who runs away; a deserter or escapee.,A type of soft-soled shoe originally intended for runners.,Part of a shoe that is stitched to the bottom of the upper so it can be glued to the sole.,A part of an apparatus that moves quickly.,A smooth strip on which a sledge runs.,The blade of an ice skate.,The channel or strip on which a drawer is opened and closed.,Part of a mechanism which allows something to be pulled out for maintenance.,The curved base of a rocking chair.,In saddlery, a loop of metal through which a rein is passed.,In molding, a channel cut in a mold.,The rotating-stone of a grinding-mill.,The movable piece to which the ribs of an umbrella are attached.,A tool in which lenses are fastened for polishing.,An automobile; a working or driveable automobile.,A strip of fabric used to decorate or protect a table or dressing table.,A long, narrow carpet for a high traffic area such as a hall or stairs.,A part of a cigarette that is burning unevenly.,A long stolon sent out by a plant (such as strawberry), in order to root new plantlets, or a plant that propagates by using such runners.,A short sling with a carabiner on either end, used to link the climbing rope to a bolt or other protection such as a nut or friend.,A competitor in a poker tournament.,A restaurant employee responsible for taking food from the kitchens to the tables.,A leaping food fish (Elagatis pinnulatis) of Florida and the West Indies; the skipjack, shoemaker, or yellowtail.,An employee of a sports agent who tries to recruit possible player clients for the agent.,A rope to increase the power of a tackle.,A speedrunner.,An idea or plan that has potential to be adopted or put into operation.,A trusty (prisoner granted special privileges).,A running gag', 'lugger,picker-up,roper,steerer,sneaker,trainer,rocker,quick-draw,extender', '', 'noun', '[{\"text\":\"runners\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
