(8353, 'fitting', 'A small part, especially a standardized or detachable part of a device or machine.,A tube connector; a standardized connecting part of a piping system to attach sections of pipe together, such as a coupling,The act of trying on clothes to inspect or adjust the fit.,The process of fitting up; especially of applying craft methods such as skilled filing to the making and assembling of machines or other products.,A removable item in a house or other building, which can be taken with one when one moves out, such as a moveable piece of furniture, a carpet, picture, etc.; US furnishing; compare fixture.,The action or condition of having fits in the sense of seizures or convulsions.', '', '', 'noun', '[{\"text\":\"fittings\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8354, 'surplus', 'That which remains when use or need is satisfied, or when a limit is reached; excess; overplus.,Specifically, an amount in the public treasury at any time greater than is required for the ordinary purposes of the government.,The remainder of a fund appropriated for a particular purpose.,assets left after liabilities and debts, including capital stock have been deducted.', '', '', 'noun', '[{\"text\":\"surpluses\",\"type\":\"plural\"},{\"text\":\"surplusses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
