(8445, 'penny', 'In the United Kingdom and Ireland, a unit of currency worth ¹⁄₂₄₀ of a pound sterling or Irish pound before decimalisation, or a copper coin worth this amount. Abbreviation: d.,In the United Kingdom, a unit of currency worth ¹⁄₁₀₀ of a pound sterling, or a copper coin worth this amount. Abbreviation: p.,In Ireland, a coin worth ¹⁄₁₀₀ of an Irish pound before the introduction of the euro. Abbreviation: p.,In the US and (formerly) Canada, a one-cent coin, worth ¹⁄₁₀₀ of a dollar. Abbreviation: ¢.,In various countries, a small-denomination copper or brass coin.,A unit of nail size, said to be either the cost per 100 nails, or the number of nails per penny. Abbreviation: d.,Money in general.', '1⁄100 of a pound sterling,cent', '', 'noun', '[{\"text\":\"pennies\",\"type\":\"plural\"},{\"text\":\"pence\",\"type\":\"plural\"},{\"text\":\"pens\",\"type\":\"obsolete plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8446, 'penny', 'To jam a door shut by inserting pennies between the doorframe and the door.,To circumvent the tripping of an electrical circuit breaker by the dangerous practice of inserting a coin in place of a fuse in a fuse socket.,During a meal or as part of a drinking game, to drop a penny in a person\'s drink such that they must finish it (or some such variation thereof); commonly associated with crewdates at Oxford and swaps at Cambridge.', '', '', 'verb', '[{\"text\":\"pennies\",\"type\":\"present singular third-person\"},{\"text\":\"pennying\",\"type\":\"participle present\"},{\"text\":\"pennied\",\"type\":\"participle past\"},{\"text\":\"pennied\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8447, 'remix', 'A rearrangement of an older piece of music, possibly including various cosmetic changes.,A piece of music formed by combining existing pieces of music together, possibly including various other cosmetic changes', '', '', 'noun', '[{\"text\":\"remixes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
