(8461, 'overhead', 'The expense of a business not directly assigned to goods or services provided.,The items or classes of expense not directly assigned to goods or services provided.,Any cost or expenditure (monetary, time, effort or otherwise) incurred in a project or activity, which does not directly contribute to its progress or outcome.,Wasted money.,A smash.,The ceiling of any enclosed space below decks in a vessel.,A compartment above the seats for stowing luggage in a passenger aircraft.,The system of overhead wires used to power electric transport, such as streetcars, trains, or buses.,Data or steps of computation used only to facilitate the computations in the system and not directly related to the actual program code or data being processed.,An overhead throw.', '', '', 'noun', '[{\"text\":\"overheads\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
