(8481, 'trash', 'Useless physical things to be discarded; rubbish; refuse.,A container into which things are discarded.,Something worthless or of poor quality.,A dubious assertion, either for appearing untrue or for being excessively boastful.,The disused stems, leaves, or vines of a crop, as well as any weeds mixed therewith, which will either be plowed in as green manure or be removed by raking, grazing, or burning.,Loose-leaf tobacco of a low grade, with much less commercial value than the principal grades.,(slang, derogatory) People of low social status or class. (See, for example, white trash or Eurotrash.),(fandom slang, humorous, uncountable) A fan who is excessively obsessed with their fandom and its fanworks.,Temporary storage on disk for files that the user has deleted, allowing them to be recovered if necessary.', 'refuse,cultch,crap,debris [⇒ thesaurus],dreck,drek,garbage,junk [⇒ thesaurus],litter,pelf,rubbish,refuse,roughage,service item,shit,stuff,waste,trashcan,trash can,trashbin,trash bin,garbage can,rubbish bin,bin,trash can,garbage,rubbish,scrap,recycle bin,recycle bin', '', 'noun', '[{\"text\":\"trashes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
