(8528, 'assign', 'To designate or set apart (something) for some purpose.,To appoint or select (someone) for some office.,To allot or give (something) as a task.,To attribute or sort (something) into categories.,To categorize (someone) as belonging to the male or female sex.,To transfer (property, a legal right, etc.) from one person to another.,To give (a value) to a variable.', 'allocate,consign', '', 'verb', '[{\"text\":\"assigns\",\"type\":\"present singular third-person\"},{\"text\":\"assigning\",\"type\":\"participle present\"},{\"text\":\"assigned\",\"type\":\"participle past\"},{\"text\":\"assigned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
