(8530, 'shade', 'Darkness where light, particularly sunlight, is blocked.,Something that blocks light, particularly in a window.,A variety of a colour/color, in particular one obtained by adding black (compare tint).,A subtle variation in a concept.,An aspect that is reminiscent of something.,A very small degree of a quantity, or variety of meaning,A ghost or specter; a spirit.,A postage stamp showing an obvious difference in colour/color to the original printing and needing a separate catalogue/catalog entry.,Subtle insults.,A cover around or above a light bulb, a lampshade.,A candle-shade.', '', '', 'noun', '[{\"text\":\"shades\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8531, 'shade', 'To shield (someone or something) from light.,To shield oneself from light.,To alter slightly.,To vary or approach something slightly, particularly in color.,To move slightly from one\'s normal fielding position.,To darken, particularly in drawing.,To surpass by a narrow margin.,To reduce (a window) so that only its title bar is visible.,To throw shade, to subtly insult someone.,To shelter; to cover from injury; to protect; to screen.,To present a shadow or image of; to shadow forth; to represent.', '', 'unshade', 'verb', '[{\"text\":\"shades\",\"type\":\"present singular third-person\"},{\"text\":\"shading\",\"type\":\"participle present\"},{\"text\":\"shaded\",\"type\":\"participle past\"},{\"text\":\"shaded\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8532, 'rhythm', 'The variation of strong and weak elements (such as duration, accent) of sounds, notably in speech or music, over time; a beat or meter.,A specifically defined pattern of such variation.,A flow, repetition or regularity.,The tempo or speed of a beat, song or repetitive event.,The musical instruments which provide rhythm (mainly; not or less melody) in a musical ensemble.,A regular quantitative change in a variable (notably natural) process.,Controlled repetition of a phrase, incident or other element as a stylistic figure in literature and other narrative arts; the effect it creates.,A person\'s natural feeling for rhythm.', 'rhythm section', '', 'noun', '[{\"text\":\"rhythms\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8533, 'symphony', 'An extended piece of music of sophisticated structure, usually for orchestra.,An instrumental introduction or termination to a vocal composition.,Harmony in music or colour, or a harmonious combination of elements.,A symphony orchestra.', '', '', 'noun', '[{\"text\":\"symphonies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
