(8565, 'chambers', 'A set of rooms in a building used as an office or a residential apartment.,Chiefly in in chambers: a judge\'s private office which is used for hearings that do not need to be held in open court.,Originally, a set of rooms at an Inn of Court used by one or more barristers as an office and residence; now, the office of one or more barristers in any building.,Euphemistic form of chamber pot (“a container used for defecation and urination”); also, synonym of potty (“a small (chiefly plastic) pot used by children for defecation and urination when toilet-training”).,In full king\'s chambers: parts of the sea next to the coast of England and Wales delimited by imaginary lines connecting headlands, over which the Crown asserted exclusive jurisdiction; these have now been superseded by the concept of the territorial sea.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
