(8993, 'cheque', 'A draft directing a bank to pay money to a named person or entity.,Sometimes abbreviations are used (which would be explained on the statement) and only the last three figures of the cheque number may be given. ‘Sundries’ are cash or cheques paid into the account.,You can avoid dealing with paper cheques — written or printed — by paying your bills online.,The daily cheque clearings began around 1770 when bank clerks met at the Five Bells (a tavern in Lombard Street in the City of London) to exchange all their cheques in one place and settle the balances in cash.', '', '', 'noun', '[{\"text\":\"cheques\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
