(9034, 'settle', 'To determine (something which was exposed to doubt or question); to resolve conclusively; to set or fix (a time, an order of succession, etc).,To conclude, to cause (a dispute) to finish.,To conclude, to cause (a dispute) to finish.,To close, liquidate or balance (an account) by payment, sometimes of less than is owed or due.,To pay (a bill).,To adjust differences or accounts; to come to an agreement on matters in dispute.,To conclude a lawsuit by agreement of the parties rather than a decision of a court.,To put into (proper) place; to make sit or lie properly.,To cause to no longer be in a disturbed, confused or stormy; to quiet; to calm (nerves, waters, a boisterous or rebellious child, etc).,To silence, especially by force.,To kill.,To bring or restore (ground, roads, etc) to a smooth, dry, or passable condition.,To place or arrange in(to) a desired (especially: calm) state, or make final disposition of (something).,To become calm, quiet, or orderly; to stop being agitated.,To become firm, dry, and hard, like the ground after the effects of rain or frost have disappeared.,To place in(to) a fixed or permanent condition or position or on(to) a permanent basis; to make firm, steady, or stable; to establish or fix.,In particular, to establish in life; to fix in business, in a home, etc.,In particular, to establish in life; to fix in business, in a home, etc.,To formally, legally secure (an annuity, property, title, etc) on (a person).,To become married, or a householder.,To be established in a profession or in employment.,To become stationary or fixed; to come to rest.,To fix one\'s residence in a place; to establish a dwelling place, home, or colony. (Compare settle down.),To colonize (an area); to migrate to (a land, territory, site, etc).,To move (people) to (a land or territory), so as to colonize it; to cause (people) to take residence in (a place).,To clear or purify (a liquid) of dregs and impurities by causing them to sink.,To cause to sink down or to be deposited (dregs, sediment, etc).,To render compact or solid; to cause to become packed down.,To sink to the bottom of a body of liquid, as dregs of a liquid, or the sediment of a reservoir.,To sink gradually to a lower level; to subside, for example the foundation of a house, etc.,To become compact due to sinking.,To become clear due to the sinking of sediment. (Used especially of liquid. also used figuratively.),To make a jointure for a spouse.,Of an animal: to make or become pregnant.', '', '', 'verb', '[{\"text\":\"settles\",\"type\":\"present singular third-person\"},{\"text\":\"settling\",\"type\":\"participle present\"},{\"text\":\"settled\",\"type\":\"participle past\"},{\"text\":\"settled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
