(9573, 'climb', 'To ascend; rise; to go up.,To mount; to move upwards on.,To scale; to get to the top of something.,To move (especially up and down something) by gripping with the hands and using the feet.,to practise the sport of climbing,to jump high,To move to a higher position on the social ladder.,Of plants, to grow upwards by clinging to something.', '', '', 'verb', '[{\"text\":\"climbs\",\"type\":\"present singular third-person\"},{\"text\":\"climbing\",\"type\":\"participle present\"},{\"text\":\"climbed\",\"type\":\"past\"},{\"text\":\"clomb\",\"type\":\"archaic past\"},{\"text\":\"climbed\",\"type\":\"participle past\"},{\"text\":\"clumb\",\"type\":\"archaic participle past\"},{\"text\":\"en-conj\",\"type\":\"inflection-template\"},{\"text\":\"climb\",\"type\":\"infinitive\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
