(9586, 'token', 'Something serving as an expression of something else.,A keepsake.,A piece of stamped metal or plastic, etc., used as a substitute for money; a voucher that can be exchanged for goods or services.,A small physical object, often designed to give the appearance of a common thing, used to represent a person or character in a board game or other situation.,A minor attempt for appearance\'s sake, or to minimally comply with a requirement.,A member of a group of people that is included within a larger group to comply with a legal or social requirement.,Evidence, proof; a confirming detail; physical trace, mark, footprint.,Support for a belief; grounds for an opinion.,An extraordinary event serving as evidence of supernatural power.,An object or disclosure to attest or authenticate the bearer or an instruction.,A seal guaranteeing the quality of an item.,Something given or shown as a symbol or guarantee of authority or right; a sign of authenticity, of power, good faith.,A tally.,A particular thing to which a concept applies.,An atomic piece of data, such as a word, for which a meaning may be inferred during parsing.,A conceptual object that can be possessed by a computer, process, etc. in order to regulate a turn-taking system such as a token ring network.,A meaningless placeholder used as a substitute for sensitive data.,A lexeme; a basic, grammatically indivisible unit of a language such as a keyword, operator or identifier.,A single example of a certain word in a text or corpus.,A characteristic sign of a disease or of a bodily disorder, a symptom; a sign of a bodily condition, recovery, or health.,A livid spot upon the body, indicating, or supposed to indicate, the approach of death.,Ten and a half quires, or, commonly, 250 sheets, of paper printed on both sides; also, in some cases, the same number of sheets printed on one side, or half the number printed on both sides.,A bit of leather having a peculiar mark designating a particular miner. Each hewer