(9587, 'token', 'Done as an indication or a pledge.,Perfunctory or merely symbolic; done or existing for appearance\'s sake, or to minimally comply with a requirement.,Included in minimal numbers in order to create an impression or illusion of diversity, especially ethnic or gender diversity.,He was hired as the company\'s token black person.', '', '', 'adj', '[{\"text\":\"more token\",\"type\":\"comparative\"},{\"text\":\"most token\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
