(9638, 'flush', 'Smooth, even, aligned; not sticking out.,Wealthy or well off.,Short for flush left and right: a body of text aligned with both its left and right margins.,Full of vigour; fresh; glowing; bright.,Affluent; abounding; well furnished or suppled; hence, liberal; prodigal.', 'forced,forced justified,force justified,justified', '', 'adj', '[{\"text\":\"flusher\",\"type\":\"comparative\"},{\"text\":\"flushest\",\"type\":\"superlative\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
