(9640, 'flush', 'A sudden flowing; a rush which fills or overflows, as of water for cleansing purposes.,Particularly, such a cleansing of a toilet.,The process of clearing the contents of a buffer or cache.,A suffusion of the face with blood, as from fear, shame, modesty, or intensity of feeling of any kind; a blush; a glow.,Any tinge of red colour like that produced on the cheeks by a sudden rush of blood.,A sudden flood or rush of feeling; a thrill of excitement, animation, etc.', '', '', 'noun', '[{\"text\":\"flushes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9641, 'flush', 'To cleanse by flooding with generous quantities of a fluid.,Particularly, to cleanse a toilet by introducing a large amount of water.,To become suffused with reddish color due to embarrassment, excitement, overheating, or other systemic disturbance, to blush.,To cause to blush.,To cause to be full; to flood; to overflow; to overwhelm with water.,To excite, inflame.,To be cleansed by being flooded with generous quantities of water.,To clear (a buffer or cache) of its contents.,To write (the data) to primary storage, clearing it from the buffer or cache.,To flow and spread suddenly; to rush.,To show red; to shine suddenly; to glow.,To fill in (joints); to point the level; to make them flush.,To operate a placer mine, where the continuous supply of water is insufficient, by holding back the water, and releasing it periodically in a flood.,To fill underground spaces, especially in coal mines, with material carried by water, which, after drainage, constitutes a compact mass.,To dispose or be disposed of by flushing down a toilet', 'blush', '', 'verb', '[{\"text\":\"flushes\",\"type\":\"present singular third-person\"},{\"text\":\"flushing\",\"type\":\"participle present\"},{\"text\":\"flushed\",\"type\":\"participle past\"},{\"text\":\"flushed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
