(9748, 'pencil', 'A paintbrush.,A writing utensil with a graphite (commonly referred to as lead) shaft, usually blended with clay, clad in wood, and sharpened to a taper.,An aggregate or collection of rays of light, especially when diverging from, or converging to, a point.,A family of geometric objects with a common property, such as the set of lines that pass through a given point in a projective plane.,A small medicated bougie.,Ellipsis of power of the pencil.', '', '', 'noun', '[{\"text\":\"pencils\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9749, 'pencil', 'To write (something) using a pencil.,To mark with, or as if with, a pencil.', '', '', 'verb', '[{\"text\":\"pencils\",\"type\":\"present singular third-person\"},{\"text\":\"pencilling\",\"type\":\"UK participle present\"},{\"text\":\"penciling\",\"type\":\"US participle present\"},{\"text\":\"pencilled\",\"type\":\"UK participle past\"},{\"text\":\"pencilled\",\"type\":\"UK past\"},{\"text\":\"penciled\",\"type\":\"US participle past\"},{\"text\":\"penciled\",\"type\":\"US past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9750, 'freeze', 'Especially of a liquid, to become solid due to low temperature.,To lower something\'s temperature to the point that it freezes or becomes hard.,To drop to a temperature below zero degrees celsius, where water turns to ice.,To be affected by extreme cold.,(of machines and software) To come to a sudden halt, stop working (functioning).,(of people and other animals) To stop (become motionless) or be stopped due to attentiveness, fear, surprise, etc.,To cause someone to become motionless.,To lose or cause to lose warmth of feeling; to shut out; to ostracize.,To cause loss of animation or life in, from lack of heat; to give the sensation of cold to; to chill.,To prevent the movement or liquidation of a person\'s financial assets,Of prices, spending etc., to keep at the same level, without any increase.,To prevent from showing any visible change.', 'solidify,freeze up,freeze up,grind to a halt,hang,lock up,seize,seize up,freeze up,halt', '', 'verb', '[{\"text\":\"freezes\",\"type\":\"present singular third-person\"},{\"text\":\"freezing\",\"type\":\"participle present\"},{\"text\":\"froze\",\"type\":\"past\"},{\"text\":\"frozen\",\"type\":\"participle past\"},{\"text\":\"froze\",\"type\":\"colloquial participle past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9751, 'freeze', 'A period of intensely cold weather.,A halt of a regular operation.,The state when either a single computer program, or the whole system ceases to respond to inputs.,A precise draw weight shot where a delivered stone comes to a stand-still against a stationary stone, making it nearly impossible to knock out.,A block on pay rises or on the hiring of new employees etc.', '', '', 'noun', '[{\"text\":\"freezes\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
