(9758, 'concord', 'A state of agreement; harmony; union.,Agreement by stipulation; compact; covenant; treaty or league,Agreement of words with one another, in gender, number, person or case.,An agreement between the parties to a fine of land in reference to the manner in which it should pass, being an acknowledgment that the land in question belonged to the complainant. See fine.,An agreeable combination of tones simultaneously heard; a consonant chord; consonance; harmony.', '', '', 'noun', '[{\"text\":\"concords\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9759, 'concord', 'A variety of sweet American grape, with large dark blue (almost black) grapes in compact clusters; a Concord grape.', '', '', 'noun', '[{\"text\":\"concords\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
