(9765, 'lance', 'A weapon of war, consisting of a long shaft or handle and a steel blade or head; a spear carried by horsemen.,A wooden spear, sometimes hollow, used in jousting or tilting, designed to shatter on impact with the opposing knight’s armour.,A spear or harpoon used by whalers and fishermen.,A soldier armed with a lance; a lancer.,An instrument which conveys the charge of a piece of ordnance and forces it home.,A small iron rod which suspends the core of the mold in casting a shell.,One of the small paper cases filled with combustible composition, which mark the outlines of a figure.,A lancet.', '', '', 'noun', '[{\"text\":\"lances\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
