(9766, 'lance', 'To pierce with a lance, or with any similar weapon.,To open with a lancet; to pierce.,To throw in the manner of a lance; to lanch.', '', '', 'verb', '[{\"text\":\"lances\",\"type\":\"present singular third-person\"},{\"text\":\"lancing\",\"type\":\"participle present\"},{\"text\":\"lanced\",\"type\":\"participle past\"},{\"text\":\"lanced\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9767, 'ladder', 'A frame, usually portable, of wood, metal, or rope, used for ascent and descent, consisting of two side pieces to which are fastened rungs (cross strips or rounds acting as steps).,A series of stages by which one progresses to a better position.,The hierarchy or ranking system within an organization, such as the corporate ladder.,A length of unravelled fabric in a knitted garment, especially in nylon stockings; a run.,In the game of go, a sequence of moves following a zigzag pattern and ultimately leading to the capture of the attacked stones.', 'stepladder,run', '', 'noun', '[{\"text\":\"ladders\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9768, 'ladder', 'To arrange or form into a shape of a ladder.,To ascend (a building, a wall, etc.) using a ladder.,Of a knitted garment: to develop a ladder as a result of a broken thread.,To close in on a target with successive salvos, increasing or decreasing the shot range as necessary.', '', '', 'verb', '[{\"text\":\"ladders\",\"type\":\"present singular third-person\"},{\"text\":\"laddering\",\"type\":\"participle present\"},{\"text\":\"laddered\",\"type\":\"participle past\"},{\"text\":\"laddered\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
