(9777, 'colon', 'The punctuation mark \":\".,The triangular colon (especially in context of not being able to type the actual triangular colon).,A rhetorical figure consisting of a clause which is grammatically, but not logically, complete.,A clause or group of clauses written as a line, or taken as a standard of measure in ancient manuscripts or texts.', 'colon-point', '', 'noun', '[{\"text\":\"colons\",\"type\":\"plural\"},{\"text\":\"cola\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9778, 'colon', 'Part of the large intestine; the final segment of the digestive system, after (distal to) the ileum and before (proximal to) the rectum. (Because the colon is the largest part of the large intestine (constituting most of it), it is often treated as synonymous therewith in broad or casual usage.)', '', '', 'noun', '[{\"text\":\"colons\",\"type\":\"plural\"},{\"text\":\"cola\",\"type\":\"plural\"},{\"text\":\"coli\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
