(9781, 'purse', 'A small bag for carrying money.,A handbag (small bag usually used by women for carrying various small personal items),A quantity of money given for a particular purpose.,A specific sum of money in certain countries: formerly 500 piastres in Turkey or 50 tomans in Persia.', 'pocketbook,coin purse,change purse,handbag,bursary,grant', '', 'noun', '[{\"text\":\"purses\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
