(9791, 'bless', 'To make something holy by religious rite, sanctify.,To make the sign of the cross upon, so as to sanctify.,To invoke divine favor upon.,To honor as holy, glorify; to extol for excellence.,To esteem or account happy; to felicitate.,To wave; to brandish.,To turn (a reference) into an object.,To secure, defend, or prevent from.', '', '', 'verb', '[{\"text\":\"blesses\",\"type\":\"present singular third-person\"},{\"text\":\"blessing\",\"type\":\"participle present\"},{\"text\":\"blest\",\"type\":\"participle past\"},{\"text\":\"blest\",\"type\":\"past\"},{\"text\":\"blessed\",\"type\":\"participle past\"},{\"text\":\"blessed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9792, 'bless', 'Used as an expression of endearment, gratitude, or (ironically) belittlement.', '', '', 'intj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9793, 'crest', 'The summit of a hill or mountain ridge.,A tuft, or other natural ornament, growing on an animal\'s head, for example the comb of a cockerel, the swelling on the head of a snake, the lengthened feathers of the crown or nape of bird, etc.,The plume of feathers, or other decoration, worn on or displayed on a helmet; the distinctive ornament of a helmet.,A bearing worn, not upon the shield, but usually on a helmet above it, sometimes (as for clerics) separately above the shield or separately as a mark for plate, in letterheads, and the like.,The upper curve of a horse\'s neck.,The ridge or top of a wave.,The helm or head, as typical of a high spirit; pride; courage.,The ornamental finishing which surmounts the ridge of a roof, canopy, etc.,The top line of a slope or embankment.,A ridge along the surface of a bone.,A design or logo, especially one of an institution, sports club, association or high-class family.,Any of several birds in the family Regulidae, including the goldcrests and firecrests.', 'comb,cockscomb', '', 'noun', '[{\"text\":\"crests\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9794, 'crest', 'Particularly with reference to waves, to reach a peak.,To reach the crest of (a hill or mountain),To furnish with, or surmount as, a crest; to serve as a crest for.,To mark with lines or streaks like waving plumes.', '', '', 'verb', '[{\"text\":\"crests\",\"type\":\"present singular third-person\"},{\"text\":\"cresting\",\"type\":\"participle present\"},{\"text\":\"crested\",\"type\":\"participle past\"},{\"text\":\"crested\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9795, 'crest', 'Acronym of comparisons, reasons, examples, statistics, testimony: the five types of verbal support used to enhance an oral presentation.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9796, 'align', 'To form a line; to fall into line.,To adjust or form to a line; to range or form in line; to bring into line.,To store (data) in a way that is consistent with the memory architecture, i.e. by beginning each item at an offset equal to some multiple of the word size.,To identify with, match, or support the behaviour, thoughts, etc. of another person, organization, or country.,To organize a linear arrangement of DNA, RNA or protein sequences which have regions of similarity.', 'ally,support', '', 'verb', '[{\"text\":\"aligns\",\"type\":\"present singular third-person\"},{\"text\":\"aligning\",\"type\":\"participle present\"},{\"text\":\"aligned\",\"type\":\"participle past\"},{\"text\":\"aligned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9797, 'triumph', 'A conclusive success following an effort, conflict, or confrontation of obstacles; victory; conquest.,A magnificent and imposing ceremonial performed in honor of a victor.,Any triumphal procession; a pompous exhibition; a stately show or pageant.,A state of joy or exultation at success.,A trump card.,A card game, also called trump.,a ceremony held to publicly celebrate and sanctify the military achievement of an army commander.,A work of art, cuisine, etc. of very high quality.,A card trick in which the cards are shuffled with half face-up and half face-down, then laid out so that only the observer\'s chosen card is facing upward.', '', '', 'noun', '[{\"text\":\"triumphs\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9798, 'triumph', 'To celebrate victory with pomp; to rejoice over success; to exult in an advantage gained; to exhibit exultation.,To prevail over rivals, challenges, or difficulties.,To succeed, win, or attain ascendancy.,To be prosperous; to flourish.,To play a trump in a card game.', '', '', 'verb', '[{\"text\":\"triumphs\",\"type\":\"present singular third-person\"},{\"text\":\"triumphing\",\"type\":\"participle present\"},{\"text\":\"triumphed\",\"type\":\"participle past\"},{\"text\":\"triumphed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9799, 'caroline', 'Synonym of Carolean (“relating to the time of Kings Charles I and II of England or Charles III of the United Kingdom, or of the kings themselves”)', 'Carolean,Carolean', '', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
