(9801, 'jewel', 'A precious or semi-precious stone; gem, gemstone.,A valuable object used for personal ornamentation, especially one made of precious metals and stones; a piece of jewellery.,Anything precious or valuable.,A bearing for a pivot in a watch, formed of a crystal or precious stone.,Any of various lycaenid butterflies of the genus Hypochrysops.,The clitoris.', '', '', 'noun', '[{\"text\":\"jewels\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9802, 'jewel', 'To bejewel; to decorate or bedeck with jewels or gems.', '', '', 'verb', '[{\"text\":\"jewels\",\"type\":\"present singular third-person\"},{\"text\":\"jewelling\",\"type\":\"participle present\"},{\"text\":\"jeweling\",\"type\":\"participle present\"},{\"text\":\"jewelled\",\"type\":\"participle past\"},{\"text\":\"jewelled\",\"type\":\"past\"},{\"text\":\"jeweled\",\"type\":\"participle past\"},{\"text\":\"jeweled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9803, 'survivor', 'One who survives, especially one who survives a traumatic experience.,A person who is able to endure hardship.,One who knew a specific decedent.', 'trooper,tough cookie', '', 'noun', '[{\"text\":\"survivors\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
