(9809, 'alloy', 'A metal that is a combination of two or more elements, at least one of which is a metal.,A metal of lesser value, mixed with a metal of greater value.,An admixture; something added which stains, taints etc.,Fusion, marriage, combination.', '', '', 'noun', '[{\"text\":\"alloys\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
