(9895, 'cannon', 'A complete assembly, consisting of an artillery tube and a breech mechanism, firing mechanism or base cap, which is a component of a gun, howitzer or mortar. It may include muzzle appendages.,Any similar device for shooting material out of a tube.,An autocannon.,A bone of a horse\'s leg, between the fetlock joint and the knee or hock.,A cannon bit.,A large muzzle-loading artillery piece.,A carom.,The arm of a player who can throw well.,A hollow cylindrical piece carried by a revolving shaft, on which it may, however, revolve independently.,A cylindrical item of plate armor protecting the arm, particularly one of a pair of such cylinders worn with a couter, the upper cannon protecting the upper arm and the lower cannon protecting the forearm.,Alternative form of canon (“a large size of type”),A piece which moves horizontally and vertically like a rook but captures another piece by jumping over a different piece in the line of attack.,A pickpocket.', '', '', 'noun', '[{\"text\":\"cannons\",\"type\":\"plural\"},{\"text\":\"cannon\",\"type\":\"UK mainly plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
