(9900, 'spine', 'A series of bones situated at the back from the head to the pelvis of a human, or from the head to the tail of an animal, enclosing the spinal cord and providing support for the thorax and abdomen.,Courage or assertiveness.,Something resembling a backbone, such as a ridge, or a long, central structure from which other structures radiate.,The narrow, bound edge of a book that encloses the inner edges of the pages, facing outwards when the book is on a shelf and typically bearing the title and the author\'s and publisher\'s name.,A pointed, fairly rigid protuberance or needlelike structure on an animal, shell, or plant.,The heartwood of trees.,Ellipsis of dendritic spine..,A linear payscale operated by some large organizations that allows flexibility for local and specific conditions.,A tall mass of viscous lava extruded from a volcano.,The stiffness of an arrow.', 'backbone,spinal column,vertebral column,backbone,spinal column,vertebral column,needle,prickle,quill,spicule,spike,thorn,virgula,pay spine', '', 'noun', '[{\"text\":\"spines\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
