(9928, 'bracket', 'A fixture attached to a wall to hold up a shelf.,Any intermediate object that connects a smaller part to a larger part, the smaller part typically projecting sideways from the larger part.,A short crooked timber, resembling a knee, used as a support.,The cheek or side of an ordnance carriage, supporting the trunnions.,\"(\" and \")\" specifically, the other forms above requiring adjectives for disambiguation.,\"[\" and \"]\" specifically - as opposed to the other forms, which have their own technical names.,A printed diagram of games in a tournament.,A prediction of the outcome of games in a tournament, used for betting purposes.,One of several ranges of numbers.,A pair of values that represent the smallest and largest elements of a range.,Typically of stationary weapons, the zone enclosed by one long and one short shot impact expected to be hit very accurately.,The small curved or angular corner formed by a serif and a stroke in a letter.,a mark cut into a stone by land surveyors to secure a bench.', 'benchmark', '', 'noun', '[{\"text\":\"brackets\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9929, 'bracket', 'To support by means of mechanical brackets.,To enclose in typographical brackets.,To bound on both sides, to surround, as enclosing with brackets.,To place in the same category.,To mark distinctly for special treatment.,To set aside, discount, ignore.,To gauge the range of a target by firing equally short and long of it and ranging the weapon between the two to achieve a very accurate hit.,To take multiple images of the same subject, using a range of exposure settings, in order to help ensure that a satisfactory image is obtained.,In the philosophical system of Edmund Husserl and his followers, to set aside metaphysical theories and existential questions concerning what is real in order to focus philosophical attention simply on the actual content of experience.', '', '', 'verb', '[{\"text\":\"brackets\",\"type\":\"present singular third-person\"},{\"text\":\"bracketing\",\"type\":\"participle present\"},{\"text\":\"bracketed\",\"type\":\"participle past\"},{\"text\":\"bracketed\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
