(9948, 'missile', 'Any object used as a weapon by being thrown or fired through the air, such as stone, arrow or bullet.,A self-propelled projectile whose trajectory can be adjusted after it is launched.', '', '', 'noun', '[{\"text\":\"missiles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9949, 'turtle', 'Any land or marine reptile of the order Testudines, characterised by a protective shell enclosing its body. See also tortoise.,A marine reptile of that order.,An Ancient Roman attack method, where the shields held by the soldiers hide them, not only left, right, front and back, but also from above.,A type of robot having a domed case (and so resembling the reptile), used in education, especially for making line drawings by means of a computer program.,An on-screen cursor that serves the same function as a turtle for drawing.,The curved plate in which the form is held in a type-revolving cylinder press.,A small element towards the end of a list of items to be bubble sorted, and thus tending to take a long time to be swapped into its correct position. Compare rabbit.,A breakdancing move consisting of a float during which the dancer\'s weight shifts from one hand to the other, producing rotation or a circular \"walk\".,A low stand for a lamp etc.', 'shellpad,shield-toad,sea turtle,testudo', '', 'noun', '[{\"text\":\"turtles\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9950, 'turtle', 'To flip over onto the back or top; to turn upside down.,To move along slowly.,To turn and swim upside down.,To hunt turtles, especially in the water.,To build up a large defense force and strike only occasionally, rather than going for an offensive strategy.', '', '', 'verb', '[{\"text\":\"turtles\",\"type\":\"present singular third-person\"},{\"text\":\"turtling\",\"type\":\"participle present\"},{\"text\":\"turtled\",\"type\":\"participle past\"},{\"text\":\"turtled\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
