(9956, 'apollo', 'A very handsome young man.,Any of several papilionid butterflies of the genus Parnassius, especially Parnassius apollo of Eurasia (also known as the mountain apollo).', '', '', 'noun', '[{\"text\":\"apollos\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9957, 'apollo', 'An asteroid possessing an orbit that crosses the orbit of the Earth and an orbital period of over one year, with semimajor axes greater than 1 AU, and perihelion distances less than 1.017 AU.', '', '', 'noun', '[{\"text\":\"Apollos\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9958, 'fossil', 'The mineralized remains of an animal or plant.,Any preserved evidence of ancient life, including shells, imprints, burrows, coprolites, and organically-produced chemicals.,A fossil word.,Anything extremely old, extinct, or outdated.,An extremely old or outdated person.', '', '', 'noun', '[{\"text\":\"fossils\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
