(9970, 'novelty', 'The state of being new or novel; newness.,A new product; an innovation.,A small mass-produced trinket.,In novelty theory, newness, density of complexification, and dynamic change as opposed to static habituation.,An opening move played for the first time ever (in high-level chess).', '', '', 'noun', '[{\"text\":\"novelties\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
