(9972, 'verbal', 'Of or relating to words.,Concerned with the words, rather than the substance of a text.,Consisting of words only.,Expressly spoken rather than written; oral.,Derived from, or having the nature of a verb.,Used to form a verb.,Capable of speech.,Word for word.,Abounding with words; verbose.', 'wordish,rhematic,lectic,literal,verbatim', 'substantive,preverbal', 'adj', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
