(10057, 'wagon', 'To load into a wagon in preparation for transportation; to transport by means of a wagon.,To travel in a wagon.', '', '', 'verb', '[{\"text\":\"wagons\",\"type\":\"present singular third-person\"},{\"text\":\"wagoning\",\"type\":\"participle present\"},{\"text\":\"wagoned\",\"type\":\"participle past\"},{\"text\":\"wagoned\",\"type\":\"past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
