(10066, 'shepherd', 'A person who tends sheep, especially a grazing flock.,A male sheep tender,Someone who watches over, looks after, or guides somebody.,A male watcher/guardian/guider/leader,The pastor of a church; one who guides others in religion.,A male pastor,A swain; a rustic male lover.,A German Shepherd.', 'pastor,pastor', '', 'noun', '[{\"text\":\"shepherds\",\"type\":\"plural\"},{\"text\":\"shepherdess\",\"type\":\"feminine\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
