(10070, 'flour', 'Powder obtained by grinding or milling cereal grains, especially wheat, or other foodstuffs such as soybeans and potatoes, and used to bake bread, cakes, and pastry.,The food made by grinding and bolting cleaned wheat (not durum or red durum) until it meets specified levels of fineness, dryness, and freedom from bran and germ, also containing any of certain enzymes, ascorbic acid, and certain bleaching agents.,Powder of other material.,Obsolete form of flower.', '', '', 'noun', '[{\"text\":\"flours\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
