(10072, 'sympathy', 'The formal expression of pity or sorrow for someone else\'s misfortune.,The ability to share the feelings of another.,A feeling of pity or sorrow for the suffering or distress of another.,Support in the form of shared feelings or opinions.,Feeling of loyalty; tendency towards, agreement with or approval of an opinion or aim; a favorable attitude.,Mutual or parallel susceptibility or a condition brought about by it.,Artistic harmony, as of shape or colour in a painting.,An affinity, association or mutual relationship between people or things such that they are correspondingly affected by any condition.', 'compassion,compassion,compassion', '', 'noun', '[{\"text\":\"sympathies\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
