(10085, 'corpus', 'A collection of writings, often on a specific topic, of a specific genre, from a specific demographic or a particular author, etc.,Such a collection in form of an electronic database used for linguistic analyses.,A body, a collection.', 'collection,compilation,aggregation,body,digital corpus,text corpus,collection,body', '', 'noun', '[{\"text\":\"corpora\",\"type\":\"plural\"},{\"text\":\"corpuses\",\"type\":\"plural\"},{\"text\":\"corpusses\",\"type\":\"plural\"},{\"text\":\"corpi\",\"type\":\"plural proscribed\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
