(10087, 'virtue', 'Accordance with moral principles; conformity of behaviour or thought with the strictures of morality; good moral conduct.,A particular manifestation of moral excellence in a person; an admirable quality.,Specifically, each of several qualities held to be particularly important, including the four cardinal virtues, the three theological virtues, or the seven virtues opposed to the seven deadly sins.,An inherently advantageous or excellent quality of something or someone; a favourable point, an advantage.,A creature embodying divine power, specifically one of the orders of heavenly beings, traditionally ranked above angels and below archangels.,Specifically, moral conduct in sexual behaviour, especially of women; chastity.,The inherent power of a god, or other supernatural being.,The inherent power or efficacy of something (now only in phrases).', '', '', 'noun', '[{\"text\":\"virtues\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
