(10091, 'polymer', 'A long or larger molecule consisting of a chain or network of many repeating units, formed by chemically bonding together many identical or similar small molecules called monomers. A polymer is formed by polymerization, the joining of many monomer molecules.,A material consisting of such polymer molecules.', '', '', 'noun', '[{\"text\":\"polymers\",\"type\":\"plural\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
