(10093, 'burst', 'To break from internal pressure.,To cause to break from internal pressure.,To cause to break by any means.,To separate (printer paper) at perforation lines.,To enter or exit hurriedly and unexpectedly.,To erupt; to change state suddenly as if bursting.,To produce as an effect of bursting.,To interrupt suddenly in a violent or explosive manner; to shatter.', '', '', 'verb', '[{\"text\":\"bursts\",\"type\":\"present singular third-person\"},{\"text\":\"bursting\",\"type\":\"participle present\"},{\"text\":\"burst\",\"type\":\"past\"},{\"text\":\"brast\",\"type\":\"archaic past\"},{\"text\":\"bursted\",\"type\":\"nonstandard past\"},{\"text\":\"burst\",\"type\":\"participle past\"},{\"text\":\"bursten\",\"type\":\"participle past rare\"},{\"text\":\"bursted\",\"type\":\"nonstandard participle past\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
