(10111, 'adware', 'A software application that includes advertisements, which are displayed while the software is running. Developers use adware as a source of income and to keep the costs of the software down (usually making it free). Some adware programs can include spyware.', '', '', 'noun', '[]', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
